INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('010725PE486', 2, '6305016609010001', 'Helyatun Nida ', '08875318520', 'Izin tanya min, saya kan mau pisah KK dari orang tua dan ikut kk suami, tapi suami domisili di jakarta dan dia mau pindah domisili ke alamat saya, dia sudah cabut berkas di jakarta, jadi gimana ya alur pengajuannya?', '', '', '', '', '', '', '', 'Silahkan lapor Kedangan (suami) di Aplikasi, sekaligus dengan pisah/pindah KK anda dari Ortu. Persiapkan :\r\n1. Surat Pindah Suami (SKPWNI),\r\n2. Surat/Buku Nikah Anda,\r\n3. Kartu Keluarga Anda,\r\n4. KTP anda dan suami.\r\nUntuk syarat silahkan di lihat pada menu Persyaratan. Terima Kasih\r\n', '3', '2025-07-01', '08:52:03', '0000-00-00', '', '2025-07-01', '09:30:19', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('010725PE487', 2, '6307052302960002', 'Fajri', '0895352088118', 'Assalamualaikum ijin Ulun mohon bantuannya...\r\nUlun mau mengajukan surat pindah ke kabupaten Banjar \r\nTapi pas Ulun sudah login d pondok dukcapil...\r\nTernyata untuk pilihan pengiriman nya cuma ada 2 \r\nPengambilan ke kantor dukcapil \r\nDan pengiriman lewat pos ...\r\nSedangkan saat ini Ulun posisi nya sudah tinggal d kabupaten Banjar...\r\nBisa kah untuk pengambilan berkas nya minta d buat kan pdf nya saja\r\nJadi Ulun bisa cetak mandiri d sini\r\nD karenakan keterbatasan biaya juga kalo mau ke Capil tapin\r\nMohon bantuannya bapa/ibu????\r\nTerima kasih banyak ???? ', 'syarat/2025/07/01/96b0aedf2900755c427fa3c87c60e015.jpg', '', '', '', '', '', '', 'Waalaikumsalam, kalau untuk khusus pindah jangan repot ambil Surat Pindah nya, nanti pian bisa download kalau sudah selesai.\r\nSaran :\r\n1. Lengkapi Persyaratan\r\n2. Pada kolom *catatan* tulis/ketik saja posisi pian sudah di Kab. Banjar dan mohon kirim Surat Pindah via Pdf saja. Insyaallah petugas mengerti.\r\nSemoga dapat dimengerti, Terima Kasih.', '3', '2025-07-01', '09:49:52', '0000-00-00', '', '2025-07-01', '09:55:10', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('010725PE488', 2, '7173032106980001', 'Brandon stile gerungan', '081351940022', 'Selamat siang Pak/Ibu, pak kemarin saya sdh ngajukan pergantian KTP, karena KTP lama rusak. Untuk estimasi nya selesai kapan ya Pak/Ibu?', '', '', '', '', '', '', 'Nomor Permohonan KTP Rusak : 300625KTPR911, \r\nPilihan pengambilan : Via Pos, \r\nBaik akan kami cek terlebih dahulu, mohon menunggu infirmasi selanjutnya. Terima Kasih.', 'Permohonan KTP dengan nomor : 300625KTPR911.\r\n*Status* : Selesai (Dukcapil)\r\n*Pengiriman* : Menunggu pihak Pos jemput berkas ke Dukcapil.\r\n*Nomor Pos* wiayah Binuang : 081250166980\r\nSilahkan cek foto BA di menu Konsultasi -- > Cari Permohonan --> Copas nomor Pengaduan ini : 010725PE488 --> Klik Cari\r\n', '3', '2025-07-01', '11:34:57', '2025-07-01', '11:42:51', '2025-07-01', '11:55:34', '126', '126'),
	('010825PE16044', 2, '1234567890123456', 'INI TES', '081234567890', 'TES TES', 'syarat/2025/08/01/487830752151eed4bf7de87ecad17275.jpg', '', '', '', '', '', '', 'YA SIP MASUK', '3', '2025-08-01', '21:18:09', '0000-00-00', '', '2025-08-01', '21:20:09', '', '127');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('020125PE5', 5, '6305090902880002', 'Gapuri Rahman', '081231503239', 'Ijin, Apakah bisa saya meminta cetak ulang KK yang rusak ? ', '', '', '', '', '', '', 'Bisa, Silahkan pilih menu perubahan KK pada aplikasi, beri keterangan rusak, upload dokumen kk rusak dan dokumen pendukung lainnya apabila ada perubahan.', 'Silahkan registrasi akun pada aplikasi Pondok Dukcapil terlebih dahulu untuk mendapatkan layanan lebih lanjut, atau download APK Pondok Dukcapil pada tautan berikut : \r\nhttps://drive.google.com/file/d/19kCzRnajLBkFC93WoHci7XqUplwXUpFQ/view?usp=sharing\r\nKetika intsall izinkan saja prosesnya, Tks', '3', '2025-01-02', '20:29:02', '2025-01-03', '07:11:44', '2025-01-03', '07:15:28', '126', '126'),
	('020225PE63', 5, '6305031512890001', 'MUHAMMAD ARSYAD', '087863264413', 'Perbaharui KTP karna rusak..', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil,\r\nUntuk mencetak KTP rusak Anda harus melampirkan syarat sbb :\r\n1. Rormulir F.1-02, \r\n2. KK, \r\n3. KTP Rusak \r\nSebelunya anda harud daftar Akun terlebih dahulu. Tks\r\n', '3', '2025-02-02', '17:22:05', '0000-00-00', '', '2025-02-03', '10:58:09', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('020225PE64', 5, '6305031512890001', 'MUHAMMAD ARSYAD', '087863264413', 'Perbaharui KTP karna rusak..', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil,\r\nUntuk mencetak KTP rusak Anda harus melampirkan syarat sbb :\r\n1. Formulir F.1-02, \r\n2. KK, \r\n3. KTP Rusak \r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-02-02', '17:22:15', '0000-00-00', '', '2025-02-03', '10:59:17', '', '126'),
	('020525PE342', 2, '6305086102020001', 'Jamâ€™iyatul Hasanah', '082252135646', 'min ga bisa kah kalo mengurus pembatalan pindah datangnya online saja? soalnya lagi disamarinda ini belum ada waktu pulang ke tapin. makanya saya ngurusnya onlien. sedangkan kalo bisa mau dipakai cepat. terimakasih sebelumnya min maaf merepotkan ', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, akan kami koordinasikan terlebih dahulu dengan Bidang terkait', 'Setelah kami konsultasikan ke bidang yang menangani, silahkan daftar/regeistrasi user terlebih dahulu.\r\nSyarat pengajuan : \r\n1. Lampirkan Foto SKPWNI (Surat pindah asal)\r\n2. Surat Keterangan Batal Pindah\r\n3. Kartu Keluarga + KTP \r\nBerikut kami lampirkan formulir batal pindah, silahkan cek di menu konsultasi cek permohonan, paste nomor permohonan ini.', '3', '2025-05-02', '10:20:16', '2025-05-02', '10:23:55', '2025-05-05', '08:42:35', '126', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('020725PE489', 5, '6307052302960002', 'Fajri ', '0895352088118', 'Assalamualaikum bapa/ibu mohon maaf Ulun umpat betakun lagi\r\nTadi Ulun sudah mengajukan surat pindah beserta dgn anak Ulun...\r\nTapi d tangguhkan karena katanya d minta memfoto kan hasil keputusan hak asuh anak...\r\nSedangkan Ulun tidak punya surat yg d minta...\r\nUlun cuma ada akta cerai nya aja...\r\nAnak Ulun Muhammad Rifqi ini juga sudah lawas ikut sama Ulun...\r\nDia juga sudah sekolah d kabupaten Banjar sini...\r\nUlun dan mantan istri juga sudah sepakat kalo anak Ulun ikut sama Ulun sebagai Abah nya \r\nKalo surat hak asuh anak nya tidak ada gimana bapa/ibu\r\nJadi minta tolong bantu an  dan solusinya\r\n bapa/ibu', 'syarat/2025/07/02/fba9d4834b4e9d8a93ffdda69b0bdfd8.jpg', '', '', '', '', '', '', 'Waalaikumsalam, kalau boleh adakah di Akta cerainya menuliskan masalah pengasuhan anak? kalau boleh silahkan lampirkan Akta cerainya pada konsultasi selanjutnya. Terima Kasih.\r\n_Saran : Untuk kasus seperti ini akan lebih baik bisa diurus langsung ke kantor dukcapi_ .', '3', '2025-07-02', '09:53:21', '0000-00-00', '', '2025-07-02', '10:59:35', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('020725PE490', 2, '6307052302960002', 'Fajri ', '0895352088118', 'Maaf bapa/ibu\r\nYg mana formulir surat kuasa pengasuh an anak nya \r\nKarena pas lun cek tidak ada formulir seperti itu \r\nYg ada surat kuasa pelayanan administrasi kependudukan aja\r\nMinta tolong bantu an nya bapa/ibu', 'syarat/2025/07/02/47ddbaa9bd032e5ecaea7fe273773800.jpg', 'syarat/2025/07/02/4a6aac807beafed7bfd5a22a1dcb36ac.jpg', 'syarat/2025/07/02/65420645012a927faa0b9d20c33cd26e.jpg', 'syarat/2025/07/02/1163d21432b74a02ab080c62ebd4e846.jpg', '', '', 'Baik akan kami koordinasikan terlebih dahulu dengan Petugas.', 'Berikut kami lampirkan Formulir SURAT KUASA PENGASUHAN ANAK, silahkan download.\r\nCek Cari Permohonan pada menu Konsultasi. Terima Kasih.\r\n_Untuk pengajuan ulang, lampirkan Akta Cerai_', '3', '2025-07-02', '10:37:17', '2025-07-02', '11:00:17', '2025-07-02', '11:24:02', '126', '126'),
	('020725PE491', 2, '6305034206670003', 'MASLIA', '082151701136', 'mau tanya tanggal dan tahun lahir sebenarnya adalah 08-07-1959...apa bisa dirubah ', 'syarat/2025/07/02/0c0b8ea04bc742a7b1f80cdd2dd168e4.jpg', '', '', '', '', '', '', 'Silahkan lampirkan dokumen pendukung atau dasar perubahan tanggal lahir tersebut (Cth : Izajah/Akta/Putusan Pengadilan/dll...)', '3', '2025-07-02', '10:57:11', '0000-00-00', '', '2025-07-02', '11:02:06', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('020725PE492', 2, '6303082704960003', 'Misno', '082352764088', 'Kalau membuat akta bayi baru lahir apakah perlu mengajukan permohonan memasukkan nama anak di KK?\r\nAtau membuat Akta sama saja dengan memperbarui KK yang baru tidak perlu lg membuat permohonan memasukkan nama anak di KK ?', '', '', '', '', '', '', '', 'Kalau membuat Akta Kelahiran untuk anak (bayi) baru lahir tidak perlu memasukan anak di KK, karena pembuatan Akta Kelahiran Baru untuk anak akan *include* dengan KK dan KIA anak. Jadi Anda cuma mengajukan Permohonan Akta Kelahiran belun ada NIK di APlikasi Pondok Dukcapil.\r\nTerima Kash', '3', '2025-07-02', '16:27:42', '0000-00-00', '', '2025-07-03', '08:33:34', '', '126'),
	('020725PE493', 5, '6305050112950003', 'ahmad syahid alam', '081649256670', 'assalamualaikum.\r\n\r\nuln pernah daftar akun.\r\ntapi salah memasukkan no kk, akhirnya pendaftaran akun uln di tolak.\r\n\r\npas uln hndk mendaftar ulang akun email uln malah kd kwa dipakai lagi.\r\nbacaanya akun sudah terdaftar jar.\r\npas dicoba log in kd mau jua..\r\n\r\nadakah solusinya yu.. \r\n\r\nterimakasih\r\nwassalam....', '', '', '', '', '', '', 'Waalaikumsalam, baik akan kami cek terlebih dahulu, harap menunggu.', 'Kami sudah recover. Silahkan Anda coba daftar/regestrasi ulang. Terima Kasih', '3', '2025-07-02', '21:53:34', '2025-07-03', '08:34:22', '2025-07-03', '09:21:12', '126', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('030125PE6', 5, '6305034201630002', 'asiah', '082125602563', 'bikin kartu keluarga,akta,dan kia', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil,\r\nUntuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\n\r\nUntuk pengajuan Akta Lahir, KIA, dan KK bisa sekaligus dengan mengajukan Akta Kelahiran untuk kelahiran Baru belum ada NIK.\r\nUntuk KK apabila ada perubahan silahkan ajukan pada menu KK Perubahan dan dilanjutkan pengajuan Akte Kelahiran sudah ada NIK (apabila KK sdh benar)\r\nTerima Kasih.\r\n', '3', '2025-01-03', '07:35:30', '0000-00-00', '', '2025-01-06', '07:39:31', '', '126'),
	('030125PE7', 5, '6385030511960002', 'MUHAMMAD AMIN', '085246312467', 'KTP HILANG ', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil,\r\nUntuk mencetak KTP hilang Anda harus membuat *Surat Keterangan Hilang* dari Kepolisian terlebih dahulu, dan itu sebagai syarat pengajuan cetak ulang KTP karena hilang.\r\n\r\nUntuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu dan mengisi Data dengan benar.\r\nTerima Kasih.', '3', '2025-01-03', '11:44:59', '0000-00-00', '', '2025-01-06', '07:28:55', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('030225PE65', 5, '6305020907050002', 'Muhammad Wahyu ', '081250480124', 'Pisah kartu keluarga.tapi yg di kasih formolir pendaftaran perpindahan penduduk.apa itu benar', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil,\r\nMisalkan pisah kartu keluarga ke luar domisili asal, benar harus menggunakan formulir pindah.', '3', '2025-02-03', '09:50:00', '0000-00-00', '', '2025-02-03', '11:00:44', '', '126'),
	('030225PE66', 5, '6305015203890001', 'Zainab', '085837698096', 'Mau memindah alamat di ktp', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil,\r\nJika alamat baru adalah di luar domisili (desa/kecamatan/kabupaten) anda, maka anda harus melakukan permohonan pindah terlebih dahulu, dimana alamat ktp akan mengikuti alamat pindah(baru). Tetapi jika hanya perubahan jalan atau RT anda bisa mengajukan perbaikan KTP saja pada menu Cetak KTP.', '3', '2025-02-03', '10:59:35', '0000-00-00', '', '2025-02-03', '11:05:03', '', '126'),
	('030225PE67', 5, '6305020907050002', 'Muhammad Wahyu ', '081250480124', 'Klo mau pisah KK apa kita harus ada pengajuan dari RT RW nya ya?', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil,\r\nKalau RT/RW tetap sama dan cuma pisah KK saja, tidak perlu pengajuan RT/RW. Tapi kembali alasan pisah KK nya, dan syarat juga akan menyesuaikan.\r\nTerima Kasih.\r\n', '3', '2025-02-03', '11:10:10', '0000-00-00', '', '2025-02-03', '11:48:39', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('030225PE68', 5, '6305015206770002', 'IDA YUNISTIANA', '081345398611', 'Mau minta file KK dalam bentuk Pdf  ', 'syarat/2025/02/03/2c7ebbe1f6726f442d595232142615ee.jpg', '', '', '', '', '', '', 'Untuk verifikasi keamanan lebih lanjut :\r\n1. Nama Ayah Kandung : .....\r\n2. Nama Ibu Kandung : .....\r\n3. Nama Kepala Keluarga (Suami) : ....\r\nKirim data-data yang diminta pada pengaduan selanjutnya, agar dapat kami tindak lanjuti. Terima Kasih', '3', '2025-02-03', '13:26:40', '0000-00-00', '', '2025-02-03', '15:22:30', '', '126'),
	('030225PE69', 5, '6305080106810001', 'Admin', '082154612828', 'Akta kelahiran ', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, \r\nUntuk pengajuan Akta Lahir, KIA, dan KK bisa sekaligus dengan mengajukan Akta Kelahiran untuk kelahiran Baru belum ada NIK, syarat ada pada menu *Persyaratan* dan Formulir kelengkapan ada pada menu *Download Formulir*\r\nSelamat Mencoba.', '3', '2025-02-03', '22:53:07', '0000-00-00', '', '2025-02-04', '07:10:43', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('030325PE162', 2, '6305052112040002', 'Muhammad Yunus', '087841137400', 'Merubah nama orang tua di akta agar sesuai dengan kartu keluarga ', 'syarat/2025/03/03/86a690e1406ff40bf3d6bad20117d901.jpg', 'syarat/2025/03/03/e379de2377c0a78b098aa87bb2b2ed41.jpg', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, terlabih dahulu ajukan permohonan perubahan Akta, serta lampirkan bukti/dokumen pendukung perubahan Nama Ayah yang menjadi acuan perubahan, diusahakan dokumen pendukung selain KK. Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. ', '3', '2025-03-03', '09:28:20', '0000-00-00', '', '2025-03-03', '09:46:34', '', '126'),
	('030325PE163', 2, '6305025811010002', 'Rhevina rasellyta', '081253994266', 'Ingin membuat kartu keluarga', '', '', '', '', '', '', '', 'Yang di maksud menggabung kartu keluarga atau gimana?Bila menggabung kartu keluarga silahkan lampirkan kartu keluarga lama dan kartu keluarga yang ingin di gabungkan dan bila beda desa silhkan melalui menu PINDAH ', '3', '2025-03-03', '09:51:14', '0000-00-00', '', '2025-03-03', '10:00:13', '', '274');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('030325PE164', 2, '6305020707780001', 'ACHMAD SYARIF ', '085750270035', 'Dmana mendapat formulir F1-02 permohonan\r\nFormulir F1-03 perpindahan,', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, silahkan klik tautan ini untuk formulir persyaratan yang di butuhkan https://pondok.dukcapil.tapinkab.go.id/main/formulir Terima Kasih', '3', '2025-03-03', '21:43:26', '0000-00-00', '', '2025-03-04', '07:21:15', '', '126'),
	('030625PE427', 2, '6371025010580009', 'Darmawati', '0895326035514', 'Dari kemarin belum di ACC untuk bisa login, SDH veripikasi awal', '', '', '', '', '', '', '', 'Mohon maaf kemarena masih maintenance pada web aplikasi, tetapi barusan sudah disetujui regestrasi Anda. Terima Kasih', '3', '2025-06-03', '07:32:49', '0000-00-00', '', '2025-06-03', '07:40:02', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('030625PE428', 2, '6305042608000001', 'Supyan Rahman', '082154739917', 'Bisa dijelaskan bagaimana langkah dan persyaratan apa saja yg perlu dipersiapkan untuk pencetakan fisik KTP Baru ? Seandainya saya mengurusnya di mal pelayanan publik, bagaimana teknis dan dokumen persyaratannya ? Agar saya tidak bolak balik.', '', '', '', '', '', '', '', 'Untuk mencetak KTP Anda harus melampirkan syarat sbb :\r\n	1. Formulir F.1-02, (menu download formulir)\r\n	2. Kartu Keluarga, \r\n	3. KTP Rusak/Ganti (Jika Rusak/Ganti)\r\n	4. Suket Hilang dari Kepolisian (Jika Hilang)\r\n	5. Formulir F.1-06, (Jika ada Perubahan)\r\nTerima Kasih.', '3', '2025-06-03', '10:55:49', '0000-00-00', '', '2025-06-03', '11:26:56', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('030625PE429', 2, '6305030609990001', 'Muhammad Rahman', '082154102607', '1. Syarat dan mekanisme memperbarui data pekerjaan pada KK dan KTP; dan\r\n2. Ketentuan mengganti pasfoto pada KTP Kepala Keluarga dan Istri.\r\nPosisi saat ini sedang berdomisili di Jakarta karena penempatan pekerjaan, sehingga tidak memungkinkan untuk mengurus langsung secara offline. Sebelumnya terima kasih banyak. ????????', '', '', '', '', '', '', '', '1. Lampirkan bukti pendukung (SK pekerjaan), mengisi Formulir F-1.06 PERUBAHAN ELEMEN DATA, \r\n2. Penggantian Foto KTP mengharuskan pemohon langsung *Datang* ke Kantor Dukcapil / Kantor Pelayanan yang melayani pencetakan KTP.\r\n\r\nUntuk persyaratan silahkan klik tautan berikut : https://pondok.dukcapil.tapinkab.go.id/main/persyaratan\r\nTerima Kasih ', '3', '2025-06-03', '16:12:12', '0000-00-00', '', '2025-06-04', '07:31:46', '', '126'),
	('030625PE430', 2, '6305065801030001', 'Masliana', '081255447258', 'Pembatalan pindah dari sungai salai ke Balimau', '', '', '', '', '', '', '', 'Pada pelayanan Pondok Dukcapil tidak ada menu Batal Pindah, silahkan Anda langsung datang ke Kantor Dukcapil. Akan kami lampirkan formulir yang di butuhkan.(pilih cari permohonan, masukan nomor permohonan).\r\nSyarat awal adalah Surat Keterangan Pindah (SKPWNI) sebelumnya harus ada. Terima Kasih.\r\n', '3', '2025-06-03', '16:26:57', '0000-00-00', '', '2025-06-04', '07:44:45', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('030725PE494', 2, '6305010506950002', 'Riky Royadi', '085251319096', 'Assalamualaikum , mau bertanya masalah surat pernyata an dari RT , untuk RT 006 Desa Pulau pinang baru saja meninggal , belum di lakukan pemilihan ,,, jadi untuk tandatangan RT nya di surat pernyata an nya bagaimana ? Makasihhh', '', '', '', '', '', '', '', 'Waalaikumsalam, izin untuk surat pernyataan apa? Saran : mungkin bisa di arahkan ke Kepala Desa. Terima Kasih.', '3', '2025-07-03', '09:54:28', '0000-00-00', '', '2025-07-03', '09:56:36', '', '126'),
	('030725PE495', 2, '6301080506000001', 'Arkana Wildan Satria Nafi Makapuan', '082358897943', 'Saya baru saja menikah, saya dengan istri saya berbeda kabupaten dan berencana untuk pindah ke binuang dan membuat KK beserta KTP\r\nUntuk pengurusan dokumen tersebut bagaimana prosedur nya dan dokumen apa saja yang diperlukan', '', '', '', '', '', '', '', 'Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nSyarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n	1. Mengisi Formulir F-1.02 Permohonan (menu download formulir)\r\n	2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n	3. Kartu Keluarga dan KTP-el\r\n_Catatan : Anda terpantau masih berdomisili di Tanah Laut, saran kami segera untuk mengurus Surat Pindah terlebih dahulu di Dukcapil Tanah Laut_\r\nTerima Kasih', '3', '2025-07-03', '09:55:34', '0000-00-00', '', '2025-07-03', '10:02:09', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('030725PE496', 2, '6305010506950002', 'Riky Royadi', '085251319096', 'Assalamualaikum , mau bertanya masalah surat pernyata an dari RT , untuk RT 006 Desa Pulau pinang baru saja meninggal , belum di lakukan pemilihan ,,, jadi untuk tandatangan RT nya di surat pernyata an nya bagaimana ? Makasihhh', 'syarat/2025/07/03/4ab2002e3fbbfc464072d9dbef472ed7.jpg', '', '', '', '', '', 'Baik akan kami koordinasikan terlebih dahulu dengan bidang terkait.', 'Setelah kami koordinasikan dengan bidang terkait, Silahkan di arahkan ke tanda tangan Kepala Desa dan juga disertakan stempel Desa. Terima kasih', '3', '2025-07-03', '09:59:35', '2025-07-03', '10:03:39', '2025-07-03', '10:32:51', '126', '126'),
	('030725PE497', 2, '6305064606040002', 'Siti Rahmawati03', '085787127368', 'Skpwni', '', '', '', '', '', '', '', 'Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nSyarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n	1. Mengisi Formulir F-1.02 Permohonan (menu download formulir)\r\n	2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n	3. Kartu Keluarga dan KTP-el\r\nTerima Kasih', '3', '2025-07-03', '10:04:03', '0000-00-00', '', '2025-07-03', '10:31:31', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('030725PE498', 2, '6307032910010002', 'Muhammad Naufal', '08875318520', 'Bagaimana progres permohonan dengan nomor 010725DT916', '', '', '', '', '', '', 'Baik akan kami koordinasikan dengan Petugas. Terima Kasih.', 'Data sudah di Proses oleh Petugas, mohon selalu pantau track nya pada menu lacak permohonan. Terima Kasih.', '3', '2025-07-03', '11:08:49', '2025-07-03', '13:55:17', '2025-07-03', '15:02:29', '126', '126'),
	('030725PE499', 5, '6303082704960003', 'Misno', '082352764088', 'Mohon maaf kak saya 2x mengajukan permohonan membuat Akta kelahiran anak 2x juga ditolak. Padahal sudah terlampir foto buku nikah yang tercantum nama suami istri.\r\n\r\nJadi harus bagaimana? Mengajukan lagi kah? Atau bagaimana ya?', '', '', '', '', '', '', '', 'Mohon maaf atas kendala yang ada, mohon izin informasikan *nomor permohonan* Akta Kelahiran yang diajukan biar dapat kami lacak dan kami koordinasikan dengan Petugas pelaksana. Terima Kasih', '3', '2025-07-03', '14:48:12', '0000-00-00', '', '2025-07-03', '15:01:09', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('030725PE500', 5, '6305014805790001', 'Hj.jumiati', '082153252501', 'Kehilangan kartu keluarga dan mengeluarkan anak atas nama ayuna adiyati karna sudah pindah kartu keluarga , dan minta cetak yang baru', 'syarat/2025/07/03/7ef7a58713f53211cbe454697aa79fa7.jpg', '', '', '', '', '', '', 'Selamat sore, untuk memperbarui kartu keluarga yang hilang silakan melampirkan surat keterangan kehilangan dari kepolisian dan mengisi formulir F-1.02, kemudian masuk ke menu Peubahan KK. Terima kasih', '3', '2025-07-03', '15:12:22', '0000-00-00', '', '2025-07-03', '15:34:44', '', '162'),
	('030725PE501', 5, '6303082704960003', 'Misno', '082352764088', 'Nomor permohonan pengajuan Akta kelahiran 030725AL943', '', '', '', '', '', '', '', 'Nomor pengajuan : 030725AL943\r\nStatus : SELESAI\r\nPengiriman : Kantor POS\r\n_Catatan : Pengiriman Via Pos diharapkan menggunggu_\r\nTerima Kasih ', '3', '2025-07-03', '15:15:42', '0000-00-00', '', '2025-07-03', '18:44:54', '', '126');
