	('040225PE70', 5, '6305016609010001', 'Helyatun Nida ', '08875318520', 'Izin bertanya, kan saya sudah mengajukan pencetakan ktp dari beberapa minggu yang lalu, tapi statusnya tetap dibagian diproses sejak 22 Januari, kapan ya kira-kira selesai? Terimakasih ', '', '', '', '', '', '', '', '*Pesan Petugas :* Yth bapak/Ibu *Helyatun Nida ,* Mohon maaf atas ketidaknyamannya, karena pas tanggal tersebut ada maintenance server, dan syarat2 yg anda ajukan terhapus. Mohon kiranya dapat di ajukan ulang setelah kami tangguhkan, cek dimenu *Lacak* --> tolak, lalu ajukan ulang dengan mengisi persyaratan, Terima Kasih ', '3', '2025-02-04', '07:53:59', '0000-00-00', '', '2025-02-04', '08:45:26', '', '126'),
	('040225PE71', 4, '6305066708970001', 'SITI RUKAYAH', '082154756769', 'ingin memperbaiki buku nikah supiani jadi sufiani dan tgl lahir 1991 jd 1992', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, untuk perbaikan buku Nikah sebaimana di maksud pada pengaduan seharusnya ke lembaga terkait (KUA).\r\nKalau perbaikan data KK dll yang tekait Adminduk berdasarkan buku Nikah sebagai dasar, silahkan ajukan perubahan KK di aplikasi Pondok Dukcapil.\r\nTerima Kasih.', '3', '2025-02-04', '08:27:05', '0000-00-00', '', '2025-02-04', '08:40:16', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('040225PE72', 5, '6305012307860004', 'SYAMSUDIANI', '082158036320', 'Perubahan KK', 'syarat/2025/02/04/f7b82f898f08d10e60d77b10d8e280b0.jpg', 'syarat/2025/02/04/6b62886e76a1712e4326482b74d680f6.jpg', '', '', '', '', '', 'Untuk KK apabila ada perubahan silahkan ajukan pada menu KK Perubahan dengan melengkapi syarat yang ditentukan. Silahkan cek syarat pada menu *Persyaratan*', '3', '2025-02-04', '10:20:33', '0000-00-00', '', '2025-02-04', '10:30:48', '', '126'),
	('040225PE73', 5, '6305012307860004', 'SYAMSUDIANI', '081253473103', 'Perubahan KK', 'syarat/2025/02/04/db77fb1220465b60f030a1d99bf3b2cf.jpg', 'syarat/2025/02/04/958fcc5bfdd3da22dd45015c61a7611c.jpg', '', '', '', '', '', 'Untuk KK apabila ada perubahan silahkan ajukan pada menu KK Perubahan dengan melengkapi syarat yang ditentukan. Silahkan cek syarat pada menu *Persyaratan*', '3', '2025-02-04', '10:25:55', '0000-00-00', '', '2025-02-04', '10:31:30', '', '126'),
	('040225PE74', 4, '6305055810080001', 'Siti Alpisah Hasanah ', '085691431679', 'ktp ulun hilang lo ka, handak baulah baasa itu selain surat keterangan hilang dari polsek apa aja ka yang harus di bawa ka dukcapilnya?', '', '', '', '', '', '', '', 'Syarat :\r\n1. Suket Hilang\r\n2. Isi Formulir F-1.02 (permohonan), bisa d download di menu Download formulir.\r\n3. Kartu Keluarga', '3', '2025-02-04', '18:44:23', '0000-00-00', '', '2025-02-05', '08:08:47', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('040325PE165', 2, '5305055004070001', 'Siti Fadilah', '085347735001', 'Bolehkan berikan saya informasi mengenai nama asli saya yang sebenarnya di kartu keluarga ataupun di akta kelahiran yang tercatat atau tercantum secara online di data kependudukan. Apakah nama sayaa Betul Siti Fadilah atau Siti Fadillah', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil. Mohon maaf sebelumnya, NIK yang Anda masukan kurang tepat (5305055004070001) tidak terdaftar di Database kami, silahkan ajukan ulang pertanyaan/informasi pada Konsultasi Baru dengan memasukan NIK yang benar. Terima kasih', '3', '2025-03-04', '09:43:51', '0000-00-00', '', '2025-03-05', '08:01:01', '', '126'),
	('040325PE166', 2, '6305016105030002', 'Nurul Hasanah ', '089602668692', 'Mengetahui informasi tentang bikin KK Dukcapil status Nikah tidak tercatat \r\nApa saja syarat nya terimakasih ', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, syaratnya dalam KK lama sudah gabung antara Suami dan Istri, tapi kalau masih terpisah tidak bisa, kecuali ada Surat Isbat Nikah. Informasi lebih lanjut bisa datang ke Kantor Dukcapil. Terima kasih.', '3', '2025-03-04', '12:15:18', '0000-00-00', '', '2025-03-05', '07:55:56', '', '126');
