	('040825PE16045', 2, '6305060203680001', 'Jumri', '085849316390', 'Mau buat kartu keluarga baru', '', '', '', '', '', '', '', 'Silahkan pilih menu Rubah KK, Terima Kasih', '3', '2025-08-04', '06:07:57', '0000-00-00', '', '2025-08-04', '08:33:31', '', '126'),
	('040825PE603', 2, '6305011206140001', 'AHMAD BADALI', '085248117059', 'Ingin memperbaharui KIA ', 'syarat/2025/08/04/459be15def5907cafff8a0395c87f345.jpg', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, berikut syaratnya :\r\n	1. Formulir F.1-02, (Pendaftaran),\r\n	2. Kartu Keluarga,\r\n	3. Foto ukuran 3 x 4,\r\n	4. KIA Lama.\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-08-04', '10:19:39', '0000-00-00', '', '2025-08-04', '10:47:16', '', '126'),
	('040825PE604', 2, '6305015908050003', 'Siti Aisyah', '087892356592', 'saya ingin memperbarui Kartu Keluarga yang baru,karena di KK saya tidak terdapat barcode atau KK yang asli\r\napa langkah yang harus saya lakukan? Terimakasih', 'syarat/2025/08/04/3e173c76d45eb10ede1078cd504f3908.jpg', '', '', '', '', '', '', 'Silahkan ajukan pada Menu Perubahan KK, pada keterangan sampaikan update kk lama menjadi menggunakan qrcode.\r\nSyarat :\r\n1. Formulir F.1-02\r\n2. KK Lama', '3', '2025-08-04', '11:47:25', '0000-00-00', '', '2025-08-04', '12:58:53', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('040825PE605', 2, '6305026901740001', 'Anita Ratna Sari', '082155294181', 'Minta informasi detail mengenai berkas apa saja yang dikasih ke dukcapil setelah dapat dokumen sudah pindah alamat', '', '', '', '', '', '', '', 'Seperti yang Anda Upload ketika pengajuan, Terima Kasih', '3', '2025-08-04', '15:11:16', '0000-00-00', '', '2025-08-04', '15:47:41', '', '126'),
	('040825PE606', 2, '6312050905970004', 'Sri suryati', '083122930594', 'Apakah nik saya cocok', '', '', '', '', '', '', '', 'Mohon kiranya dapat menyesuaikan dengan NIK di KTP-elektronik, atau lampirkan foto KTP/KK untuk pencocokan, Terima Kasih.', '3', '2025-08-04', '17:24:03', '0000-00-00', '', '2025-08-05', '07:03:37', '', '126'),
	('041224PE1', 5, '6305044611940002', 'Nur Jannah', '089504695929', 'Mau update ganti status perkawinan menjadi cerai hidup', 'syarat/2024/12/04/9ccf07df6ba80e4614385428451c2fb7.jpg', 'syarat/2024/12/04/9e73b1c4c318b4ddaa3cc70c9ee34119.jpg', '', '', '', '', '', 'Terima Kasih telah menghubungi Dukcapil Tapin.\r\nPertama anda harus mendaftarkan akun di aplikasi terlebih dahulu, setelah itu memohon pada menu Cetak KTP.\r\nDownload Formulir F.1-02 dan F.1-06 pada menu Formulir (https://pondok.dukcapil.tapinkab.go.id/main/formulir), isi ke dua formulir tersebut dan upload ke permohonan dengan menyertakan foto KTP dan AKTA Cerai anda.', '3', '2024-12-04', '15:27:40', '0000-00-00', '', '2024-12-05', '07:57:50', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('050225PE75', 4, '3316051304830006', 'MOHAMMAT SAIFUDIN', '081257208043', 'Saya mengajukan permohonan tapi ditolak terus   terus tidak ada keterangan yang salah dimana', '', '', '', '', '', '', '', 'Mohon kirim id transaksi nya pada pengaduan selanjutnya, agar dapat kami lacak permohonan Anda. Terima Kasih', '3', '2025-02-05', '08:09:39', '0000-00-00', '', '2025-02-05', '13:34:24', '', '126'),
	('050225PE76', 4, '6305021408930001', 'Abdul Basid ', '085654935891', 'Data permohonan pembuatan akte kelahiran tidak di proses.\r\nDengan nomor permohonan 200125AL95.', 'syarat/2025/02/05/e29fbd959cf0500b0100a4f4bdcbacac.jpg', 'syarat/2025/02/05/706e9690c2be7f7f65c38f351bcc6c12.jpg', '', '', '', '', '', 'Setelah kami telusuri, foto buku nikah yg dilampirkan kurang tepat hanya yg ada foto suami istri saja, jadi kami tangguhkan agar dpt di edit di menu LACAK pengguna dan di ajukan ulang, mohon ganti foto buku nikah yang ada nama suami dan istri (bagian dalam). Terima Kasih ', '3', '2025-02-05', '08:20:27', '0000-00-00', '', '2025-02-05', '09:32:36', '', '126'),
	('050225PE77', 2, '6305112812000001', 'Rahmansyah', '082154630015', 'Mau upgrade foto KTP dan perbaharui KTP ', '', '', '', '', '', '', '', 'Untuk perubahan foto KTP bisa dilakukan langsung di kantor Dukcapil, karena perubahan foto langsung dengan aplikasi Pencetakan KTP.\r\nTerima Kasih', '3', '2025-02-05', '08:42:43', '0000-00-00', '', '2025-02-05', '13:32:47', '', '126');
