	('050225PE78', 5, '6305011112950001', 'Dian Andi Wijayanto', '82252398397', 'pembaruan status KTP', 'syarat/2025/02/05/6efc735e271525183ffe7f9756ce73c8.jpg', 'syarat/2025/02/05/848d2be722364645365c23198dda3750.jpg', '', '', '', '', '', 'Untuk mencetak KTP Anda harus melampirkan syarat sbb :\r\n1. Formulir F.1-02, \r\n2. KK, \r\n3. KTP Lama\r\n4. Formulir F.1-06 Perubahan\r\n5. Dokumen pendukung perubahan\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-02-05', '08:56:06', '2025-02-05', '10:18:04', '2025-02-05', '13:25:07', '126', '126'),
	('050225PE79', 5, '6305020707780001', 'Achmad Syarif ', '085750270035', 'Ingin cabut berkas dan pencabutan daftar keluarga Krn sdh meninggal dunia 2thn yg lalu ', '', '', '', '', '', '', '', 'Syarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n1. Mengisi Formulir F-1.02 (menu download formulir)\r\n2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n3. Kartu Keluarga dan KTP-el\r\nTerima Kasih,', '3', '2025-02-05', '09:47:42', '2025-02-05', '10:18:15', '2025-02-05', '13:26:18', '126', '126');
