	('050225PE80', 5, '6305014512040001', 'Nur Sifa', '085750765262', 'Un hndk baulah akta anak cuman balum ada surat sidang anak nya kaypa', '', '', '', '', '', '', '', 'Syarat Akta Lahir :\r\n1. Formulir F-2.01 kelahiran (Download)\r\n2. Kartu Keluarga\r\n3. KTP Orang tua (suami-istri)\r\n4. KTP Saksi 2 orang\r\n5. Akta Nikah / STPJM Perkawinan (Download)\r\n6. Surat Keterangan Lahir / STPJM Kelahiran (Download)\r\n\r\nUntuk masalah sidang, izin infokan lebih lanjut sidang apa. pada pengaduan selanjutnya. Terima Kasih', '3', '2025-02-05', '10:52:49', '0000-00-00', '', '2025-02-05', '13:30:22', '', '126'),
	('050225PE81', 5, '6305014512040001', 'Nur Sifa', '085750765262', 'Mengirim syarat syarat baulah akta kelahiran nya kamana', '', '', '', '', '', '', '', 'Silahkan ajukan permohonan di Aplikasi Pondok Dukcapil.\r\nDownload Aplikasi Pondok Dukcapil berbasis Android di link berikut :\r\nhttps://drive.google.com/file/d/19kCzRnajLBkFC93WoHci7XqUplwXUpFQ/view?usp=sharing\r\nAtau Website : https://pondok.dukcapil.tapinkab.go.id/\r\n\r\nSyarat ada pada Menu Persayaratan, di aplikasi Pondok dukcapil.', '3', '2025-02-05', '15:08:45', '0000-00-00', '', '2025-02-05', '16:06:23', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('050225PE82', 4, '6305055810080001', 'Siti Alpisah Hasanah ', '085691431679', 'kalonya hilang ktp, habis tu baulah baasa ka lo, kawa lah fotonya baasa jua?', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, \r\nUntuk mencetak KTP hilang Anda harus membuat *Surat Keterangan Hilang* dari Kepolisian terlebih dahulu, dan itu sebagai syarat pengajuan cetak ulang KTP karena hilang. Bisa ganti foto, lapora saja ke patugas untuk ganti foto KTP. Terima Kasih.', '3', '2025-02-05', '17:13:40', '0000-00-00', '', '2025-02-06', '06:46:25', '', '126'),
	('050325PE167', 2, '6305014304050003', 'Vivi Nur Aini Aprilia', '081528808040', 'bisa kah ktp saya dikirim kan ke alamat Jl. Sekumpul Martapura ( Pempek Windy ) lewat kantor pos', 'syarat/2025/03/05/7a4b873763e4196d9d8510053963c29a.jpg', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil. Saran kami lebih baik di wakilkan saudara/orang tua yang satu kartu keluarga dengan Anda untuk mengambil KTP Anda, karena kalau via Pos di luar Tapin kami tidak bisa menjamin. Terima Kasih.', '3', '2025-03-05', '02:52:04', '0000-00-00', '', '2025-03-05', '07:43:22', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('050325PE168', 2, '6308054603910004', 'Murliani', '085931918429', 'Assalamualaikum, umpat batakun kaya apa caranya jd warga tapin. Ulun ne sdah 2 tahun labih di tapin. Nah ulun handak jd warga tapin tolong padahe caranya. Trims\r\n', '', '', '', '', '', '', '', 'Wa\'alaikumsalam, jadi pian kami cek didata masih alamat Amuntai, bila mau jadi warga Tapin pian harus baisi surat Pindah dari Amuntai dengan tujuan Tapin seperti itu. Ada 2 cara baolah surat pindah, 1. Pian langsung baurusan ke Ducapil Amuntai, 2. Minta bantu Pindah dari Dukcapil Tapin, tapi pian harus datang langsung ke Kantor kami bu, demikian informasinya, Terima Kasih.', '3', '2025-03-05', '20:56:04', '0000-00-00', '', '2025-03-06', '07:18:14', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('050525PE343', 2, '6305086102020001', 'jamâ€™iyatul hasanah', '082252135646', 'assalamualaikum. mohon maaf mau menanyakan, bagaimana min bisakah minta tolong keringanannya untuk mengurus semuanya online saja? soalnya belum ada waktu pulang ke Tapin, kalo bisa mau dipakai cepat. terimakasih sebelumnya min ????????', '', '', '', '', '', '', '', 'Setelah kami konsultasikan ke bidang yang menangani, silahkan daftar/regeistrasi user terlebih dahulu.\r\nSyarat pengajuan : \r\n1. Lampirkan Foto SKPWNI (Surat pindah asal)\r\n2. Surat Keterangan Batal Pindah\r\n3. Kartu Keluarga + KTP \r\nBerikut kami lampirkan formulir batal pindah, silahkan cek di menu konsultasi cek permohonan, paste nomor permohonan ini.', '3', '2025-05-05', '07:57:01', '0000-00-00', '', '2025-05-05', '08:42:52', '', '126'),
	('050525PE344', 5, '6305044808030001', 'Tazkia aulia murni', '082159150904', 'Mau buat kartu keluarga baru', '', '', '', '', '', '', '', 'Silahkan daftar/registrasi user, ajukan pada Menu Kartu Keluarga, silahkan ajukan perubahan KK sesuai kondisi (Pisah KK, Pecah KK, karena pindah, karena nikah, dll) Terima Kasih.', '3', '2025-05-05', '09:18:35', '0000-00-00', '', '2025-05-05', '09:47:09', '', '126');
