	('050525PE345', 5, '6308054603910004', 'Murliani', '085931918429', 'Saya sudah daftar, kenapa login g bs', 'syarat/2025/05/05/04dd1e0c65d65f53c8446fab4a9f11d7.jpg', '', '', '', '', '', '', 'Mohon daftar/registrasi ulang, Terima kasih', '3', '2025-05-05', '09:43:17', '0000-00-00', '', '2025-05-05', '09:45:08', '', '126'),
	('050525PE346', 2, '6305086102020001', 'Jamâ€™iyatul Hasanah ', '082252135646', 'Min untuk mengirim persyaratan batal pindah nya di menu yang mana yah min? \r\ndi menu â€œpindahâ€ itu kah? atau disini saja? ', '', '', '', '', '', '', '', 'Disini gpp (upload foto), karena pada menu utama tidak ada menu batal pindah. tolong syarat2 nya dipenuhi sesuai arahan sebelumnya, tks,', '3', '2025-05-05', '09:50:31', '0000-00-00', '', '2025-05-05', '09:56:51', '', '126'),
	('050525PE347', 2, '3510090308830010', 'MOH. AGUS KAMIL ', '08388493240', 'Cara nya ngurus pindah tempat ', '', '', '', '', '', '', '', 'Syarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n	1. Mengisi Formulir F-1.02 Permohonan (menu download formulir)\r\n	2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n	3. Kartu Keluarga dan KTP-el\r\nTerima Kasih', '3', '2025-05-05', '10:31:57', '0000-00-00', '', '2025-05-05', '10:36:47', '', '126');
