	('050525PE348', 2, '3510066001200001', 'Eleanoor Mecca Adiasti', '087755581011', 'Berkas pindah tempat lahir atas nama Eleanoor Mecca Adiasti .Nik 3510066001200001. Apa sudah keluar', 'syarat/2025/05/05/f87cb96e6f9abd9b3824ecadfbf70751.jpg', 'syarat/2025/05/05/42040981a4c88ec1ec1834e0e7f00e31.jpg', '', '', '', '', '', 'Mohon lampirkan nomor pengajuan pindahnya biar kami dapat Lacak, terima kasih.\r\nSilahkan ajukan pengaduan baru dengan menyertakan nomor Pengajuan.', '3', '2025-05-05', '10:41:38', '0000-00-00', '', '2025-05-05', '11:48:21', '', '126'),
	('050625PE431', 5, '6305060909640001', 'Kursani', '082251299486', 'Kemaren akta sudah dikonfirmasi katanya dikirim lewat pos tapi sudah beberapa hari kantor pos belum ada yang menghubungi biasanya dua hari sampai sesama tapi apakah bisa minta no resi supaya bisa melacak atau no wa kurir pos', '', '', '', '', '', '', 'Baik akan kami cek terlebih dahulu, mohon menunggu Informasi selanjutnya.', 'Berkas sudah kami serahkan ke pihak POS tgl 3 kemaren. Berikut nomor kontak Petugas POS wilayah Margasari : 08115008585\r\nSilahkan berhubungan dengan nomor tersebut, Terima Kasih.', '3', '2025-06-05', '08:15:24', '2025-06-05', '08:21:14', '2025-06-05', '08:53:11', '126', '126');
