	('050625PE432', 2, '6305104101020002', 'Nurul hidayah ', '083865982370', 'Assalamualaikum mohon izin bertanya, apakah bisa minta cetak kan ulang kartu keluarga yang ketidaksengajaan hilang ????', '', '', '', '', '', '', '', 'Biasa syaratnya pakai surat keterangan Hilang dari Kepolisian. Mungkin solusinya apabila mempunyai Aplikasi IKD dan kartu keluarganya sudah menggunakan QRCode bisa d cetak secara mandiri di Anjungan Dukcapil Mandiri (ADM), semoga dapat mambantu, terima kasih. ', '3', '2025-06-05', '11:03:31', '0000-00-00', '', '2025-06-05', '16:28:20', '', '126'),
	('050625PE433', 2, '6305014709970001', 'Arminiwati', '085654853066', 'Hallo ka selamat siang mohon maaf saya ingin bertanya, pada saat pendaftar akun saya terferifikasi oleh admin salah pada saat pengisian nik (kurang dari 14 digit) dan pada saat ingin daftar kembali tapi email dan no telpon sudah tidak bisa didaftarkan ulang karena sudah terdaftar, bagaimana solusinya?', 'syarat/2025/06/05/83e6c2b7c282ea1438764b6be87601ab.jpg', 'syarat/2025/06/05/84feec54b40c132fec120eff3fcdaa1b.jpg', 'syarat/2025/06/05/b85ebbb932d5105fae81c719d34092ed.jpg', '', '', '', 'Kami Cek terlebih dahulu, harap menunggu.', 'Silahkan dilanjutkan, semoga Berhasil, Terima Kasih', '3', '2025-06-05', '11:55:26', '2025-06-05', '12:53:27', '2025-06-05', '13:20:44', '126', '126');
