	('050625PE434', 2, '6307067006030001', 'Nida Jawza Luthfiana', '083142341751', 'Pencabutan berkas dari kartu keluarga, dan pindah KTP karena cerai. Tidak ada surat cerai karena nikah dibawah tangan. Apa yang harus dilakukan dan di urus? persyaratannya apa dan langkahnya apa saja untuk pengurusan.', 'syarat/2025/06/05/a3c566e9e522764d4cc4573e882af73d.jpg', '', '', '', '', '', '', 'Permasalahan seperti ini kami sarankan langsung datang ke Kantor Dukcapil. Terima Kasih.', '3', '2025-06-05', '13:46:05', '0000-00-00', '', '2025-06-05', '16:08:04', '', '126'),
	('050825PE607', 2, '6305022003000001', 'Zayyid jidane', '0895340565370', 'Cetak ktp', '', '', '', '', '', '', '', 'Untuk mencetak KTP/KK Anda harus melampirkan syarat sbb :\r\n	1. Formulir F.1-02, (menu download formulir)\r\n	2. Kartu Keluarga, \r\n	3. KTP Rusak/Ganti (Jika Rusak/Ganti)\r\n	4. Suket Hilang dari Kepolisian (Jika Hilang)\r\n	5. Formulir F.1-06, (Jika ada Perubahan) \r\n	6. Bukti (Dokumen) Pendukung \r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-08-05', '12:11:10', '0000-00-00', '', '2025-08-05', '12:48:17', '', '126');
