	('050825PE608', 2, '6305060805950003', 'Muhammad Riduan', '082251949612', 'Berkas kk dan akta gak bisa didownload saja ajukan ulang\r\nKk Muhammad Riduan \r\nAkta kelahiran helsya kamil\r\nPdfnya', 'syarat/2025/08/05/fd12a8eb05e1d99d38914a6d550e63e8.jpg', 'syarat/2025/08/05/080be453352bbf84f88649264c555af0.jpg', '', '', '', '', 'Mohon menunggu, kami proses terlebih dahulu file pdf-nya....', 'Berikut kami lampirkan pdf akta dan kk yang diminta, Silahkan masuk ke menu Layanan Konsultasi, pilih Cari permohonan, paste/ketik nomor permohonan berikut ini : 050825PE608', '3', '2025-08-05', '12:47:50', '2025-08-05', '12:51:12', '2025-08-05', '12:55:08', '126', '126'),
	('050825PE609', 2, '6305110301930001', 'Nanang Edi harianto', '083122930594', 'Nik', '', '', '', '', '', '', '', 'Mohon izin, Status NIK Anda terpantau aman dan Sinkron/Valid di Data Dukcapil. Terima Kasih', '3', '2025-08-05', '21:45:54', '0000-00-00', '', '2025-08-06', '07:26:55', '', '126'),
