	('060125PE8', 5, '6305014708760003', 'BARNIATI', '085248798643', 'Kartu keluarga saya yg asli gak ada lagi gimana', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil,\r\nUntuk mencetak KK hikang hilang Anda harus membuat *Surat Keterangan Hilang* dari Kepolisian terlebih dahulu, dan itu sebagai syarat pengajuan cetak ulang KK karena hilang, atau cetak mandiri pada mesin ADM dukcapil apabila mempunyai aplikasi IKD. \r\n\r\nUntuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu dan mengisi Data dengan benar.\r\nTerima Kasih.', '3', '2025-01-06', '13:12:03', '0000-00-00', '', '2025-01-06', '14:05:02', '', '126'),
	('060125PE9', 5, '6305042306000001', 'Rijali sabirin ', '082352322984', 'Mau cabut berkas', '', '', '', '', '', '', '', 'Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nSyarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n1. Mengisi Formulir F-1.02 (menu download formulir)\r\n2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n3. Kartu Keluarga dan KTP-el\r\nTerima Kasih', '3', '2025-01-06', '15:59:02', '0000-00-00', '', '2025-01-07', '06:53:20', '', '126');
