	('060225PE83', 4, '1408096805010001', 'Sarah saskia ', '085849537530', 'Saya mau menanyakan kepada BPK/ ibu yang bertugas tentang KTP elektronik yang sudah saya urus dari tanggal 30 Desember 2024 hingga saat ini belum sampai di saya sudah hampir sebulan ???????? ', '', '', '', '', '', '', '', 'Mohon maaf ibu atas ketidak nyamannya KTP ibu akan kami proses dan akan kami kirimkan hari ini  sesuai alamat di KTP,saat ini kami saat dalam masa peralihan dari aplikasi WA ke WEB. terimakasih', '3', '2025-02-06', '08:51:07', '0000-00-00', '', '2025-02-06', '10:09:09', '', '274'),
	('060225PE84', 4, '6302051806900001', 'Sunardi Ahmad, M.Pd', '0813360700072', 'Mohon ijin, tadi saya salah centang aplikasi dokumen sudah diteriama, sedangkan saya belm menerima. Untuk Perpanjangan KIA anak apakah bisa menggunakan Aplikasi Pergantian di Menu KIA ya pak (as req yang sudah kami kirimkan sebelmnya', '', '', '', '', '', '', '', 'KIA nya sudah di proses cetak bapa silahkan bapa ambil di Kantor dukcapil sesuai permintaan bapa.terimakasih', '3', '2025-02-06', '09:44:11', '0000-00-00', '', '2025-02-06', '10:13:32', '', '274');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('060225PE85', 5, '630501150208001', 'MUHAMMAD RAVI', '085822804796', 'SAYA MAU MENCETAK KTP , SUDAH PEREKAMAN DIKANTOR KECAMANTAN BINUANG', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil,\r\nUntuk mencetak KTP Anda harus melampirkan syarat sbb :\r\n1. Formulir F.1-02, \r\n2. KK, \r\n3. Dokumen pendukung (Izajah/Akta ahir)\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks\r\nCatatan : NIK anda yang tertera kurang dari 16 digit. Terima Kasih\r\n', '3', '2025-02-06', '10:52:04', '0000-00-00', '', '2025-02-06', '12:42:12', '', '126'),
	('060525PE349', 2, '351813007020001', 'Dhori Dwi Yulianto ', '085704864258', 'Min mau tau caranya mengurus surat dan persyaratan pindah dari Tapin ke Jawa, tpi posisi sekarang di jawa', '', '', '', '', '', '', '', 'untuk pengurusan surat Pindah silahkan Bikin akun terlebih dahulu setelah itu download form f1.03 jika pindah nya suami istri silahkan f103nya isi 2 lembar dan ajukan di menu PINDAH. terimaksih ', '3', '2025-05-06', '07:43:48', '2025-05-06', '08:16:12', '2025-05-06', '08:18:50', '277', '277');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('060525PE350', 2, '6305042608000001', 'Supyan Rahman', '082154739917', 'Saya sudah membuat KTP sejak berusia 17 tahun. Sampai saat ini KTP saya masih ada dan saya gunakan. Akan tetapi, waktu saya menggunakan KTP saya untuk identifikasi Perbankan (Memperbaharui kartu ATM yg expired), KTP saya tidak terbaca dengan alasan belum elektronik (disebutkan oleh pihak perbankan). Saat ini saya tinggal di luar Kabupaten Tapin, namun untuk KTP masih di kabupaten Tapin. Mohon petunjuk dan arahannya, apa yang terjadi pada KTP saya ? Bagaimana cara mengatasinya dan teknisnya seperti apa ? Dan dimana saya dapat mengurusnya ? Terima kasih ????', '', '', '', '', '', '', '', 'Baik, silahkan isi data berikut :\r\n1. NIK\r\n2. No. KK\r\n3. Nama Lengkap\r\n\r\nSilahkan kirim data di atas pada pengajuan konsultasi baru berikutnya. Tks. ', '3', '2025-05-06', '08:42:33', '0000-00-00', '', '2025-05-06', '13:47:52', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('060525PE351', 2, '6305066708990003', 'Sauzan Nur Alya', '085624028272', 'Assalamualaikum Bapak/Ibu.\r\n\r\nSelamat pagi.\r\nIni kan rencananya ulun mau bikin KK baru, Sudah ada SKPWNI suami dari Batulicin sekalian mau ubah elemen data di KTP dan KK nantinya (ubah status perkawinan dan pendidikan). \r\nYang mau ulun tanyakan, untuk perubahan elemen data itukan perlu melampirkan formulir F-1.02, nah didalam formulirnya itu tidak ada kolom untuk perubahan status perkawinan, apakah itu diisinya masuknya di kolom elemen lainnya..*??\r\n\r\nDan untuk pengisian data KK diatasnya itu pada F-1.02 sesuai KK yang masih ikut ortu ya? Atau data KK baru?\r\n\r\nTerimakasih sebelumnya, semoga bisa difahami. ', '', '', '', '', '', '', '', 'Untuk perubahan menggunakan F. 1-06 Perubahan Data (Silahkan Download Formulir). \r\nSedangkan F. 1-02 adalah formulir Permohonan awal. ', '3', '2025-05-06', '08:57:00', '0000-00-00', '', '2025-05-06', '13:50:07', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('060525PE352', 2, '6305014702790001', 'Diana', '08884371518', 'Mau mengubah status di KTP menjadi cerai hidup, tetapi tidak punya akta cerai apakah bisa, karena dikartu keluarga ulun yang jadi kepala keluarga nya, mantan suami sudah lama pisah', 'syarat/2025/05/06/935c53d487551e260913703ec9fb7ef1.jpg', '', '', '', '', '', '', 'Secara aturan mewajibkan akta perceraian sebagai bukti dukung utama perubahan status perkawinan terutama perceraian. \r\nUntuk lebih lanjut silahkan konsultasikan lebih lanjut ke Kantor Dukcapil. Tks', '3', '2025-05-06', '11:21:47', '0000-00-00', '', '2025-05-06', '13:52:09', '', '126'),
	('060525PE353', 2, '6305042608000001', 'Supyan Rahman', '082154739917', '1. NIK : 6305042608000001\r\n2. No.kk : 6305040602080036\r\n3. Nama lengkap : Supyan Rahman', '', '', '', '', '', '', 'Terima Kasih, akan kami coba bantu Cek. ', 'Data sesuai dan ditemukan pada data Dukcapil Pusat. \r\n\r\nProses Maks. 1x24 jam. Jika setelah 1x24 jam masih belum bisa terbaca / belum sesuai di instansi pengguna, silakan melaporkan kembali. ????', '3', '2025-05-06', '13:55:33', '2025-05-06', '14:45:42', '2025-05-08', '07:26:03', '126', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('060525PE354', 2, '6305066708990003', 'Sauzan nur alya', '085624028272', 'Maaf bapak/ibu tadi ada kekeliruan, memang benar yang ulun maksud adalah formulir F-1.06 untuk perubahan elemen data. Terimakasih atas responnya', '', '', '', '', '', '', '', 'Terima kasih, semoga dimudahkan. ', '3', '2025-05-06', '13:57:51', '0000-00-00', '', '2025-05-06', '14:46:32', '', '126'),
	('060525PE355', 2, '6305030107960007', 'M.RUDIANOR', '082353063669', 'Assalamualaikum, selamat malam\r\nMohon maaf sebelumnya, ingin bertanya mengenai berkas surat pindah yang hilang apakah bisa di cetakkan lagi, atau minta file pdf nya saja?', '', '', '', '', '', '', 'Waalaikumsalam, kami cek terlebih dahulu.', 'Akan kami kirim melalui WA. terima kasih', '3', '2025-05-06', '18:47:30', '2025-05-08', '07:31:04', '2025-05-08', '07:43:00', '126', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('060825PE610', 2, '6305044303040001', 'Nurhelena Alisea', '087745820403', 'Apakah saya bisa minta surat pindah lewat online saja (Dari Rantau ke Banjarmasin)', '', '', '', '', '', '', '', 'Tentu Bisa.\r\nUntuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nSyarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n	1. Mengisi Formulir F-1.02 Permohonan (menu download formulir)\r\n	2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n	3. Kartu Keluarga dan KTP-el\r\n	4. Bukti Dukung Lainnya (jika ada alasan lain)\r\nTerima Kasih', '3', '2025-08-06', '08:14:36', '0000-00-00', '', '2025-08-06', '08:33:27', '', '126'),
	('060825PE611', 2, '6308054603910004', 'Murliani ', '085931918429', 'Assalamualaikum mh. Maaf meganggu, ulun garing, bayi ulun garing tolong banar lah kirimakan kartu keluarga, aktelahir anak ulun kia nak ulun', '', '', '', '', '', '', '', 'Waalaikumsalam, silahkan informasikan Nomor Permohonannya biar dapat kami Lacak, apakah pengiriman via Pos atau di ambil di Kantor dukcapil. Terima Kasih. ', '3', '2025-08-06', '09:27:03', '0000-00-00', '', '2025-08-06', '12:11:12', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('060825PE612', 2, '6305060406700002', 'Ardiansyah', '082195441776', 'Bisa kh 1 akun ma ajukan 2 pemohon \r\nUlun ada majukan akta isti ulun atas nama nurlina wati\r\nTapi yg di kirim akta kelahiran ulun hja Ardiansyah \r\n040825ALN1149 nomor permohonan akta atas nama nurlina wati', 'syarat/2025/08/06/39f71592f2e93bd216db0001e1a4338a.jpg', 'syarat/2025/08/06/f275a3b19b149e2980c6eb785209b93c.jpg', '', '', '', '', '', 'Pengajuan oleh satu (1) Akun bisa mengajukan dokumen kependudukan hanya pada anggota yang ada dalam 1 KK tersebut, tidak bisa Akun mengajukan permohonan yang bukan anggota keluarganya. Semoga dapat dipahami, Terima Kasih.', '3', '2025-08-06', '09:46:54', '0000-00-00', '', '2025-08-06', '15:43:06', '', '126'),
	('060825PE613', 2, '6305044303040001', 'Nurhelena Alisea', '087745820403', 'Saya mau minta surat pindah dari rantau ke banjarmasin tolong jelaskan yaa yg tdi kurng paham,TerimaKasih', '', '', '', '', '', '', '', 'Syarat - syarat pindah yang harus disiapkan :\r\n	1. Mengisi Formulir F-1.02 Permohonan (menu download formulir)\r\n	2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n	3. Kartu Keluarga dan KTP-el\r\n	4. Bukti Dukung Lainnya (jika ada alasan lain)\r\nTerima Kasih', '3', '2025-08-06', '11:10:03', '0000-00-00', '', '2025-08-06', '15:40:05', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('060825PE614', 2, '1220047010910002', 'Arnita Nainggolan ', '081377207891', 'Cara mengurus akta pernikahan ', 'syarat/2025/08/06/d81616a9cf3ffe480fddaa7309949a53.jpg', '', '', '', '', '', '', 'Untuk Akta Perkawinan, silahkan Bpk/Ibu bisa langsung datang ke Kantor Dukcapil, berikut kami *lampirkan* Formulir untuk Pencatatan Perkawinan, syarat ada pada di formulir tersebut (Halaman depan). Nanti silahkan cek dengan memasukan nomor Konsultasi ini *060825PE614* pada menu Layanan Konsultasi --> Cari Permohonan, Terima Kasih.', '3', '2025-08-06', '12:38:52', '0000-00-00', '', '2025-08-06', '15:38:17', '', '126'),
	('060825PE615', 2, '6303082704960003', 'Misno', '082352764088', 'Halo kak, mau bertanya, kalau baru menikah mau pecah KK untuk buat KK baru itu apakah perlu KK  mertua juga atau cukup KK orgtua? Dan apakah harus KK aslinya?', '', '', '', '', '', '', '', 'Ya ke dua KK dari pasangan harus ada dan Asli, karena masing-masing harus di keluarkan dari KK Asal, dan KK yg di tinggalkan akan di buatkan KK baru tanpa Anda.\r\nKecuali salah satu adalah pindahan dari Luar Daerah. Semoga dapat dipahami. Terima Kasih.', '3', '2025-08-06', '19:09:55', '0000-00-00', '', '2025-08-07', '07:08:45', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('070125PE11', 5, '6305042306000001', 'Rijali sabirin ', '082352322984', 'Cara membuat surat domisili \r\n', '', '', '', '', '', '', '', 'Dinas Dukcapil tidak ada mengeluarkan Surat Domisili.\r\nKTP dan Kartu Keluarga adalah Dokumen sah untuk menunjukan data dan Domisili.\r\nTerima Kasih', '3', '2025-01-07', '07:07:41', '0000-00-00', '', '2025-01-07', '07:21:52', '', '126'),
	('070125PE12', 5, '6305010308960003', 'Anggi nurrahman', '082298504411', 'No kk tidak  valid pas saya ingin membuat npwp', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil,\r\nData terpantau Sinkron di Aplikasi SIAK, tapin kami coba bantu UP lagi ke server Pusat.', 'Informasi dari Pusat :\r\n----------------------\r\nData sudah sesuai dengan DWH. (Data warehouse) Kemendagri.\r\nNamun, belum tervalidasi karena Hasil validasi atas NIK tersebut dari DJP tidak ditemukan dalam tiga bulan terakhir.\r\nSilakan dicoba akses lagi hingga ke tahap validasi ya kak, karena NIK tsb tidak divalidasi oleh Ditjen Pajak.\r\n----------------------\r\nSilahkan coba lagi di Kantor Pajak, mudahan dapat solusi.\r\nTerima Kasih', '3', '2025-01-07', '07:34:02', '2025-01-07', '07:50:49', '2025-01-08', '07:03:53', '126', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('070125PE13', 5, '6305037009030001', 'NURUL HUSNA', '6281938754420', 'Mau Urus Surat Pindah ', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil,\r\nUntuk mengurus Surat pindah anda harus memenuhi persyaratan sbb :\r\n1. Mengisi Formulir F-1.02 (menu download formulir)\r\n2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n3. Kartu Keluarga dan KTP-el', '3', '2025-01-07', '09:21:55', '0000-00-00', '', '2025-01-07', '09:53:10', '', '126'),
	('070125PE14', 5, '6305037009030001', 'NURUL HUSNA', '6281938754420', 'Ingin mengurus surat pindah', '', '', '', '', '', '', '', 'Syarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n1. Mengisi Formulir F-1.02 (menu download formulir)\r\n2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n3. Kartu Keluarga dan KTP-el\r\n\r\nDownload Aplikasi Pondok Dukcapil berbasis Android di link berikut :\r\nhttps://drive.google.com/file/d/19kCzRnajLBkFC93WoHci7XqUplwXUpFQ/view?usp=sharing\r\nTerima Kasih\r\n ', '3', '2025-01-07', '09:49:02', '0000-00-00', '', '2025-01-08', '08:26:28', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('070125PE15', 5, '6305061708910003', 'Mardikansyah', '085849650709', 'Ingin pindah antar provinsi', '', '', '', '', '', '', '', 'Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nUntuk mengurus Surat pindah anda harus memenuhi persyaratan sbb :\r\n1. Mengisi Formulir F-1.02 (menu download formulir)\r\n2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n3. Kartu Keluarga dan KTP-el\r\n\r\nDownload Aplikasi Pondok Dukcapil berbasis Android di link berikut :\r\nhttps://drive.google.com/file/d/19kCzRnajLBkFC93WoHci7XqUplwXUpFQ/view?usp=sharing', '3', '2025-01-07', '12:15:35', '0000-00-00', '', '2025-01-07', '12:46:22', '', '126'),
	('070125PE16', 5, '6371012909870002', 'RICKY YAMANI', '08558894851', 'Bagaimana cara merubah biodata di aplikasi ini, karena no. KK 1 digit kurang', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil,\r\nSementara akan kami coba bantu perbaiki, tetapi dalam proses login no kk tidak menjadi acuan.\r\nKalau dalam pengajuan bisa anda ketik manual no kk yang benar.\r\nTerima Kasih.', 'No KK anda adalah 6305050812160003 ?\r\nCoba anda cek lagi, Terima Kasih', '3', '2025-01-07', '15:39:53', '2025-01-08', '06:59:09', '2025-01-08', '07:37:01', '126', '126');
