	('070225PE86', 5, '6305014107950045', 'Siti aminah', '0882020528372', 'Tidak bisa upload gambar untuk mengisi syarat/dokumen pengajuan perpindahan', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, mohon dicoba kembali. Terim Kasih', '3', '2025-02-07', '09:36:03', '0000-00-00', '', '2025-02-07', '09:53:59', '', '126'),
	('070225PE87', 4, '6305011708040003', 'MUHAMMAD WILDAN', '085156519582', 'KTP saya sudah mau rusak itu gimana ya apakah bisa di urus secara online? Dan untuk sekarang saua berdomisili di banjarmasin', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, Saran kami kalau Anda akan tetap berdomisil di Kota Banjarmasin maka silahkan membuat Surat Keterangan Pindah (Bisa secara online). Jadi nanti KTP dll nya bisa di mohonkan cetak di tempat yang baru.\r\nUntuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nSyarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n1. Mengisi Formulir F-1.02 (menu download formulir)\r\n2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n3. Kartu Keluarga dan KTP-el\r\nTerima Kasih', '3', '2025-02-07', '13:05:42', '0000-00-00', '', '2025-02-07', '13:49:22', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('070325PE169', 2, '6305030306840004', 'A. MAHDI', '085246992429', 'gimana cara mengurus cabut berkas karena mau pindah ke kalimantan timur', '', '', '', '', '', '', '', 'Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nSyarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n1. Mengisi Formulir F-1.02 Permohonan (menu download formulir)\r\n2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n3. Kartu Keluarga dan KTP-el\r\nTerima Kasih', '3', '2025-03-07', '08:45:20', '0000-00-00', '', '2025-03-07', '09:18:41', '', '126'),
	('070325PE170', 5, '6305094201930001', 'Norhatiah', '082386487732', 'Assalamu\'alaikum\r\nSaya bernama norhatiah.\r\nMau cabut berkas dari desa bungur', '', '', '', '', '', '', '', 'Waalaikumsalam, terima kasih. Silahkan daftar / \r\nRegiatrasi Akun terlebih dahulu untuk mengajukan Permohonan. Setelah terdaftar/disetujui, sikahkan Login dan pilih menu Pindah, syarat bisa dilihat pada Menu. Terima Kasih.', '3', '2025-03-07', '17:07:15', '0000-00-00', '', '2025-03-08', '13:00:57', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('070525PE356', 2, '6305066708990003', 'Sauzan nur alya', '085624028272', 'Selamat sore Bapak/Ibu.\r\n\r\nMaaf jika mengganggu waktunya dan menghubungi diluar jam kerja.\r\nUlun mau mengurus perubahan data di KTP pada status perkawinan, karena saat ini sudah menikah. Kalau untuk merubah foto KTP lama ke Baru apa juga bisa Bapak/Ibu?\r\nApabila boleh, bolehkah saya berfoto sendiri dan dikirimkan sebagai berkas pendukung nantinya? \r\n\r\nTerima kasih sebelumnya atas perhatiannya. \r\n', '', '', '', '', '', '', '', 'Selamat pagi, utk melakukan perubahan status perkawinan bisa dilakukan pada aplikasi ini dengan melampirkan syarat lengkap berupa foto asli KK lama dan foto buku nikah, serta mengisi formulir. utk perubahan foto pada KTP-el hanya dapat dilakukan di Kantor Disdukcapil Tapin, dengan cara di foto langsung menggunakan perangkat dan aplikasi dari Ditjen Dukcapil Kemendagri. Terima kasih.', '3', '2025-05-07', '16:45:48', '0000-00-00', '', '2025-05-08', '07:40:45', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('070725PE502', 2, '6305010506950002', 'Riky Royadi', '085251319096', 'Mau nanya , kenapa berkas yang di tarik ada surat keterangan hilang dari ke polisian sama fotocopy ijazah , padahal cuman pindah alamat ? ', 'syarat/2025/07/07/05b946c2a62eedd8ef624aaf0ad62910.jpg', '', '', '', '', '', '', 'Izin, setelah kami cek history chat tidak ada petugas meminta suket hilang dan izajah, apabila ada izin, screenshot permintaan tersebut. \r\nFoto yang dilampirkan mungkin amplop global yang tertera secara umum. Terima Kasih', '3', '2025-07-07', '06:52:42', '0000-00-00', '', '2025-07-07', '08:49:52', '', '126'),
	('070725PE503', 5, '3305071811930002', 'MISBAH', '081255135532', 'Mohon di bantu bisa di kirimkan SCAN PDF atas KK dan AKTA KELAHIRAN dengan nomor pengajuan 230625AL869 karena di pengajuannya belum di upload scan PDF nya\r\n', 'syarat/2025/07/07/e0921425207441e4928851b02786c4b4.jpg', '', '', '', '', '', '', 'Apakah sudah terima berkas dari pihak Pos? apabila sudah menerima, tolong foto akta dan kk nya, kirim kembali ke kami via konsultasi aplikasi ini, akan kami kirim pdf setelahnya, terima kasih.', '3', '2025-07-07', '09:19:10', '0000-00-00', '', '2025-07-07', '09:42:15', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('070725PE504', 2, '6213044503980001', '???????????????? ????????????????????????????', '085654056224', '???????????????????? ???????????????????? ???????????????????????? ???????????????????????? ????????????????????????????????????????????????', '', '', '', '', '', '', '', 'Apa yang bisa kami bantu? Mohon sampaikan dengan jelas. Terima Kasih', '3', '2025-07-07', '09:22:40', '0000-00-00', '', '2025-07-07', '09:43:04', '', '126'),
	('070725PE505', 2, '6213044503980001', 'NATA PROLITA', '085654056224', 'Bagaimana cara pengajuan gugatan cerai secara online', '', '', '', '', '', '', '', 'Selamat pagi, mohon izin ibu, jika yang ibu maksud adalah membuat akta cerai, silakan langsung datang ke kantor disdukcapil dengan membawa KK, KTP asli, dan putusan sidang atas perceraiannya.', '3', '2025-07-07', '09:48:46', '0000-00-00', '', '2025-07-07', '09:59:00', '', '162');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('070725PE506', 5, '3305071811930002', 'MISBAH', '081255135532', 'Terima Kasih Bapak/Ibu  No Pengaduan 070725PE503 status SELESAI baca balasan di menu pengaduan ->cari ->masukan no hp d Pondok Dukcapil\r\n \r\n Pesan Petugas : Apakah sudah terima berkas dari pihak Pos? apabila sudah menerima, tolong foto akta dan kk nya, kirim kembali ke kami via konsultasi aplikasi ini, akan kami kirim pdf setelahnya, terima kasih.\r\n \r\nMelanjutkan nomor pengaduan sebelumnya ini, berikut say kirimkan foto kk dan akta kelahirannya', 'syarat/2025/07/07/a66a323c9da894fb4f169cf5082de8c2.jpg', 'syarat/2025/07/07/f3b5bceda62ae2bd71462f1fc1203e79.jpg', '', '', '', '', 'Berikut kami lampirkan pdf Akta dan KK yang dimaksud. Terima Kasih', 'Berikut kami sampaikan pdf yang dimaksud. Terima Kasih', '3', '2025-07-07', '09:50:33', '2025-07-07', '12:43:57', '2025-07-07', '12:44:42', '126', '126'),
	('070725PE507', 5, '6305031911950001', 'Adhimas Budi Parsetyo', '085754516390', 'Cabut data/mau pindah kk ke kabupaten Banjar', '', '', '', '', '', '', '', 'Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nSyarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n	1. Mengisi Formulir F-1.02 Permohonan (menu download formulir)\r\n	2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n	3. Kartu Keluarga dan KTP-el\r\nTerima Kasih', '3', '2025-07-07', '10:04:16', '0000-00-00', '', '2025-07-07', '10:47:40', '', '126');
