	('070725PE511', 2, '6305061207780001', 'Sarbawi', '081351580237', 'Syarat merubah/pemberian titel untuk istri KHAIRUL FATMI,S.Pd \r\nApakah bisa sekalian pembuatan akta kelahiran sekalian merubah Kartu Keluarga untuk perubahan ktp menyusul kemudian..', 'syarat/2025/07/07/5ccf8298d2a70a13101bbe7f6231ec8b.jpg', '', '', '', '', '', '', 'Silahkan ajukan pada perubahan KK, dalam catatan sampaikan sekalian KTP, kalau akta kelahiran tidak menggunakan titel. Terima Kasih', '3', '2025-07-07', '11:10:30', '0000-00-00', '', '2025-07-07', '12:33:03', '', '126'),
	('070725PE512', 5, '6305031911950001', 'Adhimas Budi Parsetyo', '085754516390', 'Cabut Data/pindah kk ke kabupaten banjar', '', '', '', '', '', '', '', 'Syarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n	1. Mengisi Formulir F-1.02 Permohonan (menu download formulir)\r\n	2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n	3. Kartu Keluarga dan KTP-el\r\nTerima Kasih', '3', '2025-07-07', '11:14:29', '0000-00-00', '', '2025-07-07', '12:45:13', '', '126'),
	('070725PE513', 5, '6305011112960001', 'Zulkifli', '081645472414', '290425AL550\r\nAkta lahir belum terbit', 'syarat/2025/07/07/dac488d92629502922ff5be5bd9f7a20.jpg', '', '', '', '', '', '', 'Status : Selesai\r\nPengiriman : Via Pos\r\nPertanyaan, apakah belum sampai dokumen kiriman dari pihak POS?', '3', '2025-07-07', '12:52:10', '0000-00-00', '', '2025-07-07', '12:58:45', '', '126');
