	('070725PE514', 2, '6305014408980001', 'Maya', '085751618931', 'Pada saat pengisian formulir permohonan akta kematian (F-2.01) pada bagian data orang tua apabila orang tua yg bersangkutan telah meninggal dunia dan para cucu yang mengajukan permohonan ini tidak punya kk dari pihak mereka apakah boleh di isi hanya dengan nama saja', '', '', '', '', '', '', '', 'Silahkan isi dengan nama saja, dan apabila ada kekeliruan, petugas akan memberikan arahan. Terima KAsih', '3', '2025-07-08', '11:13:38', '0000-00-00', '', '2025-07-08', '22:37:21', '', '126'),
	('070825PE616', 5, '6308054603910004', 'Murliani ', '085931918429', 'Sudah tuntung kk ulun yg tabuat ngaran anak ulun Muhammad avicenna husein', '', '', '', '', '', '', '', 'Setelah kami cek KK Sudah Tanda Tangan Elektronik. Apakah ada kendala permohonan? Jika Ada silahkan infromasikan Nomor Permohonan-nya, terima kasih.', '3', '2025-08-07', '08:42:44', '0000-00-00', '', '2025-08-07', '09:03:49', '', '126');
