	('070825PE617', 2, '6305014505050005', 'Nurul Muthma\'inah ', '085823744690', 'Mau buat kartu keluarga dan ganti status KTP.', '', '', '', '', '', '', '', 'Untuk mencetak KTP/KK Anda harus melampirkan syarat sbb :\r\n	1. Formulir F.1-02, (menu download formulir)\r\n	2. Kartu Keluarga, \r\n	3. KTP Rusak/Ganti (Jika Rusak/Ganti)\r\n	4. Suket Hilang dari Kepolisian (Jika Hilang)\r\n	5. Formulir F.1-06, (Jika ada Perubahan) \r\n	6. Bukti (Dokumen) Pendukung \r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-08-07', '10:10:02', '0000-00-00', '', '2025-08-07', '10:11:58', '', '126'),
	('070825PE618', 5, '6308054603910004', 'Murliani ', '085931918429', 'Klo sudah selesai kk saya kasih tau dong link download nya di sini biar saya cetak', '', '', '', '', '', '', 'Mohon menunggu kami cek histrory permohonan-nya terlebih dahulu.', 'Setelah kami cek, Awal Anda melakukan proses kedatangan dari Amuntai ke Tapin, dan pengiriman dokumen-nya via Pos, seharusnya ada sampai Via Pos KK dan KTP nya, tetapi akan kami tetap upload kan pdf KK nya karena kami lihat sudah selesai seperti yang di maksud. \r\nBerikut kami lampirkan pdf kk yang diminta, Silahkan masuk ke menu Layanan Konsultasi, pilih Cari permohonan, paste/ketik nomor permohonan berikut ini (070825PE618)\r\n', '3', '2025-08-07', '10:44:45', '2025-08-07', '10:57:33', '2025-08-07', '11:15:04', '126', '126');
