	('070825PE621', 5, '6308054603910004', 'Murliani ', '085931918429', 'Klo sudah selesai kk saya kasih tau dong link download nya di sini biar saya cetak', '', '', '', '', '', '', '', 'Setelah kami cek, Awal Anda melakukan proses kedatangan dari Amuntai ke Tapin, dan pengiriman dokumen-nya via Pos, seharusnya ada sampai Via Pos KK dan KTP nya, tetapi akan kami tetap upload kan pdf KK nya karena kami lihat sudah selesai seperti yang di maksud. \r\nBerikut kami lampirkan pdf kk yang diminta, Silahkan masuk ke menu Layanan Konsultasi, pilih Cari permohonan, paste/ketik nomor permohonan berikut ini (070825PE618)', '3', '2025-08-07', '10:34:41', '0000-00-00', '', '2025-08-07', '11:15:46', '', '126'),
	('070825PE622', 5, '6308054603910004', 'Murliani ', '085931918429', 'Klo sudah selesai kk saya kasih tau dong link download nya di sini biar saya cetak', '', '', '', '', '', '', '', 'Setelah kami cek, Awal Anda melakukan proses kedatangan dari Amuntai ke Tapin, dan pengiriman dokumen-nya via Pos, seharusnya ada sampai Via Pos KK dan KTP nya, tetapi akan kami tetap upload kan pdf KK nya karena kami lihat sudah selesai seperti yang di maksud. \r\nBerikut kami lampirkan pdf kk yang diminta, Silahkan masuk ke menu Layanan Konsultasi, pilih Cari permohonan, paste/ketik nomor permohonan berikut ini (070825PE618)', '3', '2025-08-07', '10:34:52', '0000-00-00', '', '2025-08-07', '11:15:56', '', '126');
