	('070825PE623', 2, '6371056012880005', 'Parina amelia', '085651037474', 'Minta surat pengantar dari capil utk ke pengadilan negeri membuat akta kematian tdk ada datanya lagi', '', '', '', '', '', '', '', 'Persyaratan yang di bawa usahakan ada surat keterangan Meninggal dari Desa/Kelurahan, dan dokumen lainnya yang menerangkan Data sidin. Misalkan tidak ada silahkan konsultasi lebih lanjut ke Kantor Dukcapil. Terima Kasih.', '3', '2025-08-07', '11:35:20', '0000-00-00', '', '2025-08-07', '12:18:53', '', '126'),
	('070825PE624', 2, '6305016007020004', 'Anâ€™nissa Zahwa Ridhona', '085121153557', 'Cabut berkas mau pindah kk ikut suami', '', '', '', '', '', '', '', 'Syarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n	1. Mengisi Formulir F-1.02 Permohonan (menu download formulir)\r\n	2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n	3. Kartu Keluarga dan KTP-el\r\n	4. Bukti Dukung Lainnya (jika ada alasan lain)\r\nTerima Kasih', '3', '2025-08-07', '11:39:26', '0000-00-00', '', '2025-08-07', '12:05:13', '', '126');
