	('070825PE625', 2, '6308054603910004', 'Murliani', '085931918429', 'Minta pdf kk yg ada nama anak saya. Minta pdf kia nya juga. Udah selesai g kia nya. 070825PE618. Jujur saya cape bu berbulan bulan kaga kelar yg beginian. Saya lagi sakit, tambah lagi saya bu sui tambah lg saya posisi g di tapin. Kasihlah permudah. Walau dulu saya setel ambil berkas di kantor tolong lah kirim via pos. Tanda terima bisa aja kan situ yg acc. Saya cape bu. Andai saya punya rekan calon mending ngurus lewat calo. Jujur dr pd ky gine dg sistem yg berbelit belit berbulan bulan kaga kelar. Saya ini minta keringanan berkas di kirim ke pos alamat saya di amuntai. Apa busui yg lagi sakit, yg pasca operasi, yg lagi ngurus bayi sendirian di tinggal jauh suami di luar provinsi,  dan lagi jauh dr tempat kantor sampean " apa g berhak gto dpt  keringanan selaku warga tapin gto? Tolong lah prikemanusiaannya', '', '', '', '', '', '', '', 'Sudah Ibu kami lampiran, Silahkan masuk ke menu Layanan Konsultasi, pilih *Cari permohonan, paste/ketik nomor permohonan berikut ini (070825PE618)* nanti tampil dokumen dengan huruf tebal, silahkan download.', '3', '2025-08-07', '14:18:30', '0000-00-00', '', '2025-08-07', '14:31:26', '', '126');
