	('070825PE626', 2, '6372025806970005', 'Elly Oktavia Nanda', '081349180279', 'Cara untuk mengubah nama bagaimana ? apa saja yg di isi syrat dan ktentuan nya', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, berikut syaratnya :\r\n	1. Foto Formulir F.1-06 (Perubahan elemen data) yg sudah diisi --> Download Formulir\r\n	2. Foto Kartu Keluarga\r\n	3. Foto Kutipan Buku Nikah (jika sdh menikah)\r\n	4. Foto KTP\r\n	5. Foto Akta\r\n	6. Foto Dokumen Pendukung (Izajah, dll) / Putusan Pengadilan tentang perubahan Nama', '3', '2025-08-07', '18:26:44', '0000-00-00', '', '2025-08-08', '08:34:36', '', '126'),
	('080325PE171', 2, '6308054603910004', 'Murliani ', '085931918429', 'Abis konfirmasi kedatangan hrs apa lg', '', '', '', '', '', '', '', 'Setelah anda melakukan input kedatangan di Aplikasi, akan di Respon Petugas, harap selalu cek pada Menu Cari pada permohonan Kedatangan untuk melihat status permohonan dengan mamasukan Nomor Permohonan, Terima Kasih.', '3', '2025-03-08', '07:41:46', '0000-00-00', '', '2025-03-09', '01:31:58', '', '126');
