	('080425PE225', 2, '6305055004070001', 'Siti Fadillah ', '085347735001', 'Jika sudah mengunduh formulir 1.06 apakah harus di print formulir nyaa lalu di isi dan begitu juaa dengan formulir lainnya', 'syarat/2025/04/08/a2ae0ece4d5260e480905fb454fce141.jpg', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, Ya harus di print dan diisi.', '3', '2025-04-08', '06:23:33', '0000-00-00', '', '2025-04-08', '07:01:28', '', '126'),
	('080425PE226', 2, '6305055004070001', 'Siti Fadillah ', '085347735001', 'Apakah bisa akta kelahiran saya bisa dirubah namanya sekalian juga dengan kartu keluarga dan KTP untuk menyesuaikan dengan nama yang tertera di ijazah..apakah ada syarat tertentu jika ingin merubah nyaa agar nanti bisa sesuai dengan ijazah saya..dan berapa lama proses pengerjaan dalam perubahan elemen data tersebut ', 'syarat/2025/04/08/bcc3d00456c162d662dc70e9325762dc.jpg', '', 'syarat/2025/04/08/4f49b2491e107ceec9e068fa6d6d02de.jpg', '', 'syarat/2025/04/08/dcecb8df7ca834f51da2b40347461903.jpg', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, Bisa, kami sarankan untuk perubahan Nama di KK,KTP, dan Akta langsung ke kantor Dukcapil.', '3', '2025-04-08', '06:37:00', '0000-00-00', '', '2025-04-08', '07:03:41', '', '126');
