	('080425PE227', 2, '6303040607840004', 'HENDRA SAPUTRA ', '081255591286', 'persyaratan untuk merubah nama yang sudah bertahun2 terjadi kesalahan pada saat pembuatan akte,kk,dan KTP.apa saja syarat yang harus dilengkapi formulir yang mana?', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, berikut syaratnya :\r\n	1. Foto Formulir F.1-06 (Perubahan elemen data) yg sudah diisi --> Download Formulir\r\n	2. Foto Kartu Keluarga Lama\r\n	3. Foto Kutipan Buku Nikah (jika sdh menikah)\r\n	4. Foto KTP Lama\r\n	5. Foto Akta Lama\r\n	6. Foto Dokumen Pendukung (Izajah, dll) / Putusan Pengadilan tentang perubahan Nama\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-04-08', '08:14:55', '0000-00-00', '', '2025-04-08', '09:19:35', '', '126'),
	('080425PE228', 2, '6305060107650010', 'SUHARTO', '085845942521', 'Selamat siang bu, handak betakun kalonya meurus Kartu Keluarga yang hilang milik orang tua yg sudah pisah KK gimana ya bu, apa minta surat keterangan kepolisian dulu kah?', '', '', '', '', '', '', '', 'Untuk mencetak KTP  Anda harus melampirkan syarat sbb :\r\n	1. Formulir F.1-02, (Pendaftaran)\r\n	2. Kartu Keluarga, \r\n	3. KTP Rusak/Ganti (Jika Rusak/Ganti)\r\n	4. Suket Hilang dari Keplolisian (Jika Hilang)\r\n	5. Formulir F.1-06, (Jika ada Perubahan)\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-04-08', '08:15:50', '0000-00-00', '', '2025-04-08', '09:15:45', '', '126');
