	('080425PE230', 2, '6305054503690002', 'SITI RAHMAH', '081346768588', 'Perubahan data kartu keluarga ', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, berikut syaratnya :\r\n	1. Foto Formulir F.1-06 (Perubahan elemen data) yg sudah diisi --> Download Formulir\r\n	2. Foto Kartu Keluarga\r\n	3. Foto Kutipan Buku Nikah (jika sdh menikah)\r\n	4. Foto KTP\r\n	5. Foto Akta\r\n	6. Foto Dokumen Pendukung (Izajah, dll)\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-04-08', '09:41:21', '0000-00-00', '', '2025-04-08', '09:45:33', '', '126');
