	('080425PE231', 2, '630208451099001', 'Siti Fatimah', '085821093395', 'Syarat bikin kk baru suami istri\r\nDan permohonan pindah karna istri masih beda kabupaten', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, berikut syaratnya :\r\n1. Formulir F.1-02, (Pendaftaran),\r\n2. Kartu Keluarga (Suami),\r\n3. SKPWNI (Surat Pindah) Istri dari tempat Asal,\r\n4. KTP (Pasutri).\r\n5. Foto Kutipan Buku Nikah,\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-04-08', '10:37:29', '0000-00-00', '', '2025-04-08', '10:54:34', '', '126'),
	('080425PE232', 2, '6305105306040001', 'Pingkan Aryanti ', '081352575159', 'Surat pindah ', '', '', '', '', '', '', '', 'Syarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n	1. Mengisi Formulir F-1.02 Permohonan (menu download formulir)\r\n	2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n	3. Kartu Keluarga dan KTP-el\r\nTerima Kasih', '3', '2025-04-08', '11:23:37', '0000-00-00', '', '2025-04-08', '12:00:53', '', '126');
