	('080425PE233', 2, '6303124201880001', 'Lisa novia sari', '081251563994', 'Cara memindah anggota keluarga dari KK kab. Tapin ke KK kab. Banjar', '', '', '', '', '', '', '', 'Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu.\r\nSyarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n	1. Mengisi Formulir F-1.02 Permohonan (menu download formulir)\r\n	2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n	3. Kartu Keluarga dan KTP-el\r\nTerima Kasih', '3', '2025-04-08', '14:25:06', '0000-00-00', '', '2025-04-09', '07:24:19', '', '126'),
	('080425PE234', 2, '6305060301790001', 'Maksum', '081219017863', 'Berkas persyaratan perubahan kartu keluarga sdh di antar ke kantor pos', '', '', '', '', '', '', '', 'Mohon menunggu informasi selanjutnya. Terima Kasih', '3', '2025-04-08', '17:12:33', '0000-00-00', '', '2025-04-09', '08:11:36', '', '126'),
	('080525PE357', 4, '6305092710000001', 'Rahmad', '085946482518', 'Ingin pindah', '', '', '', '', '', '', '', 'Syarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n	1. Mengisi Formulir F-1.02 Permohonan (menu download formulir)\r\n	2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n	3. Kartu Keluarga dan KTP-el\r\nTerima Kasih', '3', '2025-05-08', '11:48:13', '0000-00-00', '', '2025-05-08', '14:20:01', '', '126');
