	('080525PE358', 4, '6305094503960001', 'Zulaiha', '082155700051', 'Penyerahan berkas fisik untuk surat pindah apa harus dengan ktp asli, sehubungan saat ini saya juga lagi di balikpapan. apakah bisa di wakilkan dengan surat kuasa?\r\n', '', '', '', '', '', '', '', 'Untuk penyerahan berkas formulir dan KK sebelumnya bisa diwakilkan, namun untuk fisik KTP-el diurus di Disdukcapil tujuan, jadi tidak perlu diserahkan ke Disdukcapil Tapin.', '3', '2025-05-08', '12:54:46', '0000-00-00', '', '2025-05-08', '13:10:51', '', '126'),
	('080525PE359', 2, '6305014702790001', 'Diana', '08884371518', 'Apa bisa pakai surat F1. 05 atau surat pernyataan tanggung jawab mutlak perkawinan / perceraian belum tercatat ', 'syarat/2025/05/08/906fd261624b3ae201091348f36c8b54.jpg', '', '', '', '', '', '', 'Untuk informasi, F1. 05 hanya bisa dipakai utk memberbarui KK yg pasangannya sudah ada di KK dan statusnya sudah kawin. Namun jika mengubah status perkawinan sudah tidak bisa lagi.', '3', '2025-05-08', '14:12:16', '0000-00-00', '', '2025-05-08', '14:15:59', '', '126'),
	('080625PE435', 2, '6305016911970002', 'Dian rizky fauzi', '08818269177', 'bagaimana cara mengubah nama akta dan ktp yg beda 1 hruf ', '', '', '', '', '', '', '', 'Silahkan lampirkan dokumen pendukung (izajah) sebagai dasar perubahan. Terima Kasih', '3', '2025-06-08', '19:23:23', '0000-00-00', '', '2025-06-10', '06:41:52', '', '126');
