	('080725PE5076', 5, '6305031911950001', 'ADHIMAS BUDI PARSETYO', '085754516390', 'Cabut Data /Pindah ke Kabupaten Banjar', 'syarat/2025/07/08/912c797e4a7fa1066205bb3aee149e1b.jpg', 'syarat/2025/07/08/e25d56c61a28d08870251e88968418f5.jpg', 'syarat/2025/07/08/8ac8dfef8887ebd80cbdb9f265654a9e.jpg', 'syarat/2025/07/08/eb1dc1a983e7a886d5d128fc9287e090.jpg', 'syarat/2025/07/08/6092c3f1e0a77a3cd4ffea62c6b11e9c.jpg', 'syarat/2025/07/08/8b09095008afa41f60d45498a475b0ee.jpg', '', 'Foto yang Anda upload/lampirkan silahkan di ajukan pada Menu Pindah agar dapat diproses oleh petugas, bukan pada menu konsultasi. Terima Kasih', '3', '2025-07-08', '09:21:29', '0000-00-00', '', '2025-07-08', '22:32:48', '', '126'),
	('080725PE5077', 2, '6372044708000001', 'Dea Aulya', '082157155239', 'saya  tidak sengaja klik konfirmasi dokumen sudah diterima, dokumen belum sampai ke rumah. tadi saya tidak menemukan file dokumen aktanya jadi tidak sengaja klik file diterima', '', '', '', '', '', '', '', 'Kalau Akte Kelahiran yang dikirm via Kantor Pos tidak di upload petugas ketika konfirmasi Selesai, tetapi bisa di minta pdf ketika sudah sampai ke Pemohon, dikarenakan ada lembar Register yang harus di tandatangani oleh Pelapor. Cara memohon pdf Akta adalah dengan melampirkan foto Akta yang sudah diterima. Terima Kasih.', '3', '2025-07-08', '08:09:27', '0000-00-00', '', '2025-07-08', '22:30:51', '', '126');
