	('080725PE5080', 2, '6305010111030003', 'isa norazis', '085787608291', 'jika ingin merubah data agama pada ktp persyaratan apa saja yang harus saya bawa', '', '', '', '', '', '', '', 'Biasa ada surat pernyataan/keterangan dari Pemuka Agama, mohon dapat dijelaskan dari Agama apa ke Agama apa, agara dapat kami arahkan lebih lanjut.Terima Kasih.', '3', '2025-07-08', '16:13:46', '0000-00-00', '', '2025-07-08', '22:39:38', '', '126'),
	('080725PE5081', 5, '6305061207780001', 'Sarbawi ', '081351580237', 'Gimana kalau salah klik di menu pelacak permohonan,ke klik konfirmasi sedangkan dokumen belum di download/belum muncul menu download dokumen', '', '', '', '', '', '', '', 'Silahkan Anda informasikan dokumen apa yang tidak sengaja di-klik. Apabila KK yang belum ada pdf-nya silahkan informasikan ke kami nomor permohonan KK nya, apabila Akte Kelahiran memang tidak di-upload karena harus ada tanda tangan pelapor terlebih dahulu baru di minta pdf Aktanya dengan melampirkan foto Akte yang diterima. Apabila KTP/KIA mohon juga informasikan ke kami nomor permohonan-nya agar dapat kami LACAK permohonan tersebut. Terima Kasih.', '3', '2025-07-08', '17:50:28', '0000-00-00', '', '2025-07-08', '22:44:01', '', '126');
