	('080825PE627', 5, '6305111302030001', 'BAYU FIRDAUS', '083142194177', 'Mau buat ktp lagi soalnya ktp yg sebelumnya hilang', '', '', '', '', '', '', '', 'Untuk mencetak KTP/KK Anda harus melampirkan syarat sbb :\r\n	1. Formulir F.1-02, (menu download formulir)\r\n	2. Kartu Keluarga, \r\n	3. KTP Rusak/Ganti (Jika Rusak/Ganti)\r\n	4. Suket Hilang dari Kepolisian (Jika Hilang)\r\n	5. Formulir F.1-06, (Jika ada Perubahan) \r\n	6. Bukti (Dokumen) Pendukung ', '3', '2025-08-08', '06:38:10', '0000-00-00', '', '2025-08-08', '08:35:13', '', '126'),
	('080825PE628', 2, '6305012212180002', 'muhammad syarwani abdan', '085754247953', 'ingin merubah kia anak jadi berfoto', 'syarat/2025/08/08/d2dfac01758372dad88548c69d1018ac.jpg', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, berikut syaratnya :\r\n	1. Formulir F.1-02, (Pendaftaran),\r\n	2. Kartu Keluarga,\r\n	3. Foto ukuran 3 x 4,\r\n	4. KIA Lama.\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-08-08', '09:52:51', '0000-00-00', '', '2025-08-08', '10:01:04', '', '126');
