	('090125PE17', 5, '3401010108840002', 'Albuma satagus dele', '085822406331', 'Pembuatan KIA di pending katanya luar daerah, padahal identitas berada di binuang', 'syarat/2025/01/09/53f9db592c482dc134cdc2fc08ac5cc2.jpg', '', '', '', '', '', '', 'Data dengan NIK 3401010108840002 beserta anggota dengan No KK 6306050506140003 terpantau Pindah dengan nomor :\r\nNo. Datang : SKDWNI/5202/17022023/0024 dan \r\nNo. Pindah : SKPWNI/6305/17022023/0006\r\nPada tahun 2023', '3', '2025-01-09', '10:00:54', '0000-00-00', '', '2025-01-09', '14:52:47', '', '126'),
	('090125PE18', 5, '6305091009990004', 'Rahmadi', '081250825812', 'perpindahan pendudukan', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil,\r\nUntuk mengurus Surat pindah anda harus memenuhi persyaratan sbb :\r\n1. Mengisi Formulir F-1.02 (menu download formulir)\r\n2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n3. Kartu Keluarga dan KTP-el\r\n\r\nSilahkan registrasi akun pada aplikasi Pondok Dukcapil terlebih dahulu untuk mendapatkan layanan lebih lanjut, atau download APK Pondok Dukcapil pada tautan berikut : \r\nhttps://drive.google.com/file/d/19kCzRnajLBkFC93WoHci7XqUplwXUpFQ/view?usp=sharing\r\nKetika intsall izinkan saja prosesnya, Tks', '3', '2025-01-09', '12:25:52', '0000-00-00', '', '2025-01-09', '15:01:44', '', '126');
