	('090125PE19', 5, '6305091009990004', 'Rahmadi', '081250825812', 'perpindahan penduduk', '', '', '', '', '', '', '', 'Silahkan registrasi akun pada aplikasi Pondok Dukcapil terlebih dahulu untuk mendapatkan layanan lebih lanjut, atau download APK Pondok Dukcapil pada tautan berikut : \r\nhttps://drive.google.com/file/d/19kCzRnajLBkFC93WoHci7XqUplwXUpFQ/view?usp=sharing\r\nKetika intsall izinkan saja prosesnya, Tks\r\n\r\nTerima kasih telah menghubungi Pondok Dukcapil,\r\nUntuk mengurus Surat pindah anda harus memenuhi persyaratan sbb :\r\n1. Mengisi Formulir F-1.02 (menu download formulir)\r\n2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n3. Kartu Keluarga dan KTP-el', '3', '2025-01-09', '13:15:35', '0000-00-00', '', '2025-01-09', '14:50:00', '', '126'),
	('090425PE1459', 5, '6305015006930002', 'Fatimah Hidayati', '082154645685', 'Kartu keluarga yang baru d buat tidak sampai k kantor pos', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, coba cek di menu Lacak Permohonan, ada tanda bintang merah, biasa operator Upload dokumen yang sudah jadi dan bisa di download. ', '3', '2025-04-09', '06:02:00', '0000-00-00', '', '2025-04-09', '07:26:01', '', '126');
