	('090425PE236', 2, '6305015006930002', 'Fatimah Hidayati', '082154645685', 'Tolong informasi mengenai Kartu keluarga yang saya buat sdh smpai dimana? Karena dari pihak kantor pos belum menerima berkas kartu keluarga punya saya. Sudah lebih dari 1 bulan yg lalu saya meminta pembuatan kartu keluarga. Tetapi sampai sekarang belum sampai d kantor pos. Mohon informasinya, karena saya juga sudah mengecek k kantor pos dan mereka bilang bahwa kartu keluarga punya saya tidak ada.', '', '', '', '', '', '', 'Kami cek terlebih dahulu, izin infokan no kk dan no transaksi KK nya, biar dapat kami lacak. Boleh di coba juga cek di Menu Lacak Permohonan bisa di upload petugas KK nya bila sudah jadi.', 'Silahkan cek pada menu keonsutasi --> Cari Permohonan --> isi id transaksi ---> download dokumen. Tks', '3', '2025-04-09', '09:08:49', '2025-04-09', '09:25:23', '2025-04-09', '09:42:40', '126', '126'),
	('090425PE237', 2, '6305034705970004', 'NURSAFITRI', '081257977875', 'Memasuk akan anggota baru di kartu keluarga\r\nBikin kia dan akta kelahiran', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, Silahkan ajukan permohonan Akta Kelahiran karena sudah include dengan KK dan KIA, Tks', '3', '2025-04-09', '11:59:02', '0000-00-00', '', '2025-04-10', '06:24:21', '', '126');
