	('090425PE239', 5, '6305054503690002', 'Siti rahmah', '081253901402', 'Saya mengajukan pisah kk,yg terbit kk atas nama nada islama,kk saya tidak ada,dan surat pindah,saya tdk mengenali siapa yg pindah ', 'syarat/2025/04/09/e82f7e026537751c7ee8e247cb963cf3.jpg', 'syarat/2025/04/09/e739c243b727028cc097c725fddcb98d.jpg', '', '', '', '', '', 'Mohon informasikan ke kami *nomor transaksi* nya biar dapat kami LACAK, ajukan pengaduan baru dan sertakan *nomor transaksi* \r\nTerima Kasih', '3', '2025-04-09', '13:54:40', '0000-00-00', '', '2025-04-10', '06:26:10', '', '126');
