	('090525PE360', 2, '6308054603910004', 'Murliani ', '085931918429', 'Di kk ulun tulisannya cerai tercatatat . Berhubung ulun sdah lawas nikah siri kw lah di ubahkan jd kawin...atau jd kawin taktercatat', '', '', '', '', '', '', '', 'Mohon maaf kalau nikah siri secara aturan memang tidak bisa jadi kawin tercatat, kawin/kawin tercatat hanya bisa apabila ada buku nikah/ dokumen Isbat Nikah dari KUA/Lembaga berwenang. Terima Kasih', '3', '2025-05-09', '06:15:56', '0000-00-00', '', '2025-05-10', '06:23:30', '', '126'),
	('090525PE361', 2, '6308054603910004', 'Murliani ', '085931918429', 'Di kk ulun tulisannya cerai tercatatat . Berhubung ulun sdah lawas nikah siri kw lah di ubahkan jd kawin...atau jd kawin taktercatat. Kw lah ky aa cr nya', '', '', '', '', '', '', '', 'Mohon maaf kalau nikah siri secara aturan memang tidak bisa jadi kawin tercatat, kawin/kawin tercatat hanya bisa apabila ada buku nikah/ dokumen Isbat Nikah dari KUA/Lembaga berwenang. Terima Kasih', '3', '2025-05-09', '06:25:31', '0000-00-00', '', '2025-05-10', '06:23:55', '', '126');
