	('090525PE363', 2, '6306025610040001', 'Salasiah ', '083159394140', 'Apakah KTP yang sudah dicetak bisa diambil ke dukcapil walaupun sudah memilih opsi kirim melalui kantor pos?', '', '', '', '', '', '', '', 'Untuk berkas yang di kirim lewat POS tidak bisa di ambil di kantor karena KTP nya sudah kami kirimkan lewat POS,termakasih', '3', '2025-05-09', '07:46:38', '2025-05-09', '09:37:08', '2025-05-09', '09:39:21', '274', '274'),
