	('090525PE365', 2, '6305075008740002', 'Nuriah', '081549774347', 'Ingin bertanya Bagaimana untuk membuat akte kelahiran, karena saya lahir dulu tidak ada akte kelahiran karena lahir di jaman masih dengan Dukun beranak mohon apakah bisa dibantu buatkan. Dan apakah pembuatan Akte kelahiran harus tetap sesuai di asal lahir atau bisa buat di tempat tinggal terbaru Atau provinsi baru.\r\nTerimakasih ', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, berikut syaratnya :\r\n	1. Foto Formulir F.2-01 (Kelahiran) yg sudah diisi --> Download Formulir\r\n	2. Foto Kartu Keluarga, \r\n	3. Foto Kutipan Buku Nikah (Jika Ada), /STPJM Kebenaran Suami-Istri\r\n	4. Foto KTP Orang Tua (Suami-Istri),\r\n	5. Foto Keterangan Lahir (bidan/dokter)Jika ada, /STPJM Kelahiran\r\n	6. Foto KTP Saksi 2 Org.\r\n	7. Surat Keterangan Hilang (Wajib jika hilang)\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-05-09', '09:55:03', '0000-00-00', '', '2025-05-10', '06:07:18', '', '126');
