	('090525PE366', 5, '6306071410950002', 'Supiadi', '085787366687', 'Dari pertama melengkapi dokumen saya juga bingung, kenapa menu unggah dokumen lainnya tidak ada, seperti unggah ktp saksi, unggah KTP pemohon, dan juga unggah dokumen pendukung lainnya ????', 'syarat/2025/05/09/5293411afbcc1f31da16b57b34eb92f4.jpg', '', '', '', '', '', '', 'Mohon izin menu apa yang Anda Pilih? Akte Hilang/Baru/Ubah? Beberapa upload memang tidak ada menyesuaikan pilihan menu, untuk dokumen pendukung lain selain syarat bisa dijadikan 1 foto, untuk formulir F.1-02 bisa dijadikan 1 foto apabila lembaran foto dijadikan 1. dan untuk KTP Pemohon jika orang tuanya dari anak bisa tdk diupload karena sudah jadi 1 dengan ktp ortu. Terima Kasih.', '3', '2025-05-09', '20:31:55', '0000-00-00', '', '2025-05-10', '06:20:16', '', '126'),
	('090725PE521', 2, '6305010111030003', 'isa norazis', '085787608291', 'jika ingin merubah data agama dari islam ke katolik pada ktp persyaratan apa yang harus di bawa? apakah cukup surat baptis atau adalagi', '', '', '', '', '', '', 'Baik terima kasih atas informasinya, akan kami koordinasikan terlebih dahulu kepada bidang terkait.', 'Setelah kami koordinasikan dengan bidang terkait, Silahkan bapa lampirkan Surat baptis tersebut.\r\nSyarat : \r\n1. Mengisi Formulir F.1-06 (Perubahan elemen data)\r\n2. Surat Ketarangan/Baptis tersebut.\r\n3. KK dan KTP lama.', '3', '2025-07-09', '00:03:10', '2025-07-09', '00:42:14', '2025-07-09', '08:13:32', '126', '126');
