	('090725PE524', 2, '6305025707910001', 'AZIZAH', '082351930295', 'Mengaubah pekerjaan di ktp', '', '', '', '', '', '', '', 'Silahkan lakukan perubahan KK terlebih dahulu dan sampaikan di catatan sekaligus merubah pekerjaan di KTP; Syarat :\r\n1. KK dan KTP lama\r\n2. Mengisi Formulir F.1-06 (perubahan)\r\n3. Dokumen pendukung perubahan pekerjaan.\r\n', '3', '2025-07-09', '09:42:43', '0000-00-00', '', '2025-07-09', '10:14:57', '', '126'),
	('090725PE525', 2, '6305021411850002', 'M. Rahman', '085934759365', 'Mengubah pekerjaan diktp', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, berikut syaratnya :\r\n	1. Foto Formulir F.1-06 (Perubahan elemen data) yg sudah diisi --> Download Formulir\r\n	2. Foto Kartu Keluarga\r\n	3. Foto KTP\r\n	4. Dokumen pendukung perubahan pekerjaan (SK Kerja atau lainnya)\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-07-09', '09:48:20', '0000-00-00', '', '2025-07-09', '11:45:46', '', '126');
