	('090725PE526', 2, '6305020201670001', 'Tusimin', '082351930295', 'Mengubah pekerjaan di ktp', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, berikut syaratnya :\r\n	1. Foto Formulir F.1-06 (Perubahan elemen data) yg sudah diisi --> Download Formulir\r\n	2. Foto Kartu Keluarga\r\n	3. Foto KTP\r\n	4. Dokumen pendukung perubahan pekerjaan (SK Kerja atau lainnya)\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks\r\nSilahkan ajukan di Aplikasi Menu Perubahan KK (beri catatan KTP juga berubah)', '3', '2025-07-09', '09:52:54', '0000-00-00', '', '2025-07-09', '11:47:57', '', '126'),
	('090725PE527', 2, '6305025707910001', 'Azizah', '082351930295', 'Mengubah pekerjaan di ktp', 'syarat/2025/07/09/8a7431879f733601bfc6ef09287d8464.jpg', 'syarat/2025/07/09/daa2ba856fa5e7c7175f1fae8196c765.jpg', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, berikut syaratnya :\r\n	1. Foto Formulir F.1-06 (Perubahan elemen data) yg sudah diisi --> Download Formulir\r\n	2. Foto Kartu Keluarga\r\n	3. Foto KTP\r\n	4. Dokumen pendukung perubahan pekerjaan (SK Kerja atau lainnya)\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks\r\nSilahkan ajukan di Aplikasi Menu Perubahan KK (beri catatan KTP juga berubah)', '3', '2025-07-09', '10:32:46', '0000-00-00', '', '2025-07-09', '11:48:11', '', '126');
