	('090725PE528', 2, '6372062002000001', 'Muhammad efendi k', '081346048271', 'Ktp terbaru', '', '', '', '', '', '', '', 'Silahkan klik tautan berikut untuk persyaratan --> https://pondok.dukcapil.tapinkab.go.id/main/persyaratan pilih KTP\r\nTerima Kasih', '3', '2025-07-09', '12:03:18', '0000-00-00', '', '2025-07-09', '12:19:53', '', '126'),
	('090725PE529', 2, '6372062002000001', 'Muhammad efendi k', '081346048271', 'Minta data informasi terbaru karena cerai', '', '', '', '', '', '', '', 'Untuk perubahan data dari kawin menjadi cerai Anda harus melampirkan Akta Perceraian dari Pengadilan Agama (Syarat Utama), selanjutnya akan diproses perubahan Status tersebut. Terima Kasih', '3', '2025-07-09', '12:27:03', '0000-00-00', '', '2025-07-09', '13:59:08', '', '126');
