	('090725PE530', 2, '6305105408980001', 'Irma', '085787072531', 'Maaf izin bertanya...\r\nU sudah mengajukan KTP suami pindah ke Tapin melalui aplikasi pondok capil...pas di cek ada keterangan berkas persyaratan di serahkan ke disdukcapil...itu apa kh berkasnya u serahkan saat mengambil KTP atau kapan ? Boleh kah misalnya yg mengambil KTP / mengantar berkas persyaratan bukan suami ?', 'syarat/2025/07/09/c024e24d9b0b81ec1436ff385b09a89b.jpg', '', '', '', '', '', '', 'Izin, kami cek NIK atas nama Marhamah (adik anda) bukan Irma (anda), untuk pengajuan konsultasi dalam penyampaian informasi mohon untuk dapat mengajukan NIK dan Nama yang sesuai. Untuk kasus suami anda, pastikan sudah ber-KK Tapin, baru setelahnya anda pindah/pisah KK dari orang tua dengan melampirkan Akta/Buku Nikah untuk di gabungkan 1 KK suami istri. Kalau mau ke Kantor Dukcapil, silahkan bawa persyaratan yang pernah diajukan ke aplikasi Pondok di tambah KK lama dan Buku Nikah anda. Terima Kasih.', '3', '2025-07-09', '13:01:40', '0000-00-00', '', '2025-07-09', '13:33:30', '', '126'),
	('090725PE531', 2, '6305106901950001', 'Irma', '085787072531', 'Kalau mau memindah KTP suami ke Tapin yang harus datang ke dukcapil boleh kah isteri atau harus org yg bersangkutan ?', '', '', '', '', '', '', '', 'Bisa bu, tunjukan saja Buku Nikah bahwa Anda istrinya dengan maksud gabung KK dengan membawa surat pindah suami. Terima Kasih', '3', '2025-07-09', '15:07:46', '0000-00-00', '', '2025-07-09', '15:26:35', '', '126');
