	('100125PE20', 5, '6305091009990004', 'RAHMADI', '081250825812', 'cabut berkas karna ingin pindah', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, untuk pengajuan melalui Aplikasi Pondok anda harus *mendaftar/registrasi* terlebih dahulu. \r\nSyarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n1. Mengisi Formulir F-1.02 (menu download formulir)\r\n2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n3. Kartu Keluarga dan KTP-el\r\nTerima Kasih\r\n\r\n', '3', '2025-01-10', '07:21:38', '0000-00-00', '', '2025-01-10', '08:29:50', '', '126'),
	('100125PE21', 5, '6305040707840002', 'Herman firdaus', '089691036193', 'Kenapa berkas saya selalu ditolak dengan alasan pengunduhan dokumen tdk akan muncul.. Bagian mana yg salah tolong penjelasan', 'syarat/2025/01/10/6713467cbd913ae7a9aaf2be2dbe949c.jpg', 'syarat/2025/01/10/6238ffd711c54837c714e3aa6f425ab2.jpg', 'syarat/2025/01/10/7b15ee422bed1e550a359d339f794da6.jpg', 'syarat/2025/01/10/547d367a6a5903725b1ba0df7380759c.jpg', '', '', 'Mohon izin, bisa infokan nomor transaksi nya, biar kami cek.\r\nTks', 'Setelah kami lacak, dan kami cek di persyaratan. Memang arahan petugas untuk upload KTP suami-istri belum anda penuhi.\r\nUntuk dapat dinlanjutkan, silahkan upload kembali yang disarankan petugas. Cek menu lacak. \r\nTerima Kasih.', '3', '2025-01-10', '08:16:20', '2025-01-10', '08:58:36', '2025-01-10', '09:23:32', '126', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('100225PE88', 5, '6305014107950045', 'Siti aminah', '0882020528372', 'Ass.. Maaf kak batakun ini kartu keluarga u yg baru sudah di terbitkan jer, kemaren pindah alamat. Nah ini kena amun sudah u cetak kelanjutan nya kayapa ? Trus ktp2 kami lwn kia anak u jua kena kyapa mendapat akn nya.. Apakah bulah ajuan beasa kah u atau dapat automatis kena ktp lwn kia nya. Trimakasih ???? ', '', '', '', '', '', '', '', 'Waalaikumsalam, bearti KK pian sdh cetak. Semalam pian KTP dan KiA selajur minta cetak lah pas memohon pindah alamat semalam? Mohon balas pada konsultasi baru berikutnya, sertakan ID TRANSAKSI agar dpt kami lacak permohonan Anda. Terima Kasih.', '3', '2025-02-10', '09:02:47', '0000-00-00', '', '2025-02-10', '09:09:19', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('100225PE89', 5, '6305014107950045', 'Siti aminah', '0882020528372', 'No.ID *100225PE88* \r\nKd ingat nah ulun kak ???? tapi rasa nya ada u membaca pas pengajuan pindah semalam tuh selain ktp dan kia bisa ajukan kembali jer kytu kah yu semalam kd ingat ulun nah, jadi ulun kira klo misal kk beganti alamat otomatis ktp lwn kia nya beganti jua, cuma u asa kdd pang betulis beasa misal ktp lwn kia nya sekalian jua kytu nah karna ulun pikir tadi beganti otomatis jua ????????', '', '', '', '', '', '', '', 'Izin, maksud kami nomor transaksi pindah pian samalam, bukan transaksi yg ini.\r\nTapi tenang, saran kami lebih baik pian ajukan lagi perubahan KIA dan KTP sesuai alamat baru.\r\nTerima Kasih.', '3', '2025-02-10', '09:28:13', '0000-00-00', '', '2025-02-10', '09:50:41', '', '126');
