	('100225PE90', 5, '6305037009030001', 'NURUL HUSNA', '081938754420', 'Surat Pindah', 'syarat/2025/02/10/9f189f09099472043e6dcd1f9bd2a21a.jpg', 'syarat/2025/02/10/beb66436dadb80a7c3461dd6dcd535dc.jpg', 'syarat/2025/02/10/e2c8f7bbf8be0ff4d3396752838fbf34.jpg', 'syarat/2025/02/10/431a0dfc5274477cb3aac26725a77b61.jpg', 'syarat/2025/02/10/fefe97b4b7db1543924794eefeaae87f.jpg', '', '', 'Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nSyarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n1. Mengisi Formulir F-1.02 (menu download formulir)\r\n2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n3. Kartu Keluarga dan KTP-el\r\nTerima Kasih', '3', '2025-02-10', '11:17:13', '0000-00-00', '', '2025-02-10', '12:27:57', '', '126');
