	('100225PE91', 5, '6305014107950045', 'Siti aminah', '0882020528372', 'Syarat nya apa aja kak gasan bulah ktp dan kia baru bekas pindahan. Trus ini kena klo u bikin lewat online nih ktp lwn kia nya minta tolong di cetak akn disana aja nanti di kirim lewat kantor pos kawalah kak sekalian lawan kk nya tadi, ni belum u cetak lagi kk nya. Trimakasih ????', '', '', '', '', '', '', '', 'Syarat :\r\nA. KTP\r\n1. Formulir F.1-02, \r\n2. KK, \r\n3. KTP Lama\r\nB. KIA\r\n1. Formulir F.1-02, \r\n2. Foto Kutipan Akta Kelahiran/\r\n3. KK asli orang tua/wali\r\n4. Foto anak berwarna ukuran 3x4 sebanyak 2 (dua) lembar untuk anak 5 ke atas, dibawah 5 tahun tidak perlu Foto anak.\r\n\r\n\r\n', '3', '2025-02-10', '11:33:16', '0000-00-00', '', '2025-02-10', '12:31:33', '', '126'),
	('100225PE92', 4, '6309060702020002', 'Rahim', '085820205432', 'Kenapa ya mau memasukan anak saya baru lahir di kk di tolak di apk', '', '', '', '', '', '', '', 'Memang di aplikasi tidak bisa memasukan data anak, cuma bisa mohon KK, Akta, KTP, dan KIA serta, pindah - datang (berupa dokumen), Data yang tertera di aplikasi hanya User.\r\nTerima Kasih', '3', '2025-02-10', '15:29:50', '0000-00-00', '', '2025-02-10', '16:08:37', '', '126');
