	('100225PE93', 5, '6305045809990001', 'Noor Amalia ', '088705813887', 'Bagaimana jika ingin mengubah/pindah alamat domisili di kartu keluarga ', '', '', '', '', '', '', '', 'Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nSyarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n1. Mengisi Formulir F-1.02 (menu download formulir)\r\n2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n3. Kartu Keluarga dan KTP-el\r\nTerima Kasih', '3', '2025-02-10', '15:50:28', '0000-00-00', '', '2025-02-10', '16:09:06', '', '126'),
	('100225PE94', 5, '6305014204580001', 'Hendra maulana', '085750242669', 'Ktp rusak dan kartu keluarga hilang', '', '', '', '', '', '', '', 'Untuk mencetak KTP rusak Anda harus melampirkan syarat sbb :\r\n1. Formulir F.1-02, \r\n2. KK, \r\n3. KTP Rusak \r\n\r\nUntuk mencetak KK hilang Anda harus membuat *Surat Keterangan Hilang* dari Kepolisian terlebih dahulu, dan itu sebagai syarat pengajuan cetak ulang KK karena hilang.\r\nTerima Kasih', '3', '2025-02-10', '16:26:43', '0000-00-00', '', '2025-02-11', '07:13:06', '', '126');
