	('100225PE95', 5, '6305014204580001', 'Hendra maulana', '085750242669', 'Ktp rusak dan kartu keluarga hilang', '', '', '', '', '', '', '', 'Untuk mencetak KTP rusak Anda harus melampirkan syarat sbb :\r\n1. Formulir F.1-02, \r\n2. KK, \r\n3. KTP Rusak \r\n\r\nUntuk mencetak KK hilang Anda harus membuat *Surat Keterangan Hilang* dari Kepolisian terlebih dahulu, dan itu sebagai syarat pengajuan cetak ulang KK karena hilang.\r\nTerima Kasih', '3', '2025-02-10', '16:26:53', '0000-00-00', '', '2025-02-11', '07:13:41', '', '126'),
	('100325PE172', 2, '6308054603910004', 'Murliani ', '085931918429', 'Assalamualaikum, ulun sdah d konfirmasi pindah datang, ulun pindahan dr amuntai, umpat bakun kartu keluarga ulun otomatis lah jadi, di kantor pos kah maambil, kantor postambarangan kah?, sudah lan tuntung padahe pang prosesnya apa apa supaya sampai jd ktp org sini', '', '', '', '', '', '', '', 'Terima Kasih, kalau lapor kedatangan biasa sudah satu paket KK dan KTP, kalau untuk pos biasa nya di informasikan melalui wa oleh pihak Pos, untuk melacak progress permohonan Silahkan pian cek pada menu Lacak Permohonan. Terima Kasih ', '3', '2025-03-10', '10:46:16', '0000-00-00', '', '2025-03-10', '13:14:29', '', '126');
