	('100325PE173', 2, '6308054603910004', 'Murliani', '085931918429', 'Kdd yg di ubah lg jd kd perlu duk pendukung', '', '', '', '', '', '', '', 'Terima Kasih, untuk melacak progress permohonan Silahkan Anda cek pada menu Lacak Permohonan. Terima Kasih.', '3', '2025-03-10', '10:48:25', '0000-00-00', '', '2025-03-10', '13:16:59', '', '126'),
	('100325PE174', 2, '6308054603910004', 'Murliani', '085931918429', 'Kdd yg di ubah lg jd kd perlu duk pendukung. Tuntunglah sdah kartu keluarga ulun', '', '', '', '', '', '', '', 'Terima Kasih, untuk melacak progress permohonan Silahkan Anda cek pada menu Lacak Permohonan. Terima Kasih.', '3', '2025-03-10', '10:48:48', '0000-00-00', '', '2025-03-10', '13:22:53', '', '126'),
	('100325PE175', 2, '6305096201890001', 'Indah Amallea', '081349546130', 'Mau bertanya.\r\nUntuk penghapusan titel di E-KTP, pengajuannya pakai formulir berapa aja?\r\nApakah bisa digabung permohonannya dgn perubahan anggota keluarga di KK? Atau harus bikin permohonan terpisah?\r\n\r\nKami tidak tahu form apa aja yg perlu di download dan diisi, langsung diarahkan ke website ini aja oleh admin.', '', '', '', '', '', '', '', 'Terima Kasih, silahkan pilih Menu Perubahan KK, download formulir F.1.02 Permohonan, dan formulir F.1.06 Perubahan Data. ', '3', '2025-03-10', '12:18:35', '0000-00-00', '', '2025-03-10', '13:21:56', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('100425PE243', 5, '6305054503690002', 'Siti rahmah', '081253901402', 'Kartu keluarga siti rahma tidak ada?\r\nDan surat pindah itu siapa?', 'syarat/2025/04/10/ff4e33d2387cfede03f4b272891629de.jpg', '', '', '', '', '', 'Baik akan kami cek terlebih dahulu, mohon bersabar menunggu.', 'Silahkan Cek di menu lacak pengaduan.', '3', '2025-04-10', '07:00:28', '2025-04-10', '08:06:51', '2025-04-10', '16:08:09', '126', '126'),
	('100425PE244', 2, '3374131608960003', 'Dimas', '081251383872', 'Pembuatan akta kematian yang sudah lama ', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, Silahkan pilih Menu Akta Kematian.\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks\r\nUntuk kematian yang lama selama NIK ybs masih ada di Database, insyaallah bisa.', '3', '2025-04-10', '07:54:02', '0000-00-00', '', '2025-04-10', '08:14:50', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('100425PE245', 2, '3526101702960004', 'MOH.SA\'I', '083114750922', 'Kami belum tau cara membuat kartu keluarga online mohon bimbingan nya dan informasi nya', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, \r\n1. Sebelumnya anda harus daftar Akun terlebih dahulu, dengan memasukan NIK, NoKK, email, no Wa Aktif dll sesuai petunjuk.\r\n2. Setelah disetujui petugas, akan ada notifikasi di whatsapp anda,\r\n3. Setelah login berhasil, pilih menu Perubahan KK, lanjutkan sesuai petunjuk,\r\n4. Lanjutan cek selalu notifikasi Wa Anda, dan cek selalu juga Menu Lacak Permohonan untuk mengatahui tracking permohonan Anda (notif ada tanda bintang Merah)\r\n5. Persyaratan ada pada Menu Persyaratan, Formulir ada pada Menu Download Formulir.\r\nSelamat Mencoba.', '3', '2025-04-10', '08:25:52', '0000-00-00', '', '2025-04-10', '09:03:19', '', '126'),
	('100425PE246', 2, '6305015402040002', 'Lindawati', '085654779740', 'Ass.selamat siang bpk/ibu yg bertugas.\r\nUlun mau tanya apakah bisa buat akta kelahiran anak namun usia anak lebih dari usia pernikahan tercatat orangtuanya,karena sebelumnya orang tua anak tersebut telah melakukan nikah tidak tercatat.????????????', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, Bisa, tapi harus sudah Isbat Nikah dan Pengesahan Anak memalui Pengadilan.', '3', '2025-04-10', '10:57:29', '0000-00-00', '', '2025-04-10', '11:12:27', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('100425PE247', 5, '3526101702960004', 'MOH.SA\'I', '083114750922', 'Saya ingin membuat Kartu keluarga di margasari tapi selalu ditangguhkan ', '', '', '', '', '', '', '', 'Mohon sertakan nomor transaksi nya pak biar kami Lacak penyebabnya, Silahkan ajukan pengaduan ulang dengan menyertakan *nomor transaksi* nya. Tks', '3', '2025-04-10', '11:47:19', '0000-00-00', '', '2025-04-10', '16:02:15', '', '126'),
	('100625PE436', 2, '6305065801030001', 'Masliana', '082242439915', 'Saya mau bikin akte kelahiran anak cuman kendala belum pindah dari alamat suami..sekarang sudah ada surat pindah gimana saya biar penjaguan akta anak saya tidak d tangguhkan terimakasih mohon info nya', 'syarat/2025/06/10/ec60bd46984b6899eaceb3981da7c470.jpg', '', '', '', '', '', '', 'Izin, kami cek data ibu status sudah pindah dan KK nya posisi di KK ortu Anda, misalkan apakah lebih baik gabung dulu KK nya dengan Suami agar mudah dalam membuat Akte anaknya. Kalau Ibu tetap ingin membatalkan kepindahan, izin harus ke kantor dukcapil terlebih dahulu dan membawa surat pindahnya untuk dibatalkan, tetapi kemungkinan akan terkendala untuk pembuatan Akte Lahir anak Ibu karena tidak ada Suami dalam KK ortu Ibu. Terima Kasih, semoga dapat membantu.', '3', '2025-06-10', '08:20:52', '2025-06-10', '08:42:56', '2025-06-10', '08:45:39', '274', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('100625PE437', 2, '6305065801030001', 'Masliana', '082242439915', 'Saya sedang megurus akta kelahiran buat anak saya cuman ada kendala..sura pindah saya, dan sudah saya urus surat pindah di nyatakan beres.., cuman di kasih file kk aja, trus saya urus pengajajuan akta baru itu katanya di suruh nuggu surat pindah yg sedangkan surat pindah d nyatak sudah beres..tp untuk pengajuan akta masih d tolak jadi saya harus bagai mana minta tolong kejelasannya harus melangkas seperti apa terimakasih', 'syarat/2025/06/10/8f9e6feea7f753315f9a0c73d6895644.jpg', 'syarat/2025/06/10/79f222e759476b557d2b1837a310898d.jpg', 'syarat/2025/06/10/a9f70dcfe245e5488478514856afe867.jpg', 'syarat/2025/06/10/2fa81ef089aafd2bf9544d778e4968fc.jpg', '', '', '', 'silahkan di ajukan ulang ibu dan untuk form pembatalan pindahnya tidak usah di lampirkan, dan tolong lampirkan KK terbaru ', '3', '2025-06-10', '12:05:51', '2025-06-10', '12:37:03', '2025-06-10', '12:39:07', '274', '274'),
	('100625PE438', 2, '6305010405090002', 'Hj.Jumiati', '082153252501', 'Kehilangan KK', '', '', '', '', '', '', '', 'Silahkan minta surat kehilangan dari kepolisian dan ajukan di menu Perubahan KK dan lampirkan surat kehilangan dan Form F1.02 untuk formulir bisa di download di menu download. terimakasih', '3', '2025-06-10', '22:30:26', '2025-06-11', '07:42:54', '2025-06-11', '07:45:17', '274', '274');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('100725PE533', 2, '6305010612920003', 'Hairun', '082154782500', 'KIA anak tanggal 20 Juli ini habis amsa berlakunya, itu harus diperpanjang kah atau bagaimana ?\r\nKalau diperpanjang, apa saja persyaratan yang harus dilengkapi ?\r\nTerima kasih', 'syarat/2025/07/10/e2cea4e512b977fa4a64309774c910fa.jpg', '', '', '', '', '', '', 'Tanggal 20 Juli anak bapa genap umur 5 tahun yang bearti KIA nya harus di perbaharui dengan melampirkan Foto anak ukuran 3 x 4, jadi nanti KIA nya sudah ada foto anak-nya. Saran kami ajukan permohonan KIA pada tanggal 20 saja atau sehari sebelum agar nanti pas di cetak sudah ada foto anak-nya.\r\nSyarat :\r\n1. Formulir F.1-02 (permohonan)\r\n2. KIA lama\r\n3. Foto Anak\r\nTerima Kasih', '3', '2025-07-10', '07:40:13', '0000-00-00', '', '2025-07-10', '07:44:58', '', '126'),
	('100725PE534', 2, '6303051907000004', 'Muhammad amin mulyanto', '082213508574', 'Cara pengajuan akta kelahiran bagaiamana file F2. Sdh d donwload itu apa kah di print atau bagaimana', '', '', '', '', '', '', '', 'Betul F.2-01 di print, baru di isi, foto baru di upload ke aplikasi. Terima Kasih.', '3', '2025-07-10', '09:21:05', '0000-00-00', '', '2025-07-10', '10:35:07', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('100725PE535', 2, '6305106901950001', 'Irma', '085787072531', 'Kalau pengajuan permohonan melalui pondok capil..berapa biasanya  waktunya', '', '', '', '', '', '', '', 'Tergantung persyaratan lengkap/tidak, dan jam kerja juga, diharapkan mengajukan pada waktu jam kerja efektif (08:00 s/d 14.00), insyaallah akan segera  direspon petugas. Terima Kasih.', '3', '2025-07-10', '09:51:47', '0000-00-00', '', '2025-07-10', '10:37:04', '', '126'),
	('110225PE100', 4, '6305014107950045', 'Siti aminah', '0882020528372', 'Ass.. Maaf kak batakun ini kan ulun handak bulah ktp lawan kia yg hanyar bekas pindah alamat kemaren, kena di formulir u bulati yg mana aja jenis permohonan nya dan u centang yang mana aja yg dilampirkan nya... Ktp lawan kia kak. Terimakasih', '', '', '', '', '', '', '', 'Wallaikumsalla, Untuk KIA silahkan centang kolum IV perubahan data dan (c) KIA dan kalau anak ibu sudah berusia di atas 5 tahun silahkan lampirkan Foto nya  \r\nUntuk KTP silahkan centang Kolum II KTP-el dan (B) pindanh datang,terimakasih', '3', '2025-02-11', '10:39:19', '0000-00-00', '', '2025-02-11', '11:01:04', '', '274');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('110225PE96', 5, '6305125412030001', 'FATIMAH ', '085845358649', 'SAYA MAU BIKIN AKTA KELAHIRAN ANAK ', 'syarat/2025/02/11/6f99e9bf29c2ae764105010633e4a34e.jpg', 'syarat/2025/02/11/11b29b42b9f58ab8985c3fe02da7f7e4.jpg', '', '', '', '', '', 'Silahkan ajukan permohonan di Aplikasi Pondok Dukcapil. Daftar akun terlebih dahulu.\r\nSyarat :\r\n1. Isi Formulir F.2-01\r\n2. Buku Nikah / STPJM Perkawinan\r\n3. KK\r\n4. KTP (Suami-istri)\r\n5. Surat Ketarangn Kelahiran / STPJM elahiran\r\n6. KTP Saksi 2 org.\r\nLebih lanjut cek di Menu Persyaratan. Terima Kasih\r\n', '3', '2025-02-11', '07:34:12', '0000-00-00', '', '2025-02-11', '08:32:29', '', '126'),
	('110225PE97', 5, '6305061907000001', 'Mahliyannor ', '082253320550', 'Assalamualaikum ka. Ulun kamarian beulh akta anak Ulun dikantor, tpi ada kendala mesinnya jdi dikirim lewat online tpi masih belum dikirim sampai ini.\r\nNama anak Ulun Muhammad Nafis Amin\r\nMohon konfirmasi nya', '', '', '', '', '', '', 'Baik kami cek terlebih dahulu.', 'Akta anak pian sudah jadi, tp KIA dan KK masih proses, jadi saran kami, karena KIA bentuk fisik bisa di ambil sekalian yg lainnya di tempat pian maolah kemaren. Terima Kasih.', '3', '2025-02-11', '09:26:39', '2025-02-11', '09:30:08', '2025-02-11', '09:38:56', '126', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('110225PE98', 5, '6305061907000001', 'Mahliyannor ', '082253320550', 'Ka untuk akta Muhammad Nafis Amin tadi bisa dikirim online lewat pdf ja lah, soalnya KIA dan kartu keluarga sudah jadi kemarian. Tinggal akta ja yg belum', '', '', '', '', '', '', '', 'Baik, kami kirim. Mohon di cek, Tks', '3', '2025-02-11', '09:45:05', '0000-00-00', '', '2025-02-11', '09:50:31', '', '126'),
	('110225PE99', 5, '6305061907000001', 'Mahliyannor ', '082253320550', 'Ka mohon maaf kenapa akta atas nama Muhammad Nafis Amin tadi masih belum dikirim, mohon konfirmasi nya. Terimakasih ', '', '', '', '', '', '', '', 'Ok, padahal sdh lun upload di aplikasi, tapi baik kami japri aja ya. Tks', '3', '2025-02-11', '10:33:57', '0000-00-00', '', '2025-02-11', '11:07:43', '', '126'),
	('110325PE176', 2, '6305105009940002', 'meliani Dewi Hastuti ', '081256117881', 'perubahan nama anak', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, untuk perubahan data silahkan menggunakan Formulir F.1-06 (Download menu download formulir), sekiranya dapat menyampaikan *dokumen pendukung* perubahan sebagai lampiran perubahan. \r\nUntuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nTerima Kasih.', '3', '2025-03-11', '09:56:55', '0000-00-00', '', '2025-03-11', '10:13:41', '', '126');
