	('110325PE177', 2, '6303085111890003', 'JUHAIRIATI ', '081254630053', 'Saya ingin menanyakan pembaharuan KK d sejui atau tidak ', '', '', '', '', '', '', '', 'Silahkan ajukan dan penuhi terlebih dahulu syarat-syarat nya, Petugas kami akan merespon permohonan Anda. Terima Kasih.', '3', '2025-03-11', '10:09:12', '0000-00-00', '', '2025-03-11', '11:33:57', '', '126'),
	('110325PE178', 2, '6305054110980002', 'Muliana', '085849289049', 'Assalamu\'alaikum\r\nMaaf. Ini Ulun dari Puskesos Desa Baringin A.. \r\nMau tanya, kalo misal ada warga yg kehilangan KTP dn KTP nya masih KTP bahari... Itu kayapa cara meurusnya yo?\r\nSedangkan yg bersangkutan nih kd kw duduk d kandaraan lagi.\r\n\r\n', '', '', '', '', '', '', '', 'Waalaikumsalam, secara aturan kalau KTP hilang dan untuk mendapatannya kembali harus memiliki Surat Keterangan Kehilangan dari Kepolisian sebagai syarat dasar kehilangan. Untuk kasus ini kami sarankan untuk konsultasi lebih lanjut ke nomor Pengaduan * (0811-511-141) *, apakah nanti diminta lebih lanjut NIK yang bersangkutan terlebih dahulu atau seperti apa. Semoga informasi ini dapat membantu, Terima Kasih.', '3', '2025-03-11', '11:41:11', '0000-00-00', '', '2025-03-12', '07:08:22', '', '126');
