	('110325PE179', 2, '6305060808900001', 'Ismail ', '082352654840', 'apakah bisa meupdate kartu keluarga ,soalny ada kartu keluarga siswa kami yg tdk terupdate di aplikasi Verpalpd', '', '', '', '', '', '', '', 'Silahkan lampirkan nomor KK nya pada konsultasi berikutnya, atau bisa chat Whatsapp ke nomor Konsolidasi (0822-4678-7329). Terima Kasih', '3', '2025-03-11', '11:43:04', '0000-00-00', '', '2025-03-12', '07:14:09', '', '126'),
	('110325PE180', 2, '6308054603910004', 'Murliani ', '63080546039100', 'Assalamualaikum menu lacak di mn andakannya', '', '', '', '', '', '', '', 'Waalaikumsalam, disebelah menu Keluar, tulisannya Lacak Permohonan. Terima Kasih.', '3', '2025-03-11', '16:01:02', '0000-00-00', '', '2025-03-12', '07:16:18', '', '126'),
	('110425PE248', 2, '1210197007010002', 'Essloanty Panjaitan ', '081717535840', 'Mau memasukan data anak ke kartu keluarga serta mengeluarkan kartu kis nya', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, Saran kami sekaligus pengajuan Akta Kelahiran.\r\nUntuk pengajuan Akta Lahir, KIA, dan KK bisa sekaligus dengan mengajukan Akta Kelahiran untuk kelahiran Baru belum ada NIK.\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-04-11', '08:22:10', '0000-00-00', '', '2025-04-11', '08:59:46', '', '126');
