	('110425PE249', 2, '6308054603910004', 'Murliani', '085931918429', 'Assalamualaikum umpat batakun cara menambh anggota keluarga di dlm kartu keluarga kaya apa..yg ulun tambahi ne anak', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, Saran kami sekaligus pengajuan Akta Kelahiran.\r\nUntuk pengajuan Akta Lahir, KIA, dan KK bisa sekaligus dengan mengajukan Akta Kelahiran untuk kelahiran Baru belum ada NIK.\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-04-11', '08:22:56', '0000-00-00', '', '2025-04-11', '08:58:23', '', '126'),
	('110425PE250', 2, '6308054603910004', 'Murliani', '085931918429', 'Assalamualaikum umpat batakun cara menambh anggota keluarga di dlm kartu keluarga kaya apa..yg ulun tambahi ne anak', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, Saran kami sekaligus pengajuan Akta Kelahiran.\r\nUntuk pengajuan Akta Lahir, KIA, dan KK bisa sekaligus dengan mengajukan Akta Kelahiran untuk kelahiran Baru belum ada NIK.\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-04-11', '08:23:01', '0000-00-00', '', '2025-04-11', '08:59:36', '', '126');
