	('110425PE251', 2, '6305090105630004', 'Bastian ', '085158896959', 'Bagaimana cara membuat kartu keluarga baru, karena kartu keluarga hilang? ', '', '', '', '', '', '', '', 'Untuk mencetak KK  Anda harus melampirkan syarat sbb :\r\n	1. Formulir F.1-02, (Pendaftaran)\r\n	2. Suket Hilang dari Keplolisian (Jika Hilang)\r\n	3. Formulir F.1-06, (Jika ada Perubahan)\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-04-11', '10:02:18', '0000-00-00', '', '2025-04-11', '10:11:06', '', '126'),
	('110425PE252', 5, '6305111712940001', 'Akhmad said', '082351560556', '6305111712940001', 'syarat/2025/04/11/362f2b058ec0334a7d68c9cf658b7449.jpg', 'syarat/2025/04/11/35665077e657bf0535546903dd66e4af.jpg', '', '', '', '', '', 'Izin informasi pengaduannya apa. Silahkan ajukan konsultasi baru selanjutnya dengan menginformasikan permasalahannya di kolom peihal. Terima Kasih. ', '3', '2025-04-11', '14:38:14', '0000-00-00', '', '2025-04-14', '07:07:31', '', '126'),
	('110625PE439', 2, '6203082611950001', 'Gazali rahman', '085753153812', 'Pindah ke pendudukan', '', '', '', '', '', '', '', 'Unruk pengajuan pindah silahkan lampirkan formulir F1.03 dan F1.02 untuk formulir bisa di download di menu download dan ajukan di menu kepindahan', '3', '2025-06-11', '09:07:05', '2025-06-11', '09:09:11', '2025-06-11', '09:11:26', '274', '274');
