	('110625PE440', 2, '6305031601940002', 'Hardiman', '082157329212', 'Minta barcode buat daftar aplikasi ikd', '', '', '', '', '', '', '', 'mohon maaf untuk pendaftaran IKD silahkan langsung ke kantor terimakasih', '3', '2025-06-11', '12:07:27', '0000-00-00', '', '2025-06-11', '12:11:15', '', '274'),
	('110725PE536', 2, '6306046304960001', 'RIMA REVIYANI', '081352551266', 'Mau minta cek kartu keluarga apakah sudah di pisah atau belum', '', '', '', '', '', '', '', 'Silahkan isi :\r\nNIK :\r\nKK :\r\nKeterangan :\r\n_(pemohon adalah termasuk dalam KK tersebut)_ Terima Kasih.', '3', '2025-07-11', '05:32:28', '0000-00-00', '', '2025-07-11', '06:44:00', '', '126'),
	('110725PE537', 2, '6306042804150001', 'RIMA REVIYANI', '081352551266', 'Mau tanya minta cek kan data KK apakah sudah pisah sama mantan suami apa belum', '', '', '', '', '', '', '', 'Mohon maaf ibu Rima, seharusnya anda minta informasi ke Dukcapil HSS bukan Dukcapil Tapin, karena ibu masih terdaftar di HSS. Karena kami tidak selalu bisa cek yang bukan domain Kami, semoga dapat dipahami. Terima Kasih.', '3', '2025-07-11', '07:02:49', '0000-00-00', '', '2025-07-11', '07:22:51', '', '126');
