	('110725PE538', 2, '6308030707990007', 'Ahmad', '082152480466', 'Akta dan kartu keluarga saya belum sampai sedangkan ketarangannya sudah dikirim dikantor pos', 'syarat/2025/07/11/65b2dbfad7f6f1b4795de476c75f065c.jpg', 'syarat/2025/07/11/515dc273b22533b9fe46060615bfe4e4.jpg', 'syarat/2025/07/11/f68da292135c9a96f797566210ebec28.jpg', 'syarat/2025/07/11/d7b69a99d76ed9092f761cd3df690d6c.jpg', 'syarat/2025/07/11/fbdf2f9013efb638d7b13ed137234c0f.jpg', 'syarat/2025/07/11/8579d64d41fb22e8bac8f03c2b371748.jpg', 'Baik akan kami cek terlebih dahulu no permohonan akta : 260625AL894, harap menunggu informasi selanjutnya. Terima Kasih', 'Setelah kami cek nomor permohonan Akta : 260625AL894.\r\nStatus : Terkirim Via POS\r\nTanggal : 30 Juni 2025\r\nNomor kontak petugas Pos : 0813-5295-2286.\r\nBukti pengiriman : Terlampir (cek permohonan di layanan konsutasi nomor : *110725PE538*', '3', '2025-07-11', '08:34:06', '2025-07-11', '08:42:53', '2025-07-11', '08:52:19', '126', '126'),
	('110725PE539', 2, '6305015007080003', 'Rahmatul aulia', '085821256660', 'minta informasi tentang e-KTP atas nama Rahmatul aulia dengan no nik 6305015007080003', '', '', '', '', '', '', '', 'Informasikan nomor permohonan KTP nya. Terima Kasih', '3', '2025-07-11', '10:13:25', '0000-00-00', '', '2025-07-11', '10:14:56', '', '126');
