	('110825PE629', 2, '6305114612030001', 'Putri eka rahayu ningsih', '085820406972', 'Saya kehilangan KIA anak saya apakah bisa dibuat kan lgi', '', '', '', '', '', '', '', 'Bisa, pilih Menu Cetak KIA, syarat ada setalah anda mengisi form isian. Yang pasti wajib ada surat keterangan Hilang. Terima Kasih.', '3', '2025-08-11', '10:49:01', '0000-00-00', '', '2025-08-12', '07:15:33', '', '126'),
	('110825PE630', 2, '6303102201940001', 'AHMAD NURIADI', '082252112432', 'Cara pindah dari Kabupaten tapin ke kabupaten Banjar????', '', '', '', '', '', '', '', 'Syarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n	1. Mengisi Formulir F-1.02 Permohonan (menu download formulir)\r\n	2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n	3. Kartu Keluarga dan KTP-el\r\n	4. Bukti Dukung Lainnya (jika ada alasan lain)\r\nTerima Kasih', '3', '2025-08-11', '12:16:08', '0000-00-00', '', '2025-08-12', '07:16:29', '', '126'),
	('110825PE631', 2, '6305015607060004', 'Puji Astuti', '085787749747', 'Apakah saudari Puji Astuti mempunyai berkas akta kelahiran?', 'syarat/2025/08/11/7c9dd5f82905621f59082a538b9e5fe5.jpg', '', '', '', '', '', '', 'Setelah kami cek, belum ada Akta Kelahiran yang tercatat di Database kami. Terima Kasih', '3', '2025-08-11', '14:41:12', '0000-00-00', '', '2025-08-12', '07:19:21', '', '126');
