	('110825PE632', 2, '6305015607060004', 'Puji Astuti', '085787749747', 'Apakah saudari Puji Astuti memiliki berkas Akta Kelahiran?', '', 'syarat/2025/08/11/4970e050643b83a147ab00efa564de74.jpg', '', '', '', '', '', 'Setelah kami cek, belum ada Akta Kelahiran yang tercatat di Database kami. Terima Kasih', '3', '2025-08-11', '15:00:38', '0000-00-00', '', '2025-08-12', '07:19:56', '', '126'),
	('110825PE633', 2, '6305013003250001', 'Chandra Lavanaa', '085787749747', 'Berkas Akta kelahiran', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, berikut syaratnya :\r\n	1. Foto Formulir F.2-01 (Kelahiran) yg sudah diisi --> Download Formulir\r\n	2. Foto Kartu Keluarga, \r\n	3. Foto Kutipan Buku Nikah (Jika Ada), /STPJM Kebenaran Suami-Istri\r\n	4. Foto KTP Orang Tua (Suami-Istri),\r\n	5. Foto Keterangan Lahir (bidan/dokter)Jika ada, /STPJM Kelahiran\r\n	6. Foto KTP Saksi 2 Org.\r\n	7. Surat Keterangan Hilang (Wajib jika hilang)\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-08-11', '15:04:39', '0000-00-00', '', '2025-08-12', '07:20:52', '', '126'),
