	('120225PE101', 4, '6305051003780002', 'Ahmad Fauzi', '085345461312', 'KTP blm datang dipos sdh 1 minggu', '', '', '', '', '', '', '', 'Mohon maaf sebelumya bapak KTP nya akan kami kirimkan hari ini dan silahkan siap kan berkas berkas nya seperti KTP lama nya,terimakasih', '3', '2025-02-12', '06:43:08', '0000-00-00', '', '2025-02-12', '08:06:12', '', '274'),
	('120225PE102', 5, '6305074110770001', 'Misna Wati', '085248084567', 'mengurus surat pindah', '', '', '', '', '', '', '', 'Untuk megurus Surat Pindah silahkan di menu *PINDAH* silahkan ibu/bapak ajukan disana dan  untuk formulirnya silahkan download di menu download Formulir. Terimakasih', '3', '2025-02-12', '06:51:54', '0000-00-00', '', '2025-02-12', '07:55:42', '', '274');
