	('120225PE103', 5, '6305014107950045', 'Siti aminah', '0882020528372', 'Maaf kak pencetakan ktp dan kia u ditangguhkan jer, yg kia kurang lampiran akta kelahiran jer, sdh u fto kan akta kelahiran nya tapi masih ditangguhkan. Trus ktp nya ditangguhkan jua jer karna salah form, trus disuruh meisi di form f1-0 disuruh download lagi, tapi u cari di download form kdd form f1-0 nya. Terimakasih', '', '', '', '', '', '', '', 'mohon maaf sebelumnya, untuk kia mau bikin baru atau mau pindah juga, soalnya yang dipengajuan ktp td kan di formulir f1-02 nya pindah datang. apakah mau pindah juga atau bikin baru aja, kalo bikin baru silahkan lingkari di formulir f1-02 kia baru. terimakasih', '3', '2025-02-12', '08:31:55', '0000-00-00', '', '2025-02-12', '08:37:40', '', '272'),
	('120225PE104', 4, '6305014107950045', 'Siti aminah', '0882020528372', 'Yg anggaran alamat nya berubah kia lawan ktp nya kak, soal nya yg lama kan masih alamaat PLN binuang. Kemaren sdh bulah surat pindah dan kk sdh pindah, cuma ini u hndak bulah ktp nya lagi lwn kia nya. Kemaren sdh u konsulkan disuruh centang di form ada gambar nya nih', 'syarat/2025/02/12/b5504ce4c893935423d80068f5957ba7.jpg', '', '', '', '', '', '', 'baik. bisa langsung jadikan satu aja berkas kk , ktp dan kia nya dan formulirnya di kolom ktp. kita proseskan.', '3', '2025-02-12', '08:49:12', '0000-00-00', '', '2025-02-12', '09:03:14', '', '272');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('120225PE105', 5, '6305074110770001', 'Misna Wati', '085248084567', 'Surat pindah', '', '', '', '', '', '', '', 'Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nSyarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n1. Mengisi Formulir F-1.02 (menu download formulir)\r\n2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n3. Kartu Keluarga dan KTP-el\r\nTerima Kasih', '3', '2025-02-12', '08:52:45', '0000-00-00', '', '2025-02-12', '15:48:09', '', '126'),
	('120225PE106', 4, '6305014107950045', 'Siti aminah', '0882020528372', 'Berarti ini u tinggal menunggu tuntung nya aja kah lagi atau u meaju akan beasa gsan bulah ktp dan kia nya ? Mun meaju akn beasa tahapan2 nya plih aapa2 ajj di menu2 nya', '', '', '', '', '', '', '', 'silahkan ajukan ke pengajuan ktp seperti tadi ibu. untuk fupload dokumen nya silahkan dilampirkan formulir f1-02, kk, ktp dan kia nya. terimakasih', '3', '2025-02-12', '09:15:03', '0000-00-00', '', '2025-02-12', '09:18:19', '', '272'),
	('120225PE107', 5, '6303085204910009', 'Riana', '081343275453', 'tidak bisa di buka link nya', '', '', '', '', '', '', '', 'mohon maaf sebelumnya LINK apa yang di maksud?', '3', '2025-02-12', '11:17:12', '0000-00-00', '', '2025-02-12', '12:20:15', '', '274');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('120225PE108', 5, '6305115404040002', 'Eva Aprilliana ', '081351397205', 'Mau ubah pendidikan di kartu keluarga \r\n', '', '', '', '', '', '', '', 'Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nSyarat :\r\n1. Mengisi Formulir F.1-02\r\n2. KK lama\r\n3. Izajah terakhir.\r\n4. Mengisi Formulir F.1-06\r\nDownload formulir di menu Download', '3', '2025-02-12', '14:03:48', '0000-00-00', '', '2025-02-12', '15:46:02', '', '126'),
	('120325PE181', 2, '3278104101940007', 'Pepi siti sopiah', '082295541426', 'Cara mendonlod hasil pengajuan skpwni', '', '', '', '', '', '', '', 'Silahkan cek pada Menu Lacak Permohonan, pilih Dokumen Terbit, nanti terlihat tanda/tulisan biru, klik untuk download. Terima Kasih', '3', '2025-03-12', '07:50:10', '0000-00-00', '', '2025-03-12', '07:57:19', '', '126'),
	('120325PE182', 2, '3278104101940007', 'Pepi siti sopiah', '082295541426', 'Tidak bisa d donlod dalam dokumen terbit ataupun dokumen d Terima \r\nMohon bantuannya kalau bisa d kirim d WA pdf nya atau di emaila', 'syarat/2025/03/12/84c4eb18ad63757a1b3ab27cd80f9374.jpg', '', '', '', '', '', 'Baik mohon menunggu, kita cek dl ke petugas kami. Terima Kasih ', 'Mohon beri nilai kami, Terima Kasih', '3', '2025-03-12', '08:01:19', '2025-03-12', '08:41:07', '2025-03-12', '09:16:02', '126', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('120325PE183', 5, '3278104101940007', 'Pepi siti sopiah', '082295541426', 'Tidak bisa mendonlod hasil pengajuan skpwni baik dari dokumen terbit ataupun dokumen diterima mohon bantuannya dikirim lewat email ataupun WA ', 'syarat/2025/03/12/e93cfccb997cd7b8ba74e2a843348f6d.jpg', '', '', '', '', '', 'Baik kami cek terlebih dahulu.', 'Mohon beri nilai kami, Terima Kasih', '3', '2025-03-12', '08:29:24', '2025-03-12', '08:42:57', '2025-03-12', '09:16:20', '126', '126'),
	('120325PE184', 2, '6308056001890001', 'Jumiati', '087844202188', 'Cara mengubah status di ktp', '', '', '', '', '', '', '', 'Untuk perubahan data silahkan download Surat Pernyataan Perubahan Elemen Data F-1.06 (pada menu Download Formulir) serta sertakan foto dokumen pendukung perubahan data. Terima Kasih', '3', '2025-03-12', '10:15:38', '0000-00-00', '', '2025-03-12', '10:48:58', '', '126'),
	('120325PE185', 5, '6305060808900001', 'Ismail ', '082352654840', 'memperbaharui Kartu Keluarga', 'syarat/2025/03/12/9c622ed39509fc718edaf68f24701098.jpg', '', '', '', '', '', '', 'Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. Dan untuk Permohonan Kartu Keluarga Anda bisa memilih Menu Perubahan KK pada aplikasi Pondok Dukcapil. Terima Kasih', '3', '2025-03-12', '11:17:23', '0000-00-00', '', '2025-03-12', '11:47:21', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('120325PE186', 2, '6305025310930001', 'Rahmi Aulina', '082353089490', 'Dokumen akta kelahirannya belum saya terima, tapi saya salah klik konfirmasi. Apakah tidak papa?', '', '', '', '', '', '', '', 'Dokumen apa yang Anda ajukan? mohon informasikan Nomor Permohonan Anda agar dapat kami lacak, Terima Kasih.\r\nSilahkan ajukan permintaan informasi Baru selanjutnya. Terima Kasih', '3', '2025-03-12', '12:03:48', '0000-00-00', '', '2025-03-12', '13:54:30', '', '126'),
	('120325PE187', 2, '6308054603910004', 'Murliani ', '085931918429', 'Assalamualaikum,Sudahkah kartu kluarga ulun. Bl sudah nyaman ulun ambil', '', '', '', '', '', '', '', 'Mohon informasikan/sertakan Nomor Permohonan Anda agar dapat kami lacak, Terima Kasih.\r\nSilahkan ajukan permintaan informasi Baru selanjutnya. Terima Kasih', '3', '2025-03-12', '12:59:26', '0000-00-00', '', '2025-03-12', '13:57:59', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('120325PE188', 2, '6472055204010004', 'Efi Esty', '081382041997', 'Permisi, saya kan kemaren pindah ktp ke bontang, dari dukcapil bontang bilang kalo mau cetak ktp tapi masih di luar kota katanya bisa cetak didukcapil daerah setempat yang penting kembalikan kk sama ktp lama. Jadi apa bisa ya saya cetak ktp bontang disini?', '', '', '', '', '', '', '', 'Cetak KTP-el luar domisili bisa dilakukan di Kabupaten Tapin dengan Syarat & Ketentuan berlaku, Cth : dengan alasan Hilang/Rusak. Silahkan kunjungi Kantor Disdukcapil Tapin untuk kepengurusan KTP-el luar domisili. Terima Kasih.', '3', '2025-03-12', '13:06:59', '0000-00-00', '', '2025-03-12', '14:02:45', '', '126'),
	('120325PE189', 2, '6305025310930001', 'Rahmi Aulina', '082353089490', 'Dokumen akta kelahiaran dengan nomor permohonan 120325AL364 kapan hasil dokumennya diupload agar bisa didownload?', '', '', '', '', '', '', 'Baik akan kami cek terlebih dahulu. Mohon menunggu.', 'Berkas sudah selesai dan sedang dalam proses pengiriman kantor POS (file pdf akta tidak di upload di aplikasi sebelum kami mendapat balikan register akta dr pemohon).\r\nKarena di Akta Lahir ada Register Akta yang wajib di ttd oleh Pemohon dan harus di kembalikan ke Dukcapil baru Kutipan dapat di Upload, mudahan dapat dimengerti. Tks', '3', '2025-03-12', '14:02:00', '2025-03-12', '14:10:54', '2025-03-12', '15:02:12', '126', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('120325PE190', 2, '6305025310930001', 'Rahmi Aulina', '082353089490', 'Ini kenapa belum diupload aja ya dokumen hasil permohonan pembuatan akta kelahiran dengan nomor permohonan 120325AL364? Tolong dong min. Ga sengaja kepencet konfirmasi tadi', 'syarat/2025/03/12/aadbf0c7ae907235a42cb9e5fb9d9b53.jpg', '', '', '', '', '', '', 'Berkas sudah selesai dan sedang dalam proses pengiriman kantor POS (file pdf akta tidak di upload di aplikasi sebelum kami mendapat balikan register akta dr pemohon).\r\nKarena di Akta Lahir ada Register Akta yang wajib di ttd oleh Pemohon dan harus di kembalikan ke Dukcapil baru Kutipan dapat di Upload, mudahan dapat dimengerti. Tks', '3', '2025-03-12', '14:27:47', '0000-00-00', '', '2025-03-12', '15:02:43', '', '126'),
	('120425PE253', 5, '6305111712940001', 'AKHMAD SAID', '082351560556', 'Mengubah alamat pindah ke\r\nJL PASAR MINGGU RT 010 RW 002\r\nSIMPANG EMPAT SUNGAI BARU', '', '', '', '', '', '', '', 'Terima kasih, Anda dpt melakukan permohonan pindah dengan memenuhi syarat (cek di menu perayaratan). Sebelumnya untuk melakukan pengajuan, Anda anda harus regestrasi terlebih dahulu. ', '3', '2025-04-12', '06:35:45', '0000-00-00', '', '2025-04-14', '07:00:37', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('120625PE441', 5, '6305100808750002', 'HAMBERI ', '082254899506', 'Permisi saya ingin pindah alamat dari tapin ke kandangan dengan alasan kesehatan saya dan saya sudah ceray dengan istri saya di tapin', '', '', '', '', '', '', '', 'Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nSyarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n	1. Mengisi Formulir F-1.02 Permohonan (menu download formulir)\r\n	2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n	3. Kartu Keluarga dan KTP-el\r\nTerima Kasih', '3', '2025-06-12', '09:28:11', '0000-00-00', '', '2025-06-12', '10:19:42', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('120625PE442', 2, '6305061101980002', 'JAHRATUN NISA', '08195107190', 'Nama		: JAHRATUN NISA\r\nNIK		: 6305061101980002\r\nNomor KK	: 6305062002080258\r\nPengaduan	: cek biodata KTP dan kartu keluarga ini apakah valid, untuk keperluan input data disistem sekolah dasar 2 landasan ulin utara banjarbaru. Kami cek berdasarkan sistem sekolah data nik tidak sesuai sama nama.', 'syarat/2025/06/12/57beb6b09694dcdb8a4708b2181d8d3e.jpg', '', '', '', '', '', 'Baik akan kami bantu cek data, mohon bersabar menunggu. Terima Kasih', 'Di dalam No KK : 6305062002080258 tidak ada anggota yang bernama JAHRATUN NISA, dan NIK 6305061101980002 adalah milik dengan nama NORZIANNOR dan sudah ber-KTP elektronik. Mohon kiranya lampirkan KK Asli, karena yang di tampilkan adalah fotocopy nya saja, dan perkiraan kami KK yang dilampirkan adalah editan. Terima Kasih', '3', '2025-06-12', '17:47:20', '2025-06-12', '20:14:12', '2025-06-13', '08:26:39', '126', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('120625PE443', 2, '6305050207000001', 'Muhamad zaini ghani', '085828411924', 'Langkah langkah pengajuan pindah dari kabupaten tapin ke kabupaten tapin, dan persyaratannya', '', '', '', '', '', '', '', 'Persyaratan :\r\n1. Mengisi Formulir F. 1-02 (Permohonan) \r\n2. Mengisi Formulir F. 1-03 (Pindah) \r\n3. Kartu Keluarga\r\n4. KTP\r\nPada Aplikasi, pilih Menu Pindah, isi form, lalu upload foto-foto persyaratan, lalu kirim. \r\nSemoga dapat membantu, terima kasih. ', '3', '2025-06-12', '18:02:08', '0000-00-00', '', '2025-06-12', '20:12:03', '', '126'),
	('120625PE444', 2, '6305050207000001', 'Muhamad zaini ghani', '085828411924', 'Cara pindah dari tapin ke kabupaten lain, dan syaratnya, harus kemana aja', '', '', '', '', '', '', '', 'Persyaratan :\r\n1. Mengisi Formulir F. 1-02 (Permohonan) \r\n2. Mengisi Formulir F. 1-03 (Pindah) \r\n3. Kartu Keluarga\r\n4. KTP\r\nPada Aplikasi, pilih Menu Pindah, isi form, lalu upload foto-foto persyaratan, lalu kirim. \r\nSemoga dapat membantu, terima kasih. ', '3', '2025-06-12', '18:13:59', '0000-00-00', '', '2025-06-12', '20:12:33', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('120825PE634', 5, '6305114512850001', 'Riski Fuji lestari ', '082254188263', 'Mau merubah dat yang salah\r\nYang di status perkawinan:cerai hidup jadikan kawin', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, berikut syaratnya :\r\n	1. Foto Formulir F.1-06 (Perubahan elemen data) yg sudah diisi --> Download Formulir\r\n	2. Foto Kartu Keluarga\r\n	3. Foto Kutipan Buku Nikah (jika sdh menikah)\r\n	4. Foto KTP\r\n	5. Foto Akta\r\n	6. Foto Dokumen Pendukung (Izajah, dll) / Putusan Pengadilan tentang perubahan Nama\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-08-12', '07:59:40', '0000-00-00', '', '2025-08-12', '08:08:15', '', '126'),
	('120825PE635', 2, '6305060406700002', 'Ardiansyah', '082159441776', 'Minta file pdf kk dan akta kelahiran ', 'syarat/2025/08/12/9f84acfe8201861adb1e0834fd220e38.jpg', 'syarat/2025/08/12/cd01311cb2829897bafd67486fe6f22d.jpg', 'syarat/2025/08/12/8ce2ff6182f9bdad81e0a0ebbd92eb9b.jpg', '', '', '', 'Baik mohon mengunggu kami cek dan proses terlebih dahulu....', 'Berikut kami lampirkan pdf Akta dan KK yang diminta, Silahkan masuk ke menu Layanan Konsultasi, pilih Cari permohonan, paste/ketik nomor permohonan berikut ini (120825PE635)', '3', '2025-08-12', '08:16:56', '2025-08-12', '08:31:54', '2025-08-12', '08:52:14', '126', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('120825PE636', 2, '6305061405960002', 'Kursani', '081522520035', 'Minta file pdf kk ', 'syarat/2025/08/12/ee0a25b0ec02efeb1badab646b61d04e.jpg', 'syarat/2025/08/12/84a41ef1adff0c6f342f16bc337bcc7e.jpg', 'syarat/2025/08/12/4385a75400663f3436bd1cf59fa5a7b6.jpg', '', '', '', 'Kami hanya bisa memberikan KK An, Kursani sesuai pemohon, harap menunggu kami proses terlebih dahulu...', 'Berikut kami lampirkan pdf KK yang diminta, Silahkan masuk ke menu Layanan Konsultasi, pilih Cari permohonan, paste/ketik nomor permohonan berikut ini (120825PE636)', '3', '2025-08-12', '08:21:45', '2025-08-12', '08:34:34', '2025-08-12', '08:50:41', '126', '126'),
	('120825PE637', 5, '3574032203910001', 'Reri Aringga', '081334283771', 'jika anak kembar untuk pembuatan akta kelahiran secara online apakah 2 X, atau bagaimana?', '', '', '', '', '', '', '', 'Betul karena 2 orang, jadi nanti diberi keterangan pada kolom catatan _kembar ke-1_ , dan di pengajuan berikutnya _kembar ke-2_ .\r\nTerima Kasih', '3', '2025-08-12', '09:06:21', '0000-00-00', '', '2025-08-12', '09:15:42', '', '126'),
	('120825PE638', 2, '6305074605920002', 'Erica putri mentari ', '08152003233', 'Sudah ganti foto ktp..kapan boleh ganti lagi?kurang cakep saya nya', 'syarat/2025/08/12/dc9e5848d5285d8e967fc8669150b8b7.jpg', '', '', '', '', '', '', 'Kapan-kapan, bila rusak atau hilang silahkan sekaligus ganti foto. Terima Kasih.', '3', '2025-08-12', '12:06:22', '0000-00-00', '', '2025-08-12', '13:49:55', '', '126');
