	('130125PE22', 5, '6305056910820001', 'Raudah, S.Pd', '085842420042', 'Menghapus gelar di KTP dan KK ', 'syarat/2025/01/13/cac57a400c40ada5bef6b5366a420180.jpg', 'syarat/2025/01/13/5cbe19ef3cbd6a83a0792c2254da4c1b.jpg', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil,\r\nUntuk menghapus gelar, anda harus mengajukan permohonan KK dan KTP tentunya, \r\nSyarat : \r\nFormuir F.1-02 (permohonan)\r\nFormulir F.1-06 (perubahan)\r\nBawa KK Asli dan KTP Asli (untuk berkas di tukar Lama ke Asli) di Disdukcapil.\r\nSaran : karena 2 dokumen sekaligus lebih baik datang langsung ke Kantor Dukcapil.\r\nTerima Kasih', '3', '2025-01-13', '06:56:45', '0000-00-00', '', '2025-01-13', '07:29:05', '', '126');
