	('130125PE23', 5, '6305091009990004', 'RAHMADI', '081250825812', 'cabut berkas kk ikut orang tua.\r\nbikin kk sendiri.', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil.\r\nApabila pisah KK masih di alamat yang sama syaratnya adalah :\r\n1. Formulir Permohonan F.1-02 (menu download formulir)\r\n2. KK Asli\r\ndan apabila alamat di luar domisili desa/kecamatan/kabupaten berbeda syaratnya adalah :\r\n1. Mengisi Formulir F-1.02 (menu download formulir)\r\n2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n3. Kartu Keluarga dan KTP-el\r\nTerima Kasih.\r\nNote : Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\n\r\n', '3', '2025-01-13', '09:43:20', '0000-00-00', '', '2025-01-13', '14:38:44', '', '126');
