	('130125PE24', 5, '6305032705160002', 'MAHMUD ARRAZI', '085189382869', 'Pengajuan pembuatan Kartu Identitas Anak (KIA) Baru', 'syarat/2025/01/13/b2eb1d35cad4bc02faec41cd75ad1e76.jpg', 'syarat/2025/01/13/995b6b2648ea9a702fee7539982664ed.jpg', 'syarat/2025/01/13/54dd1679e16cc091e3350d8731d26d20.jpg', 'syarat/2025/01/13/9e9811bb4c16d0c71ca4be816a4a748e.jpg', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil,\r\nSyarat permohonan KIA adalah :\r\n1. Fotokopi Kutipan Akta Kelahiran dan menunjukkan Kutipan Akta Kelahiran aslinya.\r\n2. KK asli orang tua/wali\r\n3. Foto anak berwarna ukuran 3x4 sebanyak 2 (dua) lembar untuk anak 5 ke atas, dibawah 5 tahun tidak perlu Foto anak.\r\n\r\nUntuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nTerima Kasih.', '3', '2025-01-13', '10:03:15', '0000-00-00', '', '2025-01-13', '14:42:36', '', '126');
