	('130125PE25', 5, '6305064104680003', 'SANIAH', '082271145699', 'Mau merubah status perkawinan di KTP agar sama dengan di KK', 'syarat/2025/01/13/6002f7596643f342c62329278af5d93b.jpg', 'syarat/2025/01/13/7774be442806e5cd448055b5b8aadb7f.jpg', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil,\r\nSyarat :\r\n1. KTP Lama (blm berubah)\r\n2. Kartu Keluarga\r\n3. Buku/Surat Nikah.\r\n4. Mengisi Formulir F-1.02 (menu download formulir)\r\n\r\nUntuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nDownload Aplikasi Pondok Dukcapil berbasis Android di link berikut :\r\nhttps://drive.google.com/file/d/19kCzRnajLBkFC93WoHci7XqUplwXUpFQ/view?usp=sharing\r\natau di Website : https://pondok.dukcapil.tapinkab.go.id/\r\nTerima Kasih', '3', '2025-01-13', '10:40:29', '0000-00-00', '', '2025-01-13', '14:46:01', '', '126');
