	('130125PE28', 5, '6307054202890001', 'Misfiati', '0882019599308', 'KTP hilng ', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil,\r\nUntuk mencetak KTP hilang Anda harus membuat *Surat Keterangan Hilang* dari Kepolisian terlebih dahulu, dan itu sebagai syarat pengajuan cetak ulang KTP karena hilang.\r\nUntuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu.\r\nDownload Aplikasi Pondok Dukcapil berbasis Android di link berikut :\r\nhttps://drive.google.com/file/d/19kCzRnajLBkFC93WoHci7XqUplwXUpFQ/view?usp=sharing\r\nAtau Website : https://pondok.dukcapil.tapinkab.go.id/\r\n', '3', '2025-01-13', '18:24:03', '0000-00-00', '', '2025-01-14', '06:43:26', '', '126'),
	('130225PE109', 4, '6305074110770001', 'Misnawati', '081348946226', 'Pindah alamat ke luar pulau jawa', '', '', '', '', '', '', '', 'Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nSyarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n1. Mengisi Formulir F-1.02 (menu download formulir)\r\n2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n3. Kartu Keluarga dan KTP-el\r\nTerima Kasih', '3', '2025-02-13', '07:26:56', '0000-00-00', '', '2025-02-13', '07:56:07', '', '126');
