	('130225PE110', 4, '6305061011930001', 'Rendy hermawan', '085346300435', 'Ingin memperbaiki data kk dan ktp yang salah di aplikasi tapi ditolak karna lagi proses pengajuan pindah, pada tahun 2018 pengajuan pindah, tapi sekarang kada jadi pindah dan tidak diurus lagi pengajuannya', 'syarat/2025/02/13/f75445364f905fb7b25dfa7ee12f81ab.jpg', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil. Proses pindahnya kami batalkan, silahkan melakukan pengajuan ulang Aplikasi.', '3', '2025-02-13', '07:54:29', '0000-00-00', '', '2025-02-13', '08:10:21', '', '126'),
	('130225PE111', 5, '6305074110770001', 'Misnawati', '081348946226', 'No KK lupa', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil. Untuk keamanan lebih lanjut, isi bagian berikut pada pengaduan selanjutnya untuk mendapatkan nomor kk anda.\r\nNama Lengkap Ibu :\r\nNama Lengkap Ayah :\r\nTerima Kasih', '3', '2025-02-13', '08:08:17', '0000-00-00', '', '2025-02-13', '08:28:37', '', '126'),
	('130225PE112', 5, '6305061011930001', 'Rendy hermawan', '085346300435', 'Pengajuan perubahan nama ditulak karna ada proses pengajuan proses pindah domisili, disuruh isi formulir pembatalan pindah bagaimana saya dapat formulirnya', 'syarat/2025/02/13/b1a25ec155425167982e47083158673c.jpg', 'syarat/2025/02/13/4b3d8bac95922c7eed98b9dde31a4a66.jpg', '', '', '', '', '', '', '3', '2025-02-13', '08:39:45', '0000-00-00', '', '2025-02-13', '08:48:27', '', '272');
