	('130225PE117', 4, '6305061011930001', 'Randy hermawan', '085346300435', 'Sebelumnya terimakasih untuk perubahan kartu keluarga sudah selesai tapi untuk perubahan ktp bagaimana apah karus melakukan pengajuan lagi untuk melakukan perubahan KTP', '', '', '', '', '', '', '', 'Seharusnya sekaligus, dengan infromasi KK dan KTP. Tapi karena maksud belum tersampaikan, silahkan ajukan kembali untuk KTP nya. Tks', '3', '2025-02-13', '11:18:14', '0000-00-00', '', '2025-02-13', '11:52:07', '', '126');
