	('130225PE119', 5, '6305074110770001', 'Misnawati', '081348946226', 'Cetak KK \r\nNo KK\r\nNo KK nya 6305073101180003\r\nNama  ibu tasniah\r\nNama ayah zakaria', 'syarat/2025/02/13/1b3981860e0178778bfb6ee6631f4eec.jpg', '', '', '', '', '', '', 'Silahkan ajukan permohonan di Aplikasi Pondok Dukcapil. Bukan lewat pengaduan.\r\nUntuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. ', '3', '2025-02-13', '12:55:46', '0000-00-00', '', '2025-02-13', '14:45:42', '', '126');
