	('130225PE120', 5, '6305014710070001', 'Raisya Azzahra', '6285751151850', 'ULUN HANDAK MENCETAK KTP, SUDAH PEREKAMAN DI KANTOR KECAMATAN BINUANG', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, pian bisa membawa persyaratannya ke kantor Dukcapil di Rantau, nanti lapor sama petugas bahwa sudah rekam di Kecamatan.\r\nUntuk mencetak KTP baru Anda harus melampirkan syarat sbb :\r\n1. Formulir F.1-02, (isi di dukcapil nanti)\r\n2. KK, \r\n3. Akta / Izajah.\r\nTerima Kasih\r\n', '3', '2025-02-13', '19:52:05', '0000-00-00', '', '2025-02-14', '07:23:12', '', '126'),
	('130225PE121', 5, '6305012506870001', 'Pansuri', '6281520396355', 'File aktanya dan kartu keluarga belum ada mau cetak sendiri ', '', '', '', '', '', '', '', 'Apakah aktanya sudah sampai? kalo sudah ada foto akta dan kknya kirimkan ke nomor 082255252914. Kalo sudah nanti dikirimkan file akta dan kknya, buat tanda bukti bahwa aktanya sudah sampai tujuan. Terimakasih', '3', '2025-02-13', '19:28:50', '0000-00-00', '', '2025-02-14', '07:06:21', '', '148'),
	('130325PE191', 2, '6305016901010001', 'NOOR LAILA SHAUMI', '085754134117', 'bagaimana caranya memperbaiki ktp yg rusak', '', '', '', '', '', '', '', 'Untuk mencetak KTP rusak Anda harus melampirkan syarat sbb :\r\n1. Formulir F.1-02, \r\n2. KK, \r\n3. KTP Rusak \r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-03-13', '12:31:48', '0000-00-00', '', '2025-03-13', '13:17:40', '', '126');
