	('130325PE192', 2, '6305010106970005', 'Bambang lestari', '085822767993', 'Bpk/ibu saya mau tanya bs gk ngurus akta kelahiran bayi yg blm memiliki NIK ngurus nya bs lewat online/hrs ke dukcapil nya lngsng?\r\n', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil.\r\nBisa sekali lewat Online atau Langsung ke Dukcapil, untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nTerima Kasih.', '3', '2025-03-13', '22:56:00', '0000-00-00', '', '2025-03-14', '07:31:17', '', '126'),
	('130425PE254', 2, '6305086102020001', 'jamâ€™iyatul hasanah', '082252135646', 'saya mau bikin KK baru sekalian suami saya pindah alamat dari samarinda-rantau, tapi saya tanya kemarin katanya harus datang langsung, bagaimana dgn sekarang posisi saya lg di samarinda dan bisa kah mengurus nya lewat online saja.. ', '', '', '', '', '', '', '', 'Harus ada Surat Keterangan Pindah dari tempat asal (Samarinda). \r\nSaran : Kalau Ibu posisi ada di samarinda, silahkan urus sekalian Surat Pindah suaminya dari sana dengan tujuan  Kab.Tapin. Kalau sdh terbit disana baru Ibu ajukan Online untuk pembuatan KK baru bersama suami. Demikian informasinya. ', '3', '2025-04-13', '06:50:44', '0000-00-00', '', '2025-04-14', '07:05:19', '', '126');
