	('140125PE29', 5, '6305055512010001', 'Siti Musyafah ', '082148649680', 'Kenapa ko aga ribet yah mengurusnya', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil,\r\nSilahkan infokan nomor transaksi Anda, biar kami lacak permohonan Anda.\r\nMasukan :\r\nSilahkan penuhi semua syarat yang di sarankan Petugas.\r\nTerima Kasih', 'Petunjuk Permohonan ada pada menu Tutorial, semoga dapat membantu.\r\nTerima Kasih.', '3', '2025-01-14', '09:25:34', '2025-01-14', '11:25:29', '2025-01-16', '09:52:08', '126', '126'),
	('140225PE122', 4, '3509202302850004', 'FEBTU ARISANDI', '085959041457', 'Ijin menanyakan perkembangan permohonan kedatangan dari luar provinsi, untuk pencetakan KK, KTP Elektronik dan KIA untuk nomor permohonan 110225DT241 atas nama Febtu Arisandi. Berkas asli sudah saya kirimkan melalui pos per tanggal 12 Februari 2025 dengan nomor paket P2502120011023 dan diterima oleh Amau pada tanggal 13 Februari 2025 pukul 08.41 WITa', 'syarat/2025/02/14/f22fe05db1a2ef850ebf33697c817bc9.jpg', 'syarat/2025/02/14/d1f489f857c257b2bef1a22b63132af4.jpg', '', '', '', '', '', 'Info operator barang sudah di ambil oleh pihak Pos, mohon maaf karena kolektif kami tidak bisa menyampaikan nomor paketnya, Terima Kasih.', '3', '2025-02-14', '07:08:48', '0000-00-00', '', '2025-02-14', '07:53:51', '', '126');
