	('140225PE123', 5, '5207081605990001', 'Yusril', '085656368384', 'Min, apakah bisa dibantu file PDF KK saya?\r\nAtau bisa di improve aplikasinya bisa download mandiri file kk di aplikasi ini', '', '', '', '', '', '', '', 'Izin, pian ajukan aja permohonan kk di menu perubahan KK, nanti kalau sdh selesai KK pdfnya biasa di kirim di aplikasi dan bisa d download pemohon. Tks', '3', '2025-02-14', '08:13:57', '0000-00-00', '', '2025-02-14', '09:07:18', '', '126'),
	('140225PE124', 5, '6305121503750001', 'MAWARDI', '082125602724', 'SALAH CETAK NAMA,TITIN SUMARNI/TERCETAK:TITIN SUMARMI,', 'syarat/2025/02/14/6148ee94190bbc165d37787cb662045c.jpg', '', '', '', '', '', '', 'Untuk mencetak KTP perubahan Anda harus melampirkan syarat sbb :\r\n1. Formulir F.1-02, (download di menu formulir)\r\n2. Formulir F.1-06, (download di menu formulir)\r\n3. KK, \r\n4. KTP\r\n5. Dokumen pendukung perubahan. \r\nSebelumnya anda harus daftar Akun terlebih dahulu agar dapat menggunakan layanan ini. Tks', '3', '2025-02-14', '14:25:32', '0000-00-00', '', '2025-02-15', '10:03:27', '', '126');
