	('140225PE125', 4, '6305061011930001', 'Randy Hermawan', '085346300435', 'Berkas kemaren yg pembaharuan nama yg salah yg sudah dikirim kekantor pos apakah cuman ktp aja, untuk kartu keluarganya seperti apa', '', '', '', '', '', '', '', 'Biasa untuk KK di upload petugas, Silahkan cek di menu Lacak...biasa ada pdf dilampirkan, apabila masih terkandala silahkan ajukan pengaduan/konsultasi lagi dengan menuliskan ID TRx atau id transaksinya biar dapat kami bantu lacak. Tks', '3', '2025-02-15', '06:48:28', '0000-00-00', '', '2025-02-15', '09:54:08', '', '126'),
	('140225PE126', 4, '6305051505830003', 'Muhammad Dipa Syahbana', '081347163224', 'Kami operator dapodik di SMAN 1 Candi Laras Selatan. Selama kami menangani dapodik, sekarang sering terjadi ketidakpadanan antara data anak di ijazah dengan data pada kartu keluarga. Sehingga kami sering kesulitan dalam proses update data siswa. Apakah ada cara agar kami mudah meminta cek data atau perubahan data anak?\r\nKalau kami menunggu anak melakukan perubahan data di dukcapil, sering data yang harus diupdate jadi tidak terupdate karena mereka tidak melakukan perubahan data di dukcapil.', '', '', '', '', '', '', '', 'Terima Kasih telah menghubungi kami, untuk lebih lanjut untuk permasalahan data bisa chat langsung ke nomor wa (0822-4678-7329) pada jam kerja. Tks', '3', '2025-02-14', '15:56:48', '0000-00-00', '', '2025-02-15', '10:00:28', '', '126');
