	('140325PE193', 2, '6305014211080001', 'Sri mulyani', '0882021051410', 'Ktp nya udh jdi kah bisa di ambil di kantor pos kah kak', '', '', '', '', '', '', '', 'Mohon izin, sertakan Nomor Permohonan KTP nya agar dapat kami Lacak.\r\nSilahkan ajukan Konsultasi Baru dan sertakan Nomor Permohonan KTP nya, Terima Kasih', '3', '2025-03-14', '08:52:31', '0000-00-00', '', '2025-03-14', '09:08:49', '', '126'),
	('140325PE194', 2, '6305045512020001', 'Nurul Ainah', '085753141303', 'Informasi pembuatan KTP ELEKTRONIK', '', '', '', '', '', '', '', 'Untuk mencetak KTP  Anda harus melampirkan syarat sbb :\r\n1. Formulir F.1-02, (Pendaftaran)\r\n2. Kartu Keluarga, \r\n3. KTP Rusak/Ganti (Jika Rusak/Ganti)\r\n4. Suket Hilang dari Keplolisian (Jika Hilang)\r\n5. Formulir F.1-06, (Jika ada Perubahan)\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-03-14', '11:39:02', '0000-00-00', '', '2025-03-17', '07:42:33', '', '126');
