	('140325PE195', 2, '6308054603910004', 'Murliani ', '085931918429', 'ASSALAMUALAIKUM Sudahkah tuntung , jd kah sudah ktp dan kk ulun.\r\n060325DT376', '', '', '', '', '', '', 'Baik akan kami cek terlebih dahulu, mohon menunggu Informasi selanjutnya.', 'Seletah kami cek data terkonfirmasi Selesai pada tanggal 07-03-2025. \r\nUntuk cek dokumen Kartu keluarga silahkan cek pada Menu Lacak Permohonan untuk download File KK, dan untuk KTP terkonfirmasi sudah di ambil Pihak Kantor Pos dari Dukcapil, silahkan coba cek ke Kantor Pos. Terima Kasih', '3', '2025-03-14', '14:01:56', '2025-03-17', '07:49:48', '2025-03-17', '08:11:12', '126', '126'),
	('140325PE196', 2, '6308054603910004', 'Murliani ', '085931918429', 'ASSALAMUALAIKUM Sudahkah tuntung , jd kah sudah ktp dan kk ulun.\r\n060325DT376', '', '', '', '', '', '', '', 'Seletah kami cek data terkonfirmasi Selesai pada tanggal 07-03-2025. \r\nUntuk cek dokumen Kartu keluarga silahkan cek pada Menu Lacak Permohonan untuk download File KK, dan untuk KTP terkonfirmasi sudah di ambil Pihak Kantor Pos dari Dukcapil, silahkan coba cek ke Kantor Pos. Terima Kasih', '3', '2025-03-14', '14:02:11', '0000-00-00', '', '2025-03-17', '08:13:40', '', '126');
