	('140325PE197', 2, '6308054603910004', 'Murliani ', '085931918429', 'ASSALAMUALAIKUM Sudahkah tuntung , jd kah sudah ktp dan kk ulun. No permohonan \r\n060325DT376 ats nama murliani. Bl sdah kabari nyaman ulun ambil k kantorpos', '', '', '', '', '', '', '', 'Seletah kami cek data terkonfirmasi Selesai pada tanggal 07-03-2025. \r\nUntuk cek dokumen Kartu keluarga silahkan cek pada Menu Lacak Permohonan untuk download File KK, dan untuk KTP terkonfirmasi sudah di ambil Pihak Kantor Pos dari Dukcapil, silahkan coba cek ke Kantor Pos. Terima Kasih', '3', '2025-03-14', '14:04:31', '0000-00-00', '', '2025-03-17', '08:14:05', '', '126'),
	('140425PE255', 2, '6305044508830003', 'Apriyanti ningsih', '08161116450', 'Mohon update data karena tidak bisa buka rekening dengan keterangan belum update ktp', 'syarat/2025/04/14/1ab922a0e08366ffb9d2507bce879765.jpg', 'syarat/2025/04/14/0b451486dd4a59b2be9dba4128dbcb4b.jpg', '', '', '', '', '', 'Mohon maaf sebelumnya apakah ibu sudah melakukan perekaman e-KTP karena data yang kami cek NIK ibu belum melakukan Rekam E-Ktp. Terimakasih', '3', '2025-04-14', '08:35:02', '0000-00-00', '', '2025-04-14', '09:29:45', '', '274');
