	('140425PE256', 2, '6305060301790001', 'Maksum', '081219017863', 'Mohon Ma\'af kenapa Kartu keluarga uln belum terbit juga', 'syarat/2025/04/14/cd74805450a301587e140a98fc29c6e9.jpg', '', '', '', '', '', '', 'Mohon tuliskan nomor Permohonan KK Anda agar dapat kami Lacak, Terima Kasih.\r\nSilahkan buat Pengaduan Baru dengan menginformasikan Nomor Permohonan Anda.', '3', '2025-04-14', '10:09:54', '0000-00-00', '', '2025-04-15', '08:10:20', '', '126'),
	('140425PE257', 2, '6305013107950001', 'dicky nor aditya', '081348135243', 'perbaikan ktp rusak ', '', '', '', '', '', '', '', 'Untuk mencetak KTP  Anda harus melampirkan syarat sbb :\r\n	1. Formulir F.1-02, (Pendaftaran)\r\n	2. Kartu Keluarga, \r\n	3. KTP Rusak/Ganti (Jika Rusak/Ganti)\r\n	4. Suket Hilang dari Keplolisian (Jika Hilang)\r\n	5. Formulir F.1-06, (Jika ada Perubahan)\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-04-14', '10:59:45', '0000-00-00', '', '2025-04-15', '08:11:02', '', '126');
