	('140425PE258', 2, '6305064501990001', 'RAHMAH', '082252360459', 'Tadi uln masukan data untuk buat kk baru dan ganti status di Ktp jadi kawin tapi ditolak tolong bantu dong ka supaya bisa tidak ditolak lagi ', '', '', '', '', '', '', '', 'Biasa Petugas memberi pesan, mohon di cek di notifikasi WA anda dari Pondok Dukcapil.\r\nBiasa syarat nya adalah, KK lama masing2 pasangan, Buku Nikah, KTP Lama masing2, dan Mengisi Formulir F.1-02 (download di menu Download Formulir)\r\nTerima Kasih', '3', '2025-04-14', '11:27:21', '0000-00-00', '', '2025-04-15', '08:13:45', '', '126'),
	('140425PE259', 2, '6305050207000001', 'Muhamad Zaini Ghani', '085828411924', 'Persyaratan Mengajukan permohonan KK Baru, yg hanya memiliki KTP dan belum pernah membikin KK', '', '', '', '', '', '', '', 'Secara aturan KTP terbit dengan persyaratan Kartu Keluarga (Lama/numpang/dll), mohon kiranya dapat di cek terlebih dahulu KK Asal/Lama nya.\r\nApabila Kk Hilang, silahkan membuat Surat Keterangan Hilang dari Kepolisian. Terima Kasih', '3', '2025-04-14', '12:39:35', '0000-00-00', '', '2025-04-15', '08:16:07', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('140425PE260', 2, '6305055004070001', 'Siti Fadillah ', '085347735001', 'Kak kalonyaa ingin datang langsung ke kantor dukcapil dengan tujuan ingin merubah nama di akta,KK, KTPnya agar sama dengan ijazah ini sudah pernah uln konsultasikan secara online dan kata admin datang langsung ke kantor..adakah persyaratan yang harus dibawa atau konsultasi terlebih dahulu kesana.', '', '', '', '', '', '', '', 'Yang pasti bawa Izasah (SD,SMP, sdt) Anda sebagai dasar Perubahan, untuk formulir lainnya bisa di isi nanti di dukcapil, diharapkan langsung yang bersangkutan yang datang untuk mempermudah prosesnya. Terima Kasih', '3', '2025-04-14', '12:52:08', '0000-00-00', '', '2025-04-15', '08:18:17', '', '126'),
	('140425PE261', 2, '6305061903990002', 'Muhammad Fahmi Arif', '085651041723', 'Bisakah saya melakukan perpindahan sekaligus perubahan KK,karena saya baru melaksanakan pernikahan', '', '', '', '', '', '', '', 'Bisa, tapi saran kami lakukan dulu perkawinan-nya, baru merubah KK, kecuali anda pindahnya ke luar kabupaten untuk mempermudah proses, silahkan pindah terlebih dahulu. Terima Kasih.', '3', '2025-04-14', '20:41:30', '0000-00-00', '', '2025-04-15', '08:20:15', '', '126');
