	('140525PE367', 5, '6305026707970003', 'Tuti Alawiyah', '082286895198', 'assalamualaikum bapak /ibu. ulun hndk btakun kyp mun ktp hilang kwlh dicetak akan beasa ', '', '', '', '', '', '', '', 'Waalaikumsalam. Bisa banar Bu.\r\nUntuk mencetak KTP  Anda harus melampirkan syarat sbb :\r\n	1. Formulir F.1-02, (Pendaftaran)\r\n	2. Kartu Keluarga, \r\n	3. KTP Rusak/Ganti (Jika Rusak/Ganti)\r\n	4. Suket Hilang dari Kepolisian (Jika Hilang)\r\n	5. Formulir F.1-06, (Jika ada Perubahan)\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-05-14', '08:05:19', '0000-00-00', '', '2025-05-14', '08:16:58', '', '126'),
	('140525PE368', 5, '6305014907990003', 'Noor laila', '082149344812', 'Tentang kartu keluarga', '', '', '', '', '', '', '', 'Silahkan ajukan pada Menu Perubahan KK', '3', '2025-05-14', '10:06:08', '0000-00-00', '', '2025-05-14', '11:11:27', '', '126'),
	('140525PE369', 2, '6305104210940001', 'Husnul Kahtimah', '085391800524', 'Bagaiaman cetak ulang KTP yg hilang dimainin anak', '', '', '', '', '', '', '', 'Untuk mencetak KTP  Anda harus melampirkan syarat sbb :\r\n	1. Formulir F.1-02, (Pendaftaran)\r\n	2. Kartu Keluarga, \r\n	3. KTP Rusak/Ganti (Jika Rusak/Ganti)\r\n	4. Suket Hilang dari Kepolisian (Jika Hilang)\r\n	5. Formulir F.1-06, (Jika ada Perubahan)\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-05-14', '11:45:47', '0000-00-00', '', '2025-05-14', '12:41:39', '', '126');
