	('140525PE370', 2, '6305046907940003', 'Lisa aflaha', '085821841325', 'Kehilangan ktp', '', '', '', '', '', '', '', 'Untuk mencetak KTP  Anda harus melampirkan syarat sbb :\r\n	1. Formulir F.1-02, (Pendaftaran)\r\n	2. Kartu Keluarga, \r\n	3. KTP Rusak/Ganti (Jika Rusak/Ganti)\r\n	4. Suket Hilang dari Kepolisian (Jika Hilang)\r\n	5. Formulir F.1-06, (Jika ada Perubahan)\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-05-14', '13:01:41', '0000-00-00', '', '2025-05-14', '13:30:55', '', '126'),
	('140525PE371', 5, '6305075207890001', 'Lindawati', '0895635122491', 'kemarin perbaikan pengajuan pindah, kok sekarang lacak permohonan nya kosong ??', '', '', '', '', '', '', '', 'Mohon maaf atas ketidaknyamannya. mohon Informasikan Nomor Pengajuan Pindahnya agar dapat kami Lacak.\r\nSilahkan infokan Nomor Pengajuan Pindahnya pada konsultasi baru berikutnya. Terima Kasih', '3', '2025-05-14', '13:36:40', '0000-00-00', '', '2025-05-14', '15:12:06', '', '126'),
