	('140725PE540', 5, '6305073006040004', 'Muhammad Yusuf Saputra', '088258275468', 'Ktp hilang, ingin membuat ktp baru', '', '', '', '', '', '', '', 'Untuk mencetak KTP Anda harus melampirkan syarat sbb :\r\n	1. Formulir F.1-02, (menu download formulir)\r\n	2. Kartu Keluarga, \r\n	3. KTP Rusak/Ganti (Jika Rusak/Ganti)\r\n	4. Suket Hilang dari Kepolisian (Jika Hilang)\r\n	5. Formulir F.1-06, (Jika ada Perubahan)\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-07-14', '06:32:01', '0000-00-00', '', '2025-07-14', '07:17:12', '', '126'),
	('140725PE541', 2, '6372062002000001', 'Muhammad efendi k', '081346048271', 'Info data saya saat ini setelah bercerai', 'syarat/2025/07/14/486172f4a033210523a6008d7b708508.jpg', '', '', '', '', '', '', 'Untuk mencetak KTP/KK Anda harus melampirkan syarat sbb :\r\n	1. Formulir F.1-02, (menu download formulir)\r\n	2. Kartu Keluarga, \r\n	3. KTP Rusak/Ganti (Jika Rusak/Ganti)\r\n	4. Suket Hilang dari Kepolisian (Jika Hilang)\r\n	5. Formulir F.1-06, (Jika ada Perubahan) \r\n	6. Bukti (Dokumen) Pendukung --> AKta Cerai\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Silahkan Pengajuan di Aplikasi. Tks', '3', '2025-07-14', '06:48:08', '0000-00-00', '', '2025-07-14', '07:19:10', '', '126');
