	('140725PE543', 2, '6305085603990001', 'Ayu Sari Sofa', '085392034734', 'saya baru menikah mau membuat kartu keluarga suami saya beralamat sesuai ktp (kotabaru). dan kami tinggal di bali untuk sementara waktu. bagaimana caranya sehingga saya dan suami bisa membuat kartu keluarga ? saya sudah meng unduk formulir F1.02 langkah selanjutnya bagaimana ? dimana saya bisa bisa mendapatkan informasi lengkapnya ?', '', '', '', '', '', '', 'Baik akan kami cek data Anda terlebih dahulu...', 'Pilihan 1 (Pertama) :\r\n- Apabila anda dan suami memutuskan untuk berdomisili di Bali lebih baik Anda memohon surat Pindah dari Tapin ke Bali, begitu jua suami dari Kotabaru ke Bali dengan surat pindah, nanti gabung KK barunya di sana (Bali).\r\nPilihan 2 (Kedua) :\r\n- Jika Anda mau tetap di Tapin, maka suami Anda yang membuat surat Pindah dari Kotabaru ke Tapin digabungkan di Tapin dengan KK Baru ikut suami.\r\n_Catatan : Wajib melampirkan Buku/Akte Nikah_\r\nSemoga dapat dimengerti, Terima Kasih.\r\n', '3', '2025-07-14', '08:49:14', '2025-07-14', '08:49:37', '2025-07-14', '08:57:51', '126', '126');
