	('140725PE544', 4, '6305034308940002', 'Norhasanah irawati', '083141833526', 'Mao mengulah akta', 'syarat/2025/07/14/7c9345dc842eb9774acbe4431e157348.jpg', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, berikut syaratnya :\r\n	1. Foto Formulir F.2-01 (Kelahiran) yg sudah diisi --> Download Formulir\r\n	2. Foto Kartu Keluarga, \r\n	3. Foto Kutipan Buku Nikah (Jika Ada), /STPJM Kebenaran Suami-Istri\r\n	4. Foto KTP Orang Tua (Suami-Istri),\r\n	5. Foto Keterangan Lahir (bidan/dokter)Jika ada, /STPJM Kelahiran\r\n	6. Foto KTP Saksi 2 Org.\r\n	7. Surat Keterangan Hilang (Wajib jika hilang)\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-07-14', '09:25:00', '0000-00-00', '', '2025-07-14', '09:37:00', '', '126'),
	('140725PE545', 2, '6305052404820001', 'Abdul sani', '0895342434799', 'Kenapa lama sekali lewat pos,saya kepake akte nya,untuk pengajuan kantor ', 'syarat/2025/07/14/ae3cc57ed98ef1229511497203f7fb95.jpg', '', '', '', '', '', 'Akan kami cek terlebih dahulu...', 'Sudah di respon petugas, dan status dalam pengajuan ulang. Mohon menunggu respon petugas. Terima Kasih', '3', '2025-07-14', '11:05:21', '2025-07-14', '11:15:32', '2025-07-14', '12:06:10', '126', '126');
