	('140725PE546', 2, '6371034911990011', 'Ananda putri', '087711024517', 'Mohon dibantu saya mengajukan surat pindah apakah surat pindah akan masuk ke email saya juga karena saat ini posisi saya sudah dijakarta tidak di tapin', 'syarat/2025/07/14/154044dfd03f905ba08e93e2622e9229.jpg', '', '', '', '', '', '', 'Surat Pindah-nya (pdf) akan dikirm via Aplikasi ini, jadi nanti bisa di download dan di cetak mandiri. Mohon pantau terus permohonan anda, cek selalu Menu Lacak Permohonan (jika sudah memohon). Terima Kasih', '3', '2025-07-14', '11:31:19', '0000-00-00', '', '2025-07-14', '11:36:18', '', '126'),
	('140725PE547', 2, '6371041306840008', 'Joko Norwiyono', '087820033336', 'Pembuatan KIA', 'syarat/2025/07/14/bba4f1c2c2d9462db6518b5fdd46318e.jpg', 'syarat/2025/07/14/16bea0d34b2b92409b6d8d255085df55.jpg', 'syarat/2025/07/14/6a891cf5bb79ad5e71d44fff0c75909f.jpg', '', '', '', '', 'Silahkan Anda laporkan kedatangan terlebih dahulu di Menu Kedatangan, selanjutnya sampaikan dokumen apa saja yang akan di cetak/mohon pada Kolom Catatan. Terima Kasih', '3', '2025-07-14', '11:34:42', '0000-00-00', '', '2025-07-14', '11:38:43', '', '126');
