	('140825PE639', 2, '6305031011900002', 'Suriansyah ', '087863265466', 'Kelanjutan bikin akta lahir', 'syarat/2025/08/14/7ab7f39267500735b98152ac0635d99d.jpg', '', '', '', '', '', '', 'Silahkan Bapa pilih menu Akta Kelahiran jika mengajukan Baru, tetapi apabila sudah silahkan lanjutkan, atau ajukan ulang bila di tangguhkan. Terima Kasih.', '3', '2025-08-14', '07:22:51', '0000-00-00', '', '2025-08-14', '07:38:34', '', '126'),
	('140825PE640', 2, '6305031011900002', 'Suriansyah ', '087863265466', 'Kelanjutan data apakah masih ada yg di tunggu', 'syarat/2025/08/14/21e2f0b68697840b3b499d5e52f45167.jpg', '', '', '', '', '', 'Baik akan kami cek terlebih dahulu permohonan Anda, harap menunggu.', 'Nomor Permohonan 110825AL1195 Akta Kelahiran pernah d tangguhkan, lalu di ajukan ulang, Mohon menunggu respon dari Petugas, sudah kami koordinasikan, Terima Kasih.', '3', '2025-08-14', '07:54:37', '2025-08-14', '08:37:40', '2025-08-14', '08:43:52', '126', '126');
