	('140825PE641', 2, '6303051203020005', 'Hidayat Eko Saputra', '081254244203', 'Mau bertanya, Kk saya ini di pecah jd 2 kd d gabung lwn istri, karna istri ulun tinggal di martapura sedangkan saya kerja di tapin, jd saya ini mau pindah k martapura, gimana caranya pindah terus mau menggabungkan kartu keluarga lagi sama istri sekalian mau mengganti alamat di ktp ulun supaya jadi alamat martapura', 'syarat/2025/08/14/ead0e532b888cc4dd70eee552c798dce.jpg', 'syarat/2025/08/14/765690f0f74d1947cc7f77e3aaf75628.jpg', '', '', '', '', '', 'Syarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n	1. Mengisi Formulir F-1.02 Permohonan (menu download formulir)\r\n	2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n	3. Kartu Keluarga dan KTP-el\r\n	4. Bukti Dukung Lainnya (jika ada alasan lain)\r\n_Catatan : Alamat tujuan pindah ke alamat istri di Martapura_\r\nTerima Kasih', '3', '2025-08-14', '09:34:54', '0000-00-00', '', '2025-08-14', '09:57:58', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('140825PE642', 2, '6305012209890003', 'Thayibudin', '085654026252', 'Assalamu alaikum.\r\nUlun handak batakun apa nik ulun belum terdaftar di pusat.\r\nSoalnya,\r\nMama ulun di balangan handak daftar bpjs ada kendala.\r\nKan dulu bekas 1 KK.\r\nSekarang sdh pisah KK. \r\nInfo dari pihak bpjs balangan, ulun disuruh memastikan NIK ulun apa sudah terdaftar dipusat.\r\nBaru bisa diproses bpjs mama yang di balangan.', '', '', '', '', '', '', '', 'Waalaikumsalam, data pian Aktif bersama Istri dan anak-anak pian sudah di Tapin. Terima Kasih. Misalkan pian handak mancek KK/NIK Mama pian silahkan informasikan NIK/KK Sidin.', '3', '2025-08-14', '10:11:29', '0000-00-00', '', '2025-08-14', '10:17:51', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('140825PE643', 2, '6303051203020005', 'Hidayat Eko Saputra', '081254244203', 'Saya nanti mengisi form f1-03 dan f1-02 lewar word, berapa hari kira kira selesai setelah pengajuan cabut berkas. Dan saya sudah tidak berada di tapin lagi jadi semuanya lewat online, tidak bisa langsung ke tempat ', 'syarat/2025/08/14/0360cd2db12e1838f8555e8042472c18.jpg', 'syarat/2025/08/14/3250713a1fcc99bfadc1e82e8295f00f.jpg', '', '', '', '', '', 'Ya silahkan ajukan lewat Online pada Menu Pindah, lengkapi Syarat, tidak perlu datang ke Kantor kalau Pindah, nanti kalau sudah jadi Berkas Pindahnya akan kami Upload di aplikasi dan bisa di download dan cetak mandiri/sendiri oleh pemohon. Kalau estimasi berkas selesai adalah ketika jam kerja dan syarat lengkap, inshaallah 1 hari jadi, kalau tidak mungkin besoknya. Yang pasti akan ada notifikasi di WA untuk progess-nya.', '3', '2025-08-14', '10:21:54', '0000-00-00', '', '2025-08-14', '12:02:31', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('140825PE644', 2, '6305012209890003', 'Thayibudin', '085654026252', 'Jer pihak bpjs balangan. NIK ulun kada terdftar di pusat. Karena bekas pernah 1 KK. Kada tahu pusat mana maksudnya. Jadi mama kada kawa proses bpjs di balangan. Disuruh pihak bpjs balangan pastikan NIK ulun jer. Supaya kdd kendala di pihak bpjs balangan.', '', '', '', '', '', '', '', '1. Pian sudah terdaftar di BPJS/belum ?\r\n2. Pian dan mama pian sudah beda Kabupaten yang sepengatahuan kami juga pasti beda Faskes (Fasilitas Kesehatan)\r\n3. Data Pian, istri, dan anak terdaftar secara Nasional di Kabupaten Tapin, sedangkan Mama pian di mungkin di Balangan.\r\nKalau boleh kami cek kan data NIK mama pian, silahkan infokan NIK Mama pian agar dapat kami bantu Cek, terima Kasih.\r\n', '3', '2025-08-14', '10:23:02', '0000-00-00', '', '2025-08-14', '12:07:10', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('140825PE645', 2, '6305012209890003', 'Thayibudin', '085654026252', 'Berarti ampun ulun aman aja. Alhamdulillah....\r\nNIK mama di balangan 6311064607710001\r\nBpjs ulun sudah ada aman aja.\r\nYang kendala mama handak beolah bpjs di balangan. Di maslahkan pihak bpjs sana, nik ulun bermasalah jer. Jadi ada kendala di bpjs. Jadinya ulun bingung. Padahal sudah beda kartu keluarga. Kenapa di sangkutkan ke nik ulun, sengaja dipersulit pihak bpjs balangan kah mama ulun ni yu.', '', '', '', '', '', '', 'Baik, kami cek dl NIK mama Pian, mohon menunggu', 'Terdafatar di Data Nasional Dukcapil, dengan 4 Anggota ;\r\n1. SALFIA - Kepala Keluarga\r\n2. BASERAH - Istri\r\n3. MUHAMMAD SANUSI - Anak\r\n4. AHMAD SIBAWAYHI - Anak\r\nInshaAllah aman aja, mungkin BPJS Balangan harus singkron ulang ke Dukcapil.', '3', '2025-08-14', '12:16:47', '2025-08-14', '12:21:10', '2025-08-14', '12:26:57', '126', '126'),
	('140825PE646', 2, '6305012209890003', 'Thayibudin', '085654026252', 'Terima kasih banyak informasinya ????', '', '', '', '', '', '', '', 'Siap, sama-sama', '3', '2025-08-14', '12:30:08', '0000-00-00', '', '2025-08-14', '12:46:56', '', '126');
