	('140825PE647', 5, '6305061604980001', 'Muhammad Yunan Habibi', '082250030693', 'Pilihan pada kolom desa/kelurahan tidak ada, atau keterangan desa/kelurahan tidak muncul (hanya keterangan pilih desa/kelurahan tanpa ada list nama desa/kelurahan nya) ', 'syarat/2025/08/14/0bda3fc27fe89af3afe4866547b1b003.jpg', 'syarat/2025/08/14/b31801efe677845d2b6812573c304df6.jpg', '', '', '', '', '', 'Setelah kami cek, ditempat kami bisa Pak, silahkan di coba kembali, di refesh browsernya. Terima Kasih', '3', '2025-08-14', '17:31:35', '0000-00-00', '', '2025-08-15', '07:01:12', '', '126'),
	('150125PE30', 5, '6305060107060018', 'Dhani', '083141118790', 'ingin membuat KTP\r\nnamun pengaduan di tolak', 'syarat/2025/01/15/2b8574fb69d457b1321406cc9e63bfbe.jpg', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, silahkan ajukan ulang permohonan anda dengan melengkapi persyaratan lengkap.\r\nTerima Kasih', '3', '2025-01-15', '08:15:01', '0000-00-00', '', '2025-01-15', '12:06:23', '', '126'),
	('150125PE31', 5, '3174060505951003', 'Irmawa ', '085928874929', 'Mau mnta surat domisili ', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, Mohon maaf Dukcapil tidak menerbitkan Surat Domiisili.\r\nUntuk membuktikan masyarakat berdomisili di tempat hanya KTP dan Kartu Keluarga.\r\nTerima Kasih', '3', '2025-01-15', '10:26:14', '0000-00-00', '', '2025-01-15', '12:04:53', '', '126');
