	('150125PE32', 5, '6305041709000001', 'Mohamad Iqbal', '081255671155', 'Tidak bisa login pdahal pasword sudah di ganti dan di masukkan dengan benar', '', 'syarat/2025/01/15/6ab0bdac919631d18957f09aa234e406.jpg', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil,\r\ncoba masukan password sesuai NIK anda.\r\npassword : 6305041709000001\r\nkode aktivasi : 96862\r\nSelamat mencoba.', '3', '2025-01-15', '11:21:48', '0000-00-00', '', '2025-01-15', '16:13:24', '', '126'),
	('150125PE33', 5, '3174060505951003', 'Irmawan', '085928874929', 'Meminta surat domisili ', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, Mohon maaf Dukcapil tidak menerbitkan Surat Domiisili. Untuk membuktikan masyarakat berdomisili di tempat hanya KTP dan Kartu Keluarga. Terima Kasih', '3', '2025-01-15', '11:43:22', '0000-00-00', '', '2025-01-15', '12:09:43', '', '126');
