	('150125PE34', 5, '6305055606960001', 'Siti Fatimah', '085752242668', 'Gimana cara nya merubah nama Ayah yang tidak lengkap di Akta Kelahiran? ', 'syarat/2025/01/15/ce2556edc16bf230445fad5306718133.jpg', 'syarat/2025/01/15/54236427ed4cd20d654752a7e429b421.jpg', 'syarat/2025/01/15/e9b5b1af0485e916d85a2ffec92fd1ef.jpg', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, \r\nMemenuhi persyaratan Akta Kelahiran dan melampirkan bukti dukung yang mencantumkan Nama Ayah sebenarnya, contoh : Izajah/KTP dll.\r\nApabila nama ayah berubah makna (berubahnya jauh dari nama awal) bisa disarankan untuk sidang Pengadilan.\r\nUntuk lebih lanjut silahkan datang k Kantor Dukcapil untuk konsultasi.', '3', '2025-01-15', '12:35:28', '0000-00-00', '', '2025-01-15', '12:40:58', '', '126'),
	('150225PE127', 5, '6305012707890001', 'Wildan', '081346348097', 'Kalo buat ktp persaratan nya apa aja,soalnya ktp nya hilang', 'syarat/2025/02/15/20b3ceb9db08956cca358ba56aa31bbb.jpg', '', '', '', '', '', '', 'Untuk mencetak KTP hilang Anda harus melampirkan syarat sbb :\r\n1. Formulir F.1-02, (download di menu formulir)\r\n2. KK, \r\n3. Surat Keterangan Hilang\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-02-15', '09:07:39', '0000-00-00', '', '2025-02-15', '09:55:57', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('150425PE262', 2, '6305015112900001', 'Andriani', '0882021218581', 'Cara membuat akte kelahiran', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, berikut syaratnya :\r\n	1. Foto Formulir F.2-01 (Kelahiran) yg sudah diisi --> Download Formulir\r\n	2. Foto Kartu Keluarga, \r\n	3. Foto Kutipan Buku Nikah,\r\n	4. Foto KTP Orang Tua (Suami-Istri),\r\n	5. Foto Keterangan Lahir (bidan/dokter),\r\n	6. Foto KTP Saksi 2 Org.\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-04-15', '06:08:48', '0000-00-00', '', '2025-04-15', '08:23:30', '', '126'),
	('150425PE263', 5, '6305014708980001', 'Chicha kusuma dewi r ', '082253395356', 'saya ingin memperbarui kartu keluarga dengan yang ter update , karna waktu saya ingin meng Klaim BPJS ketenagakerjaan nik saya tidak ditemukan. saya di arahkan untuk meminta pembaruan kartu keluarga', 'syarat/2025/04/15/1c36b7f92a7722d132c72a3f00a7295f.jpg', 'syarat/2025/04/15/c20424d6311f441e5751a3363a737692.jpg', '', '', '', '', '', 'Boleh, silahkan ajukan permohonan KK, di kolom informasi ketikan mau cetak KK terupdate atau KK dengan QRCode. Penuhi persyaratan agar proses segera di respon Petugas. Sebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-04-15', '07:56:30', '0000-00-00', '', '2025-04-15', '08:22:41', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('150425PE264', 5, '6305111712940001', 'Akhmad said', '082351560556', 'Memperbaiki alamat pindah domisili yang seharusnya dibawah ini\r\nDs. Simpang empat sungai baru\r\nJl pasar minggu RT 010 RW 002', '', '', '', '', '', '', '', 'Silahkan ajukan Perubahan desa di tempat tujuan,terimakasih', '3', '2025-04-15', '09:56:37', '0000-00-00', '', '2025-04-15', '10:02:24', '', '274'),
	('150425PE265', 2, '6305064302020001', 'Siti Rahmawati', '085389145266', 'Izin bertanya, setelah upload persyaratan berkas pindah dtng selanjutnya bagaimana ya pak/ibu? \r\nDi persyaratan yg wajib di isi ada KTP, kk dan formulir f2 dan f3. Apakah syarat tersebut harus di kirim lewat kantor pos baru bisa di proses pindah datangnya? \r\nTerimakasih', '', '', '', '', '', '', '', 'Tunggu respon dari Petugas via Whatsapp, biasa pindah datang hasilnya akan di upload petugas, dan ada notifikasi pada Menu Lacak Permohonan di aplikasi.\r\nDiharapkan syarat2 yang di foto dikirm via pos apabila dalam pengajuan memilih pengiriman POS. Terima Kasih', '3', '2025-04-15', '09:58:33', '0000-00-00', '', '2025-04-15', '10:09:25', '', '126'),
	('150425PE266', 2, '6305014708980001', 'Chicha kusuma dewi r', '082253395356', 'mau cetak KK ter update atau KK dengan QRcode', 'syarat/2025/04/15/0571b50cbf9d441e8ccb248e936edaae.jpg', '', '', '', '', '', '', 'Silahkan ajukan di menu kartu keluarga. terimakasih', '3', '2025-04-15', '12:19:24', '0000-00-00', '', '2025-04-15', '13:25:21', '', '274');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('150425PE267', 2, '6305066708990003', 'Sauzan Nur Alya', '085624028272', 'Selamat siang Bapak/Ibu.\r\nMohon informasinya bagaimana dan dimana bisa didapat Surat Keterangan Pindah WNI (SKPWNI) jika yang bersangkutan berasal dari luar kabupaten Tapin yang ingin pindah ke kabupaten Tapin?\r\n\r\nAtas perhatiannya saya ucapkan Terima kasih.', '', '', '', '', '', '', '', 'Terima Kasih. Di Dukcapil tempat Asal, sesuai KTP/KK yang bersangkutan.', '3', '2025-04-15', '14:58:12', '0000-00-00', '', '2025-04-15', '15:23:45', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('150425PE268', 2, '6305066708990003', 'Sauzan Nur Alya', '085624028272', 'Selamat sore Bapak/Ibu.\r\nMau bertanya. Saya baru menikah tahun kemarin, belum bikin Kartu Keluarga Baru dan perubahan Data di KTP. Suami saya asal dari Batu licin dan saya Margasari kabupaten Tapin.\r\n\r\nYang mau saya tanyakan, apakah benar yang perlu kami urus itu yaitu :\r\n- Membentuk Kartu Keluarga Baru\r\n- Pisah Kartu Keluarga (dari KK yang terdahulu yang masih ikut orang tua)\r\n- Pindah datang (untuk suami saya)\r\n-Perubahan Data KTP (suami isteri)\r\n-Mengisi Surat pernyataan perubahan elemen data kependudukan  dan Surat pernyataan pencabutan data kependudukan (daerah asal suami)\r\n-Meminta SKPWNI dari daerah asal suami\r\n\r\n\r\nDemikian yang saya tanyakan, atas perhatiannya terimakasih.', '', '', '', '', '', '', '', 'Betul, Pertama Surat Pindah dari Batu Licin (Suami) dengan tujuan Margasari, ke Dua di datangkan di Tapin untuk membuat KK Baru, ke Tiga Anda Pisak KK dari ortu dengan melampirkan Surat Nikah dan F.1-06 (perubahan elemen data blm kawin menjadi kawin), Lampirkan KTP dan KK lama Anda (utk KTP lama suami juga).\r\nTerima Kasih, semoga dapat membantu.', '3', '2025-04-15', '15:36:09', '0000-00-00', '', '2025-04-16', '08:06:58', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('150425PE269', 2, '6371025807060006', 'Akira Rizkika', '081251563994', 'Untuk pindah keluar kabupaten, yang harus dipilih pada formulir F1.02 yang mana?', '', '', '', '', '', '', '', 'Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nSyarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n	1. Mengisi Formulir F-1.02 Permohonan (menu download formulir)\r\n	2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n	3. Kartu Keluarga dan KTP-el\r\nTerima Kasih', '3', '2025-04-15', '17:28:54', '0000-00-00', '', '2025-04-16', '08:08:37', '', '126'),
	('150525PE373', 2, '6305072505880002', 'Samhadiyanor', '082132000085', 'Sudah mengakukan online permintaan pindah ke kalteng karena domisili tetap kami sekarang dikalteng. Sdh di respon dan diverifikasi jg oleh petugas nya. Selanjutnya bagaimana agar sy bisa segera masukan berkas nya ke dukcapil kalteng tujuan', 'syarat/2025/05/15/4d206cdd628a348bd0af798d461d14f6.jpg', '', '', '', '', '', '', 'Silahkan di download file PDF SKPWNI nya di menu download ', '3', '2025-05-15', '08:32:57', '2025-05-15', '08:35:57', '2025-05-15', '08:40:31', '274', '274');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('150525PE374', 2, '6305082808990001', 'muhammad gazali', '082240631405', 'syarat mencetak ulang akta kelahiran karena hilang', '', '', '', '', '', '', '', 'Silahkan lampirkan surat kehilngan dan mengisi form seperti semula \r\nuntuk persyaratan bisa di cek di menu persyaratan . Terimakasih', '3', '2025-05-15', '12:14:07', '2025-05-15', '12:41:20', '2025-05-15', '12:43:21', '274', '274'),
	('150525PE375', 2, '6305055010920001', 'Nor saupiah', '085787129152', 'Maaf apakah pengajuan data pembuatan akta yang tadi sudah benar ..dan mohon maaf kalau boleh tau biasa nya berapa hari selesainya soalnya baru pertama lewat online ..mkasih', '', '', '', '', '', '', '', 'Mohon info *Nomor Pengajuannya* biar dapat kami lacak. Silahkan informasikan *Nomor Pengajuannya* di permintaan informasi selanjutnya. Terima Kasih', '3', '2025-05-15', '13:51:09', '0000-00-00', '', '2025-05-15', '15:29:20', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('150525PE376', 4, '6308054603910004', 'Mur', '085931918429', 'Assalamualaikum mhon maaf mengganggu. Minta tolong, kw lah berkas ulun yg sudah selesai itu, minta tolong kirimkan ke pos kah atau jnt. Kealamat mama ulun di amuntai. Ulun ne abis operasi parut masih marinyut, jd bagana ae sementara wadah mama, mama ulun yg ngurus ulun dan bayi ulun..kirim ke alamat ini ..jl tepikali negara desa rantawan rt 6, no 23 kec amuntai tengah kab hulu sungai utara (gang annajah belokkanan pinggir banyu)..biaya ongkir nanti cod', '', '', '', '', '', '', '', 'Pertama, Mohon izin kirim nomor permohonannya biar dapat kami lacak. Kedua, dokumen apa yang pian urus kemaren.\r\nSampaikan informasi pada pengajuan konsultasi selanjutnya. Terima Kasih', '3', '2025-05-15', '17:29:40', '0000-00-00', '', '2025-05-16', '09:07:05', '', '126');
