	('150525PE377', 4, '6308054603910004', 'Mur', '085931918429', 'Assalamualaikum mhon maaf mengganggu. Minta tolong, kw lah berkas ulun yg sudah selesai itu, minta tolong kirimkan ke pos kah atau jnt. Kealamat mama ulun di amuntai. Ulun ne abis operasi parut masih marinyut, jd bagana ae sementara wadah mama, mama ulun yg ngurus ulun dan bayi ulun..kirim ke alamat ini ..jl tepikali negara desa rantawan rt 6, no 23 kec amuntai tengah kab hulu sungai utara (gang annajah belokkanan pinggir banyu)..biaya ongkir nanti cod', '', '', '', '', '', '', '', 'Pertama, Mohon izin kirim nomor permohonannya biar dapat kami lacak. Kedua, dokumen apa yang pian urus kemaren.\r\nSampaikan informasi pada pengajuan konsultasi selanjutnya. Terima Kasih', '3', '2025-05-15', '17:29:49', '0000-00-00', '', '2025-05-16', '09:09:10', '', '126'),
	('150725PE548', 2, '6305116709990001', 'WIJIATI NINGSIH ', '083159678811', 'Minta informasi persyaratan pembuatan kia untuk umur 7 tahun ke atas', '', '', '', '', '', '', '', 'Syarat KIA :\r\nFotokopi Kutipan Akta Kelahiran dan menunjukkan Kutipan Akta Kelahiran aslinya.\r\nKK asli orang tua/wali\r\nFoto anak berwarna ukuran 3x4 sebanyak 2 (dua) lembar untuk anak 5 ke atas, dibawah 5 tahun tidak perlu Foto anak.\r\nTerima Kasih', '3', '2025-07-15', '07:30:53', '0000-00-00', '', '2025-07-15', '08:00:36', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('150725PE549', 2, '6305045410930001', 'Noor Aida', '082352480180', 'Izin bapak/ibu, mengubah KK dan status di KTP bisa secara online disini kah? kalo langsung ke dukcapil apa aja yg dilampirkan? di MPP apakah bisa? terimakasih', '', '', '', '', '', '', '', 'Untuk mencetak KTP/KK Anda harus melampirkan syarat sbb :\r\n	1. Formulir F.1-02, (menu download formulir)\r\n	2. Kartu Keluarga, \r\n	3. KTP Rusak/Ganti (Jika Rusak/Ganti)\r\n	4. Suket Hilang dari Kepolisian (Jika Hilang)\r\n	5. Formulir F.1-06, (Jika ada Perubahan) \r\n	6. Bukti (Dokumen) Pendukung --> AKta Cerai (Jika Perubahan Status)\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-07-15', '08:13:45', '0000-00-00', '', '2025-07-15', '12:42:03', '', '126'),
	('150725PE550', 5, '6305064110960003', 'Hairun Nisa', '085654910254', 'Tidak tahu dimana mengunduh ijazah terakhir ingin bikin akta lahir', 'syarat/2025/07/15/b552dad18bc852675531ff3728a19a44.jpg', '', '', '', '', '', '', 'Apakah maksudnya me-upload izajah? Kalaus status nya ditolak, Anda bisa mengajukan ulang permohonan sebelumnya sekaligus upload file/dokumen yang kurang.\r\nTerima Kasih.', '3', '2025-07-15', '17:41:17', '0000-00-00', '', '2025-07-16', '06:41:37', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('150825PE648', 2, '6305014609900001', 'MARLIYANA ', '081256864001', 'Assalamualaikum bapak/ibu izin bertanya.\r\nSaya warga desa Pulau Pinang Utara yang sudah lama tinggal di Banjarbaru sudah 13 tahun. Saya berniat ingin pindah ke Banjarbaru dikarenakan anak yang akan sekolah dengan sistem zonasi. Mohon bimbingannya apa yang harus dilakukan terlebih dahulu untuk pengurusan terkait pindah KTP dll. Terimakasih ????', '', '', '', '', '', '', '', 'Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nSyarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n	1. Mengisi Formulir F-1.02 Permohonan (menu download formulir)\r\n	2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n	3. Kartu Keluarga dan KTP-el\r\n	4. Bukti Dukung Lainnya (jika ada alasan lain)\r\nTerima Kasih', '3', '2025-08-15', '10:32:40', '0000-00-00', '', '2025-08-15', '20:29:26', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('160125PE35', 5, '3206276310990001', 'Sri asriyati', '081520472161', 'Saya 1 tahun yang lalu sudh bikin KK tapi kenapa pas saya mau masukan nama anak malah baru ada dimintai surat pindah padahal sebelumnya juga sudh diuruskan oleh pihak capil sebelum pembuatan KK dan KTP saya juga sudah domisili di Tapin.\r\n\r\nJadi bingung saya mau mengurus data keluarga baru gimna', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, untuk kasus Ibu kami sarankan untuk konsultasi langsung ke kantor Dukcapil, dan bawa kelegkapan berkas yang menunjukan Ibu sudah mempunyai KK Tapin seperti informasi Ibu. Karena ini perlu diteksi riwayat data kami sarankan sekali lagi datang ke Kantor kami. Terima Kasih', '3', '2025-01-16', '09:37:42', '0000-00-00', '', '2025-01-16', '09:44:59', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('160125PE36', 5, '6305012507740001', 'Iman', '085751934253', 'Memperbarui KTP', 'syarat/2025/01/16/8bd94515357272bfda73639c92b13e98.jpg', 'syarat/2025/01/16/6dcdcb73b270f68cb3e5b18da416df89.jpg', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil,\r\nUntuk mencetak KTP ulang atau memperbaharuinya, silahkan pilih menu Cetak KTP.\r\nPengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nDownload Aplikasi Pondok Dukcapil berbasis Android di link berikut :\r\nhttps://drive.google.com/file/d/19kCzRnajLBkFC93WoHci7XqUplwXUpFQ/view?usp=sharing\r\nAtau Website : https://pondok.dukcapil.tapinkab.go.id/\r\n\r\n', '3', '2025-01-16', '09:50:10', '0000-00-00', '', '2025-01-16', '09:55:01', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('160125PE37', 5, '6305010204830001', 'FUAD HASAN', '081257977876', 'PENULISAN DI KARTU KELUARGA ( K K ) \r\nUNTUK TEMPAT LAHIR SAYA TIDAK SAMA DENGAN YANG DI KARTU TANDA PENDUDUK ,,\r\nDI KARTU TANDA PENGENAL TERTULIS " TAPIN " \r\nDI KARTU KELUARGA TERTULIS "BINUANG" MOHON DI SAMA KAN UNTUK PENULISAN NYA MENJADI " TAPIN " ', 'syarat/2025/01/16/fbc36b404005458de554759bf72cefec.jpg', 'syarat/2025/01/16/5158fdc0668026614c2abdfb9e8918cd.jpg', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, setelah kami cek ada perubahan data pada tanggal 22-12-2020 dari TAPIN menjadi BINUANG,\r\nuntuk merubahnya kembali, silahkan ajukan permohonan perubahan data dengan memenuhi syarat sbb :\r\n1. Formulir F.1-02 (permohonan)\r\n2. Formulir F.1-06 (perubahan data)\r\n3. Dokumen Pendukung lainnya yang menyatakan tempat kelahiran Anda sebenarnya.\r\n\r\nTerima Kasih.', '3', '2025-01-16', '22:07:47', '0000-00-00', '', '2025-01-17', '08:46:44', '', '126'),
	('160325PE198', 2, '3305014211080001', 'Sri mulyani', '0882021051410', 'Nik ga terdaftar ka jdi gimn mau bikin pengajuan cetak ktp', '', '', '', '', '', '', '', 'Mohon di Cek kembali NIK Anda dengan benar di Kartu Keluarga, perkiraan ada kesalahan ketik NIK pada pendaftaran. Terima Kasih.', '3', '2025-03-16', '17:47:25', '0000-00-00', '', '2025-03-17', '07:55:16', '', '126');
