	('160425PE270', 2, '6305014702000002', 'Mariatul fitriah', '085705855874', 'Membuat ktp sama kk', '', '', '', '', '', '', '', 'Sebelumnya anda harus daftar Akun terlebih dahulu.\r\nMohon Informasikan alasan pembuatan KK (Pisah KK/Pindah/Hilang), begitu juga KTP. Agar dapat kami pahami pembuatan KK dan KTP yang di maksud.\r\nSilakan ajukan ulang permohonan Informasinya, Terima Kasih.', '3', '2025-04-16', '08:23:47', '0000-00-00', '', '2025-04-16', '08:44:20', '', '126'),
	('160425PE271', 2, '6305060301790001', 'Maksum', '081219017863', 'Perubahan Kartu keluarga blm terbit', 'syarat/2025/04/16/83c2673712953d2be6dc0a7f51b51b7b.jpg', 'syarat/2025/04/16/2af0b7e59bd17d06a74c64b23c7609d6.jpg', '', '', '', '', '', 'Apakah sudah diajukan di Menu Perubahan KK, apabila sudah mohon infokan/ketik *Nomor Permohonan* pada pengaduan baru selanjutnya agar dapat kami LACAK.\r\nFile lampiran nanti mohon di tambah pada pengajuan perubahan di Perubahan KK, Akta serja Izajahnya sebagai dasar perubahan. Terima Kasih.', '3', '2025-04-16', '08:46:06', '0000-00-00', '', '2025-04-16', '08:53:17', '', '126');
