	('160425PE272', 2, '6305060301790001', 'Maksum', '081219017863', 'Perubahan kartu keluarga, berkas sdh diserahkan ke kantor pos', 'syarat/2025/04/16/6591c877933c1ddc54f3c6204068a099.jpg', 'syarat/2025/04/16/8be1082e54843d9f3c1bd890fa8531fb.jpg', 'syarat/2025/04/16/401bd55f8fc7ff58e3f1a579c270d003.jpg', 'syarat/2025/04/16/bf5cc6a0ebb047c64dacb4f53ec51bac.jpg', 'syarat/2025/04/16/0dfd7e489331e8df92eb74a4ec76cc89.jpg', 'syarat/2025/04/16/84b78380971d50894342980c427d90e6.jpg', 'Baik akan segera kami cek, mohon menunggu pemberitahuan selanjutnya.', 'Silahkan Kartu keluarganya di download di menu download.terimakasih', '3', '2025-04-16', '09:10:55', '2025-04-16', '09:27:06', '2025-04-16', '09:38:41', '126', '274'),
	('160425PE273', 2, '6305094503960001', 'Zulaiha', '082155700051', 'Persyarata pindah domisili antar provisi apa aja', '', '', '', '', '', '', '', 'persyartan Pinah \r\n1. Mengisi form f1.02\r\n2. Mengisi form F1.03 \r\n3. KTP pasutri\r\n4. KK \r\nuntuk formulir silahkan di download\r\nUntuk Pasangan suami istri Untuk Form F1.03 lamoir kan 2 lembar 1 untuk suami dan anak 1 untuk istri atau sebaliknya\r\nterimakasih', '3', '2025-04-16', '10:39:21', '0000-00-00', '', '2025-04-16', '10:56:02', '', '274');
