	('160425PE275', 2, '6305061810040001', 'Muhammad Tahir', '082350220494', 'pembuatan ulang ktp yang rusak', 'syarat/2025/04/16/d9be8281dce0872f966bb0f213d7b2d0.jpg', '', '', '', '', '', '', 'Untuk mencetak KTP  Anda harus melampirkan syarat sbb :\r\n	1. Formulir F.1-02, (Pendaftaran)\r\n	2. Kartu Keluarga, \r\n	3. KTP Rusak/Ganti (Jika Rusak/Ganti)\r\n	4. Suket Hilang dari Kepololisian (Jika Hilang)\r\n	5. Formulir F.1-06, (Jika ada Perubahan)\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-04-16', '17:42:06', '0000-00-00', '', '2025-04-16', '19:49:40', '', '126'),
	('160425PE276', 2, '6305061810040001', 'Muhammad Tahir', '082350220494', 'pembuatan ulang ktp yang rusak', '', '', '', '', '', '', '', 'Untuk mencetak KTP  Anda harus melampirkan syarat sbb :\r\n	1. Formulir F.1-02, (Pendaftaran)\r\n	2. Kartu Keluarga, \r\n	3. KTP Rusak/Ganti (Jika Rusak/Ganti)\r\n	4. Suket Hilang dari Kepolisian (Jika Hilang)\r\n	5. Formulir F.1-06, (Jika ada Perubahan)\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-04-16', '17:42:08', '0000-00-00', '', '2025-04-16', '19:50:16', '', '126');
