	('160525PE380', 4, '6308054603910004', 'Murliani ', '085931918429', 'Nomor Permohonan 070525AL601 atas nama murliani, tolong untuk berkas asli yg sudah selesai semua (kk (terbaru yg ada nama bayi saya), kartu kia, akta lahir bayi saya). Tolong di kirim ke jl tepikali negara desa rantawan rt 6 no 23 kec amuntai tengah kab hulu sungai utara. Masuk gang an najah belok kanan. Kirim via pos atau jnt. Cod ya', '', '', '', '', '', '', '', 'Setelah kami lacak permohonan Anda memang pilihan pengambilan pada Kantor Dukcapil bukan Kantor Pos, dan karena ada berkas register Akta yang wajib di tandatangani oleh pelapor maka kami sarankan untuk tetap di ambil oleh pemohon ke kantor dukcapil. Semoga dapat dipahami. Terima Kasih. ', '3', '2025-05-16', '10:19:33', '0000-00-00', '', '2025-05-16', '15:38:41', '', '126'),
	('160525PE381', 2, '6305011112960001', 'Zulkifli', '081645472414', 'Akta lahir belum di terima itu kendala apa ya ?', '', '', '', '', '', '', '', 'Mohon kirim nomor permohonan anda pada permintaan informasi selanjutnya, agar dapat kami lacak. Tks', '3', '2025-05-16', '10:22:02', '0000-00-00', '', '2025-05-16', '15:22:33', '', '126');
