	('160525PE382', 5, '6305030107960007', 'M.RUDIANOR', '082353063669', 'Assalamu\'alaikum, selamat siang\r\nPada Surat keterangan pindah saya, Alamat tujuan pindah saya ternyata ada yang salah. Solusinya bagaimana? Apakah cetak ulang? \r\n\r\nAlamat yg betul\r\nJl. Belakang Stadion Demang Lehman Perumahan Arwana Residence 19 RT.012 RW.004 Kel.Indrasari Kec.Martapura Kab.Banjar', 'syarat/2025/05/16/39526478aecbc0301202c5f1d936fb33.jpg', '', '', '', '', '', '', 'Surat Pindah sudah terbit dan status 2 (pindah) pada Database Pusat tidak bisa dirubah lagi. Solusi : Ketika Lapor di tempat tujuan informasikan ke Petugas bahwa ada alamat yang belum benar dan perlu diperbaiki, nanti pas di dukcapil tujuan diperbaikinya. Tks', '3', '2025-05-16', '10:45:01', '0000-00-00', '', '2025-05-16', '15:25:58', '', '126'),
	('160625PE445', 2, '6305060701210002', 'Muhammad bahar akmal', '082242439915', 'Mau bikin file akta kelahiran anak gimana carranya', 'syarat/2025/06/16/c800ff23bb44816cfce7d9235f6135bf.jpg', '', '', '', '', '', '', 'Berikut kami lampirkan file PDF akta lahir Anda. Cek pada cek permohonan di menu konsultasi, paste nomor permohonan, akan tampil ikon dokumen, silahkan download. Terima Kasih', '3', '2025-06-16', '10:53:23', '0000-00-00', '', '2025-06-16', '11:01:57', '', '126');
