	('160625PE446', 5, '6305010106950001', 'M. ABDULLAH', '085823453938', 'Verifikasi kk dan masukan data anak ke kk, dan membuat akta anak\r\nAlasan nya kerna di kk itu, atas nama istri sendiri bukan nama suami sebagai kepala keluarga, dan data anak tidak ada di ke kk\r\n', '', '', '', '', '', '', '', 'Mohon izin, bisa diperjelas permasalahannya apa, dan bisa dilampirkan/upload dokumen yang dimaksud, Terima Kasih', '3', '2025-06-16', '12:30:17', '0000-00-00', '', '2025-06-16', '15:19:10', '', '126'),
	('160625PE447', 5, '6305011205800004', 'Sofyani rahman', '082251186002', 'Mau mengurus perpindahan alamat domisi yg dulu di pualam sari sekarang di  nes11 pualu pinang', 'syarat/2025/06/16/1bbaf7602e78d41163478058fdc0e7ee.jpg', 'syarat/2025/06/16/baf925c804a4d588f9c76f9aacf479fb.jpg', 'syarat/2025/06/16/8d4840bf5cf14ff1c0f4effa4745d3be.jpg', 'syarat/2025/06/16/d16c3129817bc8401cc062b90f494993.jpg', 'syarat/2025/06/16/3322de4360a514a494a8a0912b0d07f3.jpg', '', '', 'Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nSyarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n	1. Mengisi Formulir F-1.02 Permohonan (menu download formulir)\r\n	2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n	3. Kartu Keluarga dan KTP-el\r\nTerima Kasih', '3', '2025-06-16', '19:15:47', '0000-00-00', '', '2025-06-17', '08:15:38', '', '126');
