	('160625PE448', 2, '630506200480001', 'Mithan', '085754118320', 'Saya mau bertanya.saya mau merubah kartu keluarga saya.soalnya kartu keluarga saya yang lama dari kabupaten batola dan saya mau beralih ke  tapin.', '', '', '', '', '', '', '', 'Silahkan anda mengurus Surat Pindah terebih dahulu dari Kabupaten Batola, setelah terbit surat Pindahnya, silahkan anda laporkan di Aplikasi Pondok Dukcapil pada menu Kedatangan, Terima Kasih.', '3', '2025-06-16', '21:31:37', '0000-00-00', '', '2025-06-17', '08:17:35', '', '126'),
	('160725PE551', 4, '6305114601650001', 'SUPATMIATI ', '083852263664', 'mau membuat akta kelahiran', '', '', '', '', '', '', '', 'Silahkan pilih menu persyaratan, atau klik link berikut https://pondok.dukcapil.tapinkab.go.id/main/persyaratan\r\nTerima Kasih', '3', '2025-07-16', '07:18:36', '0000-00-00', '', '2025-07-17', '08:13:02', '', '126'),
	('160725PE552', 5, '6372062002000001', 'Muhammad efendi k', '081346048271', 'Kk baru,ktp baru, mau pindah ke banjarbaru', 'syarat/2025/07/16/e6260edf8bf50404fa2740cf0516f558.jpg', 'syarat/2025/07/16/e637d1866a340d135182a0da17b1a59b.jpg', '', '', '', '', '', 'Selamat pagi, jika ingin melakukan permohonan pindah, silakan login kemudian ajukan di menu pindah', '3', '2025-07-16', '08:48:07', '0000-00-00', '', '2025-07-16', '08:54:49', '', '162');
