	('160725PE553', 5, '6305034308940002', 'Norhasanah irawati', '83141833526', 'Kenapa kalau online lama banget baru selesai kalau membuat akta', '', '', '', '', '', '', '', 'Selamat Pagi, Mohon maaf atas ketidak nyamanannya, berdasarkan pengecekan kami, akta kelahiran atas nama NABELLA PUTRI sudah selesai dan siap diserahkan. Jika pilihan pengambilan kantor pos, mohon menunggu diantarkan pihak pos. Terima kasih.', '3', '2025-07-16', '09:21:27', '0000-00-00', '', '2025-07-16', '09:34:48', '', '162'),
	('170225PE128', 4, '6305012707890001', 'Wildan', '081346348097', 'Persarataan bikin ktp yg baru apa saja', 'syarat/2025/02/17/5469dc56eafaedb3789f9cdcaebc9d18.jpg', '', '', '', '', '', '', 'Untuk KTP yang baru selesai perekaman silahkan lampirkan IJAZAH,AKTA,KK dan isi f1.02\r\nuntuk KTP rusak silahkan lampirkan KTP rusaknya dan isi Formulir f1.02\r\nuntuk KTP hilang silahkan lampirkan Surat kehilangannya dan isi formulir f1.02', '3', '2025-02-17', '08:15:59', '0000-00-00', '', '2025-02-17', '08:26:31', '', '274'),
	('170225PE129', 5, '6305024107790035', 'Jurmiah', '087792739174', 'Mengubah status belum kawin menjadi janda /cerai hidup ', 'syarat/2025/02/17/d5332e590de88d70137c750817262851.jpg', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, anda harus melakukan verfikasi data langsung ke Kantor Dukcapil, tks', '3', '2025-02-17', '13:10:18', '0000-00-00', '', '2025-02-17', '14:26:08', '', '126');
