	('170225PE130', 5, '6305012111010001', 'Muhammad Ramadhani', '081251097311', 'Minta kartu keluarga baru kami dengan format pdf', 'syarat/2025/02/17/edf7e032d0041c699364385d9d3bcad9.jpg', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, mohon nilai kami di menu IKM, Terima Kasih.\r\nSilahkan copy-paste id transaksi di menu pencarian.', '3', '2025-02-17', '13:40:41', '0000-00-00', '', '2025-02-17', '14:38:23', '', '126'),
	('170325PE201', 2, '6305010603460001', 'FAHRUDIN', '083836972604', 'MOHON KEBIJAKAN NYA\r\n\r\nMOHON DI BANTU ABAH ULUN HANDAK BEOLAH AKTE LAHIR, TAPI SAKSI NYA KDD YANG LEBIH TUA DARI SIDIN DI KABUPATEN TAPIN, YANG ADA KELUARGA TERAIT SIDIN YANG ADA DI BANJARMASIN\r\n\r\nUMUR SIDIN SEKARANG 79 TAHUN\r\n\r\nMOHON KEBIJAKAN NYA', 'syarat/2025/03/17/4581b965f44e0a313f171a759ecb5cf5.jpg', '', '', '', '', '', '', 'Silahkan ajukan permohonan di Aplikasi Pondok Dukcapil di Menu Akta Kelahiran dengan Saksi diusahakan keluarga terdekat atau tetangga paling dekat.\r\nUntuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu, usahakan AN nama beliau. Terima Kasih', '3', '2025-03-17', '08:09:49', '0000-00-00', '', '2025-03-17', '08:20:31', '', '126');
