	('170325PE202', 5, '6505010807910001', 'AHMAD MAIMUN ', '083159133589', 'Mau mengganti KTP yang rusak ', 'syarat/2025/03/17/26bf306ed58373d74df0a96bfa440194.jpg', '', '', '', '', '', '', 'Untuk mencetak KTP  Anda harus melampirkan syarat sbb :\r\n1. Formulir F.1-02, (Pendaftaran)\r\n2. Kartu Keluarga, \r\n3. KTP Rusak/Ganti (Jika Rusak/Ganti)\r\n4. Suket Hilang dari Keplolisian (Jika Hilang)\r\n5. Formulir F.1-06, (Jika ada Perubahan)\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-03-17', '08:12:57', '0000-00-00', '', '2025-03-17', '08:15:37', '', '126'),
	('170325PE203', 5, '6305010807910001', 'AHMAD MAIMUN ', '083159133589', 'Mau mengganti KTP yang rusak ', 'syarat/2025/03/17/56b0e16d8f12d5e3cdf4075c17cfab5c.jpg', '', '', '', '', '', '', 'Silahkan ajukan di Menu KTP ', '3', '2025-03-17', '09:00:47', '0000-00-00', '', '2025-03-17', '09:26:57', '', '274'),
	('170325PE204', 2, '630602550681002', 'Salasiah ', '083159394140', 'Prosedur pindah domisili ', 'syarat/2025/03/17/df524713319783dda09bf5f25204d644.jpg', '', '', '', '', '', '', 'Silahkan pilih Menu Kedatangan --> Kedatangan Baru pada Aplikasi Pondok Dukcapil, Tks.', '3', '2025-03-17', '10:10:54', '0000-00-00', '', '2025-03-17', '10:16:38', '', '126');
