	('170325PE205', 2, '6305055004070001', 'Siti Fadillah ', '085347735001', 'Ingin mengajukan ulang sesuai dengan instruksi yang diberikan mengenai permintaan sebuah informasi tentang data identitas kependudukan saya. Ingin mengetahui nama yang benar mengenai nama sayaa karena terjadi perbedaan antara ijazah dengan akta kelahiran juga kartu keluarga', 'syarat/2025/03/17/396c5260a5594c553b06520980cbaeb2.jpg', 'syarat/2025/03/17/67fd259b3fbf8c55a2a4c27caaaf9b29.jpg', '', 'syarat/2025/03/17/ed260e8a2757678b4d455f06623018b1.jpg', '', '', 'Setelah kami cek data Anda dalam data kami sesuai KK dan KTP Anda.\r\nApabila menginginkan perubahan silahkan ajukan Perubahan KK dengan Informasi Perubahan *Sekalian dengan KTP*, jadi nanti cuma 1 pengajuan sudah diharapkan KK dan KTP Berubah sesuai Izajah. Terima Kasih.', 'Untuk perubahan KK / KTP  Anda harus melampirkan syarat sbb :\r\n1. Formulir F.1-02, (Pendaftaran)\r\n2. Kartu Keluarga, \r\n3. KTP Rusak/Ganti (Jika Rusak/Ganti)\r\n4. Formulir F.1-06, (Formulir Perubahan)\r\nTerima Kasih.\r\n', '3', '2025-03-17', '13:21:05', '2025-03-17', '14:27:28', '2025-03-17', '14:29:34', '126', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('170325PE206', 2, '6305055004070001', 'Siti Fadillah ', '085347735001', 'Ingin mengajukan ulang sesuai dengan instruksi yang diberikan mengenai permintaan sebuah informasi tentang data identitas kependudukan saya.', '', '', '', '', '', '', '', 'Untuk perubahan KK / KTP  Anda harus melampirkan syarat sbb :\r\n1. Formulir F.1-02, (Pendaftaran)\r\n2. Kartu Keluarga, \r\n3. KTP Rusak/Ganti (Jika Rusak/Ganti)\r\n4. Formulir F.1-06, (Formulir Perubahan)\r\nSilahkan ajukan pada menu perubahn KK Terima Kasih.', '3', '2025-03-17', '13:16:29', '0000-00-00', '', '2025-03-17', '14:30:43', '', '126'),
	('170325PE207', 2, '6306025506810002', 'Salasiah ', '083159394140', 'Terkait pengisian formulir F1.02 terutama di bagian persetujuan pemohon dan petugas', '', '', '', '', '', '', '', 'Silahkan tanda tangan pada bagian Pemohon, untuk bagian petugas abaikan, nanti akan kami verifikasi ketika Proses.\r\nTerima kasih.', '3', '2025-03-17', '16:48:45', '0000-00-00', '', '2025-03-18', '07:52:26', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('170425PE277', 2, '6305011709990001', 'Ahmad komarudin ali', '085754847174', 'pak, atau ibu, ini u mau ngirim kan surat pernytaan menyewa kemana ya...', 'syarat/2025/04/17/0c4b5050bd0f3c014feeed539b15ddbb.jpg', '', '', '', '', '', 'Mohon maaf sebelumnya ini untuk pernyataan menyewa apa ya?\r\nkalau untuk bantuan pindah silahkan langsung ke kantor \r\nterimakasih', 'Mohon maaf sebelumnya ini untuk pernyataan menyewa apa ya?\r\nkalau untuk bantuan pindah silahkan langsung ke kantor \r\nterimakasih\r\nuntuk melengkapi berkas silahkan WA ke 082158793080 \r\nuntuk surat pernyataan nya silahkan di lengkapi dengan stempel', '3', '2025-04-17', '06:48:28', '2025-04-17', '08:03:46', '2025-04-17', '08:59:44', '274', '274'),
	('170425PE278', 2, '6305041811850001', 'Wahyudi', '081348731731', 'Kalau pindah rumah dan alamat kk harus ganti,pengajuan nya ke bagian mana min?', '', '', '', '', '', '', '', 'untuk Pindah alamat beda desa silahkan ke Menu PINDAH dan mengisi f1.03 dan f1.02 kalau pindah hanya pindah hanya di desa yang sama silahkan ke bagian menu Kartu Keluarga', '3', '2025-04-17', '08:22:03', '2025-04-17', '08:43:51', '2025-04-17', '08:45:55', '274', '274');
