	('170625PE449', 2, '6305024207100002', 'Siti Aisyah ', '085750931376', 'Mau bikin surat domisili SPMB untuk sekolah ', '', '', '', '', '', '', '', 'Mohon maaf, Dukcapil tidak mengeluarkan Surat Domisili selain KTP/KIA/KK, kami sarankan untuk mengurus surat pindah terlebih dahulu dari tempat asal. Terima Kasih.', '3', '2025-06-17', '08:00:45', '0000-00-00', '', '2025-06-17', '08:18:58', '', '126'),
	('170625PE450', 5, '6305021902920001', 'Hasanul balqia', '082153272419', 'Prtama daftar layanan salah masukkan nomor HP disuruh daftar ulang. Mau daftar ulang Email sudah terdaftar.jadi tidak bisa daftar. Harus gimana caranya', 'syarat/2025/06/17/3aa3670d1fec4b4a30093e4d6a233606.jpg', 'syarat/2025/06/17/c159ed4a4e41c573c217b7d4f00a3fa5.jpg', '', '', '', '', '', 'Nomor teleponnya belum terdaftar memakai Whatsapp, mohon daftarkan dengan nomor yang WA nya aktif agar dapat notifikasi via WA. Silahkan ajukan keluhan selanjutnya dengan nomor WA yg aktif. Terima Kasih.', '3', '2025-06-17', '08:41:59', '0000-00-00', '', '2025-06-17', '08:49:58', '', '126');
