	('170625PE451', 5, '6305021902920001', 'Hasanul balqia', '082153272419', 'Cara registrasi kalau email sdh terdaftar krna no.hp salah saat registrasi pertama', 'syarat/2025/06/17/8f67449065cb44738ef6dabb8178b9ab.jpg', 'syarat/2025/06/17/5e4a67c1b82bb2765383e885b125febf.jpg', '', '', '', '', '', 'Coba langsung login, kalau tidak bisa coba reset password.', '3', '2025-06-17', '09:12:02', '0000-00-00', '', '2025-06-17', '09:25:00', '', '126'),
	('170725PE554', 2, '6303161302030001', 'M Ismail', '081528585182', 'Saya boleh minta fto kk saya', '', '', '', '', '', '', '', 'Apakah Anda sudah ada meakukan pengajuan? dan apakah Kartu Keluarga Anda sudah menggunakan QRCode (Tanda Tangan Elektronik)?\r\nMohon jelaskan terlebih dahulu pada permintaan informasi selanjutnya, terima kasih.', '3', '2025-07-17', '09:19:07', '0000-00-00', '', '2025-07-17', '10:02:03', '', '126');
