	('170725PE555', 2, '6303055808950006', 'Fatma Dayani ', '81349224889', 'Mau Ngajukan surat pindah secara online ', '', '', '', '', '', '', '', 'Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nSyarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n	1. Mengisi Formulir F-1.02 Permohonan (menu download formulir)\r\n	2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n	3. Kartu Keluarga dan KTP-el\r\n	4. Bukti Dukung Lainnya (jika ada alasan lain)\r\nTerima Kasih', '3', '2025-07-17', '09:40:19', '0000-00-00', '', '2025-07-17', '10:06:08', '', '126'),
	('170725PE556', 5, '6305064206830002', 'karmila', '085651901056', 'sdh mengajukan permohonan pindah dan bikin kk ktp sdh tapi kk blum mucul di permohonan', 'syarat/2025/07/17/fb2b8fd912faeac94d267f169563bbcd.jpg', '', '', '', '', '', '', 'Mohon jelaskan lebih datail agar kami dapat memahami kendala Anda.\r\nKami lihat pada lampiran foto yang Anda Sampaikan sudah ada berkas yang sampai. Mohon jelaskan secara detail kendala Anda.', '3', '2025-07-17', '09:44:19', '0000-00-00', '', '2025-07-17', '10:04:47', '', '126');
