	('170725PE557', 2, '3175041908940002', 'denny syahputra', '081258557619', 'apa saja persyaratan pergantian alamat dengan tetap kelurahan yang sama', '', '', '', '', '', '', '', '- Permohonan Formulir F.1-02 (Download di menu download formulir)\r\n- KK Lama + KTP Lama (asal)\r\n- Surat Pernyataan RT/RW (terlampir di cek permohonan -->menu konsultasi dgn memasukan nomor permohonan)', '3', '2025-07-17', '11:13:03', '0000-00-00', '', '2025-07-17', '12:57:53', '', '126'),
	('170725PE558', 5, '3175041908940002', 'denny syahputra', '081258557619', 'tidak bisa login tetapi sudah aktivasi', '', '', '', '', '', '', '', '- Permohonan Formulir F.1-02 (Download di menu download formulir)\r\n- KK Lama + KTP Lama (asal)\r\n- Surat Pernyataan RT/RW (terlampir di cek permohonan -->menu konsultasi dgn memasukan nomor permohonan)', '3', '2025-07-17', '11:14:07', '0000-00-00', '', '2025-07-17', '12:57:18', '', '126'),
	('170725PE559', 2, '6305064206830002', 'karmila', '085651901056', 'di pemberitahuan di suruh di cek kk di tapi di aplikasi blum ada data kknya', 'syarat/2025/07/17/1e3d28bfb38238033d380993664db255.jpg', 'syarat/2025/07/17/7c97ae114e118e63097f2a778d6206be.jpg', 'syarat/2025/07/17/b473a606a26c7f6c6c1887fefe4f58b8.jpg', '', '', '', '', 'Bisa sampaikan nomor Pernohonannya ?, biar kami Lacak. Terima Kasih', '3', '2025-07-17', '11:15:55', '0000-00-00', '', '2025-07-17', '11:46:54', '', '126');
