	('170725PE560', 5, '3175051908940002', 'denny syahputra', '081258557619', 'ulun sudah daftar tapi belum bisa login karna nik terdaftar tapi ulun sudah dapat balasan wa kalo registrasi telah di setujui', '', '', '', '', '', '', '', 'Silahkan di baca dengan seksama WA konfirmasi user dari Kami. Terima Kasih.', '3', '2025-07-17', '13:09:04', '0000-00-00', '', '2025-07-17', '16:05:18', '', '126'),
	('180225PE131', 5, '6471012803990001', 'Rendy adha', '082132021647', 'Kehilangan KTP', 'syarat/2025/02/18/701cc2bb8cbe5cfed28c4878af69e5c5.jpg', 'syarat/2025/02/18/3d546076843f60ab278f90d019283dfe.jpg', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, untuk mencetak KTP luar domisili hilang anda disarankan langsung ke Kantor Dukcapil (karena bersifat FISIK) setempat dan membawa Surat Keterangan Hilang dari Kepolisian serta mengisi formulir permohonan (F.1-02). Terima Kasih.', '3', '2025-02-18', '08:19:12', '0000-00-00', '', '2025-02-18', '08:41:40', '', '126'),
	('180225PE132', 5, '6305026501020001', 'Nor ainah', '081151100771', 'KK saya tidak terdaftar', 'syarat/2025/02/18/8bcd99b7a259e3f61c46645fc3000d81.jpg', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil,\r\nMohon informasikan no kk nya tidak terdaftar dimana? biar kami cek lebih lanjut.\r\nInformasikan pada konsultasi baru/selanjutnya. Terima Kasih', '3', '2025-02-18', '09:34:35', '0000-00-00', '', '2025-02-18', '09:57:39', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('180225PE133', 4, '6305015304980002', 'Lisa aprillyanti', '085754336013', 'Sptjm kelahiran itu apa ya, gimana caranya', '', '', '', '', '', '', '', 'Surat Pernyataan Tanggung Jawab Mutlak (STPJM), untuk kelahiran adalah surat pernyataan yang menggantikan Surat Keterangan kelahiran dari Bidan/Dokter ketika peristiwa kelahiran jika tidak ada. Untuk lebih lanjut tatacara nya klik link berikut https://youtu.be/ZOmGMkCb-jQ?si=vHoOENXNZnS9zE1r\r\nTerima Kasih.', '3', '2025-02-18', '10:53:40', '0000-00-00', '', '2025-02-19', '07:00:53', '', '126'),
	('180225PE134', 5, '6305091807930001', 'M. Salahuddin', '087719284674', 'Mau merubah nama ibu anak saya pada kartu keluarga karena salah nama nya dengan di akta kelahiran', '', '', '', '', '', '', '', 'Silahkan ajukan perubahan KK, dengan melampirkan Akta kelahiran sebagai dasar.\r\nSyarat : \r\n1. Mengisi Formulir Permohonan F.1-02\r\n2. Mengisi Formulir F.1-06 Perubahan\r\n3. KK\r\n4. Dokumen Pendukung.\r\nLebih lanjut tatacara pengisian silahkan klik link https://www.youtube.com/@dukcapiltapin \r\nTerima Kasih.', '3', '2025-02-18', '11:19:55', '0000-00-00', '', '2025-02-19', '07:23:04', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('180225PE135', 2, '6305060107400022', 'MAHJURI', '082252966792', 'DATA TIDAK MUNCUL DI LAYANAN BPJS', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, \r\n1. Pastikan NIK dan NoKK yang dimasukan sudah benar.\r\n2. Apabila masih ada kendala, silahkan WA nomor pelayanan khusus ini (0822-4678-7329)\r\nCatatan : Sertakan NIK dan NoKK ketika melakukan pengaduan/konsultasi agar dapat kami bantu proses Cek Data.\r\nSementara NIK Pemohon sudah ada di Data Konsolidasi Pusat.\r\nTerima Kasih.', '3', '2025-02-18', '12:12:27', '0000-00-00', '', '2025-02-19', '07:14:28', '', '126'),
	('180225PE136', 4, '6305020105000004', 'Husin', '85942911710', 'Hndak be ulah kk hnyar, hnyar kawin', 'syarat/2025/02/18/9a1a0094ac398a3baac100e17d5591c5.jpg', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, untuk mendapatkan layanan KK silahkan daftar/registrasi dulu.\r\nCatatan : Biasa kalau baru Kawin itu Pisak KK namanya (membentuk keluarga baru), Lebih lanjut nanti di arahkan petugas.', '3', '2025-02-18', '12:44:00', '0000-00-00', '', '2025-02-19', '07:17:47', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('180325PE208', 2, '6305021111850001', 'Norhariadi', '083135468305', 'Validasi ktp', '', '', '', '', '', '', '', 'Silahkan isi dengan lengkap sebagai berikut pada pengajuan konsultasi berikutnya : \r\n1. NIK = .........\r\n2. NO KK = ..........\r\n3. NAMA LENGKAP = ..................\r\nCatatan : Lampirkan Foto KTP', '3', '2025-03-18', '11:54:26', '0000-00-00', '', '2025-03-18', '12:17:36', '', '126'),
	('180325PE209', 2, '6305016709000004', 'Wenda Tri Ayu', '081522878966', 'ka saya mau ajukan pindah lokasi yang ada di kk masih 1 kelurahan cara nya gmna ya ', '', '', '', '', '', '', '', 'Jika alamat baru adalah di luar domisili (desa/kecamatan/kabupaten) anda, maka anda harus melakukan permohonan pindah terlebih dahulu, dimana alamat ktp/kk akan mengikuti alamat pindah(baru). Tetapi jika hanya perubahan jalan atau RT anda bisa mengajukan perbaikan KTP/KK saja. Tks', '3', '2025-03-18', '13:15:54', '0000-00-00', '', '2025-03-18', '14:03:22', '', '126'),
	('180625PE452', 2, '6305062004870001', 'Mithan', '085754118320', 'Di mana saya memperoleh furmolir f1.02', '', '', '', '', '', '', '', 'Silahkan pilih Menu Download Formulir, klik link berikut : https://pondok.dukcapil.tapinkab.go.id/main/formulir\r\nTerima Kasih.', '3', '2025-06-18', '07:36:44', '0000-00-00', '', '2025-06-18', '07:46:00', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('180625PE453', 2, '6305062004870001', 'Mithqn', '085754118320', 'Di mana saya bisa lihat dan bisa cetak  KK saya yang sudah di setujui dan selesai.', '', '', '', '', '', '', '', 'Ada 2 cara. Pertama, akan ada notifikasi di whatsapp, Kedua pada Menu Lacak Permohonan di Aplikasi Pondok Dukcapil. \r\nTerima Kasih.', '3', '2025-06-18', '09:56:03', '0000-00-00', '', '2025-06-18', '10:33:31', '', '126'),
	('180625PE454', 2, '6305062004870001', 'Mithan', '085754118320', 'Baru saja saya sudah menyelesaikan permohonan kedatangan..sudah di proses dan sudah selesai pesan jya dari via wasthap.kata nya di suruh cek ke menu lacak di aplikasi.tapi kenapa belum ada notifikasi dari pelacakan saya.', '', '', '', '', '', '', '', 'Ada tanda merah seperti bintang, apakah sudah ada? ', '3', '2025-06-18', '10:38:57', '0000-00-00', '', '2025-06-18', '10:54:00', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('180625PE455', 2, '6305062004870001', 'Mithan', '085754118320', 'Belum ada notifikasi dam tanda bintang di menu pelacakan.padahal pesan dari via wasthaap sudah selasai dan di suruh masuk ke menu pelacakan dan file fdp harus di print sendiri.tapi belum ada tanda masuk dokument terbet dan lainnya.', '', '', '', '', '', '', 'Mohon di cek kembali di Cari Permohonan Kedatangan, masukan kode permohonan kedatangannya. (180625DT834)\r\nTerima Kasih', 'Mohon di cek kembali di Cari Permohonan Kedatangan, masukan kode permohonan kedatangannya. (180625DT834)\r\nTerima Kasih', '3', '2025-06-18', '11:02:33', '2025-06-18', '12:16:05', '2025-06-18', '12:18:07', '126', '126'),
	('180625PE456', 2, '6305014206020002', 'Siti mariyam', '087891753067', 'Cara mengerim untuk pembuatan akta kelahiran dan surat kematian?', '', '', '', '', '', '', '', 'Mohon izin, mengirim/input data via aplikasi adalah untuk Kelahiran pilih menu Kelahiran, untuk Kematian pilih menu Kematian.\r\n1. Input informasi data pada kolom yang disediakan, lalu simpan.\r\n2. Upload dokumen persyaratan sesuai yang disediakan, lalu kirim.\r\nTerima Kasih, semoga dapat membantu.', '3', '2025-06-18', '20:42:54', '0000-00-00', '', '2025-06-19', '07:14:03', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('180725PE561', 5, '3175041908940002', 'denny syahputra', '081258557619', 'sudah diklik pesan yang di wa dan masuk di halaman login. sudah di isi NIK dan Password ada keterangan NIK tidak terdaftar', '', '', '', '', '', '', 'Baik kami cek terlebih dahulu, mohon menunggu....', 'Mohon maaf atas ketidaknyamannya, kemungkinan user anda terhapus/belum masuk. Silahkan daftar/registrasi ulang untuk mendapatkan user baru. Kami Tunggu terima kasih.', '3', '2025-07-18', '08:25:13', '2025-07-18', '08:32:25', '2025-07-18', '08:50:26', '126', '126'),
	('180725PE562', 2, '6305060204040001', 'Saukani ', '081903200605', ' Mau Mencetak ktp', '', '', '', '', '', '', '', 'Untuk mencetak KTP/KK Anda harus melampirkan syarat sbb :\r\n	1. Formulir F.1-02, (menu download formulir)\r\n	2. Kartu Keluarga, \r\n	3. KTP Rusak/Ganti (Jika Rusak/Ganti)\r\n	4. Suket Hilang dari Kepolisian (Jika Hilang)\r\n	5. Formulir F.1-06, (Jika ada Perubahan) \r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-07-18', '11:29:53', '0000-00-00', '', '2025-07-21', '07:20:37', '', '126'),
	('180725PE563', 2, '6305076106930001', 'Muthia husna', '085186821693', 'Apa persyaratan mengganti status ktp bagi yang cerai dari nikah siri', '', '', '', '', '', '', '', 'Untuk masalah cerai dari nikah siri kami sarankan langsung ke Kantor. Terima Kasih', '3', '2025-07-18', '15:20:39', '0000-00-00', '', '2025-07-21', '07:18:41', '', '126');
