	('180725PE564', 2, '6305060907080003', 'MUHAMMAD ALFARISI', '085828582879', 'ingin membuat ktp', 'syarat/2025/07/18/7fce055df310003c24ef251c59f2f03d.jpg', 'syarat/2025/07/18/08cd935d584ecebaeb57eaa7774cf9e3.jpg', '', '', '', '', '', 'Untuk mencetak KTP/KK Anda harus melampirkan syarat sbb :\r\n	1. Formulir F.1-02, (menu download formulir)\r\n	2. Kartu Keluarga, \r\n	3. KTP Rusak/Ganti (Jika Rusak/Ganti)\r\n	4. Suket Hilang dari Kepolisian (Jika Hilang)\r\n	5. Formulir F.1-06, (Jika ada Perubahan) \r\n	6. Bukti (Dokumen) Pendukung --> AKta Cerai\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-07-18', '19:20:30', '0000-00-00', '', '2025-07-21', '07:19:50', '', '126'),
	('190225PE137', 5, '6372026512850003', 'kadilah natalia', '081255703485', 'pecah kk \r\npindah domisili', '', '', '', '', '', '', '', 'Silahkan ajukan permohonan Perubahan KK pada aplikasi Pondok Dukcapil. Sebelumnya anda harus Daftar/Registrasi terlebih dahulu.\r\nTerima Kasih', '3', '2025-02-19', '07:04:08', '0000-00-00', '', '2025-02-19', '07:25:03', '', '126'),
	('190225PE138', 5, '6305015304980002', 'Lisa aprillyanti', '085754336013', 'Dokumen PDF akta lahir anak saya belum keluar', '', '', '', '', '', '', '', 'PDF AKAN KAMI KIRIMKAN SETELAH BERKAS FISIK IBU TERIMA DAN SILAHKAN MINTA KE NO WA AKTA ONLINE TERIMAKASIH', '3', '2025-02-19', '09:40:52', '0000-00-00', '', '2025-02-19', '09:50:39', '', '274');
