	('190225PE139', 4, '6303082309990002', 'Saini', '085787112533', 'Membuat akta/nambah anggota kleuarga', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, Silahkan daftar/registrasi Akun terlebih dahulu.\r\nPilih menu Akta Kelahiran, dalam pembuatan Akta Kelahiran anak yang belum terdaftar akan otomatis masuk di KK.\r\n', '3', '2025-02-19', '10:27:09', '0000-00-00', '', '2025-02-19', '10:41:33', '', '126'),
	('190225PE140', 4, '6303082309990002', 'Saini', '085787112533', 'Membuat akta/dan nambah anggota keluarga', '', '', '', '', '', '', '', 'UNTUK PEMBUATAN AKTA BARU DAN PENAMBAHAN ANGGOTA KELUARGA BARU SILAHKAN LANGSUNG KE MENU AKTA KELAHIRAN. TERIMAKASIH', '3', '2025-02-19', '10:46:48', '0000-00-00', '', '2025-02-19', '11:09:08', '', '274'),
	('190225PE141', 5, '6305012111010001', 'Muhammad ramadhan', '081251097311', 'Mau ganti nama ktp dari muhammad ramadhani ke muhammad ramadhan', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil,\r\nUntuk perubahan data silahkan download Surat Pernyataan Perubahan Elemen Data F-1.06 (pada menu Download Formulir) serta sertakan foto dokumen pendukung perubahan data. Terima Kasih', '3', '2025-02-19', '11:15:41', '0000-00-00', '', '2025-02-19', '11:29:37', '', '126');
