	('190325PE212', 2, '6305124810990001', 'Siti misnawati', '087833532421', 'Menambah anggota KK baru', '', '', '', '', '', '', '', 'Kalau anggota baru belum memiliki NIK / baru lahir silahkan ambil Layanan Akta kelahiran (include Akta+KK-KIA), kalau baru karena Pindah-Datang atau Perkawinan silahkan pilih Menu Perubahan KK dengan melampirkan Surat Keterangan Pindah (dan syarat lainnya). \r\nUntuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nTerima Kasih.', '3', '2025-03-19', '16:15:47', '0000-00-00', '', '2025-03-20', '08:32:53', '', '126');
