	('190525PE383', 2, '6305014101000003', 'Fitriani', '085650869296', 'Melaporkan ktp hilang', '', '', '', '', '', '', '', 'Untuk mencetak KTP  Anda harus melampirkan syarat sbb :\r\n	1. Formulir F.1-02, (Pendaftaran)\r\n	2. Kartu Keluarga, \r\n	3. KTP Rusak/Ganti (Jika Rusak/Ganti)\r\n	4. Suket Hilang dari Kepolisian (Jika Hilang)\r\n	5. Formulir F.1-06, (Jika ada Perubahan)\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-05-19', '10:06:09', '0000-00-00', '', '2025-05-19', '15:14:46', '', '126'),
	('190525PE384', 2, '3505190502870001', 'M. NURCHOZIN', '082244304530', 'Cetak KTP luar daerah', 'syarat/2025/05/19/af09bd57dd357fc60f52d106cbfee5ee.jpg', 'syarat/2025/05/19/29c0f0b4385f5470efa7f7e7d17f16d5.jpg', '', '', '', '', '', 'Cetak KTP luar daerah bisa dilakukan dengan melampirkan bukti dukung seperti surat ket hilang jika hilang atau KTP asli yang rusak jika rusak. Selain itu diminta mengisi formulir F-1.02', '3', '2025-05-19', '11:14:40', '0000-00-00', '', '2025-05-19', '11:53:13', '', '126'),
	('190525PE385', 5, '3273241506940006', 'ABDUL RAHMAN', '087874702932', 'Tidak bisa login dan masuk ke akun. Nik telah terdaftar tapi saat login tidak bisa masuk. ', 'syarat/2025/05/19/d0a33c6b61f63b7f4f1c0740eb1404d3.jpg', '', '', '', '', '', '', 'silakan kembali login menggunakan NIK : 3273241506940006 dan Password : 12345678', '3', '2025-05-19', '12:06:51', '0000-00-00', '', '2025-05-19', '12:30:42', '', '126');
