	('190525PE387', 2, '6310094802060001', 'BASTANIAH', '087762368570', 'ingin cabut berkas ktp kk di dukcapil tapin dipindah ke tanah bumbu', '', '', '', '', '', '', '', 'Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nSyarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n	1. Mengisi Formulir F-1.02 Permohonan (menu download formulir)\r\n	2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n	3. Kartu Keluarga dan KTP-el\r\nTerima Kasih', '3', '2025-05-19', '13:33:20', '0000-00-00', '', '2025-05-19', '15:17:07', '', '126');
