	('190625PE457', 5, '6305014406080001', 'Putri intan ', '085705515343', 'ini udahh di proses atau belum ya? ', '', '', '', '', '', '', '', 'Mohon menunggu respon betugas, nanti ada notifikasi whatsapp ke nomor Anda, Terima Kasih', '3', '2025-06-19', '07:29:28', '0000-00-00', '', '2025-06-19', '14:29:56', '', '126'),
