	('190625PE459', 5, '6305060404030003', 'Muhammad Amir', '082157708570', 'Saya mau membuat akta baru, yang kemarin itu ada kesalahan nama ibu', '', '', '', '', '', '', '', 'Untuk kesalahan nama kami sarankan untuk datang langsung ke Kantor Dukcapil, terima kasih.', '3', '2025-06-19', '11:56:38', '0000-00-00', '', '2025-06-19', '14:30:43', '', '126'),
	('190825PE649', 2, '6305015505030002', 'Maulida', '085754126428', 'Mau nanya kak, kalo untuk pencetakan ulang ktp yang hilang apakah bisa melewati online ya? ', '', '', '', '', '', '', '', 'Bisa, silahkan penuhi syarat (cek pada menu persyaratan), Syarat Wajib adalah surat Keterangan hilang. Terima Kasih', '3', '2025-08-19', '07:56:59', '0000-00-00', '', '2025-08-19', '08:06:33', '', '126'),
	('190825PE650', 2, '6305061604980001', 'Muhammad Yunan Habibi', '082250030693', 'Tata cara pengajuan pindah domisili KK, sebagai anggota keluarga', '', '', '', '', '', '', '', 'Syarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n	1. Mengisi Formulir F-1.02 Permohonan (menu download formulir)\r\n	2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n	3. Kartu Keluarga dan KTP-el\r\n	4. Bukti Dukung Lainnya (jika ada alasan lain)\r\nTerima Kasih\r\n_Untuk anggota, pada formulir F.1-03 ada pilihan_', '3', '2025-08-19', '08:37:08', '0000-00-00', '', '2025-08-19', '09:14:16', '', '126');
