	('190825PE651', 2, '6305091402990002', 'Akhmad irpani', '6287811566119', 'Minta file KK untuk di print', 'syarat/2025/08/19/7d5030a697991fc4e972b57532d703be.jpg', '', '', '', '', '', '', 'Mohon infromasikan no KK Anda, terima kasih.', '3', '2025-08-19', '09:55:28', '0000-00-00', '', '2025-08-19', '10:37:02', '', '126'),
	('190825PE652', 2, '6305061604980001', 'Muhammad Yunan Habibi', '082250030693', 'Kalau berkas semua sudah siap, harus dikirim kemana, apakah lewat aplikasi atau kemana\r\nKalau lewat aplikasi, lewat fitur mana harus saya kirim', '', '', '', '', '', '', '', 'Kalau Anda ingin mengurus dengan Online ajukan lewat aplikasi, pilih Menu yang di butuhkan, nanti ada langkah upload file (di foto), terima Kasih.', '3', '2025-08-19', '10:14:35', '0000-00-00', '', '2025-08-19', '10:38:35', '', '126'),
	('190825PE653', 2, '6305062604940001', 'MUHAMMAD ARSYAD', '082157225462', 'Assalamualaikum wr wb. \r\nMohon maaf, tadi mengajukan perubahan elemen data kependudukan ibu dan ayah perubahan dari kawin belum tercatat mebjadi kawin tercatat. Sudah upload berkas dan bukti dukung seperti buku nikahÂ keduaÂ orgÂ tua.Tapi tadi dapat balasan Penerbitan KTP Hilang Selesai, bukan Perubahan Kartu Keluarga. ', '', '', '', '', '', '', '', 'Waalaikumsalam. mohon di cek pada Menu Lacak Permohonan, apakah ada pemberitahuan atau tanda bintang? \r\nInfokan ke kami selanjutnya, terima kasih.', '3', '2025-08-19', '10:16:53', '0000-00-00', '', '2025-08-19', '10:35:51', '', '126');
