	('200125PE38', 5, '6271010706960002', 'M amin badali', '082352758692', 'Surat pindah ulun jar sudah di uruskan. Apakah ada data nya sudah pindah? Bila ada tolong info kan ke nomor wa ulun 082352758692', '', '', '', '', '', '', '', 'Data terakhir pian pindahan dari Palangkaraya ke Tapin. \r\nseteah itu blm ada, masih aktif di tapin.\r\nTerima Kasih', '3', '2025-01-20', '10:11:56', '0000-00-00', '', '2025-01-20', '10:42:36', '', '126'),
	('200125PE39', 5, '6271010706960002', 'M Amin Badali', '082352758692', 'Bisa lah ulun maurus surat pindah nya lewat online? Untuk berkas nya itu kayapa ? ulun nya diluar daerah. Tolong info kan cara nya?', '', '', '', '', '', '', '', 'Sangat Bisa.\r\nSyarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n1. Mengisi Formulir F-1.02 (menu download formulir)\r\n2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n3. Kartu Keluarga dan KTP-el\r\nTerima Kasih', '3', '2025-01-20', '12:35:38', '0000-00-00', '', '2025-01-20', '14:35:10', '', '126');
