	('200225PE146', 2, '6305021012700001', 'Sumarno', '082353074792', 'Nama ibu kandung tidak ada di kartu keluarga...STLH mndpt wa saya ikutin petunjuk berikut y..masukin no hp/no pengaduan di history pengaduan STLH saya klik cari yg keluar...An error was ecountered....unable to loudhe reguested file -umum/pengaduan treack.php..itu yg keluar????????????', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, untuk mengisi nama ibu pada kolom Ibu, silahkan Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu, dan pilih menu Perubahan KK, penuhi syarat, dan ikuti respon petugas. Terima Kasih', '3', '2025-02-20', '08:49:59', '0000-00-00', '', '2025-02-20', '09:05:23', '', '126'),
