	('200225PE149', 4, '6303082309990002', 'Saini', '085787112533', 'Bikin akta/nambah anggota keluarga', '', '', '', '', '', '', '', 'UNTUK PEMBUATAN AKTA KELAHIRAN SILAHKAN AJUKAN DI MENU AKTA KELIHARAN DAN UNTUK FORMULIRNYA SILAHKAN DOWNLOAD DI MENU DOWNLOAD FORMULIR.TERIMAKASIH', '3', '2025-02-20', '09:35:17', '0000-00-00', '', '2025-02-20', '10:13:37', '', '274'),
	('200225PE150', 4, '6303082309990002', 'Saini', '085787112533', 'Bikin akta/nambah anggota keluarga', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil.\r\nSecara otomatis apabila membuat Akta Lahir (baru lahir/belum ada NIK) akan menambah anggota keluarga pada Kartu Keluarga.\r\nUntuk Syarat silahkan klik tautan berikut : https://pondok.dukcapil.tapinkab.go.id/main/persyaratan pilih AKta Kelahiran.\r\nTerima Kasih.', '3', '2025-02-20', '12:48:57', '0000-00-00', '', '2025-02-21', '07:37:57', '', '126'),
	('200225PE151', 5, '630509012020001', 'siti khadijah', '081293221035', 'ktp terbakar', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil,\r\nUntuk mencetak KTP hilang/terbakar Anda harus membuat *Surat Keterangan Hilang* dari Kepolisian terlebih dahulu, dan itu sebagai syarat pengajuan cetak ulang KTP karena hilang. Syarat : \r\n1. Mengisi Formulir F.1-02\r\n2. Kartu Keluarga\r\n3. Suket Hilang dari Kepolisian\r\n', '3', '2025-02-20', '17:28:02', '0000-00-00', '', '2025-02-21', '07:39:39', '', '126');
