	('200325PE213', 2, '6305012606030002', 'AHMAD HUSIEN THALHAH ', '082158076140', 'Keluar dari Kartu Keluarga yang lama', '', '', '', '', '', '', '', 'Penuhi syarat untuk alasan keluar/pindah dari KK lama, contoh Kawin atau Membentuk Rumah Tangga baru.\r\nPilih 1. Menu Pindah apabila alasan Pindah, 2. Pilih Perubahan KK apabila pecah KK saja tetapi alamat masih SAMA.\r\nUntuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nTerima Kasih.\r\n', '3', '2025-03-20', '10:42:45', '0000-00-00', '', '2025-03-20', '13:01:58', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('200325PE214', 2, '6305064302020001', 'Siti Rahmawati', '085389145266', 'Alamat saya sekarang di desa Rawana Hulu, kalau ingin mengajukan pindah alamat KTP dan KK ke Jakarta apakah yg aslinya harus di kembalikan, tetapi bagaimana kalau posisinya sudah di jakarta? Apakah boleh yg aslinya tidak di kembalikan? ', '', '', '', '', '', '', '', 'Silahkan ajukan permohonan Pindah dari Aplikasi ini (walau Anda sudah ditempat tujuan) dengan melengkapi syarat dan ketentuan, KTP tidak perlu dikembalikan di Tapin, tapin nanti di tarik di tempat tujuan ketika Anda membuat KTP Baru dengan alamat baru. Untuk KK kalau ada yg tertinggal di KK tsb, mohon yg tinggal ajukan kk Baru, kalau semua yg di KK pindah, makan akan diterbitkan KK baru di tempat tujuan.\r\nUntuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. Terima Kasih.', '3', '2025-03-20', '11:01:37', '0000-00-00', '', '2025-03-20', '13:06:22', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('200325PE215', 5, '6305014303080002', 'Loviana Asmaulhusna ', '6287872111834', 'Saya ingin bikin KTP pas di klik di suruh masuk kan pasword karena saya lupa pasword nya saya kli lupa paswor hbis tu saya msuk kan nik stlah masuk kan nik ada tulisan kalau nik tidak tersedia? Mnt tolong ????????????????', '', '', '', '', '', '', '', 'Setelah kami cek, NIK anda belum terdaftar di Aplikasi Pondok Dukcapil. Untuk pengajuan melalui Aplikasi Pondok anda harus Mendaftar/Registrasi terlebih dahulu.\r\nTerima Kasih.', '3', '2025-03-20', '15:59:08', '0000-00-00', '', '2025-03-21', '07:46:19', '', '126'),
	('200525PE389', 5, '6305120111960001', 'Muhammad Edi cahyono ', '087767894876', 'Proses pembuatan akta kelahiran dan kartu keluarga sekalian KIA bisa di percepat kah???? ', 'syarat/2025/05/20/64b90c04f764779ec5061f8c19ed4898.jpg', 'syarat/2025/05/20/1c6c06822f015609ff9a38ae88c3652d.jpg', '', '', '', '', '', 'Baik, status pengajuan bapak sedang kami proses, untuk informasi selanjutnya akan kembali kami sampaikan melalui pesan otomatis kami. Terima kasih.', '3', '2025-05-20', '07:36:07', '0000-00-00', '', '2025-05-20', '07:59:51', '', '126');
