	('200525PE390', 2, '6305054603010001', 'Ni\'mah Azizah', '081916280045', 'Di chat wa sudah masuk persyaratan dikonfirmasi namun dimenu lacak dokumen tidak muncul sama sekali bahkan permohonan hilang 0 karena bekas di edit ', 'syarat/2025/05/20/67a0e050cf8d1da9ebc1d191f5eb73a7.jpg', '', '', '', '', '', 'Baik kami cek terlebih dahulu', 'Pengajuan ulang sudah masuk dan masih dalam proses pengecekan berkas oleh petugas kami. Tahapan permohonan akan diinformasikan melalui pesan otomatis kami, terima kasih.', '3', '2025-05-20', '10:57:05', '2025-05-20', '11:06:50', '2025-05-20', '11:13:40', '162', '162'),
	('200525PE391', 5, '6305036109950002', 'Siti masdina', '087705555540', 'Mengubah akta karena kesalahan penulisan hurup', '', '', '', '', '', '', 'Mohon izin, atas nama siapa yang akan diubah akta kelahiannya?', 'Kami sarankan untuk merubah Kartu Keluarga terlrbih dahulu, silahkan ajukan perubahan Nama (hurup) pada menu Perubahan KK, lampirkan dokumen *Pendukung* perubahan Nama dan lengkapi syarat lainnya. Terima Kasih.', '3', '2025-05-20', '13:51:27', '2025-05-20', '14:33:50', '2025-05-21', '07:20:36', '162', '126');
