	('200525PE392', 5, '6305036109950002', 'Siti masdina', '087705555540', 'Mengubah akta karena kesalahan penulisan nama di akta MUHAMMAD AS\'AT di ganti menjadi MUHAMMAD AS\'AD', '', '', '', '', '', '', '', 'Kami sarankan untuk merubah Kartu Keluarga terlrbih dahulu, silahkan ajukan perubahan Nama (hurup) pada menu Perubahan KK, lampirkan dokumen *Pendukung* perubahan Nama dan lengkapi syarat lainnya. Terima Kasih.', '3', '2025-05-20', '15:48:49', '0000-00-00', '', '2025-05-21', '07:22:46', '', '126'),
	('200625PE460', 2, '6305111107970001', 'muhammad solehuddin', '087853242193', 'mau pindah dari kabupaten banjar ke kabupaten tapin', '', '', '', '', '', '', '', 'Silahkan laporkan pada Menu Kedatangan, jika sudah memiliki Surat Pindah (SKPWNI) dari Kab. Banjar.', '3', '2025-06-20', '12:45:15', '0000-00-00', '', '2025-06-21', '09:38:21', '', '126'),
	('200825PE654', 2, '6305106511920001', 'NI\'MAH KHAYRATI', '082255643441', '1. kartu keluarga yang hilang apakah bisa minta barcode ulang atau dicetak ulang\r\n2. membuat akun di digital kependudukan meminta barcode nya kemana ?', '', '', '', '', '', '', '', '1. Bisa jika sebelumnya kk sudah dengan QRCode, Lampirkan Foto KTP anda dan sebutkan No KK Anda pada konsultasi selanjutnya. \r\n2. Maksud Anda adalah Identitas Kependudukan Digital (IKD) harus langsung dengan Petugas Dukcapil setempat. ', '3', '2025-08-20', '14:34:29', '0000-00-00', '', '2025-08-20', '17:17:04', '', '126');
