	('210125PE40', 5, '6305055512010001', 'Siti Musyafah ', '082148649680', 'Kenapa permohonan selalu di tolak padahal sdh di isi sesuai persyaratan ', '', '', '', '', '', '', '', 'Mohon baca pesan petugas dengan seksama, Terima Kasih', '3', '2025-01-21', '09:30:14', '0000-00-00', '', '2025-01-21', '14:29:16', '', '126'),
	('210125PE41', 5, '6305055512010001', 'Siti Musyafah ', '082148649680', 'Kenapa permohonan selalu di tolak padahal sdh di isi sesuai persyaratan ', '', '', '', '', '', '', '', 'Mohon baca pesan petugas dengan seksama, Terima Kasih', '3', '2025-01-21', '09:30:21', '0000-00-00', '', '2025-01-21', '14:30:17', '', '126'),
	('210125PE42', 5, '6305020206890001', 'RAMADHAN', '08319229569', 'Saya minta tolong data dengan meminta No kartu keluarga saya di karna kan saya berada di luar kota dan saya sangat memerlukan no kk saya ', 'syarat/2025/01/21/c345d5cb927bd14ec5c452b344d9480a.jpg', '', 'syarat/2025/01/21/a2b572d95e6d683a6e1eb39db9294bd1.jpg', '', '', '', '', 'Untuk sementara kami belum bisa memberikan permintaan anda.\r\nUntuk dapat informasi kami perlu beberapa langkah lagi untuk meyakinkan, ajukan pengaduan baru dan sebutkan Nama lengkap Ibu dan Ayah anda dalam kolom pengaduan, serta tempat, tanggal lahir Anda. Terima Kasih.', '3', '2025-01-21', '20:45:45', '0000-00-00', '', '2025-01-22', '07:08:52', '', '126');
