	('210425PE279', 2, '3318150705890002', 'SUSILO ', '085218186202', 'Persyaratan membuat akta kelahiran\r\n', '', '', '', '', '', '', '', 'Persyaratan membuat akta kelahiran =\r\n1. isi formulir ( di print ) \r\n2. fotokopi bukunikah orang tua yg berlegalisir/akta perkawinan\r\n3. fotocopy surat kelahiran\r\n4. fotocopy ktp ayah dan ibu\r\n5. fotocopy ktp saksi 2 orang yg berdomisili Tapin\r\n6. kartu keluarga asli\r\nUNTUK FORMULIR SILAHKAN DI MENU DOWNLOAD FORMULIR', '3', '2025-04-21', '06:53:51', '0000-00-00', '', '2025-04-21', '08:14:41', '', '274'),
	('210425PE280', 2, '6305060301790001', 'Maksum', '081219017863', 'Persyaratan sdh di antar kekantor pos', '', '', '', '', '', '', '', 'Baik terimakasih untuk File Kartu Keluarganya bisa di download di menu download', '3', '2025-04-21', '07:30:42', '0000-00-00', '', '2025-04-21', '08:16:59', '', '274'),
	('210425PE281', 2, '6305076008150001', 'Akira Rizkika', '081251563994', 'Jika ingin memindah KK harus ke kantor capil atau mall pelayanan publik?', '', '', '', '', '', '', 'Untuk memindah KK bisa lewat Online,ke kantor atau ke MPP. terimakasih', 'Untuk memindah KK bisa lewat Online,ke kantor atau ke MPP. terimakasih\r\n', '3', '2025-04-21', '08:39:29', '2025-04-21', '08:49:43', '2025-04-21', '08:59:52', '274', '274');
