	('210425PE282', 2, '6303106307990002', 'Munawarah', '082154080932', 'Tidak bisa login karna nik tidak terdaftar padahal sudah registrasi.', '', '', '', '', '', '', '', 'Mohon maaf, Setelah kami cek di data kami blm ada NIK Anda, Silahkan Registrasi Ulang dengan memasukan NIK, KK dengan benar, dan no Whatsapp yang terdaftar, Teima Kasih', '3', '2025-04-21', '10:05:54', '0000-00-00', '', '2025-04-21', '10:39:16', '', '126'),
	('210425PE283', 5, '6305010303830003', 'FAHRUL ', '081346339655', 'Kartu Keluarga Saya kenapa Ada permasalahan,data anak Saya tidak sesuai katanya di sekolah untuk membuat ijazah, \r\nsaat ini saya tinggal di Tanah Bumbu ', 'syarat/2025/04/21/006b806b3f0f4a23d15206a9ac632b44.jpg', 'syarat/2025/04/21/951593d4abc1681dff6d8c229548293c.jpg', 'syarat/2025/04/21/3a67308b637d6d6fa00b8976c819c1ce.jpg', 'syarat/2025/04/21/fa1d7b1824fd8641701b08bb4ff429b5.jpg', 'syarat/2025/04/21/0eddf16233aaeb039b60d96ce6f3d0da.jpg', '', 'Terima kasih telah menghubungi kami, mohon kiranya perlihatkan KIA serta Akta Kelahiran anak ke pihak Sekolah. Sementara data Bpk/Ibu kami cek terlebih dahulu, mohon kiranya dpt menunggu respon kami selanjutnya. Tks', 'Data anak An. KHAIRUN NIDA sudah kami Konsolidasikan dan sudah tampil di data Nasional dan dapat dipergunakan sebegaimana mestinya, Terima Kasih', '3', '2025-04-21', '11:18:41', '2025-04-21', '14:43:31', '2025-04-22', '07:27:40', '126', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('210425PE284', 2, '6305055604020001', 'Munah', '087836173879', '1.)Saya ingin membuat KIA anak, akta kelahiran dan kartu keluarga, mana yang harus saya urus lebih dahulu\r\n2.) apakah boleh orang tua atau suami yang jdi saksi lahiran sebagai syarat membuat akta kelahiran\r\n3.) anak saya masih bayi berumur 1 bulan apakah tetap pakai foto untuk syarat membuat KIA ', '', '', '', '', '', '', '', 'Terima Kasih, \r\n1). Akta Kelahiran terlebih dahulu, karena nanti pembuatan Akta Kelahiran Include dengan KIA dan KK baru.\r\n2) Boleh Orang Tua (Kakek/nenek/paman/acil) selain orang tua sendiri dr anak\r\n3) Anak di bawah umur 5 tahun tidak wajib pakai foto.\r\nDemikian disampaikan. \r\n', '3', '2025-04-21', '18:57:50', '0000-00-00', '', '2025-04-22', '07:32:06', '', '126'),
	('210525PE393', 2, '1306071312930002', 'Fransiskus Rudi Hartono ', '082250381993', 'Data saya sudah di proses minta domisili setelah itu yg di kerjakan apa bu pak', '', '', '', '', '', '', 'Kami cek terlebih dahulu, mohon menunggu informasi selanjutnya.', 'Setelah kami cek permohonan Anda, pada Formulir F.1-03 ada kesalahan pada alamat tujuan kecamatan dengan nama Medan Heiptia dan kelurahan dangan nama Tanjung Kusta tidak ada di Kabupaten Deli Serdang - Sumut, silahkan perbaiki isian Formulir F.1-03 Anda dan ajukan ulang permohonannya (cek pada menu lacak permohonan). Terima Kasih', '3', '2025-05-21', '08:29:54', '2025-05-21', '08:56:15', '2025-05-21', '09:49:47', '126', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('210525PE394', 2, '6305066708990003', 'Sauzan Nur Alya', '085624024272', 'Selamat pagi Bapak/Ibu\r\n\r\nMau bertanya soal dokumen persyaratan perubahan elemen data KTP yang sudah saya upload, apabila sudah diproses apakah dokumen persyaratan itu perlu saya kirimkan ke kantor pos juga bentuk fisiknya?\r\n\r\n\r\nTerimaksih.', '', '', '', '', '', '', '', 'Bila Anda memilih pengambilan Via Pos maka nanti Petugas Pos yang meminta Fisik KTP Lama serta persyaratan sesuai yang anda upload, dan apabila langsung di kantor Dukcapil Anda harus membawa berkas syarat sesuai yang di upload di aplikasi. Demikian informasinya, Terima Kasih.', '3', '2025-05-21', '08:54:45', '0000-00-00', '', '2025-05-21', '09:54:07', '', '126'),
	('210525PE395', 2, '6305066708990003', 'Sauzan nur alya', '085624028272', 'Selamat pagi bapak/ibu\r\n\r\nIzin bertanya. Kemarin saya sudah melengkapi dokumen persyaratan untuk pembuatan KK baru dan perubahan elemen data KTP dan KK, dan sudah saya upload untuk diproses. Apakah dokumen itu juga perlu saya kirimkan melalui pos bentuk fisiknya?\r\n\r\n\r\nTerimakasih.', '', '', '', '', '', '', '', 'Bila Anda memilih pengambilan Via Pos maka nanti Petugas Pos yang meminta Fisik KTP Lama serta persyaratan sesuai yang anda upload, dan apabila langsung di kantor Dukcapil Anda harus membawa berkas syarat sesuai yang di upload di aplikasi. Demikian informasinya, Terima Kasih.', '3', '2025-05-21', '08:59:57', '0000-00-00', '', '2025-05-21', '09:54:20', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('210525PE396', 5, '1306071312930002', 'Fransiskus Rudi Hartono ', '082250381993', 'Alamat nya memang itu kog ngak di terima \r\nPadahal saya ambil dri ktp keluarga saya\r\nMohon bimbingan nya pak /bu', '', '', '', '', '', '', '', 'Di Sistem kami tidak ada nama Kelurahan dan Kecamatan tersebut di Deli Serdang. Mohon lampirkan pada pengaduan selanjutnya data referensi Anda. Terima Kasih.', '3', '2025-05-21', '09:29:03', '0000-00-00', '', '2025-05-21', '09:56:05', '', '126'),
	('210525PE397', 2, '6303014607970007', 'Sinta', '085825576304', 'Berkas sdh di terima ksntorpos', 'syarat/2025/05/21/580254576fbdedd2a11297f7d4252875.jpg', '', '', '', '', '', '', 'Untuk Akta kelahiran pdf-nya memang tidak di Upload di aplikasi, karena ada Dokumen Register yang wajib di tanda tangani oleh pelapor. \r\nApabila via Pos akan diserahkan oleh Pihak Pos ke tempat Anda, Terima Kasih.', '3', '2025-05-21', '10:19:01', '0000-00-00', '', '2025-05-21', '10:26:17', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('210525PE398', 5, '1306071312930002', 'Fransiskus Rudi Hartono ', '082250381993', 'Sudah saya ulang i kemana dinkrim pak bu', 'syarat/2025/05/21/0a81b02f80cea2e5d97c966325134738.jpg', '', '', '', '', '', '', 'Setelah kami cek, izin untuk kolom kabupaten tambah menjadi KOTA MEDAN biar sesuai.\r\nUntuk pengajuan ulang silahkan Anda cek di MENU LACAK PERMOHONAN, PILIH TAB DITOLAK, PILIH AJUKAN ULANG.\r\nGanti upload F.1-03 lama dengan yang sudah diperbaiki tadi. Terima Kasih.', '3', '2025-05-21', '10:26:30', '0000-00-00', '', '2025-05-21', '10:38:17', '', '126'),
	('210525PE399', 5, '1306071312930002', 'Fransiskus Rudi Hartono ', '082250381993', 'perbaiki isian Formulir F.1-03 sudah saya ajukan ulang permohonannya terimaksih pak bu,mohon bimbingan nya apa perlu saya bsok pagi datang kesana saran dri bapak atau ibu,soal jya saya kerja di banjar masin pak bu mohon pengertian nya saya ucapkan terimaksih', '', '', '', '', '', '', '', 'Biasa SKPWNI (surat pindah) file nya kami upload di aplikasi Pak, jadi nanti sampean tunggu notifikasi selanjutnya saja, tidak perlu repot datang ke Kantor Dukcapil Tapin. Nanti sampean tinggal download jika sudah selesai, dan bisa d print mandiri. Update terakhir sudah kami lapor ke operator untuk segera di tindak lanjuti. Terima Kasih.', '3', '2025-05-21', '10:46:35', '0000-00-00', '', '2025-05-21', '11:37:37', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('210525PE400', 2, '630506670899000', 'Sauzan Nur Alya', '085624028272', 'Selamat sore Bapak/Ibu.\r\n\r\nMohon maaf apablia menghubungi diluar jam kerja.  Mau menanyakan Kartu Keluarga Lama dari Suami saya atas nama Febrian Ramadhan (tanah bumbu), Dia kan sudah pisah kartu keluarga untuk bikin kartu kelurga baru alamat sini (Kab,tapin) dan sudah terbit. Nah untuk KK yang lama itu apakah juga otomatis sudah berubah? Dan itu lihatnya dimana, apakah didukcapil tanah bumbu?\r\n\r\n\r\nSoalnya tadi saya cek KK yang sudah di proses hanya KK baru kami berdua dan KK lama saya. Sedangkan KK lama suami saya tidak ada.\r\n\r\n\r\nTerimaksih semoga dapat difahami', '', '', '', '', '', '', '', 'Setelah kami cek, suami ibu pindahan tanah bumbu, yang otomatis akan hilang dari kk lamanya karena proses pindah, dan di kk lama di tanah bumbu otomatis berubah tanpa suami ibu, tinggal orang tuanya dan anggota keluarga lainnya, dan posisi kk nya di tanah bumbu.', '3', '2025-05-21', '14:31:14', '0000-00-00', '', '2025-05-21', '14:59:44', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('210725PE565', 5, '6305045805950002', 'Meidha nor annisa rahman', '083136602988', 'Ktp hilang', '', '', '', '', '', '', '', 'Untuk mencetak KTP/KK Anda harus melampirkan syarat sbb :\r\n	1. Formulir F.1-02, (menu download formulir)\r\n	2. Kartu Keluarga, \r\n	3. KTP Rusak/Ganti (Jika Rusak/Ganti)\r\n	4. Suket Hilang dari Kepolisian (Jika Hilang)\r\n	5. Formulir F.1-06, (Jika ada Perubahan) \r\n	6. Bukti (Dokumen) Pendukung --> AKta Cerai\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-07-21', '06:48:23', '0000-00-00', '', '2025-07-21', '07:20:05', '', '126'),
	('210725PE566', 5, '6303055808950006', 'Fatma Dayani ', '081349224889', 'Salah data nama di surat domisili ', '', '', '', '', '', '', '', 'Untuk mencetak KTP/KK Anda harus melampirkan syarat sbb :\r\n	1. Formulir F.1-02, (menu download formulir)\r\n	2. Kartu Keluarga, \r\n	3. KTP Rusak/Ganti (Jika Rusak/Ganti)\r\n	4. Suket Hilang dari Kepolisian (Jika Hilang)\r\n	5. Formulir F.1-06, (Jika ada Perubahan) \r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-07-21', '07:18:06', '0000-00-00', '', '2025-07-21', '07:21:05', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('210725PE567', 2, '6305010612920003', 'Hairun', '082154782500', 'Mengajukan permohonan perpanjangan KIA', 'syarat/2025/07/21/c43d10e483dd2542b71e337bc39972f6.jpg', 'syarat/2025/07/21/8911f7485428b30d1dee084ff962257b.jpg', 'syarat/2025/07/21/83a14f8558f9f49c4e21b28ddf48656a.jpg', '', '', '', '', 'Izin, syarat pian sudah pas aja, tapi pian ajukan di Aplikasi pada Menu KIA.\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-07-21', '07:29:09', '0000-00-00', '', '2025-07-21', '07:35:36', '', '126'),
	('210725PE568', 5, '0305060204040001', 'saukani', '081903200605', 'Kirimkan KTP saya di kantor pos margasari', '', '', '', '', '', '', '', 'Mohon izin berapa nomor permohonan KTP anda?, biar kami Lacak terlebih dahulu. Tks', '3', '2025-07-21', '17:53:27', '0000-00-00', '', '2025-07-22', '07:20:03', '', '126'),
	('210825PE655', 2, '6305014107030021', 'JANATUL MA\'WA', '088245411607', 'ingin cetak ktp adek saya', '', '', '', '', '', '', '', 'Bisa dimohonkan apabila masih dalam 1 Kartu Keluarga, apabila tidak infokan yang bersangkutan/keluarga yang masih 1 KK yang memohon. Terima Kasih', '3', '2025-08-21', '10:22:48', '0000-00-00', '', '2025-08-21', '11:35:54', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('220125PE43', 5, '6305110812640001', 'Rasiman', '88704601971', 'Mau bikin kartu keluarga \r\nYang sebelum nya hilang \r\nJadi apa aja ya persyaratan nya?', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil,\r\nUntuk mencetak KARTU KELUARGA hilang Anda harus membuat *Surat Keterangan Hilang* dari Kepolisian terlebih dahulu, dan itu sebagai syarat pengajuan cetak ulang Kartu Keluarga karena hilang. Dan mengisi Formulir F.1-02 Permohonan Dokumen, dan KTP Pemohon.\r\n', '3', '2025-01-22', '05:50:08', '0000-00-00', '', '2025-01-22', '08:29:22', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('220125PE44', 5, '6305020206890001', 'RAMADHAN', '083192009566', 'Disini uln minta tolong kepada bapak/ibu dari petugas Dukapil daerah TAPIN RANTAU,,ulun hadak minta( No KK) Ulun .dan berhubung Ulun di luar daerah Kalimantan jadi kada kwa langsung berhadir datang langsung ke kantor Dukapil TAPIN, KARENA ADA KEPERLUAN YANG SANGAT MENDESAK YANG DI HARUS KAN MELAMPIR KAN( NO KK) JADI SAYA HANYA BISA MELALUI WHATSAPP SAJA SALAH KHILAF MOHON AMPUN DAN MAAF????????', 'syarat/2025/01/22/c47192ab2f18e3edc964988aa0a7390b.jpg', 'syarat/2025/01/22/dd7598ce932e717869a23220b9e4a131.jpg', '', '', '', '', '', 'Mohon Isi manual (isi titik-titik) pada pesan pengaduan berikutnya (baru) :\r\n1. Nama Lengkap Ayah : ......\r\n2. Nama Lengkap Ibu : .......\r\n3. Tempat, tanggal lahir Anda : .......\r\nDi isi nama ayah ibu pian. TTL nya ampun pian. Terima Kasih', '3', '2025-01-22', '09:16:04', '0000-00-00', '', '2025-01-22', '13:56:08', '', '126'),
	('220125PE45', 5, '6305010708000003', 'Muhammad Ridwan', '083195450004', 'Apakah bisa berkas dikirim lewat pos lagi? Kalau bisa gimana caranya', '', '', '', '', '', '', '', 'Pilih pada entri pengajuan, ada pilihan data pengambilan/penyerahan berkas, dan pilih Kantor POS.\r\nTerima Kasih', '3', '2025-01-22', '10:22:45', '0000-00-00', '', '2025-01-22', '13:57:59', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('220425PE285', 2, '6305021404950001', 'Ahmad maulana', '083890935347', 'Karena pengajuan ditolak untuk membuat akta kelahiran di karena kan saya tidak meuplod ktp\r\nYg sya tanyakan dimana saya me upload ktp oemohon di kolom persyaratan karena sy tdak menemukan kolom untuk upload kto', 'syarat/2025/04/22/52d5c9448c592ac3108480b0db56b44e.jpg', '', '', '', '', '', '', 'Silahkan masuk pada menu Lacak Permohonan, disana ada pilihan di tolak, silahkan buka dan pilih ajukan ulang dan silahkan tambah/upload kekurangan nya. Tks', '3', '2025-04-22', '08:35:16', '0000-00-00', '', '2025-04-22', '08:52:32', '', '126'),
	('220425PE286', 2, '6472026901980001', 'NORFITRIANI', '085386777027', 'Bagaimana cara pengurusan untuk KIA anak yg baru? KIA anak saya hilang ????', '', '', '', '', '', '', '', 'Syarat KIA Hilang :\r\n1. Mengisi Formulir F-1.02 Permohonan (menu download formulir)\r\n2. Suket Hilang dari Kepolisian (Jika Hilang)\r\n3. Foto anak berwarna ukuran 3x4 sebanyak 2 (dua) lembar untuk anak 5 ke atas, dibawah 5 tahun tidak perlu Foto anak.', '3', '2025-04-22', '17:15:38', '0000-00-00', '', '2025-04-23', '09:25:56', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('220525PE401', 5, '6305066708990003', 'Sauzan Nur Alya', '085624028272', 'Selamat pagi bapak/ibu \r\n\r\nTerkait komplain saya kemarin a.n Sauzan Nur Alya tentang pekerjaan suami saya yang tercantum dalam KK yaitu wiraswasta untuk minta diubah ke Swasta saja, apakah masih bisa diperbaiki? \r\nKarena kemarin saat komplain, saya kira tidak ada respon sehingga baru tadi pagi saya konfirmasi acc. Ternyata ada balasan dari pihak Dukcapil yang menanyakan ulang tentang pekerjaan suami saya.\r\nPekerjaannya adalah swasta bukan wiraswasta.\r\n\r\nSekian terimakasih, semoga dapat difahami.', '', '', '', '', '', '', '', 'Dalam Sistem Aplikasi SIAK Kemendagri tidak ada pekerjaan SWASTA saja, yang ada WIRASWASTA dan KARYAWAN SWASTA terkait hal tersebut. Agar dapat dipilih dan di tentukan sesuai ketentuan yang ada.', '3', '2025-05-22', '07:24:56', '0000-00-00', '', '2025-05-22', '08:02:33', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('220525PE402', 5, '6305066708990003', 'Sauzan Nur Alya', '085624028272', 'Sedikit tambahan dari aduan saya sebelumnya, saya mau menanyakan tentang status pekerjaan suami saya di KTP yang baru apakah tercantum wiraswasta atau swasta? Karena yang benar adalah swasta. \r\nApabila sudah dikirimkan lewat pos, apakah bisa saya kirim balik KTP baru nya untuk diperbaiki kembali beserta kelengkapan berkas yang diminta untuk dikirimkan melalui POS.\r\n\r\n\r\nTerimakasih.', '', '', '', '', '', '', '', 'Dalam Sistem Aplikasi SIAK Kemendagri tidak ada pekerjaan SWASTA saja, yang ada WIRASWASTA dan KARYAWAN SWASTA terkait hal tersebut. Agar dapat dipilih dan di tentukan sesuai ketentuan yang ada. ', '3', '2025-05-22', '07:29:28', '0000-00-00', '', '2025-05-22', '08:08:53', '', '126'),
	('220525PE403', 5, '6305066708990003', 'Sauzan Nur Alya', '085624028272', 'Terkait komplain saya sebelumnya tentang status pekerjaan suami saya a.n FEBRIAN RAMADHAN, karena tidak ada yang namanya swasta maka sudah benar yang tercantum yaitu wiraswasta', '', '', '', '', '', '', '', 'Baik terima Kasih.', '3', '2025-05-22', '08:25:30', '0000-00-00', '', '2025-05-22', '08:56:33', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('220525PE405', 2, '6305022812990002', 'Josswa ramadani', '082148755505', 'Persyaratan memeperbaiki ktp yg buram', '', '', '', '', '', '', '', '1. Mengisi Formulir F.1-02 Permohonan\r\n2. KTP Lama/Rusak\r\n3. Foto KK\r\nSilahkan Ajukan Pemohoanan Pada Menu Cetak KTP, Terima Kasih', '3', '2025-05-22', '13:23:46', '0000-00-00', '', '2025-05-22', '20:23:02', '', '126'),
	('220525PE406', 5, '6305066708990003', 'Sauzan Nur Alya', '085624028272', 'Selamat sore Bapak/Ibu \r\n\r\nMaaf apabila menghubungi diluar jam kerja. Hanya mau menyampaikan bahwa untuk berkas persyaratan perubahan elemn data KTP saya dan suami kemarin baru bisa saya kirimkan senin 26 Mei 2025 minggu depan, berhubung KTP lama suami saya terbawa suami ketempat kerja dan baru balik dihari minggu.\r\n\r\n\r\nSekian Terima kasih.', '', '', '', '', '', '', '', 'Baik terima kasih', '3', '2025-05-22', '14:37:17', '0000-00-00', '', '2025-05-22', '18:34:20', '', '126'),
	('220525PE407', 5, '1234567890123456', 'TES', '0812345678910', 'tes', '', '', '', '', '', '', '', 'cek lacak pengaduan bro', '3', '2025-05-22', '19:25:23', '0000-00-00', '', '2025-05-22', '20:20:46', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('220525PE919', 2, '6308054603910004', 'Murliani ', '085931918429', 'Ulun sdah ada isi kk, tp di kaka blm tabuat anak jd ky apa?, nik anak kd tahu..ulahakan kan pang', '', '', '', '', '', '', '', 'Terdata di Database kami ada anak dengan NIK 6305020802250001,	Nama : MUHAMMAD AVICENNA HUSEIN. Apabila di KK belum ada silahkan ajukan permohonan KK. Terima Kasih. ', '3', '2025-05-22', '08:49:12', '0000-00-00', '', '2025-05-22', '12:56:03', '', '126'),
	('220725PE569', 2, '6304026609990001', 'Zulfatul Ma\'rifah ', '085389669736', 'Istri (domisili Tapin), Suami (domisili Banjarbaru). Pada syarat surat pindah domisili, jika sudah menikah dan istri akan ikut domisili suami, apakah ketika istri mengurus surat pindah di kantor disdukcapil, suami perlu ikut serta atau hanya istri saja?', '', '', '', '', '', '', '', 'Kalau salah satu (istri) saja yang pindah ke tempat suami, jadi istri aja yang membuat surat pindah dari Tapin tujuan Banjarbaru.\r\nUntuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nSyarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n	1. Mengisi Formulir F-1.02 Permohonan (menu download formulir)\r\n	2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n	3. Kartu Keluarga dan KTP-el\r\n	4. Bukti Dukung Lainnya (jika ada alasan lain)\r\nTerima Kasih', '3', '2025-07-22', '04:45:51', '0000-00-00', '', '2025-07-22', '07:19:03', '', '126');
