	('220725PE570', 5, '3202291803730001', 'Ade', '087733239225', 'Pengajuan srt pindah dr kemaren belum ada di respon sama skali oleh pihak petugas,tidak semua org bisa langsung datang k kantor dan klo lwat online di persulit kenapa d adakan.semoga pagi ini srt pindah saya udah selesai karna saya mau pencairan pinjaman bank,ini udah di tanya pihak bank terkait karna saat ini posisi saya di kab banjar ', 'syarat/2025/07/22/5f7f125172a3547848952d73ea8e3690.jpg', '', '', '', '', '', '', 'Setelah kami cek, \r\nNomor permohonan : 210725PD1070 \r\nStatus : Selesai (08:51)\r\nTerima kasih.', '3', '2025-07-22', '07:32:08', '0000-00-00', '', '2025-07-22', '08:57:34', '', '126'),
	('220725PE571', 2, '6305010612920003', 'Hairun', '082154782500', 'Saya mengajukan permohonan perpanjangan KIA, sudah mengajukan lewat menu KIA dan ad apilihan konfirmasi. sudah klik konfirmasi di menu info permohonan dan diberi informasi lewat whatsapp dokumen diterima. Itu nanti KIA yang sudah dicetaknya akan dikonfirmasi lagi kah untuk diambil atau dikirim lewat kantor pos ? Atau bagaimana ?', 'syarat/2025/07/22/f219ea949fba7d0075740eaf19722335.jpg', '', '', '', '', '', '', 'NOMOR PERMOHONAN : 210725KIAG1069\r\nSTATUS : SELESAI\r\nPENGIRIMAN/PENGAMBILAN : VIA POS\r\nINFORMASI : MOHON MENUNGGU PIHAK POS\r\nKONTAK POS BINUANG : 0812-5016-6980', '3', '2025-07-22', '10:39:15', '0000-00-00', '', '2025-07-22', '11:28:19', '', '126');
