	('220825PE658', 5, '6305081003050004', 'Muhammad Rusli', '082154635122', 'Ini di kk yg tersimpan masih memiliki anggota keluarga teridiri dara 5 anggota keluarga sedangkan di kk dukcapil ada 4 anggota keluarga knpa gk di serahkan ya kk terbaru nya ', '', '', '', '', '', '', '', 'Mungkin KK yang Anda pegang adalah KK lama, untuk mendapatkan KK baru silahkan ajukan Permohonan pada Aplikasi pada Menu Perubahan KK. Terima Kasih', '3', '2025-08-22', '09:22:57', '0000-00-00', '', '2025-08-22', '09:47:44', '', '126'),
	('220825PE659', 2, '6305025206930001', 'Isma ridha', '081254009793', 'Misalkan nama di KK, KTP,Akta kita beda nama di buku nikah sama akta anak. Apakah bisa di rubah?\r\nMisal d KK KTP Akta (Akhmad) .. tp d buku nikah dan akta anak (Ahmad). Apa kah bisa di rubah yg di KTP,KK dan akta..', '', '', '', '', '', '', '', 'Dalam kondisi seperti itu, dokumen kependudukan semua sama (KK/KTP,Akta), tetapi buku nikah dan Akta anak berbeda. Kami sarankan untuk konsultasi langsung ke Kantor Dukcapil dengan membawa dokumen pendukungnya, Contoh Izajah Anda apakah Akhmad/Ahmad. Terima Kasih', '3', '2025-08-22', '18:58:14', '0000-00-00', '', '2025-08-23', '10:39:02', '', '126');
