	('230125PE46', 5, '6271010706960002', 'M. Amin Badali', '082352758692', 'Ulun udah maurus surat pindah lewat online, kawalah langsung ulun maurus akta anak ulun jua? Atau mahadang surat pindah nya tuntung kh dulu hanyar ulun maurus akta anak ulun ? TERIMA KASIH.', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil,\r\nInggih, amun pian sudah dapat kartu keluarga Tapin hanyar pian bisa maurus AKTA anak pian, bisa aja lewat Online Aplikasi ini.\r\nTerima Kasih', '3', '2025-01-23', '07:32:43', '0000-00-00', '', '2025-01-23', '08:29:50', '', '126'),
	('230125PE47', 5, '6305010071155000', 'H.ARJAN.A.YUNUS', '085753961407', 'Permohonan kartu keluarga(KK)warga baru negara indonesia', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil,\r\nUntuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nDownload Aplikasi Pondok Dukcapil berbasis Android di link berikut :\r\nhttps://drive.google.com/file/d/19kCzRnajLBkFC93WoHci7XqUplwXUpFQ/view?usp=sharing\r\nAtau Website : https://pondok.dukcapil.tapinkab.go.id/\r\n\r\n', '3', '2025-01-23', '07:57:30', '0000-00-00', '', '2025-01-23', '08:32:34', '', '126');
