	('230125PE48', 5, '3315066810000003', 'Dinar Tri Rahayu', '082252470335', 'Selamat pagi Admin, perkenalkan saya Dinar warga domisili Parandakan, Kab. Tapin. Izin bertanya mengenai perihal KK. Ketika saya hendak membuat akun pendaftaran cpns dan pengunggahan berkas untuk pembuatan E-passpor, terdapat kendala ketidaksesuaian NIK dengan KK yang baru. Setelah saya cocokkan, ternyata terdapat ketidaksesuaian 5 angka pertama dan 1 angka terakhir dari NIK yang tertulis di KTP dengan 5 angka pertama dan 1 angka terakhir dari NIK yang tertulis pada KK. Dan penulisan yang berbeda itu juga terjadi pada data Ibu Saya. Mohon bantuannya mengenai hal tersebut dan juga mekanisme penyelesain permasalahan tersebut admin. Terima kasih sebelumnya. ', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, mohon perkiraan sementara di KK, NIK ibunya tidak sesuai dengan NIK KTPel yg dipegang Ibu Anda, untuk itu bantu kami untuk pengecekan lebih lanjut dengan melampirkan foto kk dan ktp yg belum sesuai, pada pengaduan berikutnya. \r\nTerima Kasih.', '3', '2025-01-23', '08:59:22', '0000-00-00', '', '2025-01-23', '15:15:23', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('230125PE49', 5, '6271010706960002', 'M. Amin Badali', '082352758692', 'Ulun udah baisi SURAT KK dari TAPIN , ulun wahini badiam di KAL-TENG ,handak baulah surat pindah dari TAPIN handak k KAL-TENG, dan ulun handak baulah SURAT AKTA ANAK jua, jadi yg ulun takun akan kawalah baulah nya langsung baimbai? Atau yg mana dulu di dahulu akan? TERIMA KASIH PETUGAS.', '', '', '', '', '', '', '', 'Bisa banar om, untuk Akta anak bagus nya pas pian pindah disana aja,\r\nUntuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nSyarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n1. Mengisi Formulir F-1.02 (menu download formulir)\r\n2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n3. Kartu Keluarga dan KTP-el\r\nTerima Kasih', '3', '2025-01-23', '09:10:53', '0000-00-00', '', '2025-01-23', '15:05:56', '', '126');
