	('230125PE50', 5, '6305020901080001', 'M. Ridha', '085250914142', 'KENAPA MIN PENGAJUAN AKTA KELAHIRAN SELALU DI TOLAK DAN ALASANNYA MENU UNDUH DOKUMEN TIDAK MUNCUL , TOLONG SOLUSINYA MIN SUDAH DUA KALI PENGAJUAN APKNYA GA SEEFEKTIF WAKTU LANGSUNG LEWAT WA MIN', 'syarat/2025/01/23/7ed915d000eb405d031cda3049990eb2.jpg', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, dr informasi yang anda lampirkan, anda bisa pilih menu edit pengajuan untuk melengkapi syarat yang di sarankan Petugas. Apabila masih ada masalah, infokan nomor Transaksi Anda ke pengaduan berikutnya agar dapat kami tracking.', '3', '2025-01-23', '09:34:04', '0000-00-00', '', '2025-01-23', '15:09:08', '', '126'),
	('230125PE51', 5, '6271010706960002', 'M. Amin Badali', '082352758692', 'Ulun udah ada baisi SURAT PINDAH dari TAPIN handak ke PALANGKA RAYA, kawa lah masih ulun handak baulah SURAT AKTA ANAK ulun lewat TAPIN ? TERIMA KASIH PETUGAS. ', '', '', '', '', '', '', '', 'Bisa banar om, untuk Akta anak bagus nya pas pian pindah disana aja,\r\nUntuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nSyarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n1. Mengisi Formulir F-1.02 (menu download formulir)\r\n2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n3. Kartu Keluarga dan KTP-el\r\nTerima Kasih', '3', '2025-01-23', '10:25:15', '0000-00-00', '', '2025-01-23', '15:06:14', '', '126');
