	('230125PE52', 5, '6305012704000002', 'Ridwan nur aziz', '082159191937', 'Assalamualaikum disini saya ingin menyampaikan bahwa saya ingin mengubah kk saya', '', '', '', '', '', '', '', 'Waalaikumsalam, Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nKalau sudah registrasi dan disetujui, silahkan pilih Menu Perubahan KK dengan mengisi data-data yang diperlukan dan memenuhi syarat yang sudah di tentukan.\r\nTerima Kasih.', '3', '2025-01-23', '22:18:08', '0000-00-00', '', '2025-01-24', '07:27:16', '', '126'),
	('230425PE287', 2, '6305061501830002', 'M.ikhwan', '082253359519', 'Pak saat ini saya ada di Banjarmasin apa bisa pak di kirim ke kantor pos banjarmasin yg beralamat di pekauman', '', '', '', '', '', '', '', 'Apabila yang di mohon adalah Surat Pindah dan KK tidak perlu dikirim bisa langsung di download di aplikasi (syarat ketentuan berlaku), kalau selain pindah dan KK akan kami tanyakan terlebih dahulu ke pihak POS.', '3', '2025-04-23', '08:55:56', '0000-00-00', '', '2025-04-23', '09:33:11', '', '126');
