	('230425PE289', 2, '6305015805950002', 'Mely Ulandari', '081522838589', 'Apabila Akta Kelahiran Anak hilang dengan nomor KIA 6305015808200002, apakah Dukcapil bisa membantu mencetak ulang?', 'syarat/2025/04/23/9654592302548570c87b2bec0f597c24.jpg', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, berikut syaratnya :\r\n	1. Foto Formulir F.2-01 (Kelahiran) yg sudah diisi --> Download Formulir\r\n	2. Foto Kartu Keluarga, \r\n	3. Foto Kutipan Buku Nikah,\r\n	4. Foto KTP Orang Tua (Suami-Istri),\r\n	5. Foto Keterangan Lahir (bidan/dokter),\r\n	6. Foto KTP Saksi 2 Org.\r\n	7. Surat Keterangan Hilang (Wajib jika hilang)\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-04-23', '09:23:13', '0000-00-00', '', '2025-04-23', '09:30:28', '', '126'),
	('230425PE290', 2, '6305124508060001', 'FARIDATUS ZAKIYA', '083140281138', 'Membuat ktp', 'syarat/2025/04/23/6cb237d6884e9cfa452ab502ae89d05f.jpg', 'syarat/2025/04/23/f34463bbd97d0c5f6fc0cc7e4995f225.jpg', '', '', '', '', '', 'Untuk mencetak KTP  Anda harus melampirkan syarat sbb :\r\n	1. Formulir F.1-02, (Pendaftaran)\r\n	2. Kartu Keluarga, \r\n	3. Formulir F.1-06, (Jika ada Perubahan)\r\n	4. Foto Dokumen Pendukung (Izajah, dll) jika diperlukan\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-04-23', '09:41:19', '0000-00-00', '', '2025-04-23', '09:45:38', '', '126');
