	('230425PE291', 2, '6305125710040002', 'TRI MULIYANA ', '085822650133', 'Mau tanya kalo mau bikin kartu keluarga secara online apa persyaratan nya', '', '', '', '', '', '', '', 'Bisa. Mohon sebutkan bikin kartu keluarga karena apa, contoh Pisak KK. pindah KK, atau lainnya.\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-04-23', '10:18:09', '0000-00-00', '', '2025-04-23', '10:26:11', '', '126'),
	('230425PE292', 2, '6305125710040002', 'Tri muliyana', '085822650133', 'Mau bikin kartu keluarga dan akta sama ubah status di ktp', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, Silahkan ajukan permohonan di Aplikasi Online kami, Sebelumnya anda harus daftar Akun terlebih dahulu.\r\nUntuk Akta kelahiran anak bisa include dengan KK, untuk perubahan status KTP silahkan lampirkan bukti dukung berupa Buku Nikah.', '3', '2025-04-23', '10:34:25', '0000-00-00', '', '2025-04-23', '10:54:18', '', '126'),
	('230425PE293', 2, '6305016712990002', 'Almaliatul fitriah', '089652892979', 'Hallo kak , mau bikin KK tapi tidak nikah resmi apakah bisa? Apa aja syarat nya', '', '', '', '', '', '', '', 'Yang admin tahu kalau gabung kk tapi tidak nikah resmi tidak bisa, untuk lebih lanjut silahkan berkunjung ke kantor Disdukcapil Tapin. Terima Kasih', '3', '2025-04-23', '11:28:02', '0000-00-00', '', '2025-04-23', '14:00:38', '', '126');
