	('230425PE294', 5, '6305064302020001', 'Siti Rahmawati', '085389145266', 'Izin bertanya pak. Saya mau ngurus pindah domisili. Sdh mengisi link beberapa hari lalu tp sampai ini belom dapat pdf surat pindahnya', '', '', '', '', '', '', '', 'Mohon izin beritahu kami nomor permohonan pindahnya, silahkan ajukan pengaduan baru dengan menginformasikan nomor permohonan pindah nya agar kami dapat me *Lacak* permohonan pindah Anda. Terima Kasih. ', '3', '2025-04-23', '12:30:33', '0000-00-00', '', '2025-04-23', '13:57:07', '', '126'),
	('230425PE295', 2, '6303040607840004', 'HENDRA SAPUTRA ', '081255591286', 'Saya ingin mengubah nama yang selama ini salah dalam pengajuan,pembuatan dan permohonan dokumen kependudukan seperti KTP,KK, dan Akte kelahiran.nama yang tercantum dalam dokumen kependudukan saya adalah atas nama BUSRA JUDIN.sdgkn nama sebenar y yg tercantum pada ijazah,SD,SMP,dan MAN yg betul adlh BUSERA.sy baru berniat merubah y krn keterbatasan informasi.mhn di bantu seperti apa mudah dan syarat2 y yg bisa sy isi dan tdk membingungkan sy jika dlm pengisian formulir elemen perubahan data.klw bisa ada contoh pengisian layak y seseorang mengajukan SKCK di kepolisian.????????????', '', '', '', '', '', '', '', 'Silahkan klik link berikut untuk tatacara pengisian formulir perubahan elemen data (F.1-06) https://youtube.com/playlist?list=PLAmCwVzsOgfs9HCNicvNWgU0k2qQJPU0h&si=tu6MnDPJ88UEd-oT', '3', '2025-04-23', '13:34:41', '0000-00-00', '', '2025-04-23', '14:04:36', '', '126');
