	('230425PE296', 5, '6305064302020001', 'Siti Rahmawati', '085389145266', 'No permohonan : 270325PD384\r\nNama : Siti Rahmawati\r\nIzin mau bertanya pak, saya sudah mengurus dan mengisi data di link dukcapil untuk mengurus pindah domisili dan keluar kk pindah ikut suami di jakarta. Pengaduannya dari tgl 14 kmrin tp sampai skrng belom dapat file PDF surat pindahnya? \r\nTrimakasih', '', '', '', '', '', '', 'Mohon menunggu, kami cek terlebih dahulu.', 'Mohon beri kami Penilaian, Terima Kasih', '3', '2025-04-23', '14:13:16', '2025-04-23', '14:27:07', '2025-04-23', '15:03:27', '126', '126'),
	('230425PE297', 2, '6371012404790008', 'Dion Riyadi', '081250118900', 'mau mengganti nama di akta kelahiran karena ada kesalahan penulisan. seharusnya Dion Riyadi sesuai KTP dan KK', 'syarat/2025/04/23/687bf98fdf77b601efbb32172a6cb6c2.jpg', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil. Biasanya Akta Lahir sebagai dokumen pendukung perubahan KK/KTP, kalau sebaliknya biasa petugas meminta Izajah Pendidikan atau Putusan Pengadilan sebagai bukti dukung Perubahan Akta, karena Akta Lahir lebih dahulu terbit daripada KK/KTP. Untuk informasi lebih lanjut silahkan datang ke Kantor Disdukcapil. Terima Kasih', '3', '2025-04-23', '18:11:47', '0000-00-00', '', '2025-04-24', '06:59:37', '', '126');
