	('230525PE408', 5, '6305064906990002', 'Arfiah', '081258414712', 'penguploadtan data yang diajukan tidak bisa,,, mohon arahakannya pak/ibu', '', '', '', '', '', '', '', 'Mohon petunjuk, berkas apa yang di ajukan? dan mohon informasi pesan gagalnya, terima kasih.', '3', '2025-05-23', '08:03:17', '0000-00-00', '', '2025-05-23', '08:26:06', '', '126'),
	('230525PE409', 2, '6305125209980001', 'dwi setiawati', '087708784673', 'KENAPA TIDAK BISA MENGUPLOAD DOKUMEN PINDAH (PENUNJANG) . ', '', '', '', '', '', '', '', 'Mohon capture permasalahannya agar dapat kemi cek. Terima Kasih.', '3', '2025-05-23', '10:37:07', '0000-00-00', '', '2025-05-23', '21:46:59', '', '126'),
	('230625PE461', 4, '3201310407960009', 'Ahmad Sandi Saputra', '0882021424988', 'Tidak punya Ijazah jadi tidak bisa di lampirkan ijazahnya', '', '', '', '', '', '', '', 'Mohon izin, untuk kepengurusan dokumen apa? mohon dapat disebutkan. Terima Kasih', '3', '2025-06-23', '14:51:09', '0000-00-00', '', '2025-06-23', '15:58:41', '', '126'),
	('230625PE462', 2, '6305020509000001', 'Muhammad Riyan ', '083150673820', 'Ulun minta kirim kan file pdf akta kelahiran anak Ulun yang sudah selesai hari ini', '', '', '', '', '', '', '', 'Mohon izin, nanti pian foto akta/register fisiknya dulu (bahwa sdh), lampirkan pada konsultasi ini, nanti kami kirim file pdf nya, terima kasih. ', '3', '2025-06-23', '18:25:09', '0000-00-00', '', '2025-06-24', '07:37:31', '', '126');
