	('230725PE573', 2, '6303125002010005', 'Egy putri rosa widyanti', '0882020693020', 'f1.02 itu yg mna ya mas saya perasaan sdh sesuai mengisi tpi ditolak', 'syarat/2025/07/23/11ab1059c94507831fff78cde2895db6.jpg', '', '', '', '', '', '', 'Formulir F.1.02 (Permohonan) Bisa di download di Menu Download Formulir. Terima Kasih.\r\nlink : https://pondok.dukcapil.tapinkab.go.id/main/formulir\r\nNomor 11', '3', '2025-07-23', '10:21:10', '0000-00-00', '', '2025-07-23', '10:22:31', '', '126'),
	('230725PE574', 2, '6305026310940001', 'Narulian Nisfa winda', '081649162330', 'saya ingin memindah anak saya ke KK saya dari KK ayah nya', '', '', '', '', '', '', '', 'Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nSyarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n	1. Mengisi Formulir F-1.02 Permohonan (menu download formulir)\r\n	2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n	3. Kartu Keluarga dan KTP-el\r\n	4. Bukti Dukung Lainnya (jika ada alasan lain)\r\nTerima Kasih', '3', '2025-07-23', '11:15:43', '0000-00-00', '', '2025-07-23', '11:29:11', '', '126');
