	('240125PE53', 5, '3315066810000003', 'Dinar Tri Rahayu', '08225247033', 'Selamat pagi admin, terdapat ketidak-sinkronan antara NIK pada KTP saya dan anggota keluarga lainnya dengan NIK pada kartu keluarga terbaru setelah pengajuan pindah wilayah dan juga pemecahan KK. Terdapat perbedaan lima angka pertama dan satu angka terakhir NIK pada KTP dengan NIK pada KK terbaru. Mengacu pada informasi bahwa NIK pada KTP berlaku seumur hidup, maka sepertinya terdapat data yang tidak sinkron pada KK terbaru. Ketika saya hendak melakukan pembuatan akun pendaftaran CPNS pada tahun lalu, terdapat keterangan bahwa  data tidak valid ketika saya diminta mencantumkan NIK KTP dan juga nomor Kartu Keluarga. Selain itu, saya hendak melakukan pembuatan paspor dalam waktu dekat sehingga saya ingin memastikan bahwa data kependudukan saya telah valid. Berikut saya cantumkan foto KK beserta KTP Sebagai bahan ajuan. Terima kasih sebelumnya. ', 'syarat/2025/01/24/85e1a29b89a61638f8a42e21085ab6c1.jpg', 'syarat/2025/01/24/3b5b90cc91ca587ca46108731795079e.jpg', 'syarat/2025/01/24/b9df0ae48d543dd8547c8c7b8c844b80.jpg', '', '', '', 'Baik akan kami coba cek data terlampir, pengecekan butuh waktu ke aplikasi SIAK Terpusat, mohon menunggu arahan selanjutnya. Tks', 'Setelah kami cek, data Keluarga Anda terindikasi Ganda, No KK terlampir adalah : 6305101402140001 yang dimana KTP ayah yg sdh rekam, sedangkan NIK ibu dan NIK anda ber nomor KK 3315062007072737.\r\nUntuk lebih lanjut, silahkan datang ke Kantor Dukcapil Tapin untuk perbaikan/singkronisasi Data. Tks', '3', '2025-01-24', '08:29:39', '2025-01-24', '09:14:54', '2025-01-24', '09:26:55', '126', '126');
