	('240325PE216', 2, '6305105306040001', 'Pingkan Aryanti ', '081352575159', 'Persyaratan apa saja yang di perlukan saat ingin pindah domisili ', '', '', '', '', '', '', '', 'Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nSyarat untuk cabut berkas/pindah domisili ada pada menu Persyaratan :\r\n1. Mengisi Formulir F-1.02 Permohonan (menu download formulir)\r\n2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n3. Kartu Keluarga dan KTP-el\r\nTerima Kasih', '3', '2025-03-24', '08:42:48', '0000-00-00', '', '2025-03-24', '09:27:11', '', '126'),
	('240325PE217', 2, '3518131007020001', 'Dhori Dwi Yulianto ', '085704864258', 'Permisi min mau nanya, kan saya baru menikah mau bikin KK baru tpi saya blm pecah KK sama orang tua dan saya juga mau pindah ke Jawa soalnya istri saya di Jawa. Yg harus di urus dlu kepindahan dlu apa pecah KK dlu?', '', '', '', '', '', '', '', 'Saran kami urus pindah domisili dari Tapin ke Jawa, nanti pas datang disana baru urus KK barunya dengan status kawin. Terima Kasih.', '3', '2025-03-24', '08:47:57', '0000-00-00', '', '2025-03-24', '09:24:44', '', '126');
