	('240325PE218', 5, '6301036403040003', 'ARBAYAH', '081349935891', 'Ingin mengganti nama ktp orang tua', 'syarat/2025/03/24/99fbbba8ae347078da364117d31f3046.jpg', 'syarat/2025/03/24/01af0a5f1cfffb4ce285182166af23c4.jpg', 'syarat/2025/03/24/b1470ae39c17a9342f38a5d29e1283c7.jpg', '', '', '', '', 'Syarat :\r\n1. Isi Formulir permohonan F.1-02 (download pd menu formulir)\r\n2. Isi Formulir Perubahan F.1-06 (download pd menu formulir)\r\n3. Foto KK dan KTP\r\n3. Foto izajah & Akta sebagai dokumen pendukung.\r\nPilih menu KTP, isi pesan sekaligus KK. Anda harus Registrasi/Daftar dulu sebelum pengajuan. Tks', '3', '2025-03-24', '15:12:39', '0000-00-00', '', '2025-03-24', '19:32:03', '', '126');
