	('240325PE219', 2, '6305055004070001', 'Siti Fadillah ', '085347735001', 'Apakah bisa merubah nama yang ada di kartu keluarga dan KTP dengan tujuan untuk menyamakan/menyesuaikan yang ada di ijazah karena ada perbedaan terkait nama di KK dengan ijazah', 'syarat/2025/03/24/a76cbf6f511b56f5bb24ebcc8aa4b49d.jpg', 'syarat/2025/03/24/3ccb98b2ccb07026dad3f2935eb28e4d.jpg', 'syarat/2025/03/24/790d934a1bf874a88826167169f331de.jpg', 'syarat/2025/03/24/208d37c41aaf622abfcb80bbbfdd71d2.jpg', '', '', '', 'Bisa, syarat :\r\n1. Isi Formulir permohonan F.1-02 (download pd menu formulir)\r\n2. Isi Formulir Perubahan F.1-06 (download pd menu formulir)\r\n3. Foto KK dan KTP\r\n3. Foto izajah sebagai dokumen pendukung.\r\nPilih menu Perubahan KK, isi pesan sekaligus KTP. Anda harus Registrasi/Daftar dulu sebelum pengajuan. Maaf revisi point (2) Tks', '3', '2025-03-24', '18:26:31', '0000-00-00', '', '2025-03-24', '19:33:06', '', '126'),
	('240425PE298', 2, '6305055604020001', 'Munah', '087836173879', 'Bagaimana cara mengisi formulir F 1.06 (formulir pernyataan perubahan elemen data kependudukan)', 'syarat/2025/04/24/2e5af34fb35a27680acb24d1cd7fbf00.jpg', '', '', '', '', '', '', 'Silahkan klik link berikut untuk tatacara pengisian F.1-06 https://youtu.be/5CJONtfjrR8?si=cGevnFcm7uK_y_o0\r\nTerima Kasih', '3', '2025-04-24', '08:55:06', '0000-00-00', '', '2025-04-24', '09:38:06', '', '126');
