	('240425PE299', 2, '6302084510990001', 'Siti Fatimah', '085821093395', 'Kenap masih gak bisa daftar di aplikasi bagaimana bisa saya mencetak kk sedangkan masih belum bisa login. Tertera di sana kata nya masih alamat kotabaru bukan alamat tapin padahal saya sudah pengajuan pindah', '', '', '', '', '', '', '', 'Laporkan Kepindahan Anda di menu *Kedatangan*, setelah di datangkan di Tapin baru Anda bisa daftar/Registrasi User. Ikuti notifikasi WA dari Aplikasi. Terima Kasih.', '3', '2025-04-24', '09:50:53', '0000-00-00', '', '2025-04-24', '10:06:21', '', '126'),
	('240425PE300', 2, '6305066108910001', 'Arbainah', '087762544317', 'Berkas sdh di kasihkan ke kantor pos', '', '', '', '', '', '', '', 'Mohon tunggu respon petugas. Apabila masih ada kendala silahkan ajukan Konsultasi Baru dengan menginformasikan Nomor Permohonan agar dapat kami bantu me *Lacak* permohonan Anda. Terima Kasih', '3', '2025-04-24', '09:53:42', '0000-00-00', '', '2025-04-24', '10:08:08', '', '126'),
	('240425PE301', 5, '3276052107920001', 'Affan', '0882007363967', 'Saya mau buat akte anak namun di tangguhkan di karnakan di kartu kk hnya ada nama saya\r\nKami sudah bercerai dan anak memang di minta di masukan dalam kk saya', '', '', '', '', '', '', '', 'Mohon informasikan *nomor permohonan* nya biar bisa kami lacak. Silahkan ajukan ulang pengaduan dengan meinfokan *nomor permohonannya* , Terima Kasih.', '3', '2025-04-24', '13:16:43', '0000-00-00', '', '2025-04-24', '15:32:54', '', '126');
