	('240425PE302', 2, '6305014406970002', 'Hikmah pujawati', '083150075557', 'Ingin bertanya,ambil no antrian online pelayanan ganti foto E-ktp', '', '', '', '', '', '', '', 'Kalau ganti foto KTP harus datang langsung ke Kantor Dukcapil karena foto diambil dari Aplikasi Pencetakan langsung, antrian seperti biasa. Kalau online tidak ada antrian. Terima Kasih', '3', '2025-04-24', '13:26:57', '0000-00-00', '', '2025-04-24', '15:35:08', '', '126'),
	('240425PE303', 5, '3276052107920001', 'Affan', '0882007363967', 'No pemohon 240425AL515, 240425AL516, 230425AL508\r\n\r\nKami sudah bercerai dan anak ingin di masukan dalam kk saya jadi di kk saya hanya ada nama saya di karnakan sudah bercerai', 'syarat/2025/04/24/48bd437a6b5a3e6e22c42c372a51bdf0.jpg', '', '', '', '', '', '', 'Setelah kami cek 3 permohonan yang sama. Data anda di KK dengan status belum Kawin, pindahan April 2025, posisi istri di Jakarta. Izin kami sarankan untuk Konsultasi lebih lanjut dengan datang *Langsung* ke Kantor Dukcapil Tapin, karena mungkin akan ada informasi-informasi yang dibutuhkan dari Pemohon oleh petugas. Harap maklum dan Terima Kasih.', '3', '2025-04-24', '15:39:53', '0000-00-00', '', '2025-04-25', '07:46:36', '', '126');
