	('240625PE463', 2, '6305020509000001', 'Muhammad Riyan ', '083150673820', 'Untuk akta kelahiran anak Ulun belum diambil. Kemarin Ulun tapencet sdh diambil disini apa bisa diambil hari ini', '', '', '', '', '', '', '', 'Jadwal pengambilan di kantor :\r\nSenin dan Rabu, Jam 08.00 s/d 12.00.\r\nJadwal tersebut apabila pilihan pengambilan di kantor Dukcapil, jika via Pos menunggu Pos. \r\nDemikian Tks. ', '3', '2025-06-24', '07:50:17', '0000-00-00', '', '2025-06-24', '10:13:23', '', '126'),
	('240625PE464', 2, '6305060909640001', 'Kuraani', '082251299486', 'Kalo akta kelahiran sudah diterima dan mau file pdf nya dimana ya ka menu mengirim foto aktanya', 'syarat/2025/06/24/2600513a047b0798691f72b0c71daf88.jpg', '', '', '', '', '', '', 'Berikut kami lampirkan pdf akta yang diminta.\r\nSilahkan masuk ke menu Layanan Konsultasi, pilih Cari permohonan, paste/ketik nomor permohonan ini (240625PE464), klik Cari, akan tampil ikon download.\r\nSemoga pembentu.', '3', '2025-06-24', '12:06:13', '0000-00-00', '', '2025-06-24', '14:40:00', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('240625PE465', 2, '3305071811930002', 'Misbah', '081255135532', 'selamat siang, mohon informasi nya atas pengruusan akta kelahiran dengan nomor permohonan 230625AL869, apabila akta kelahiran sudah selesai apakan bisa di kirimkan ke alamat luar daerah karena saat ini tinggal nya di luar daerah', '', '', '', '', '', '', '', 'Permohonan dengan nomor 230625AL869 Akta Kelahiran terpantau sudah selesai dan dikirim via Kantor Pos.\r\nBiasa pihak pos akan mengantar sesuai Alamat yang tertera di Kartu Keluarga dan menghubungi nomor kontak sesuai yang terdaftar, dan untuk luar daerah Kabupaten Tapin seperti nya tidak. ', '3', '2025-06-24', '12:46:10', '0000-00-00', '', '2025-06-24', '14:45:00', '', '126'),
	('240625PE466', 2, '6305061011930001', 'Rendy hermawan', '085346300435', 'Apakah pengajuan permohonan saya tadi sadah terkirim', '', '', '', '', '', '', '', 'Apabila nomor telpon Anda yang didaftarkan di Aplikasi adalah nomor WA aktif, akan ada notifikasi/pesan yang dapat Anda pantau proses permohonannya.\r\nJika tidak, mohon cek dan ulangi permohonan anda di Menu Lacak Permohonan. Terima Kasih.\r\n', '3', '2025-06-24', '12:47:20', '0000-00-00', '', '2025-06-24', '14:49:18', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('240625PE467', 5, '6305015808980002', 'NURIANAH', '85750863304', ' berkas kartu keluarga sama ktp   yang di kirim ke kantor pos ad yg salah.untuk kartu kelurga benar cuma ktp aj yang salah kirim\r\n.', '', '', '', '', '', '', '', 'Izin, yg dukcapil kirim atau yang sampean kirim ke kami sebagai data balikan, dan izin nomor permohonannya berapa kemaren pas pengajuan, agar dapat kami lacak.  Atau sampean foto dan lampirkan KK dan KTP nya pada pengaduan selanjutnya. Terima Kasih', '3', '2025-06-24', '15:22:01', '0000-00-00', '', '2025-06-24', '15:49:48', '', '126'),
	('240625PE468', 5, '6305015808980002', 'NURIANAH', '85750863304', 'untuk berkas yang di kirim ke kantor pos ad  berkas yang salah. untuk kartu keluarga udah benar cuma ktp aja yang salah kirim', '', '', '', '', '', '', '', 'Izin, yg dukcapil kirim atau yang sampean kirim ke kami sebagai data balikan, dan izin nomor permohonannya berapa kemaren pas pengajuan, agar dapat kami lacak. Terima Kasih', '3', '2025-06-24', '15:27:16', '0000-00-00', '', '2025-06-24', '15:48:21', '', '126');
