	('250125PE54', 5, '6305036305980001', 'Rusma noor', '083863361466', 'Mengajukan surat pindah', 'syarat/2025/01/25/4f5862909b9a25ef1f33de0ef27a8ca8.jpg', 'syarat/2025/01/25/451fe88cb451d1247a2485f6df7f21a3.jpg', '', '', '', '', '', 'Silahkan daftar akun terlebih dahulu, dan pilih Menu Pindah pada Aplikasi.\r\nSyarat : \r\n1. Formulir F-1.03, \r\n2. Fromulir F-1.02, \r\n3. KK, \r\n4. KTP', '3', '2025-01-25', '08:23:19', '0000-00-00', '', '2025-01-27', '13:15:10', '', '126'),
	('250125PE55', 2, '63030869100002', 'Annisa', '083150184486', 'Saat mengisi formulir daftar/membuat NPWP Nomor Kartu Keluarga tidak valid, bagaimana?', 'syarat/2025/01/25/8db42dabda490f6ea8c04e51fabed935.jpg', '', '', '', '', '', '', 'Ada kesalahan dalam penegtikan nomor KK anda (info dr foto anda yg dilampirkan), mohon cek kembali Kartu Kaluarga Anda dan input dengan benar di DJP Pajak dengan benar.\r\nTerima Kasih', '3', '2025-01-25', '09:24:57', '0000-00-00', '', '2025-01-27', '13:12:24', '', '126');
