	('250125PE56', 5, '6305124508060001', 'FARIDATUS ZAKIYA ', '083140281138', 'Kesalahan nama dalam kartu keluarga ', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, untuk perubahan data silahkan isi Surat Pernyataan Perubahan Elemen Data F-1.06 (download pada menu download formulir). Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nTerima Kasih.	', '3', '2025-01-25', '13:52:20', '0000-00-00', '', '2025-01-28', '23:27:10', '', '126'),
	('250225PE152', 5, '6305016603800001', 'Norhayati', '083135961709', 'Kk saya gak valid pak,,mau mengurus bpjs,,mohon bantuannya pak biar Kk nya bisa online.trimakasih', 'syarat/2025/02/25/e529aee8eb3f07498e232b64db6e32c3.jpg', 'syarat/2025/02/25/3bbc7a1f7ae16bf3afefd87928074a37.jpg', '', '', '', '', '', 'Silahkan coba lagi dalam 1x24 jam ke BPJS, KK ibu sudah aktif', '3', '2025-02-25', '09:58:06', '0000-00-00', '', '2025-02-25', '10:32:46', '', '274'),
	('250225PE153', 2, '6305060307010001', 'Paisal rahman', '082255896438', 'Selamat siang bapak/Ibu ijin mau bertanya estimasi berapa hari sampai kantor pos untuk pengiriman KTP nya ', '', '', '', '', '', '', '', 'biasanya saat selesai berkas kami proses sore hari akan di ambil oleh kantor POS,biasanya 1 atau 2 hari sudah sampai. terimakasih', '3', '2025-02-25', '11:13:45', '0000-00-00', '', '2025-02-25', '12:35:00', '', '274');
