	('250225PE154', 5, '6305115608030001', 'Nur latifah', '085751502382', 'Bisakah bikin kartu keluarga sementara tapi nama saya dan anak saya aja', '', '', '', '', '', '', '', 'Mohon maaf, untuk Kartu Keluarga sementara tidak ada, apabila Anda ingin pisah KK dengan orang tua silahkan Ajukan Permohonan Pisah KK di menu Perubahan KK pada aplikasi Pondok Dukcapil. Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. Terima Kasih.\r\n', '3', '2025-02-25', '18:23:51', '0000-00-00', '', '2025-02-26', '06:58:07', '', '126'),
	('250425PE304', 5, '6371051507790004', 'Supiani. H', '0881011080927', 'Saat memilih Di ambil di Dukcapil atau Pos. Saya tidak sengaja memencet Ambil di dukcapil.Apa bisa KTP yang bersangkutan di kirim lewat pos saja', 'syarat/2025/04/25/9eee1abbdb2a6421930fea9acc8f8133.jpg', '', '', '', '', '', '', 'Mohon maaf bisa nya tidak bisa, karena sudah dibagi ketika mereka memproses yang mana dikantor dan ke pihak POS, mohon kiranya dapat mengambil sekeligus mengantar persyaratan ke kantor dukcapil. Terima Kasih.', '3', '2025-04-25', '07:33:18', '0000-00-00', '', '2025-04-25', '07:48:44', '', '126'),
	('250425PE305', 2, '6305001010800001', 'Mahdi', '085825576251', 'Tidak ada pemberitahuan di lacak', '', '', '', '', '', '', '', 'Silahkan ajukan pengaduan baru dengan meng-infokan nomor permohonan Anda biar dapat kami *Lacak* , Terima Kasih', '3', '2025-04-25', '07:35:22', '0000-00-00', '', '2025-04-25', '07:49:57', '', '126');
