	('250425PE306', 5, '6371051507790004', 'Supiani. H', '0881011080927', 'Apakah bisa diwakilkan untuk pengambilan KTP', '', '', '', '', '', '', '', 'Bisa asal masih orang dalam 1 kk yang mengambilkannya.', '3', '2025-04-25', '07:58:18', '0000-00-00', '', '2025-04-25', '08:11:35', '', '126'),
	('250425PE307', 5, '6305113011920001', 'RUSIYAN RIZALI SH', '081333117783', 'Pada saat pemecahan KK ke KK yg baru status nya berubah jadi cerai hidup padahal belum pernah menikah, bagaimana itu merubahnya ?', '', '', '', '', '', '', '', 'Mohon izin untuk dapat menerangkan no KK yang terdampak karena akan menambah keakuratan informasi dan dapat kami *Lacak*. Informasi sementara mungkin pelapor dari salah satu pihak melapor ketika pisah KK menyertakan Bukti Dukung berupa Akta Perceraian, demikan Terima Kasih.', '3', '2025-04-25', '08:25:58', '0000-00-00', '', '2025-04-25', '08:55:15', '', '126');
