	('250425PE308', 5, '6305113011920001', 'RUSIYAN RIZALI SH', '081333117783', 'Pada saat pemecahan KK ke KK yg baru status nya berubah jadi cerai hidup padahal belum pernah menikah, bagaimana itu merubahnya ?', '', '', '', '', '', '', '', 'Mohon izin untuk dapat menerangkan no KK yang terdampak karena akan menambah keakuratan informasi dan dapat kami *Lacak*. Informasi sementara mungkin pelapor dari salah satu pihak melapor ketika pisah KK menyertakan Bukti Dukung berupa Akta Perceraian, demikan Terima Kasih.', '3', '2025-04-25', '08:26:03', '0000-00-00', '', '2025-04-25', '08:54:31', '', '126'),
	('250425PE309', 2, '6305066912020001', 'LIDIA NURAIDAH HAYATI', '082154782216', 'Mau pindah kabupaten ', 'syarat/2025/04/25/d2ab26dc45241d421ab4dae7136e0645.jpg', 'syarat/2025/04/25/155a439c6be7355266ec0b3d4b090f3a.jpg', '', '', '', '', '', 'Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nSyarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n	1. Mengisi Formulir F-1.02 Permohonan (menu download formulir)\r\n	2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n	3. Kartu Keluarga dan KTP-el\r\nTerima Kasih', '3', '2025-04-25', '09:06:42', '0000-00-00', '', '2025-04-25', '09:11:35', '', '126');
