	('250425PE310', 5, '6302084510990001', 'Siti Fatimah', '085821093395', 'Tidak bisa registrasi akun. Di menu kedatangan tidak bisa konfirmasi dokumen sudah benar di situ tertera eror. Mau log in belum masuk alamat tapin. Kartu keluarga sudah terbit', 'syarat/2025/04/25/ab7128150a77fa3aec9565059b4b41b3.jpg', 'syarat/2025/04/25/60d1b69203312f44b1a85d109871b476.jpg', 'syarat/2025/04/25/e2b5de3651d21b7573383f5e8e1b2be8.jpg', '', '', '', '', 'Silahkan ajukan Registrasi Ulang, Terima Kasih.', '3', '2025-04-25', '10:41:47', '0000-00-00', '', '2025-04-28', '08:21:04', '', '126'),
	('250625PE469', 5, '6305015808980002', 'NURIANAH', '085750863304', 'berkas ktp sama kartu keluarga yang dikirim lewat kantor pos kemaren ada yang salah .untuk kartu keluarga udah benar cuma ktp aja yang salah kirim', '', '', '', '', '', '', '', 'Izin japri via Whatsapp.', '3', '2025-06-25', '07:09:34', '0000-00-00', '', '2025-06-25', '07:23:56', '', '126'),
	('250625PE470', 2, '6305044301080001', 'Nur aulia azizah', '087746320985', 'apa saja yang harus disiapkan sebelum bikin ktp', '', '', '', '', '', '', '', '1. Kartu Keluarga\r\n2. Copy Akta Lahir / Izajah\r\n3. Mengisi Formulir F.1-02 (di Dukcapil)\r\nTerima Kasih', '3', '2025-06-25', '07:11:41', '0000-00-00', '', '2025-06-25', '07:25:45', '', '126');
