	('250625PE471', 5, '6305015808980001', 'NURIANAH', '085750863304', 'maaf pak untuk berkas yang kemaren salah kirim gak di ambil di kantor pos .kata penjaga pos konsoltasi aj dulu sama paihak capil', '', '', '', '', '', '', '', 'Setelah di koordinasikan dengan Petugas, KTP Anda dan suami sudah dikirm ulang via Pos kemaren, jadi tinggal menunggu sampai. Terima Kasih.', '3', '2025-06-25', '07:27:49', '0000-00-00', '', '2025-06-25', '08:00:31', '', '126'),
	('250625PE472', 2, '6305021510940001', 'Rahmadi', '085389444485', 'untuk revisi akte lahir bisakah online ?', '', '', '', '', '', '', '', 'Kami sarankan untuk datang langsung ke Kantor Dukcapil, karena mungkin ada beberapa dokumen pendukung yang di butuhkan Petugas sebagai dasar revisi/perubahan Akte-nya. Terima Kasih', '3', '2025-06-25', '07:28:04', '0000-00-00', '', '2025-06-25', '07:53:36', '', '126'),
	('250625PE473', 2, '6305060307010001', 'Paisal rahman ', '082255896438', 'Mau bertanya cara cek kartu keluarga sudah online apa belum', '', '', '', '', '', '', '', 'Pada Kartu Keluarga ada Tanda Tangan Elektronik Kepala Dinas Dukcapil berupa QR-Code, silahkan scan QR tersebut, akan tampil ke-Valid-an dokumen tersebut secara online. Apabila KK nya masih tanda tangan basah pakai stempel berarti masih manual. Selamat Mencoba.', '3', '2025-06-25', '11:12:10', '0000-00-00', '', '2025-06-25', '11:16:53', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('250625PE474', 2, '6305060307010001', 'Paisal rahman ', '082255896438', 'Apakah bisa minta ligelisir dikantor dukcapil sama kalonya bisa apakah bisa hari ini', '', '', '', '', '', '', '', '*Informasi* : \r\nDokumen yang di legalisir adalah dokumen yang masih menggunakan Tanda Tangan Basah (versi lama), kalau dokumen versi baru (dengan QRCode) tidak perlu di legalisir. \r\nMasalah hari atau tidak tergantung yang menandatangani, biasa Kepala Bidang sesuai dokumen apa yang hendak di Legalisir.\r\nSemoga dapat membantu, terima kasih.', '3', '2025-06-25', '11:18:55', '0000-00-00', '', '2025-06-25', '11:40:55', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('250625PE475', 2, '6305106901950001', 'Irma', '085787072531', 'Maaf umpat batakun,,handak memisah kartu keluarga karena sudah berkeluarga itu kaya apa caranya ...Tpi KTP laki masih belum pindah...itu di pindah dulu kah ? Proses pindah nya tuh ky apa dlu', '', '', '', '', '', '', '', 'Izin, kami sarankan Suami dulu pindah (jika beda Desa/Kec/Kab) KK dari Ortu/KK lama dan pisah KK jika masih satu Desa saja, setelah itu baru pian Pindah (jika beda Desa/Kec/Kab), karena nanti Suami yang menjadi Kepala Keluarga, tapi bisa permohonannya jadi 1, dengan melampirkan Surat/Buku Nikah sebagai alasan pisah/pindah.\r\nSyarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n	1. Mengisi Formulir F-1.02 Permohonan (menu download formulir)\r\n	2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n	3. Kartu Keluarga dan KTP-el\r\n        4. Surat/Buku Nikah (jika alasan sdh menikah)\r\nTerima Kasih', '3', '2025-06-25', '13:32:48', '0000-00-00', '', '2025-06-25', '13:49:25', '', '126'),
	('250625PE476', 2, '6305106901950001', 'Irma', '085787072531', 'Untuk mengurus KTP & membuat kartu keluarga apakah bisa di mall pelayanan publik...dari Jam barapa sampai jam berapa...apa saja persyaratannya ', '', '', '', '', '', '', '', 'Bisa di Mall Pelayanan Public, dari jam 08:00 s/d 14.00, terima kasih.', '3', '2025-06-25', '14:47:20', '0000-00-00', '', '2025-06-26', '08:48:03', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('250625PE477', 5, '6305112407040001', 'Fathul jannah', '082154497966', 'Saya kehilangan KTP , jadi harus gimana mengurusnya ', '', '', '', '', '', '', '', 'Untuk mencetak KTP Anda harus melampirkan syarat sbb :\r\n	1. Formulir F.1-02, (menu download formulir)\r\n	2. Kartu Keluarga, \r\n	3. KTP Rusak/Ganti (Jika Rusak/Ganti)\r\n	4. Suket Hilang dari Kepolisian (Jika Hilang)\r\n	5. Formulir F.1-06, (Jika ada Perubahan)\r\nPoint (4) wajib untuk kehilangan.\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-06-25', '17:36:45', '0000-00-00', '', '2025-06-26', '08:49:00', '', '126'),
	('250725PE575', 2, '6305026103940001', 'Narulian Nisfa Winda', '081649162330', 'informasi ingin memasukkan 1 anggota ke KK', '', '', '', '', '', '', '', 'Silahkan pilih menu Perubahan KK pada Aplikasi, siapkan dokumen pendukung (Akta Lahir/Izajah/dll)\r\nSyarat silahkan cek di link berikut https://pondok.dukcapil.tapinkab.go.id/main/persyaratan\r\nTerima Kasih.', '3', '2025-07-25', '07:23:18', '0000-00-00', '', '2025-07-25', '08:00:32', '', '126'),
	('250725PE576', 2, '6371050707870010', 'ABDUL RAHIM', '087785601485', 'pengajuan akta kelahiran saya tidak ditemukan dalam menu lacak permohonan', '', '', '', '', '', '', '', 'Mohon infokan nomor permohonan akta kelahirannya biar dapat kami LACAK, terima kasih', '3', '2025-07-25', '08:47:27', '0000-00-00', '', '2025-07-25', '09:04:04', '', '126');
