	('250825PE660', 2, '6211026602040001', 'Ummi habibah', '082128113023', 'Membuat KTP', '', '', '', '', '', '', '', 'Selamat Siang. Untuk pembutan KTP-el baru Silakan melakukan perekaman KTP-el di Kantor Disdukcapil Setempat. Terima kasih', '3', '2025-08-25', '09:46:00', '0000-00-00', '', '2025-08-25', '11:09:41', '', '162'),
	('250825PE661', 4, '6305016108170002', 'Ellya faridha', '088246429053', 'Memperbaharui foto KIA \r\n', 'syarat/2025/08/25/6f0327d2797e0ca60127c3083dd63e79.jpg', 'syarat/2025/08/25/25e478cdd45c9440dd127caded32fb5b.jpg', 'syarat/2025/08/25/9fecec19a21cb84cc9f2fe856a43d5fb.jpg', 'syarat/2025/08/25/9735274416f58269dc7b919e112b3d61.jpg', '', '', '', 'Selamat Siang, silakan login dan masuk ke menu Cetak KIA, lalu lengkapi syarat yang diperlukan', '3', '2025-08-25', '10:44:07', '0000-00-00', '', '2025-08-25', '11:11:29', '', '162'),
	('251224PE3', 5, '6372042102000003', 'muhamad ikhbal aqbari', '081528491488', 'asalamualaikum min sdh jdi lah ktp ulun mun sdh jdi nyaman di ambil ke capil', '', '', '', '', '', '', '', 'Waalaikumsalam, KTP Pian sudah jadi, update terakhir 31-12-2024. Terima Kasih', '3', '2024-12-25', '17:23:52', '0000-00-00', '', '2025-01-02', '09:10:46', '', '126');
