	('260125PE57', 5, '6305114401030002', 'YUNITA', '082154103525', 'Pembuatan akta kelahiran belum ada nik', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, Silahkan pilih menu Akta Kelahiran pada menu utama (syarat sudah tertera pada pengajuan).\r\nUntuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nTerima Kasih.', '3', '2025-01-26', '09:07:16', '0000-00-00', '', '2025-01-28', '23:29:37', '', '126'),
	('260125PE58', 5, '6305114401030002', 'YUNITA', '082154103525', 'Pembuatan akta kelahiran belum ada nik', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, Silahkan pilih menu Akta Kelahiran pada menu utama (syarat sudah tertera pada pengajuan).\r\nUntuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nTerima Kasih.', '3', '2025-01-26', '09:07:22', '0000-00-00', '', '2025-01-28', '23:30:13', '', '126'),
	('260125PE59', 5, '6305040610640002', 'Yus Sudarmanto ', '081345087465', 'Penyesuaian data Kartu Keluarga dan KTP tentang status perkawinan dan pekerjaan', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil,\r\nUntuk perubahan data silahkan download Surat Pernyataan Perubahan Elemen Data F-1.06 (pada menu Download Formulir) serta sertakan foto dokumen pendukung perubahan data ketika anda mengajukan permohonan. Terima Kasih', '3', '2025-01-26', '10:53:56', '0000-00-00', '', '2025-01-28', '23:34:47', '', '126');
