	('260225PE155', 2, '6301020509810001', 'Seto hariyono', '082151909160', 'KK saya ada kesalahan dalam penulisan nama di kolom orang tua\r\nBagai mana cara untuk merubah kesalahan penulisan tsb.\r\nApa saja persyaratan nya..??', '', '', '', '', '', '', '', 'Untuk pembetulan nama orang tua bisa di lampirkan ijazah,akta kelahiran dan berkas berkas lainnya dan untuk melakukan perabuhan isi formulir f1.02 dan f1.06. terimakasih', '3', '2025-02-26', '10:37:41', '0000-00-00', '', '2025-02-26', '10:45:10', '', '274'),
	('260225PE156', 2, '6305086102020001', 'Jamâ€™iyatul Hasanah', '082252135646', 'apakah bisa mengurus perpindahan alamat suami dari samarinda ke tapin, dan membuat KK baru tanpa hrus datang ke dukcapil langsung? \r\n', '', '', '', '', '', '', '', 'Mohon maaf sebelumnya untuk pengurusan bantuan pindah harus ke kantor langsung dan orang yang bersangkutan langsung. terimakasih', '3', '2025-02-26', '13:23:21', '0000-00-00', '', '2025-02-27', '08:53:35', '', '274');
