	('260225PE157', 5, '6301020509810001', 'Seto hariyono', '082151909160', 'Untuk pengajuan 240225KK330\r\nBerikut kurang apa nya ya pak form f1-06 ga bisa saya download..\r\nUntuk form f1-06 yg saya download sayalampirkan di bwh didokumen pendukung 01..\r\n', 'syarat/2025/02/26/7917d439aa6ed8d715c91211c8e7e2f9.jpg', '', '', '', '', '', '', 'Silahkan download ulang F1.06nya di isi dan ajukan ulang karena ada kesalahn di form downloadnya ,terimakasih', '3', '2025-02-26', '13:31:56', '0000-00-00', '', '2025-02-27', '08:57:58', '', '274'),
	('260325PE220', 5, '6304010711010002', 'Yudha Eka Sadrani', '085754105455', 'Saya mau datang ke tapin gimana ya caranya', 'syarat/2025/03/26/2ca543c34e3d5d00342c9163bd2ed22c.jpg', '', '', '', '', '', '', 'Silahkan Pilih Menu Kedatangan di Aplikasi Pondok Dukcapil. link : https://pondok.dukcapil.tapinkab.go.id/kedatangan', '3', '2025-03-26', '10:48:57', '0000-00-00', '', '2025-03-26', '12:20:29', '', '126'),
	('260325PE221', 2, '6306025610040001', 'Novia Safitri ', '083159394140', 'Bagaimana cara lacak permohonan dan mendownload dokumen', '', '', '', '', '', '', '', 'Klik pada menu Lacak Permohonan, link : https://pondok.dukcapil.tapinkab.go.id/track/baru\r\nPilih yang ada tanda bintang merah, baca dan pelajari informasinya. Terima Kasih', '3', '2025-03-26', '11:06:46', '0000-00-00', '', '2025-03-26', '12:22:38', '', '126');
