	('260525PE410', 2, '6305066708990003', 'Sauzan Nur Alya', '085624028272', 'Selamat pagi Bapak/Ibu\r\n\r\nMau bertanya soal berkas persyaratan perubahan elemen data KTP yang mau dikirimkan lewat POS, itu apakah berupa berkas fotokopi saja atau yang aslinya dikirimkan? (Seperti KTP dan KK yang lama). Karena KTP yang baru sudah saya terima dan mau mengirimkan berkasnya hari ini lewat POS\r\n\r\n\r\nTerimakasih, semoga bisa dimengerti', '', '', '', '', '', '', 'untuk berkas balikan harus di lampirkan yang asli,makasih', 'UNTUK BERKAS BALIKAN SILAHKAN LAMPIRKAN BERKAS ASLINYA', '3', '2025-05-26', '06:15:51', '2025-05-26', '08:26:09', '2025-05-26', '08:35:45', '274', '274'),
	('260525PE411', 2, '6305066708990003', 'Sauzan Nur Alya', '085624028272', 'Selamat pagi Bapak/Ibu\r\n\r\nMau bertanya kembali soal berkas balikan tadi, bagaimana untuk Suami saya a.n Febrian Ramadhan berkas Kartu Keluarganya yang asli ada di Batulicin Tanah Bumbu, apakah bisa saya kirimkan kelengkapan berkasnya tanpa KK Lama suami?', '', '', '', '', '', '', '', 'iya bu,silahkan', '3', '2025-05-26', '09:37:53', '0000-00-00', '', '2025-05-26', '10:41:12', '', '274');
