	('260525PE412', 2, '6305044508830003', 'Apriyanti ningsih ', '08161116450', 'Mohon info izin apakah pencetak ktp an apriyanti ningsih bisa dilakukan bapak/ibu?', 'syarat/2025/05/26/80c085ed82c21eafb457b03d7f78348f.jpg', '', '', '', '', '', 'mohon ketik NIK dengan benar biar bisa kami cek. terimakasih', 'mohon ketik NIk dengan benar biar bisa kami cek. terimakasih', '3', '2025-05-26', '11:09:28', '2025-05-26', '11:38:36', '2025-05-26', '11:38:59', '274', '274'),
	('260525PE413', 5, '6305060909640001', 'Kursani', '082251299486', 'Seputar akta lahir', '', '', '', '', '', '', '', 'mohon maaf untuk persyaratan silahkam cek di menu persyaratan', '3', '2025-05-26', '11:31:22', '2025-05-26', '11:35:04', '2025-05-26', '11:36:00', '274', '274'),
	('260525PE414', 2, '6305044508830003', 'Apriyanti Ningsih', '08161116450', 'Mohon informasi, kalau ulun belum perekaman bisa rekam dimana, apakah saya dibantu terlebih dahulu agar minimal bula rekening aja dahulu', 'syarat/2025/05/26/29864365ace18d3b25b83dacca77fc1c.jpg', 'syarat/2025/05/26/721beba9faa531f91066a34c244a9028.jpg', '', '', '', '', '', 'silahkan melakukan perekaman biasanya untuk pembuatan rekening perlu melapirkan KTP ', '3', '2025-05-26', '11:47:19', '2025-05-26', '12:12:02', '2025-05-26', '12:13:35', '274', '274');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('260525PE415', 2, '6305066708990003', 'Sauzan Nur Alya', '085624048272', 'Selamat Siang Bapak/Ibu\r\n\r\nMaaf, mau menanyakan dengan pasti sekali lagi. Untuk berkas asli yang dikirimkan melalui POS itu selain Formulir F1.02, SKPWNI dan KTP lama apakah Kartu Keluarga yang lama juga disertakan?', '', '', '', '', '', '', '', 'Betul, KK lama juga dikirimkan', '3', '2025-05-26', '12:20:00', '0000-00-00', '', '2025-05-26', '13:37:02', '', '162'),
	('260525PE416', 2, '6305066708990003', 'Sauzan Nur Alya', '085624028272', 'Selamat siang Bapak/Ibu\r\n\r\n\r\nMau memastikan kembali. Selain F1.02, KTP lama dan SKPWNI bagi yang pindah datang, apakah KK Lama juga perlu dikirimkan berkas fisiknya melalui POS?', '', '', '', '', '', '', '', 'Betul, KK lama juga dikirimkan', '3', '2025-05-26', '12:22:47', '0000-00-00', '', '2025-05-26', '13:36:53', '', '162');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('260525PE417', 5, '6305060909640001', 'Kursani', '082251299486', 'Gimana kalo mau bikin akta kelahiran di umur 60 an yang orang tuanya sudah meninggal dan tidak ada lagi ktp serta buku nikah apakah ada solusi lain soalnya mau umroh ', '', '', '', '', '', '', '', 'Untuk syarat buku nikah orang tua pemohon akta kelahiran dewasa dapat diganti dengan Surat Pernyataan Tanggung Jawab Mutlak (SPTJM) sebagai pasangan suami istri yang sudah kami sediakan pada menu formulir. Dan bagi orang dewasa yang orang tuanya sudah meninggal, tidak perlu menuliskan NIK orang tua dalam pengisian Formulir Akta kelahiran. ', '3', '2025-05-26', '14:23:07', '0000-00-00', '', '2025-05-26', '14:29:28', '', '162'),
	('260525PE418', 2, '630506670899000', 'Sauzan Nur Alya', '085624028272', 'Selamat sore Bapak/Ibu\r\n\r\nMaaf jika menghubungi diluar jam kerja. Mau menanyakan title pendidikan (S1) di KK dan KTP ulun yang baru apakah memang dicantumkan gelar?\r\nKarena di KK dan KTP ulun keluaran dukcapil yang baru itu, nama ulun dicantumkan title dibelakangnya.\r\n\r\n\r\nSekian, terimakasih.\r\n\r\n', 'syarat/2025/05/26/9fbbd005d12855bbeb7faef8bfb77cd4.jpg', 'syarat/2025/05/26/fb5f0e82c59839077c9cb5895aed23e3.jpg', '', '', '', '', '', 'Ya betul, terima kasih', '3', '2025-05-26', '16:55:53', '0000-00-00', '', '2025-05-27', '07:04:48', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('260625PE478', 2, '6305045512990001', 'Adinda Ragilia Rahmandini', '082230538880', 'Saya sudah melakukan pengajuan pindah datang (keluar dari Tapin). Saya juga sudah menerima surat keterangan pindah. Namun saya ingin melakukan penggantian alamat tujuan pindah, apakah saya melakukan pengajuan ulang seperti awal?', 'syarat/2025/06/26/048733e8e4348d4723820d55849a2139.jpg', '', '', '', '', '', '', 'Pertama : Kalamu masih dalam 1 wilayah yaitu Jakarta Pusat, cuma kecamatan/kelurahan saja yang berubah, kami sarankan lapor di tempat tujuan saja. Tetapi kalau beda provinsi/kabupaten mungkin harus mengajukan Batal Pindah ke Dukcapil Asal (Tapin).\r\nKedua : Boleh lapor kedatangan dulu di Jakarta Pusat, lalu minta pindah lagi ke Kabupaten/Provinsi lain.\r\nTerima Kasih, semoga dapat membantu.', '3', '2025-06-26', '10:27:32', '0000-00-00', '', '2025-06-26', '10:46:47', '', '126'),
	('260625PE479', 2, '6305045512990001', 'Adinda Ragilia Rahmandini', '082230538880', 'Melanjutkan permintaan informasi saya sebelumnya, untuk proses pengajuan batal pindah alurnya bagaimana ya Min? ????????', '', '', '', '', '', '', '', 'Biasa harus datang langsung ke Kantor Dukcapil Tapin, karena pelayanan batal pindah tidak ada di aplikasi ini.', '3', '2025-06-26', '10:51:38', '0000-00-00', '', '2025-06-26', '10:55:04', '', '126');
