	('260625PE481', 5, '6305015305920002', 'HALIMAH', '085749794938', 'Perbarui KIA', '', '', '', '', '', '', '', 'Untuk mencetak KIA Anda harus melampirkan syarat sbb :\r\n	1. Formulir F.1-02, (menu download formulir)\r\n        2. KIA Lama\r\n        4. Pas Foto Berwarna\r\n        3. AKta Lahir (Jika Diperlukan)\r\nTerima Kasih.', '3', '2025-06-26', '11:24:26', '0000-00-00', '', '2025-06-26', '12:42:27', '', '126'),
	('260825PE662', 2, '6305036705010002', 'Norayda', '088242944951', 'Bisa buat akta kelahiran dan kartu keluarga secara online lah?', '', '', '', '', '', '', '', 'Bisa, silahkan anda Daftar Akun terlbih dahulu. Terima Kasih', '3', '2025-08-26', '10:17:35', '0000-00-00', '', '2025-08-26', '11:37:22', '', '126'),
	('270125PE60', 5, '6305037009030001', 'NURUL HUSNA', '081938754420', 'Surat Perpindahan', '', '', '', '', '', '', '', 'Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nSyarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n1. Mengisi Formulir F-1.02 (menu download formulir)\r\n2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n3. Kartu Keluarga dan KTP-el\r\nTerima Kasih', '3', '2025-01-27', '08:24:48', '0000-00-00', '', '2025-01-28', '23:35:50', '', '126');
