	('270125PE61', 5, '6305080106810001', 'I KETUT ARDI ASTAWA ', '082154612828', 'Pembuatan surat keterangan pindah ', 'syarat/2025/01/27/02f878003df194aff0e79b1c90a0f2c0.jpg', 'syarat/2025/01/27/0720b23205d721a79abc69fc3294647e.jpg', 'syarat/2025/01/27/055a655a170fe4b713d916d83dfa0500.jpg', 'syarat/2025/01/27/959ef3815890252e1e6de6cf0781bb37.jpg', 'syarat/2025/01/27/0e5ac0f952a6601f282c369d2068a358.jpg', 'syarat/2025/01/27/42a5fb4d0f206d0137bbb23d5c97a342.jpg', '', 'Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nSyarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n1. Mengisi Formulir F-1.02 (menu download formulir)\r\n2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n3. Kartu Keluarga dan KTP-el\r\nTerima Kasih', '3', '2025-01-27', '13:34:30', '0000-00-00', '', '2025-01-28', '23:36:13', '', '126'),
	('270225PE158', 2, '6305061212810001', 'Mas\'adi', '085245205968', 'Apa persyaratan membuat akta nikah', '', '', '', '', '', '', '', 'Silahkan klik link berikut untuk persyaratan https://pondok.dukcapil.tapinkab.go.id/main/persyaratan\r\nDi Dukcapil Akta Perkawinan hanya untuk Non Muslim, untuk yang Muslim adalah di KUA. Terima Kasih', '3', '2025-02-27', '10:29:24', '0000-00-00', '', '2025-02-27', '10:51:26', '', '126');
