	('270225PE161', 5, '6305024107790035', 'JURMIAH', '083150673820', 'Saya ingin mengubah status diktp saya dari belum kawin menjadi cerai hidup. Sedangkan saya tidak mempunyai buku nikah untuk melengkapi persyaratan. Apakah bisa diubah data diktp dan KK saya?', 'syarat/2025/02/27/3ba61151c2fea5aa664ea50d913e47f0.jpg', 'syarat/2025/02/27/0c73926625133549eeab916e5898cace.jpg', 'syarat/2025/02/27/a7afcc72ebba17da15e23571b3d6683a.jpg', '', '', '', '', 'Perubahan status kawin harus dengan melampirkan dokumen pendukung yang SAH (Buku Nikah/ Akta Cerai), selain itu silahkan Konsultasikan langsung ke Kantor Dukcapil, Terima Kasih.', '3', '2025-02-27', '16:49:44', '0000-00-00', '', '2025-03-01', '14:32:22', '', '126'),
	('270325PE222', 2, '6305050309030001', 'MUHAMMAD AMIN', '081343438996', 'Membikin kan akta anak secara online', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, berikut syaratnya :\r\n1. Foto Formulir F.2-01 (Kelahiran) --> Download Formulir\r\n2. Foto Kartu Keluarga, \r\n3. Foto Kutipan Buku Nikah\r\n4. Foto KTP Orang Tua (Suami-Istri)\r\n5. Foto Keterangan Lahir (bidan/dokter)\r\n6. Foto KTP Saksi 2 Org.\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-03-27', '09:38:42', '0000-00-00', '', '2025-03-27', '10:31:10', '', '126');
