	('270325PE223', 2, '6305050309030001', 'MUHAMMAD AMIN', '081343438996', 'Membikin kan akta anak secara online\r\n', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, berikut syaratnya :\r\n1. Foto Formulir F.2-01 (Kelahiran) --> Download Formulir\r\n2. Foto Kartu Keluarga, \r\n3. Foto Kutipan Buku Nikah\r\n4. Foto KTP Orang Tua (Suami-Istri)\r\n5. Foto Keterangan Lahir (bidan/dokter)\r\n6. Foto KTP Saksi 2 Org.\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-03-27', '09:40:40', '0000-00-00', '', '2025-03-27', '10:30:30', '', '126'),
	('270325PE224', 5, '6305020105860002', 'Jainal', '085750008249', 'Ingin mengganti nama ktp ', 'syarat/2025/03/27/0d9dae111bd390e0ed0d99beb2dd6df7.jpg', 'syarat/2025/03/27/800050e72ad0b449a946cf60bf7fb6d2.jpg', 'syarat/2025/03/27/ddbe6e08570833dcd6742f83ac342f71.jpg', 'syarat/2025/03/27/d50cbb47beeebfdc813d4cc324c510d6.jpg', 'syarat/2025/03/27/e4c60d57ffecec3ffb290aaa44745c22.jpg', 'syarat/2025/03/27/a400df22dfd416f566c17a3eab904481.jpg', '', 'Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu, dan pastikan menggunakan nomor telepon dengan *Whatsapp* nya Aktif.\r\nTerima Kasih.\r\n', '3', '2025-03-27', '11:17:30', '0000-00-00', '', '2025-03-27', '11:28:02', '', '126');
