	('270525PE419', 5, '6305060909640001', 'Kursani', '082251299486', 'Apakah harus wajib melampirkan ktp dua orang saksi di pengajuan pembikinan akta sedangka di syaratnya tidak bertuliskan wajib \r\nTernyata pas saya mengajukan ditolak karna tidak melampirkan ktp saksi ktanya di syarat tidak ada tulisan wajib \r\nDan untuk ktp pemohon harus diminta ketika mengajukan sedangkan pas memasukkan data tidak ada pilihan buat memasukkan ktp pemohon', '', '', '', '', '', '', 'Baik akan kami koordinasikan dengan petugas/operator terlebih dahulu. Terima Kasih', 'Silahkan ajukan Ulang permohonan yang ditangguhkan/ditolak, rubah upload-an ktp saksi dengan ktp pemohon/pelapor, serta lengkapi persyaratan yang di anjurkan petugas. Terima Kasih.', '3', '2025-05-27', '07:30:01', '2025-05-27', '07:41:40', '2025-05-27', '07:54:52', '126', '126'),
	('270525PE420', 5, '6305060909640001', 'Kursani', '082251299486', 'Apakah sekarang ktp yang masa berlaku sampai 2018 harus diperpanjang sedangkan di formulir  f1 02 tidak ada menu perpanjangan ktp', '', '', '', '', '', '', '', 'Masa berlaku KTP tidak masalah tidak perlu diperpanjang, silahkan lanjutkan saja prosesnya Pak, Terima Kasih.', '3', '2025-05-27', '08:20:58', '0000-00-00', '', '2025-05-27', '08:38:21', '', '126');
