	('270525PE421', 2, '6305060301790001', 'Maksum', '081219017863', 'Ma\'af kira2 akta lahir atas nama Nor Sabrina, apakah sudah di serahkan ke kantor pos', '', '', '', '', '', '', '', 'Mohon sebelumnya untuk Akta kelahiran A/N Nor sabrina silahkan orangtua yang bersangkutan yang mengajukannya atau yang ada dalam 1 kartu keluarga', '3', '2025-05-27', '09:14:22', '2025-05-27', '09:21:03', '2025-05-27', '09:27:36', '274', '274'),
	('270525PE422', 5, '6305054908030001', 'Siti Raudatul Hasanah', '087814553527', 'Saya ingin memperbaharui Kartu Keluarga, apa saja persyaratannya?', '', '', '', '', '', '', '', 'Silahkan buka link berikut : https://pondok.dukcapil.tapinkab.go.id/main/persyaratan pilih Kartu Keluarga, semoga dapat membantu, Terima Kasih.', '3', '2025-05-27', '10:21:10', '0000-00-00', '', '2025-05-27', '10:32:41', '', '126');
