	('270525PE423', 4, '6305066708990003', 'Sauzan Nur Alya', '085624028272', 'Selamat siang Bapak/Ibu\r\n\r\nBerkas fisik persyaratan pisah KK, pindah datang, pembuatan KK baru,  dan perubahan elemen data KK dan KTP a.n Sauzan Nur Alya dan Febrian Ramadhan sudah kami serahkan ke kantor POS tadi pagi. Sedangkan untuk KK dan KTP kami yang baru juga sudah kami terima.\r\n\r\n\r\nDemikian atas pelayanannya, kami ucapkan terima kasih.', '', '', '', '', '', '', '', 'terimakasih banyak Ibu,kami juga mengucapkan terimakasih semoga puas akan pelayanan yang kami berikan', '3', '2025-05-27', '11:45:44', '0000-00-00', '', '2025-05-27', '12:06:57', '', '274'),
	('270825PE663', 2, '6305062004870001', 'Mithan', '085754118320', 'Maaf saya mau bertanya,beberapa bulan yang lalu saya melakukan perpindahan data saya.di aplikasi ini.alhamdulillah udah selesai saya lakukan.tinggal nunggu e KTP saya aja lagi..saya memasukan pilihan e KTP saya di aplikasi ini.untuk pengambilan nya di kantor pos.tapi sampai sekarang belum ada..mohon kalu emang udah selesai tolong kirim kan secepat nya lewat kantor pos.terima kasih', '', '', '', '', '', '', '', 'Mohon sampaikan nomor Permohonan Anda agar dapat kami lacak/tracking permohonan Anda, Terima Kasih.\r\nSampaikan pada Konsultasi Selanjutnya.', '3', '2025-08-27', '09:00:13', '0000-00-00', '', '2025-08-27', '09:15:35', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('270825PE664', 2, '6305062004870001', 'Mithan', '085754118320', 'E KTP saya ada di dokcapil rantau tapin,tapi saya tidak bisa mengambil nya ke sana karena suatu hal,apakah bisa pihak dokcapil untuk mengirimkan nya ke alamat saya', '', '', '', '', '', '', '', 'Apakah anda sudah membuat permohonan via Online? \r\nUntuk mencetak KTP/KK Anda harus melampirkan syarat sbb :\r\n	1. Formulir F.1-02, (menu download formulir)\r\n	2. Kartu Keluarga, \r\n	3. KTP Rusak/Ganti (Jika Rusak/Ganti)\r\n	4. Suket Hilang dari Kepolisian (Jika Hilang)\r\n	5. Formulir F.1-06, (Jika ada Perubahan) \r\n	6. Bukti (Dokumen) Pendukung \r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-08-27', '09:56:36', '0000-00-00', '', '2025-08-27', '14:43:00', '', '126');
