	('270825PE665', 2, '6305016007020004', 'Anâ€™nissa zahwa ridhona', '085121153557', 'Saya ingin pindah kk ikut dengan suami', 'syarat/2025/08/27/c58892db0b443bda2b733bdb6b4869ad.jpg', 'syarat/2025/08/27/39430c0debc2a7690e41483b1d6bf167.jpg', '', '', '', '', '', 'Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nSyarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n	1. Mengisi Formulir F-1.02 Permohonan (menu download formulir)\r\n	2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n	3. Kartu Keluarga dan KTP-el\r\n	4. Bukti Dukung Lainnya (jika ada alasan lain)\r\nTerima Kasih', '3', '2025-08-27', '10:34:45', '0000-00-00', '', '2025-08-27', '14:29:22', '', '126'),
	('270825PE666', 2, '6305014101000005', 'Noor fitriana', '087853242326', 'Persyaratan untuk pindah domilisi dari kab tapin ke kab banjar apa aja ka', '', '', '', '', '', '', '', 'Syarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n	1. Mengisi Formulir F-1.02 Permohonan (menu download formulir)\r\n	2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n	3. Kartu Keluarga dan KTP-el\r\n	4. Bukti Dukung Lainnya (jika ada alasan lain)\r\nTerima Kasih', '3', '2025-08-27', '11:05:12', '0000-00-00', '', '2025-08-27', '14:43:45', '', '126');
