	('270825PE667', 5, '6305031009940001', 'Ahmad Riyadi', '085249499380', 'Tolong Nomor Kartu Keluarga saya tidak valid. Saya ada perlu untuk daftar NPWP hari ini ', 'syarat/2025/08/27/6311282c551f80d9cb9498119840fc73.jpg', '', '', '', '', '', 'Baik akan kami cek terlebih dahulu, mohon menunggu.', 'Setelah kami cek di data Nasional, Kartu Keluarga anda terpantau Valid. Berikut kami cek foto ke Valid-annya. (Cek pada menu lacak permohonan di pengaduan), Terima Kasih ', '3', '2025-08-27', '11:44:45', '2025-08-27', '14:31:16', '2025-08-27', '14:41:59', '126', '126'),
	('280425PE311', 5, '6303044703030008', 'Khairunisa', '085753900780', 'Kartu keluarga mama saya file PDF nya hilang apa bisa meminta lagi untuk File PDF nya ', '', '', '', '', '', '', '', 'Izin apakah anda masih dalam 1 Kk dengan orang tua yang KK nya kehilangan? Silahkan ajukan konsutasi Baru dengan mengetikan No KK yang Hilang, Terima Kasih.', '3', '2025-04-28', '07:50:43', '0000-00-00', '', '2025-04-28', '08:09:17', '', '126'),
	('280425PE312', 5, '6302084510990001', 'Siti Fatimah', '085821093395', 'Tidak bisa registrasi akun no kk 6305091805220003', '', '', '', '', '', '', 'Baik kami cek terlebih dahulu....', 'Setelah kami cek blm ada NIK dan KK terdaftar, silahkan registrasi Ulang, Terima Kasih.', '3', '2025-04-28', '08:20:52', '2025-04-28', '08:22:22', '2025-04-28', '09:18:01', '126', '126');
