	('280425PE313', 5, '6303044703030008', 'Khairunisa', '085753900780', '6303041705210006', '', '', '', '', '', '', '', 'Baik silahkan Masukan data sbb :\r\n1. NIK dan Nama Kepala Keluarga\r\n2. Alamat Lengkap KK yg diminta.\r\n3. Ajukan Konsultasi Baru dengan mengirim data di atas.\r\nTerima Kasih.', '3', '2025-04-28', '09:00:41', '0000-00-00', '', '2025-04-28', '09:24:03', '', '126'),
	('280425PE314', 2, '6305035105940001', 'Muliati', '087759309763', 'Cara membuat akta lahir', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, berikut syaratnya :\r\n	1. Foto Formulir F.2-01 (Kelahiran) yg sudah diisi --> Download Formulir\r\n	2. Foto Kartu Keluarga, \r\n	3. Foto Kutipan Buku Nikah,\r\n	4. Foto KTP Orang Tua (Suami-Istri),\r\n	5. Foto Keterangan Lahir (bidan/dokter),\r\n	6. Foto KTP Saksi 2 Org.\r\n	7. Surat Keterangan Hilang (Wajib jika hilang)', '3', '2025-04-28', '09:32:03', '0000-00-00', '', '2025-04-28', '09:40:26', '', '126'),
	('280425PE315', 2, '6302084510990001', 'Siti Fatimah', '085821093395', 'Apakah boleh pengambilan ktp di ambilkan oleh suami, berkas yang di kumpul berupa fotocopy? Apakah ktp asli harus di serahkan juga?', '', '', '', '', '', '', '', 'Kalau ganti, KTP lama (Asli) harus diserahkan, boleh diambilkan oleh orang yang masih dalam 1 KK.', '3', '2025-04-28', '09:42:19', '0000-00-00', '', '2025-04-28', '09:54:08', '', '126');
