	('280425PE316', 2, '6302084510990001', 'Siti Fatimah', '085821093395', 'Apakah ktp boleh di wakilkan suami untuk pengambilan nya di capil? Persyaratan ktp yg di serahkan ktp asli atau fotocopy?', '', '', '', '', '', '', '', 'Kalau ganti, KTP lama (Asli) harus diserahkan, boleh diambilkan oleh orang yang masih dalam 1 KK.', '3', '2025-04-28', '09:50:55', '0000-00-00', '', '2025-04-28', '09:54:24', '', '126'),
	('280425PE317', 2, '630506101080001', 'Mahdi', '085825576251', 'Berkas sdh di antar kekantor pos', '', '', '', '', '', '', '', 'Baik terima kasih.', '3', '2025-04-28', '09:52:00', '0000-00-00', '', '2025-04-28', '09:54:59', '', '126'),
	('280425PE318', 5, '6302084510990001', 'Siti Fatimah', '085821093395', 'Dokumen belum di terimah tapi di aplikasi sudah ter konfirmasi di terima apakah tidak papa?', '', '', '', '', '', '', '', 'Tidak apa, apakah pengiriman via POS? Silahkan beri keterangan dengan lengkap pada pengajuan Konsultasi baru, terima kasih.', '3', '2025-04-28', '10:04:57', '0000-00-00', '', '2025-04-28', '10:10:14', '', '126');
