	('280425PE321', 2, '6305110804700002', 'Simon Franklin Panjaitan ', '087739996672', 'Saya mengajukan perpindahan tempat tinggal .. data ada yg kurang dan tuk melengkapi yg kurang apa yg dilakukan .nambah data atau pengajuan ulang \r\n\r\nTrimakasih ', '', '', '', '', '', '', '', 'Silahkan cek di Lacak Permohonan, pilih ditolak, lengkapi data yg kurang, dan silahkan ajukan ulang.', '3', '2025-04-28', '10:52:50', '0000-00-00', '', '2025-04-28', '11:15:03', '', '126'),
	('280425PE322', 2, '6305012604080001', 'MUHAMMAD RAFI', '081348922109', 'Sy pelajar sdh rekam data di kantor lurah oleh disdukcapil utk pembuatan KTP, skrg sy sdh usia 17 thn, bgmn cara utk mendptkn KTP tersbt, ?', '', '', '', '', '', '', '', 'Untuk mencetak KTP  Anda harus melampirkan syarat sbb :\r\n	1. Formulir F.1-02, (Pendaftaran)\r\n	2. Kartu Keluarga, \r\n	3. Dokumen Lainnya (Izajah/Akte Lahir)\r\n        4. Informasikan ketika memohon bahwa sudah perekaman oleh dukcapil ketika kelapangan.\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-04-28', '12:51:47', '0000-00-00', '', '2025-04-28', '14:18:54', '', '126');
