	('280425PE323', 5, '63030501780002', 'm sairi', '083195912288', 'mau membuat akte tapi ', 'syarat/2025/04/28/0723e7ccc25b264bf36331dc5350cbae.jpg', 'syarat/2025/04/28/d7693015bafd9ee014beef9c5d041492.jpg', 'syarat/2025/04/28/d12fc4253d7097bdac31ffbd385a2de4.jpg', 'syarat/2025/04/28/4a9d4decf412e7c4a3ff62915eb45675.jpg', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, berikut syaratnya :\r\n	1. Foto Formulir F.2-01 (Kelahiran) yg sudah diisi --> Download Formulir\r\n	2. Foto Kartu Keluarga, \r\n	3. Foto Kutipan Buku Nikah,\r\n	4. Foto KTP Orang Tua (Suami-Istri),\r\n	5. Foto Keterangan Lahir (bidan/dokter),\r\n	6. Foto KTP Saksi 2 Org.\r\n	7. Surat Keterangan Hilang (Wajib jika hilang)\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-04-28', '13:23:35', '0000-00-00', '', '2025-04-28', '14:11:27', '', '126'),
	('280425PE324', 5, '63030501780002', 'm sairi', '083195912288', 'mau membuat akte orang dewasa tapi orang tua sudah meninggal dan bidan melahirkan sudha meninggal juga \r\ngimana mengisi dta nya karena sdh tdk ada data kependudukan nya lagi', '', '', '', '', '', '', '', 'Mohon maaf, registrasi anda belum berhasil karena nomor NIK kurang dari 16 digit. Silahkan ulangi pendaftaran dengan memasukan data dengan benar. Terima Kasih', '3', '2025-04-28', '13:24:16', '0000-00-00', '', '2025-04-28', '14:15:39', '', '126');
