	('280425PE325', 5, '6303091501780002', 'm sairi', '083195912288', 'mau membuat akte orang dewasa tapi kdua orang tua sudh meninggal dan bidan mmbntu kelahiran juga mningal jdi data kependudukan sdh tdk ada', 'syarat/2025/04/28/052a22e05b2f0f1fe3d786e4b94d61bb.jpg', 'syarat/2025/04/28/00abc8e8bafe7d167ed40e2a5f4b42c5.jpg', 'syarat/2025/04/28/50ea994bcf4e80fcedcc47fdebffcd79.jpg', 'syarat/2025/04/28/521c870bfc516784ed4023f16e096578.jpg', '', '', '', 'Izin pian ajukan di menu Akte Kelahiran bukan di Menu konsultasi. Terima Kasih', '3', '2025-04-28', '14:23:53', '0000-00-00', '', '2025-04-28', '14:54:49', '', '126'),
	('280425PE326', 2, '6303040607840004', 'HENDRA SAPUTRA ', '081255591286', 'Apakah untuk merubah nama yang salah pada KTP,KK,dan akta kelahiran.langkah pertama apa yg wajib saya ajukan perubahan dan apakah jika salah satu yg saya sebutkan tadi di atas sudah berganti nama,maka dokumen yang lain juga ikut berubah otomatis tanpa harus pengajuan perubahan kembali.????.trmksh ..????', '', '', '', '', '', '', '', 'Syarat utama adalah :\r\n1. Foto Formulir F.1-06 (Perubahan elemen data) yg sudah diisi --> Download Formulir\r\n2. Melampirkan Dokumen Pendukung untuk sebagai dasar Perubahan (Akta/Izajah/Putusan Pengadilan)\r\nBetul dalam Sistem SIAK apabila 1 berubah, dokumen lainnya akan mengikuti perubahan.\r\nTerima Kasih.\r\n', '3', '2025-04-28', '15:46:05', '0000-00-00', '', '2025-04-29', '06:28:26', '', '126');
