	('280425PE327', 2, '6303040607840004', 'HENDRA SAPUTRA ', '081255591286', 'Apakah untuk merubah nama yang salah pada KTP,KK,dan akta kelahiran.langkah pertama apa yg wajib saya ajukan perubahan dan apakah jika salah satu yg saya sebutkan tadi di atas sudah berganti nama,maka dokumen yang lain juga ikut berubah otomatis tanpa harus pengajuan perubahan kembali.????.trmksh ..????', '', '', '', '', '', '', '', 'Syarat utama adalah :\r\n1. Foto Formulir F.1-06 (Perubahan elemen data) yg sudah diisi --> Download Formulir\r\n2. Melampirkan Dokumen Pendukung untuk sebagai dasar Perubahan (Akta/Izajah/Putusan Pengadilan)\r\nBetul dalam Sistem SIAK apabila 1 berubah, dokumen lainnya akan mengikuti perubahan.\r\nTerima Kasih.', '3', '2025-04-28', '15:46:53', '0000-00-00', '', '2025-04-29', '06:28:40', '', '126'),
	('280425PE328', 2, '6305061010800001', 'Mahdi', '085825576251', 'DiMenu lajak tidak keluhatan  ada pemberitahuan, apa blm dikurim', '', '', '', '', '', '', '', 'Apabila Anda sudah ada permohonan tolong sampaikan nomor Permohonan nya, agar dapat kami lacak. Terima Kasih', '3', '2025-04-28', '16:22:27', '0000-00-00', '', '2025-04-29', '06:24:52', '', '126');
