	('280425PE329', 5, '6305014904860001', 'aida iriyani', '085752882230', 'mau bikin akta kelahiran tunggal persyaratan nya apa aja', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, berikut syaratnya :\r\n	1. Foto Formulir F.2-01 (Kelahiran) yg sudah diisi --> Download Formulir\r\n	2. Foto Kartu Keluarga, \r\n	3. Foto Kutipan Buku Nikah,\r\n	4. Foto KTP Orang Tua (Suami-Istri),\r\n	5. Foto Keterangan Lahir (bidan/dokter),\r\n	6. Foto KTP Saksi 2 Org.\r\n	7. Surat Keterangan Hilang (Wajib jika hilang)\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-04-28', '17:07:32', '0000-00-00', '', '2025-04-29', '06:25:24', '', '126'),
	('280525PE424', 5, '6305064906990002', 'ARFIAH', '081258414712', 'PENGAPLOADTAN BERKAS YANG TERLALU LAMBAT DIPROSES, SAYA MENGAJUKAN SURAT PINDAH AKAN TETAPI LAMBAT SEKALI SAAT PENGAPLODTAN BERKAS. PADAHAL JARINGAN SUDAH STABIL. UKURAN FILE JUGA KECIL. MOHON ARAHANYA BAGAIMANA INI .', 'syarat/2025/05/28/1a0355f52140d777d159f4149aa73d70.jpg', '', '', '', '', '', '', 'Maaf atas ketidaknyamanannya, apakah file berupa foto / pdf ? untuk aplikasi di harapkan upload berupa format foto. Silahkan ulang kembali upload an persyaratan Anda, jika masih ada kendala silahkan laporkan kembali, kami siap membantu, Terima Kasih.', '3', '2025-05-28', '01:37:16', '0000-00-00', '', '2025-05-28', '07:04:49', '', '126');
