	('280525PE425', 2, '6305014206020002', 'Siti mariyam', '087891753067', 'Bu kalo mengeluarkan nama anak di kartu keluarga marga meninggal,terus u melahirkan lagi mau membuat akta..apakah mengeluarkan nama anak meninggal itu kah dlu.baru membuat yang baru', '', '', '', '', '', '', '', 'Sekaligus bisa, laporkan aja kematiannya, ikuti aja alurnya nanti dipandu petugas. Terima Kasih', '3', '2025-05-28', '09:08:50', '0000-00-00', '', '2025-05-28', '13:07:52', '', '126'),
	('280525PE426', 2, '6305124107860010', 'Maria ulfah', '082254913125', 'Pembuatan kk untuk nikah tidak tercatat', '', '', '', '', '', '', '', 'Untuk masalah ini kami sarankan langsung datang ke kantor Dukcapil. Terima Kasih', '3', '2025-05-28', '10:54:37', '0000-00-00', '', '2025-05-28', '13:09:01', '', '126'),
	('280725PE577', 2, '6305014707950002', 'Siti khadijah', '087756980078', 'Membuat Akta lahir', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, berikut syaratnya :\r\n	1. Foto Formulir F.2-01 (Kelahiran) yg sudah diisi --> Download Formulir\r\n	2. Foto Kartu Keluarga, \r\n	3. Foto Kutipan Buku Nikah (Jika Ada), /STPJM Kebenaran Suami-Istri\r\n	4. Foto KTP Orang Tua (Suami-Istri),\r\n	5. Foto Keterangan Lahir (bidan/dokter)Jika ada, /STPJM Kelahiran\r\n	6. Foto KTP Saksi 2 Org.\r\n	7. Surat Keterangan Hilang (Wajib jika hilang)\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-07-28', '07:13:29', '0000-00-00', '', '2025-07-28', '10:23:55', '', '126');
