	('280725PE578', 5, '6305016812870001', 'Rini qamaria santy', '082155355352', 'Konsulidasi nik ktp suami atas nama H. Kasuma yudha \r\nDan perubahan data d ktp dan kartu keluarga rt dan rw dari 002/004 menjadi 004/002 \r\nSeluruh yg ada di kartu keluarga ', 'syarat/2025/07/28/67c9356922bfd494c3e0899f5e6a39bb.jpg', '', 'syarat/2025/07/28/f69f289fbdc5ea2056f3e51c66dd593b.jpg', 'syarat/2025/07/28/70726e2e5833731a2da6bd88694e3abe.jpg', '', '', '', 'Silahkan ajukan di Menu Perubahan KK, nanti isi di kolom catatan tentang perubahannya dan dokumen apa saja yang dirubah.\r\nLengkapi syarat dan bukti dukungnya. Terima Kasih.', '3', '2025-07-28', '10:38:11', '0000-00-00', '', '2025-07-28', '10:49:00', '', '126'),
	('280725PE579', 5, '6303080707020180', 'Abdullah', '085650883277', 'Mau mnta update akn KTP biar muncul', '', '', '', '', '', '', '', 'Silahkan Ketik :\r\n1. NIK :\r\n2. Lampirkan Foto KTP pada pengaduan/konsultasi selanjutnya.\r\nTerima Kasih', '3', '2025-07-28', '11:15:02', '0000-00-00', '', '2025-07-28', '12:06:31', '', '126'),
