	('280725PE581', 2, '6305010705840002', 'akhmad miftah fariz', '085148045533', 'kartu keluarga hilang jadi mau cetak ulang', '', '', '', '', '', '', '', 'Silahkan ajukan pada menu Perubahan KK, terima kasih', '3', '2025-07-28', '11:16:05', '0000-00-00', '', '2025-07-28', '12:08:19', '', '126'),
	('280725PE582', 2, '6301011205890001', 'MISRAN', '085654634200', 'Gimana cara nambah anggota kartu keluarga sama cara pisah kan anggota kartu keluarga. ', '', '', '', '', '', '', '', '1. Tambah anggota dengan alasan (nikah/pindahan/dll)\r\n2. Informasikan alasan pisah KK\r\nSampaikan pada kolom catatan, ajukan permohonan di menu Perubahan KK di Aplikasi Ini.\r\nTerima Kasih', '3', '2025-07-28', '12:11:12', '0000-00-00', '', '2025-07-28', '12:14:36', '', '126'),
	('280725PE583', 5, '6305016204090002', 'LIDIYA', '085705855750', 'lupa password&link tidak masuk ke wa(tidak ada notif link dri dukcapil untuk membuat password baru)', '', '', '', '', '', '', '', 'Silahkan login dengan memasukan NIK dan Password yang telah anda buat, Jika ada permintaan kode aktivasi, silahkan masukan kode : *03922* atau klik link berikut ini : \r\nhttps://pondok.dukcapil.tapinkab.go.id/akun/aktivasi_manual/20250728110827jDmaNErM3I0Po27pskfVSCOhJwltY8Ke ', '3', '2025-07-28', '12:22:57', '0000-00-00', '', '2025-07-28', '14:31:49', '', '126');
