	('280725PE584', 2, '6372025806970005', 'ELLY OKTAVIA NANDA', '081349180279', 'saya bingung cara mengisi data untuk membuat akta kelahiran anak baru lahir, karna disitu disuruh ngisi 3 formulir pengajuan, yang tidak saya isi itu bagaimana ya mengisi nya, sdh saya sertakan foto nya', 'syarat/2025/07/28/fdf2c5b7afa3d3f0575365650be867ca.jpg', '', '', '', '', '', '', 'Pada bagian saksi I dan II silahkan isi data saksi kelahiran, boleh kakek/nenek, atau om/tante. Terima Kasih', '3', '2025-07-28', '21:44:47', '0000-00-00', '', '2025-07-29', '06:32:24', '', '126'),
	('280825PE668', 5, '1602211212010001', 'Rafi Saksena ', '085383569629', 'Untuk penulisan RT/RW salah', '', '', '', '', '', '', '', 'Setelah kami cek di Surat Pindahnya adalah RT.001 / RW.001, dan kami menarik data sesuai Surat Pindah (SKPWNI) dari OKI.\r\nApabila ada perubahan silahkan ajukan permohonan ulang perubahan KK. Terima Kasih', '3', '2025-08-28', '10:37:35', '0000-00-00', '', '2025-08-28', '10:48:02', '', '126'),
	('290425PE330', 2, '6303040607840004', 'HENDRA SAPUTRA ', '081255591286', 'pada download dokumen tidak ada contoh atau formulir surat kuasa yang bisa saya download.bolehkah saya meminta formulir contoh surat kuasa???', '', '', '', '', '', '', '', 'Berikut kami upload, silahkan masukan nomor pengaduan/konsultasi pada menu cek permohonan kami lampirkan pdf surat kuasa.', '3', '2025-04-29', '07:42:20', '0000-00-00', '', '2025-04-29', '07:49:18', '', '126');
