	('290425PE331', 2, '6305061010800001', 'Mahdi', '085825576251', 'Nomor permohonan permintaan surat pindah 220425PD495', '', '', '', '', '', '', 'Baik akan kami cek terlebih dahulu.', 'Setelah kami cek, permohonan Pindah Anda sudah Selesai, silahkan cek dan download file pdf di Menu Lacak Permohonan --> Dokumen Terbit.', '3', '2025-04-29', '09:02:07', '2025-04-29', '09:21:32', '2025-04-29', '09:27:09', '126', '126'),
	('290425PE332', 2, '6306057011920002', 'Patimah', '085935252193', 'Mengurus surat pindah secara online', '', '', '', '', '', '', '', 'Untuk pengajuan melalui Aplikasi Pondok anda harus mendaftar/registrasi terlebih dahulu. \r\nSyarat untuk cabut berkas/pindah ada pada menu Persyaratan :\r\n	1. Mengisi Formulir F-1.02 Permohonan (menu download formulir)\r\n	2. Mengisi Formulir F-1.03 Kepindahan (menu download formulir)\r\n	3. Kartu Keluarga dan KTP-el\r\nTerima Kasih', '3', '2025-04-29', '09:47:06', '0000-00-00', '', '2025-04-29', '09:52:25', '', '126');
