	('290425PE333', 2, '6305062604940001', 'MUHAMMAD ARSYAD', '082157225462', 'Assalamualaikum wr wb.\r\nmohon maaf, Izin mau bertanya.\r\nUntuk layanan Datang dari kabupaten lain ke Tapin tapi tidak mempunnyai buku nikah diakrenakan nikah secara tidak resmi apakah bisa melampirkan SPTJM suami isteri atau tidak usah melampirkan. \r\nterimakasih. ', '', '', '', '', '', '', '', 'Waalaikumsalam, pertama kami sarankan lakukan saja dulu kedatangan dengan KK baru, kemudian setelah di datangkan baru ke tahap selanjutnya. Terima Kasih', '3', '2025-04-29', '09:54:34', '0000-00-00', '', '2025-04-29', '13:17:26', '', '126'),
	('290425PE334', 2, '6305011508870003', 'HENDRA', '082350217437', 'Jika bulan & tahun kelahiran di kartu keluarga dan KTP beda(tidak sinkron). Apa yang harus di rubah?', '', '', '', '', '', '', '', 'Bisa melakukan perubahan dengan menggunakan Formulir F.1-06 Perubahan dengan menyertakan dokumen pendukung (Akta/Izajah/Putusan Pengadilan) Terima Kasih', '3', '2025-04-29', '10:06:57', '0000-00-00', '', '2025-04-29', '13:19:50', '', '126');
