	('290425PE335', 2, '6305064302020001', 'Siti Rahmawati', '085389145266', 'Izin bapak kalau sudah beres ngurus ktp dan KK di jakarta apakah ktp dan KK lamanya di kembalikan lagi ke dukcapil rantau? ', '', '', '', '', '', '', '', 'Tidak perlu, karena KK akan berubah secara online di Data Pusat, ke dua KTP akan ditarik oleh Dukcapil di tempat kedatangan.', '3', '2025-04-29', '10:50:09', '0000-00-00', '', '2025-04-29', '13:21:25', '', '126'),
	('290425PE336', 2, '3516116411970003', 'Dwilyan candra', '081231325047', 'Informasi data kematian dari nenek ( arbayah ) dan kakek ( Ruslin ) yang berdomisili di binuang', '', '', '', '', '', '', '', 'Mohon lampirkan nomor Permohonan agar dapat kami Lacak, Terima Kasih.', '3', '2025-04-29', '11:18:11', '0000-00-00', '', '2025-04-29', '13:22:23', '', '126'),
	('290425PE337', 5, '6308054603910004', 'Murliani', '085931918429', 'Kenapa saya tak bisa login, padahal saya ktp tapin skarang .lalu di sana anda tersacatat warga hsu..kok bs double tolong dong. Sayakan jd warga tapin tolong di fix kan. Soalnya saya mongurus akta bayi dan menambahkan bayi saya di kk. Tolong banget  ya..biar saya cepat ngurusnya', 'syarat/2025/04/29/d05a689c36d94f4614ef7c146662a983.jpg', '', '', '', '', '', '', 'Silahkan Ibu Registrasi Ulang, Terima Kasih', '3', '2025-04-29', '13:42:11', '0000-00-00', '', '2025-04-29', '14:56:35', '', '126');
