	('290425PE339', 2, '6305061010800001', 'Mahdi', '085825576251', 'Balaum ada pemberitahuan dari lacak', 'syarat/2025/04/29/e5f0b28e445e9966399968d43e462243.jpg', 'syarat/2025/04/29/d641d45a242e63ef945f2ab499a9a2e9.jpg', 'syarat/2025/04/29/8485dad615e172819fd985a9260ab95a.jpg', '', '', '', '', 'Mohon Cek Pada Menu Lacak Permohonan, dokumen pindah telah di Upload', '3', '2025-04-29', '14:26:44', '0000-00-00', '', '2025-04-29', '15:02:01', '', '126'),
	('290425PE340', 2, '6372031810030005', 'M. BIMA ALFARISI ', '083829162509', 'Pembaruan ktp', '', '', '', '', '', '', '', 'Untuk mencetak KTP  Anda harus melampirkan syarat sbb :\r\n	1. Formulir F.1-02, (Pendaftaran)\r\n	2. Kartu Keluarga, \r\n	3. KTP Rusak/Ganti (Jika Rusak/Ganti)\r\n	4. Suket Hilang dari Kepolisian (Jika Hilang)\r\n	5. Formulir F.1-06, (Jika ada Perubahan)\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-04-29', '17:03:54', '0000-00-00', '', '2025-04-30', '06:59:42', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('290725PE585', 2, '6305015306930002', 'ATMARIDA', '085705855750', 'ingin membuat akta kelahiran tapi orang tua sudah bercerai(tidak ada buku nikah),tidak memiliki surat keterangan kelahiran bagaimana? hanya memiliki foto ijasah dan ktp orang tua', '', '', '', '', '', '', '', 'Terima kasih telah menghubungi Pondok Dukcapil, berikut syaratnya :\r\n	1. Foto Formulir F.2-01 (Kelahiran) yg sudah diisi --> Download Formulir\r\n	2. Foto Kartu Keluarga, \r\n	3. Foto Kutipan Buku Nikah (Jika Ada), /STPJM Kebenaran Suami-Istri\r\n	4. Foto KTP Orang Tua (Suami-Istri),\r\n	5. Foto Keterangan Lahir (bidan/dokter)Jika ada, /STPJM Kelahiran\r\n	6. Foto KTP Saksi 2 Org.\r\n	7. Surat Keterangan Hilang (Wajib jika hilang)\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks\r\n_Catatan : Pilih STPJM Kelahiran untuk ganti keterangan lahir_\r\n_apabila tidak bisa memperlihatkan Buku Nikah Ortu bisa ganti dengan STPJM Perkawinan, jika tidak bisa berarti akta kelahiran BIN IBU saja_\r\nTerima Kasih.', '3', '2025-07-29', '07:01:54', '0000-00-00', '', '2025-07-29', '07:10:16', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('290725PE586', 2, '6305036004010001', 'Noor Hikmah', '081549145261', 'Izin bertanya tekait ketidaksamaan nama orang tua di akta dengan di KTP Orang tua, apakah bisa merubah Nama KTP Orang tua menyesuaikan dengan akta anak karena di ijazah anak sama dengan nama yang ada di akta anaknya', 'syarat/2025/07/29/0c7257e19db933d107a82e48cee3cd9f.jpg', 'syarat/2025/07/29/b895b3b2d508ae18751b883cb7b828ff.jpg', '', '', '', '', '', 'Apabila KTP orang tua tidak terhubung dengan kepentingan lain (BPJS/SIM/Bank/dll) mungkin bisa saja, tetapi untuk lebih jelasnya kami *Sarankan* anda datang langsung ke Kantor Dukcapil karena mungkin ada beberapa hal yang harus diklarifikasi oleh Petugas, Terima Kasih.', '3', '2025-07-29', '08:58:00', '0000-00-00', '', '2025-07-29', '08:59:01', '', '126'),
	('290725PE587', 5, '6305094103020001', 'Salisa ananda rizqa', '085953782911', 'Ktp saya hilang minta cetak kan yg baru', 'syarat/2025/07/29/f78d3a0404a02ae23618d3550e85d45b.jpg', '', '', '', '', '', '', 'Silahkan pilih Menu Cetak KTP di Aplikasi, Terima Kasih', '3', '2025-07-29', '09:06:03', '0000-00-00', '', '2025-07-29', '09:53:28', '', '126');
