	('290725PE588', 2, '6305124610950001', 'EEN IRAWATI', '087814232999', 'Apakah akta kematian yang diajukan via pondok dukcapil dapat langsung diunduh di pondok dukcapil atau dapat mengambil di kantor pos ketika ada informasi dari pondok duscapil bahwa dokumen telah terbit?', '', '', '', '', '', '', '', 'Khusus AKta tidak kami upload di aplikasi karena ada register yang harus di tandatangani pelapor, misalkan Via Pos kalau ada notifikasi di wa selesai maka akan di kirimkan Via Pos. Terima Kasih.', '3', '2025-07-29', '09:24:55', '0000-00-00', '', '2025-07-29', '09:55:03', '', '126'),
	('290725PE589', 2, '6303125002010005', 'EGY PUTRI ROSA WIDYANTI', '0882020693020', 'alamat rumah pindah yg baru rumah sendiri / sewaan itu nulis nya dmna ya soalnya saya salah terus yg bagian itu', 'syarat/2025/07/29/eb764b0685b3ecaab3962f8b5c18588f.jpg', '', '', '', '', '', '', 'Silahkan informasikan di bagian kolom Catatan alamat nya dan terangkan disana. Untuk dokumen pendukung silahkan pilih Menu Download Formulir (No.14)', '3', '2025-07-29', '09:27:27', '0000-00-00', '', '2025-07-29', '09:58:11', '', '126');
