	('290725PE590', 2, '6305060179100013', 'Saifullah', '83167868633', 'Nama anak sudah di ubah ke capil dan dari muhammad Raditia jadi ahmad Mahmud tapi di sekolah masih bernama muhammad raditia dan belum di ubah jar di capil.. Mohon solusi nya', 'syarat/2025/07/29/db73fe6c6ee1d9c27fc784770ebf2619.jpg', 'syarat/2025/07/29/bdb566f429e17475391614aa5911a0cf.jpg', '', '', '', '', 'Informasi tadi kami sudah Laporkan ke Pihak Dirjen Adminduk Pusat melewati Chatboot WA DWH... , kita tunggu respon dari mereka sambil kami cek data Nasionalnya. Terima Kasih.', 'Setelah kami koordinasikan dengan pihak Helpdesk Pusat berikut jawabannya :\r\n*Data sudah sesuai dengan DWH. Namun, belum divalidasi sepenuhnya\r\nHasil validasi terakhir atas NIK tersebut dari Kemendikbud berstatus "Ditemukan" dengan elemen yang belum sesuai pada tanggal 18-07-2025 13:15:47*\r\nDengan ini kami sarankan untuk _menyinkron ulang Data Dapodiknya_, karena Data SIAK Nasional sudah sesuai. Terima Kasih.', '3', '2025-07-29', '09:28:47', '2025-07-29', '09:59:50', '2025-07-30', '07:48:26', '126', '126');
