	('300425PE341', 5, '1202092505870002', 'MARULI HUTASOIT', '082168449994', 'MAU CETAK KTP,DIKAREKAN KTP SAYA SUDAH BURAM DAN HURUFNYA TIDAK JELAS', '', '', '', '', '', '', '', 'Untuk mencetak KTP  Anda harus melampirkan syarat sbb :\r\n	1. Formulir F.1-02, (Pendaftaran)\r\n	2. Kartu Keluarga, \r\n	3. KTP Rusak/Ganti (Jika Rusak/Ganti)\r\n	4. Suket Hilang dari Kepolisian (Jika Hilang)\r\n	5. Formulir F.1-06, (Jika ada Perubahan)\r\nSebelumnya anda harus daftar Akun terlebih dahulu. Tks', '3', '2025-04-30', '15:44:34', '0000-00-00', '', '2025-05-02', '07:14:32', '', '126'),
	('300625PE481', 2, '6305060407000001', 'Muhammad jahrani ', '85751512876', 'Tidak mau login \r\n', '', '', '', '', '', '', '', 'Mohon cek kembali NIK dan password anda, apakah sudah benar? Apabila masih tidak bisa, silahkan klik reset password. Terima kasih. ', '3', '2025-06-30', '08:40:52', '0000-00-00', '', '2025-06-30', '09:43:36', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('300625PE482', 2, '3322041305030001', 'RAFI AKBAR MAULANA', '08882931763', 'SAYA SAAT INI SEDANG BERDOMISILI DI WILAYAH KABUPATEN SEMARANG PROVINSI JAWA TENGAH DAN SAYA BERKEINGINAN UNTUK MENGAJUKAN PERMOHONAN PINDAH KE WILAYAH KABUPATEN SEMARANG TETAPI KK ASLI SAYA HILANG. BAGAIMANA SAYA BISA MENGAJUKAN PERMOHONAN PINDAH SECARA ONLINE DAN APAKAH BISA KARENA KK ASLI SAYA HILANG. TERIMAKASIH', '', '', '', '', '', '', '', 'Selamat siang, setelah kami cek, ternyata a.n. RAFI AKBAR MAULANA dengan NIK : 3322041305030001 sudah terdata di Kabupaten Tapin. Untuk menerbitkan Kartu Keluarga yang hilang, bila diajukan secara online dengan syarat mengisi formulis F-1.02 dan melampirkan surat keterangan hilang dari kepolisian. Terima kasih.', '3', '2025-06-30', '11:47:16', '0000-00-00', '', '2025-06-30', '11:53:34', '', '162'),
	('300625PE483', 2, '7173032106980001', 'Brandon stile gerungan', '081351940022', 'Maaf KTP rusak, bisa online untuk ganti baru? Apa harus kesana & syarat nya apa saja', '', 'syarat/2025/06/30/cfa449dceaf56afeb50a300f4ddb4c54.jpg', '', '', '', '', '', 'Selamat siang, untuk KTP rusak bisa diurus secara online dengan melampirkan KTP rusak dan mengisi formulir F-1.02. Silakan daftar lalu login ke Pondok Dukcapil. Kemudian pilih menu Cetak KTP. Terima kasih.', '3', '2025-06-30', '12:11:26', '0000-00-00', '', '2025-06-30', '12:48:54', '', '162');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('300625PE484', 2, '6305062308990001', 'HINDRI', '082148343367', 'Mau bikin akta kelahiran ', '', '', '', '', '', '', '', 'Selamat siang, berikut syarat pembuatan akta kelahiran bagi yang sudah memiliki NIK :\r\n-Mengisi Formulir F-2.01\r\n-Dokumen asli Surat Kelahiran yang diterbitkan oleh Dokter/Bidan atau Surat Pertanggung Jawaban Mutlak (SPTJM) Kebenaran Kelahiran\r\n-Kartu Keluarga (KK)\r\n-Fotokopi Kartu Tanda Penduduk Elektronik (KTP-EL) orangtua\r\n-Fotokopi Kartu Tanda Penduduk Elektronik (KTP-EL) saksi kelahiran (2 Orang) Warga Tapin\r\n-Fotokopi Kartu Tanda Penduduk Elektronik (KTP-EL) Pelapor jika bukan orang tua dalam 1 KK.\r\n-Fotokopi Buku Nikah/Akta Nikah bagian Data atau Surat Pertanggung Jawaban Mutlak (SPTJM) Kebenaran Sebagai Suami Isteri\r\n-Fotokopi Kartu Tanda Penduduk Elektronik (KTP-EL) yang bersangkutan (Jika Memiliki KTP-EL)\r\n-Ijazah (Jika Memiliki Ijazah)', '3', '2025-06-30', '12:57:36', '0000-00-00', '', '2025-06-30', '13:45:27', '', '162'),
	('300625PE485', 2, '6305124103970001', 'Wahyu Putri Utami ', '085320923322', 'Menambahkan nama belakang ortu di belakang nama anak apakah harus sidang dulu untuk merubah aktanya? ', '', '', '', '', '', '', '', 'Betul, kalau ada perubahan, menambah, mengurangi nama/tgl lahir pada Akta Kelahiran yang sudah terbit, maka di sarankan perubahannya melalui Sidang. Terima Kasih. ', '3', '2025-06-30', '13:45:49', '0000-00-00', '', '2025-06-30', '16:01:14', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('300725PE591', 2, '6310092208880005', 'Rizwan adytia', '082148906306', 'Daftar anggota keluarga yang tercantum di kartu keluarga', '', '', '', '', '', '', '', 'Mohon izin penjelasan yang lebih untuk yang dimaksud. Terima Kasih', '3', '2025-07-30', '08:01:29', '0000-00-00', '', '2025-07-30', '08:28:07', '', '126'),
	('300725PE592', 2, '6310092208880005', 'Rizwan adytia', '082148906306', 'Daftar nama anggota keluarga yang tercantum di kartu keluarga......apakah Noor latifah tercantum di kartu keluarga', '', '', '', '', '', '', '', 'Tidak ada. Terima Kasih', '3', '2025-07-30', '08:35:17', '0000-00-00', '', '2025-07-30', '08:54:36', '', '126'),
	('300725PE593', 5, '6305016812870001', 'Rini qamaria santy', '082155355352', 'Merubah alamat Rt dan Rw dari 002/004 menjadi 004/002', 'syarat/2025/07/30/bcc50d58475b3bd3392b9f0fc6f74b2f.jpg', 'syarat/2025/07/30/053e237f97f4395fe742dd12b1107b65.jpg', 'syarat/2025/07/30/56959bcd80a588ef8b2aa8cca863c1c8.jpg', 'syarat/2025/07/30/a1dea05c2936a4f248553c343cc5b580.jpg', 'syarat/2025/07/30/966a2f97835e9ba37fcad1a2024bfc16.jpg', 'syarat/2025/07/30/7685ab48c69e02d0f41f14e3d5181ff5.jpg', '', 'Silahkan Anda ajukan di permohonan *Perubahan KK*, pada kolom catatan terangkan perubahan yang dimaksud dan juga pergantian alamat RT/RW di KTP, lampirkan juga surat keterangan nya ketika upload dokumen. Terima Kasih', '3', '2025-07-30', '09:20:45', '0000-00-00', '', '2025-07-30', '09:22:59', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('300725PE594', 2, '7371024112970006', 'Gresya antahari', '082252792963', 'Mohon bantuannya surat formulir f-1.03 berapa lembar di butuhkan dan untuk istri atau suami', '', '', '', '', '', '', '', '2 lembar, 1 dengan ttd Suami, 1 dengan ttd istri.', '3', '2025-07-30', '09:23:22', '0000-00-00', '', '2025-07-30', '10:40:05', '', '126'),
	('300725PE595', 2, '6371034708960006', 'Noor latifah', '082148906306', 'Siapa saja daftar anggota keluarga di no KK 6305080407220002?apakah ini KK tapin..', '', '', '', '', '', '', '', 'Anda sendiri, ya ini KK Tapin. Terima Kasih', '3', '2025-07-30', '11:05:30', '0000-00-00', '', '2025-07-30', '13:30:10', '', '126'),
	('300725PE596', 4, '630506110680002', 'Ahmad Ramadhan', '087737469918', 'untuk formulir F2-01 nya tidak bisa di unduh bagaimana? bisa kirim link yg baru aja sekian terimakasih', '', '', '', '', '', '', '', 'Berikut kami lampirkan Formulir F.2.01 nya, nanti silahkan cek dengan memasukan nomor Konsultasi ini 300725PE596 pada menu Layanan Konsultasi --> Cari Permohonan, Terima Kasih.', '3', '2025-07-30', '21:56:22', '0000-00-00', '', '2025-07-31', '13:26:51', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('301224PE4', 5, '6305015502970001', 'Febriana Ayu Yolanda', '085347892898', 'selamat siang, izin bertanya saya ingin mengetahui apakah kakek nenek saya sudah memiliki akta kematian, kalau sudah apakah saya boleh meminta kembali pdf nya, atas nama Samijan (NIK tidak ada dikelurahan) dan Sumarmi (NIK 6305015206430002), mungkin ini dulu, sebelumnya terimakasih', '', '', '', '', '', '', 'Baik, kami cek teribih dahulu.', 'An. Ibu Sumarmi dengan NIK 6305015206430002 masih berstatus AKTIF, untuk Bapak Samijan karena tidak ada NIK dan bin yang jelas maka kami sarankan untuk mendatangi Kantor Dukcapil Tapin untuk Informasi lebih lajut, Terima Kasih atas perkenanya.', '3', '2024-12-30', '13:49:05', '2025-01-02', '08:49:57', '2025-01-02', '09:02:57', '126', '126'),
	('310125PE62', 5, '6305056002100001', 'Nuri Maulida ', '085346587287', 'Kartu buram/tidakk jelas lagi', '', '', '', '', '', '', '', 'Silahkan ajukan permohonan anda, Syarat : 1. KTP lama/rusak, 2. Formulir F.1-02 permohonan (download), 3. KK, Terima Kasih\r\nDownload Aplikasi Pondok Dukcapil berbasis Android di link berikut :\r\nhttps://drive.google.com/file/d/19kCzRnajLBkFC93WoHci7XqUplwXUpFQ/view?usp=sharing\r\nAtau Website : https://pondok.dukcapil.tapinkab.go.id/ ', '3', '2025-01-31', '14:16:11', '0000-00-00', '', '2025-02-02', '15:52:27', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('310725PE597', 4, '6305012707890001', 'Wildan', '081346348097', 'Untuk ktp nya bisa langsung di cetak kan ga.', '', '', '', '', '', '', '', 'Mohon informasikan *nomor pengajuan* KTP/KK atau lainnya yang berhubungan dengan Cetak KTP biar dapat kami lacak terlebih dahulu, terima kasih.', '3', '2025-07-31', '07:41:18', '0000-00-00', '', '2025-07-31', '12:23:34', '', '126'),
	('310725PE598', 2, '6305060805950003', 'Muhammad Riduan', '082148357059', 'Boleh minta file pdfnya kk akta ', 'syarat/2025/07/31/5d8326e0e132ef7161469d28cb3dcc8a.jpg', 'syarat/2025/07/31/1d38bf598fcc0a8e21edeea8a9aa63d0.jpg', 'syarat/2025/07/31/09f4d56a725be8d376c3135db9082813.jpg', '', '', '', 'Baik foto akta/kk/kia sudah kami cek, mohon menunggu proses upload pdf-nya....', 'Berikut Kami Lampirkan PDF Akta yang diminta. Terima Kasih', '3', '2025-07-31', '07:52:41', '2025-07-31', '12:21:59', '2025-07-31', '13:28:08', '126', '126'),
	('310725PE599', 5, '6305076712990002', 'Widiyawati', '882020765135', 'Nomor kartu keluarga di data link tidak sama dengan nomor kartu keluarga asli .', '', '', '', '', '', '', '', 'Mohon dijelaskan maksudnya lebih detail, terima kasih.', '3', '2025-07-31', '10:51:38', '0000-00-00', '', '2025-07-31', '13:29:01', '', '126');
INSERT INTO `konsultasi` (`id_konsul`, `id_jenis`, `nik`, `nama`, `no_hp`, `isi_pengaduan`, `dok_dukung1`, `dok_dukung2`, `dok_dukung3`, `dok_dukung4`, `dok_dukung5`, `dok_dukung6`, `respon_awal`, `solusi`, `status`, `tgl_pengaduan`, `jam_pengaduan`, `tgl_respon`, `jam_respon`, `tgl_selesai`, `jam_selesai`, `user_respon`, `user_selesai`) VALUES
	('310725PE600', 5, '6303071608030001', 'AGUS HASANUDIN', '083849294889', 'SAYA SUDAH 3 KALI MENGAJUKAN KEDATANGAN TAPI DI TOLAK DISURUH BIKIN SURAT PERNYATAAN , DIBERI CONTOH SURATNYA ENGGA\r\nTerimakasih Bapak/Ibu AGUS HASANUDIN *. Nomor Permohonan *310725DT1137 , KEDATANGAN DITANGGUHKAN Lihat detail di menu Lacak permohonan. Pondok Dukcapil \r\n\r\nPesan Petugas : Mohon maaf berkas belum bisa diproses.\r\nsilahkan Lengkapi :\r\n1.Untuk AGUS HASANUDIN alamat pindah rumah yg baru,Rumah sendiri/sewaan? Jika rumah sendiri silahkan isi surat pernyataan rumah sendiri, sebalik nya jika rumah sewaan.\r\nJika sudah lengkap silahkan ajukan ulang terimakasih.\r\n\r\nMohon di surat pernyataan yang kami kirim dalam bentuk file pdf \r\nNama Petugas  : MUHAMMAD NOR ILMI \r\n\r\nSAYA CEK DI PERSYARAT CUMA DI MINTA SURAT PINDAH SAMA KK SAMA KTP DULU TAPI INI MALAH DI PERSULIT ,TOLONG DI PERBAIKI PELAYANAN NYA,DATA SAYA MASIH TIDAK DI DATANGKAN, KALAU SEPERTI INI TERUS SAYA MALAS BERURUSAN!!!', 'syarat/2025/07/31/f4c5fc7e6a912476f40624b41f93e4d9.jpg', 'syarat/2025/07/31/e6c96a39c36506db2914d5a26ca1c0ed.jpg', 'syarat/2025/07/31/6b115c9c0e4e3a9b8f114b6e0063d91f.jpg', 'syarat/2025/07/31/464ab17fdb282a507bebd45b143f880d.jpg', 'syarat/2025/07/31/c2c56ba65c0e2ab05508c234f9cfbac8.jpg', '', '', 'Izin menginformasikan, File yang dimaksud ada di menu Download Formulir nomor 14 PERNYATAAN TEMPAT TINGGAL bisa di download dan di isi. \r\nTerima Kasih.', '3', '2025-07-31', '10:57:28', '0000-00-00', '', '2025-07-31', '12:09:36', '', '126');
