	('010725PD915', '', 1002, '', '', '', 'Assalamualaikum wr wb \r\nIjin kepada bapa/ibu admin...\r\nSaat ini posisi Ulun sudah ada d kabupaten Banjar dan sedang bekerja \r\nDan juga karena keterbatasan biaya \r\nJuga saat ini status saya dan mantan istri sudah bercerai...jadi saya sertakan juga akte perceraian nya \r\nJadi Ulun mohon bantuannya agar kalo surat pindah nya sudah selesai mohon bisa d kirim via pdf saja...\r\nAgar Ulun bisa mencetak mandiri d sini\r\nTadi Ulun sudah konsultasi jua sama admin d sini lewat ajukan konsultasi dan d saran kan seperti ini \r\nMohon bantuannya bapa/ibu????\r\nTerima kasih ????', 5, '2025-07-04', '07:15:30', '2025-07-04', '09:44:33', '2025-07-04', '10:49:14', '7', '2005', 3, 1, 1, '', '0000-00-00', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
